INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (1, '002468b9-7d23-11ea-b0bb-ac1f6b639ec0', '恒山区石墨精深加工项目', '鸡西', '恒山区', '鸡西-恒山区', '制造业', '第二产业', NULL, '其他', '30000万元（4630.5万美元）', '30000', '一般', '4', '8000', '3300', '筹划', '无', '', '', '恒山区发展和改革局', '董勇霖', '04672457777', 'jxshsqfgj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '240', '氟化石墨是碳和氟直接反应而制得的一种石墨层间化合物，具有亲水、亲油性、其独特之处是地面能和高润滑性，是一种新型的功能材料，广泛应用于润滑剂、防湿剂、防污剂及电池活性物质的生产加工，可制成各种润滑剂、高能电池材料、核反应堆用等石墨材料。建设年产100吨氟化石墨生产线，年产50吨高导热石墨生产线。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525093502156.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (2, '0048af55-8050-11ea-b0bb-ac1f6b639ec0', '金长城文化公园项目', '齐齐哈尔', '碾子山区', '齐齐哈尔-碾子山区', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '17000', '一般', '4', '5000', '500', '筹划', '无', '', '', '碾子山经合局', '胡春艳', '13045244456', 'nzsqzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '建设地址丰荣北黑蒙交界处，对金长城、丰荣古城堡进行修复，再现金长城防御体系中的古城。修建影视拍摄基地配套住宿、餐饮、娱乐、影视体验项目，修建金长城博物馆。展示金代文化及文物。', '文化创意产业', '文化创意', '其它', '18', '2020-06-04 13:59:24', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524122821428.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (3, '004f85ee-74e4-11ea-b0bb-ac1f6b639ec0', '报废汽车拆解项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '独资', '4000万元（617.4万美元）', '7000', '一般', '3', '1620', '490', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '200', '报废汽车拆解项目，该项目位于石油大道，黑龙江东部循环利用产业园区内，是东部循环利用产业园区的支柱产业项目之一，该项目辐射周边市县，原料充足，利用率高。该项目采用韩国、意大利等拆解流水线，减少人员投入，提高生产效率。', '高端装备制造产业', '交通装备', '其它', '31', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521150004966.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (4, '00829c15-83aa-11ea-b0bb-ac1f6b639ec0', '养老产业项目', '大庆', '林甸县', '大庆-林甸县', '其他', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '18000', '一般', '5', '4000', '2000', '筹划', '无', '', '', '林甸县项目推进管理办公室', '段福臣', '13351393013', 'ldzsyz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '800', '我国老年人口消费规模预计到2030年将达到13万亿元。老年人以3亿计，每人每年消费5万元，就得到15万亿元,消费能力十分可观。借助地热资源，重点围绕高端温泉旅游产业，推进旅游向“候鸟式”养老、养生度假、健康养老等高端模式转变，建设一批多层次、多元化的医疗养老服务产业项目。\r\n项目占地面积3万平方米，主要建设养老公寓、庭院养老生活区、独栋别墅养生区、疗养中心、医疗救助中心、文化娱乐会所、健身保健运动会所、多功能办公综合楼、心理辅导咨询中心等综合性健康养老基地。', '康养产业', '康养', '黑龙江林甸经济开发区', '22', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521132902979.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (5, '0121a895-74db-11ea-b0bb-ac1f6b639ec0', '石墨深加工项目', '七台河', '勃利县', '七台河-勃利县', '采矿业', '第二产业', NULL, '合资', '21000万元（3241.35万美元）', '10000', '一般', '7', '3000', '1000', '筹划', '无', '', '', '勃利县经济合作促进局', '王波', '13946599678', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '石墨矿石初步探明储量为4．4亿吨，分布在佛岭和双河矿区，两处矿石平均品位11％－21％，极具开发价值。建设内容：建设一条石墨先进生产线，年产高纯石墨1万吨，柔性石墨5000吨。', '新材料产业', '石墨', '黑龙江勃利经济开发区', '28', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134502711.docx');
