INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (7, '0178d822-8538-11ea-b0bb-ac1f6b639ec0', '肇源县10万吨/年杂粮加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '50000', '一般', '5', '4500', '850', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@136.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '30', '近年来，谷物产品越来越受到国内外食品、保健品业界的关注。在国内，谷物产品的保健价值已逐渐被众多消费者认可，其需求量每年保持10%的速度稳步增长，行业前景十分看好。\r\n肇源县是全国粮食生产先进县、黑龙江省绿色食品基地县、畜牧水产大县。全县绿色无公害有机食品商标使用权产品达到440个，其中绿色标识62个、有机标识46个、无公害标识332个。有机认证产品类别涵盖了水稻、杂粮、水产品等品种。优质农畜产品为项目发展奠定了良好的原料基础。\r\n项目拟选址在肇源县经济开发区，规划占地面积8万平方米，建设年加工杂粮10万吨生产线及配套设施，主要加工花生、绿豆、小米、甜玉米等系列产品。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江肇源经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423155657722.doc');
