INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (9, '01e6d293-73ae-11ea-b0bb-ac1f6b639ec0', '安达市年产10万吨MMA及8万吨PMMA项目', '绥化', '安达市', '绥化-安达市', '制造业', '第二产业', NULL, '其他', '165000万元（25467.75万美元）', '220000', '重点', '4', '44000', '7000', '筹划', '无', '', '', '安达市经济合作促进中心', '刘航睿', '13634595066', 'adzsbgs@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '120', '年产10万吨MMA及8万吨PMMA项目拟投资165000万元，拟选址在精细化工产业园，主要建设厂房、综合办公楼、厂区道路等配套辅助设施。项目建成后，预计实现产值22亿元，利税5.7亿元，利润4.4亿元，可吸纳就业人数120人。', '新材料产业', '复合材料', '黑龙江安达经济开发区', '16', '2020-05-31 22:39:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161116142.doc');
