INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (12, '02448aa3-73ed-11ea-b0bb-ac1f6b639ec0', '牡丹江市四道林场森林生态康养中心项目', '牡丹江', '爱民区', '牡丹江-爱民区', '住宿和餐饮业', '第三产业', NULL, '独资', '115000万元（17750.25万美元）', '50000', '重点', '11.5', '10000', '3800', '筹划', '有', '', '', '牡丹江市经合局', '王朝贵', '18245391717', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1300', '项目占地约30万平方米,分三期建设，建设期为5年，主要建设相对独立、相互促进、协调共进的生态康养模块和森林旅游模块。\r\n一期主要建设公寓楼及宜老餐厅、老年大学、图书馆、文体活动室、棋牌室、台球室、乒乓球室、康复理疗、洗浴中心等配套设施。二期主要建设建设商务活动中心、电力、道路、供水、排污等基础设施。三期主要建设医养结合的养老保健机构。', '康养产业', '康养', '其它', '23', '2020-05-29 14:19:15', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522143606306.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (13, '02baf5e2-6eb6-11e8-afa3-ac1f6b639ec0', '膨润土综合加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '22000万元（3395.7万美元）', '16900', '重点', '5', '4000', '1900', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '50', '望奎县具有丰富的膨润土资源，膨润土具有多种特殊物化性能，如吸湿性、膨胀性、悬浮性、阳离子交换性、粘结性及表面活性等，所以在工业、农业、建筑、食品及医药等领域应用十分广泛。其产品空心砌块、白碳黑、活性白土市场前景十分广阔。该项目拟建设年产膨润土空心砌块30万立方米、白碳黑6000吨、活性白土10万吨的生产车间及附属设施，购置先进生产设备。', '新材料产业', '复合材料', '黑龙江望奎经济开发区', '56', '2020-05-26 11:02:14', '');
