INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (15, '0318e1d3-a172-11ea-8a5d-00ff338109dc', '年产15万套石墨烯电容储能系统项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '10000万元（1543.5万美元）', '20000', '重点', '5', '2000', '1500', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '本项目计划占地1万平方米，建筑面积8000平方米，主要建设新增自动分选线、自动组装线、应用模组检测线、数据中心平台等生产线4条，达产后形成年产石墨烯超级电容储能系统15万套的生产能力。省内鸡西等地具有大鳞片石墨资源，可为项目提供原料保障；此外，大庆石化、大庆炼化还可提供高品质石油焦19万吨，中蓝石化拥有商品化甲烷、丙烷、丙烯等基础化工原料，可为石墨烯衍生品制备提供原料。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，可依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新材料产业', '石墨烯', '大庆经济技术开发区', '10', '2020-05-30 16:03:22', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529140243829.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (16, '0361cba5-7395-11e8-a795-ac1f6b639ec0', '年产1万台（套）农业机械制造项目', '绥化', '明水县', '绥化-明水县', '制造业', '第二产业', NULL, '独资', '16000万元（2469.6万美元）', '10000', '重点', '6', '3000', '1000', '筹划', '无', '', '', '明水县招商引资局', '李艳军', '13804860069', 'hljms666@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '42', '黑龙江是农机传统消费大省，代表着我国中高端农机市场的发展趋势，是国内外农机企业最重要的目标市场之一。多年来，明水县一直大力发展机械加工制造企业，有较好的产业基础。该项目主要建设生产车间、办公楼、原材料库房、成品库房等。年产1万台（套）以上拖拉机底盘、轮毂、变速箱等零配件，及水泵配件、主机、电机。', '高端装备制造产业', '农机装备', '黑龙江明水经济开发区', '162', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (17, '04b08f29-843e-11ea-b0bb-ac1f6b639ec0', '节能铝合金玻璃幕墙项目', '大庆', '市辖区', '大庆-市辖区', '建筑业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '50000', '一般', '4', '6000', '2000', '筹划', '无', '', '', '大庆市高新区新材料产业促进中心', '殷宗利', '13059058885', '183346453@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '500', '玻璃幕墙在当今建筑应用越来越广泛，随着玻璃幕墙技术应用进一步发展和改进，其在建筑设计中的地位将会更加重要。该项目上游可依托大庆豫港龙泉铝合金铝材资源及精深加工技术设备，可有效降低生产运营成本，提高产品市场竞争力，同时可拉动就业近百人。\r\n项目主要建设年产100万平方米节能环保型铝合金玻璃幕墙生产线、厂房及配套设施。', '有色金属精深加工产业', '金属精深加工', '大庆高新技术产业开发区', '32', '2020-05-30 16:36:17', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521142104747.docx');
