INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (19, '04febb5c-73cb-11ea-b0bb-ac1f6b639ec0', '绥棱县30万吨水稻综合加工项目', '绥化', '绥棱县', '绥化-绥棱县', '制造业', '第二产业', NULL, '独资', '60000万元（9261.0万美元）', '100000', '重点', '5', '12000', '900', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '200', '项目依托寒地黑土品牌资源，以及绥棱以及周边县域丰富的水稻资源进行开发建设。项目设计年加工优质水稻30万吨，打造省内新的品牌水稻综合加工项目。绥棱县内水稻种植面积历年保持在100万亩左右。水稻多为河水灌溉，水稻千粒重26.2克，出糙米率达80%，整精米率达70%以上，米中有机硒含量达到了106微克每千克。该项目产品主要有：有机、绿色大米、精洁米、营养米粉、方便米饭等多个符合现代市场所需的产品。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江绥棱经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521202415080.doc');
