INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (21, '0557911d-c191-11ea-8a5d-00ff338109dc', '佳木斯市石墨烯新材料项目', '佳木斯', '市辖区', '佳木斯-市辖区', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '20000', '一般', '1', '5000', '3000', '筹划', '无', '', '', '佳木斯高新技术产业开发区管理委员会', '宫清霖', '13359763121', 'jmsgxqzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '26', '在高新区建设石墨烯新材料项目，购置设备186台包括高温窑炉、陶瓷材质精密粉碎机系统、超高速混合机、高强磁铁机等6条生产线安装关键生产线设备32台套、主要检验试验精密仪器设备47台套、电池评估设备32台套、中试生产线14台套，建设工艺车间2座，办公厂房1座。', '新材料产业', '石墨烯', '佳木斯高新技术产业开发区', '4', '2021-08-10 10:34:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200709110523468.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (22, '0620f3ab-846b-11ea-b0bb-ac1f6b639ec0', '医疗器械产业园项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '一般', '6', '3500', '2600', '筹划', '无', '', '', '大庆创业广场有限责任公司', '曹海涛', '13936951630', 'daqingcygc@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '我国医疗器械需求旺盛，市场销售分为两类，一类是医疗机构，另一类就是普通消费者。随着我国医疗器械产业的发展，现已初步形成一批集科研、生产、销售为一体的较有实力的研制单位和企业，可以生产47大门类，3500多个品种，12000余种规格的产品，但仍无法满足巨大的市场需求。项目规划建设按照“保护环境和节约能源”的原则，对引进项目和企业进行严格审核，在产品技术工艺的选择和生产装备的选型上，综合考虑达到目前国内先进的水平，接近并达到国际先进水平。\r\n该项目以福瑞邦医药产业园为依托，打造一个基础配套设施完善、服务体系健全、环境优美的医疗器械产业园。', '高端装备制造产业', '高端医疗器械', '大庆高新技术产业开发区', '42', '2020-05-30 16:31:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521160441338.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (23, '0672bddb-6eaf-11e8-afa3-ac1f6b639ec0', '肇东市大型大型冷链物流项目', '绥化', '肇东市', '绥化-肇东市', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '重点', '2', '30000', '16000', '筹划', '无', '', '', '肇东市招商局', '王相涛', '04557782115', 'zd-zsyzj@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '1000', '抓住国家实施“一带一路”发展战略的重大机遇，着眼于打造“龙江陆海丝绸之路经济带”的重要节点。计划在肇东市北部新区、铁东区或毗邻哈尔滨市的五站镇选择一处建设大型区域性冷链物流项目，计划占地1平方公里，重点建设连接园区的专用铁路线、冷链仓储设施、海关进出口货物查验场、电子交易中心等。', '物流产业', '物流', '黑龙江肇东经济开发区', '98', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144830604.doc');
