INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (28, '06f2606a-74dc-11ea-b0bb-ac1f6b639ec0', '勃利县机械制造项目', '七台河', '勃利县', '七台河-勃利县', '制造业', '第二产业', NULL, '合资', '5000万元（771.75万美元）', '14500', '一般', '3', '2400', '1100', '筹划', '无', '', '', '勃利县经济合作促进局', '马洪友', '13351148432', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '勃利县是全国商品粮食基地县，全省可耕地面积172万亩。农业机械化是现代农业建设的必经之路，通过配置农业机械来降低作业成本，给农民带来经济利益。建设内容：建设一条大型拖拉机配套农机具及加工各类配件生产线，总投资5000万元，其中固定资产投资4000万元、流动资金1000万元，达产后年销售收入14500元，年利税3500万元。', '高端装备制造产业', '农机装备', '黑龙江勃利经济开发区', '19', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521122116066.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (29, '06f5c1b7-7ad0-11ea-b0bb-ac1f6b639ec0', '北药种植及初加工项目', '鸡西', '鸡东县', '鸡西-鸡东县', '制造业', '第二产业', NULL, '其他', '8000万元（1234.8万美元）', '4000', '一般', '6', '1200', '300', '筹划', '无', '', '', '鸡东县区域经济发展服务中心', '田军', '13904675001', 'jdxjhj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '100', '人工种植北药2万亩，建设3000平方米北药加工车间及库房，购置配套机械设备。主要种植林下参、丹参、桔梗、赤芍、黄芪、防风等。', '中医药产业', '中医药', '黑龙江鸡东经济开发区', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522164830947.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (30, '07027338-7525-11e9-815b-ac1f6b639ec0', '林甸生物质发电项目', '大庆', '市辖区', '大庆-市辖区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '28500万元（4398.98万美元）', '15000', '一般', '8', '4000', '2000', '筹划', '无', '', '', '林甸县工业信息科学局', '吕德军', '13359803789', 'ldxldj@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', '该项目所用秸秆含硫量低，采取布袋除尘器高效除尘、废水及噪声等各项污染治理措施后，各项排放指标均能满足有关的环保要求，对环境影响较小，是一项新型的绿色环保项目。总投资2.85亿元。建设规模为建设生产车间、办公楼等基础设施，安装1×130t/h高温高压生物质锅炉，配1×30MW凝汽式汽轮发电机组。燃料以林甸县境域内的废弃玉米小麦秸秆、林木芦苇剩余物为主，其它废弃农林生物质燃料为辅，年燃用量约22.62万吨，年发电量2.1×108kwh/a，供电量1.8669×108kwh/a，初步估算年二氧化碳减排量约为22万吨。', '新能源产业', '生物质能', '黑龙江林甸经济开发区', '37', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (31, '070cb6cc-7a3b-11ea-b0bb-ac1f6b639ec0', '红小豆系列饮料生产线建设项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '独资', '4000万元（617.4万美元）', '11040', '一般', '2', '2600', '699', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '80', '新建3240平方米车间2座，1500平方米原材料、成品库房各1座，2400 平方米冷藏库，3000平方米综合办公楼，480平方米员工宿舍和食堂，300平方米变电所，625平方米设备维修车间，500 平方米车库及水电路绿化等配套设施；购置安装3条饮品生产线及生产原料资源等设备。达到年产3万吨红小豆蛋白饮料的生产规模。建设饮料生产线2条、生产车间2个、原材料库房、成品库房、冷藏库、办公楼等。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江虎林经济开发区', '32', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145632728.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (32, '07484d5d-74d8-11ea-b0bb-ac1f6b639ec0', '甲酸钠项目', '七台河', '勃利县', '七台河-勃利县', '制造业', '第二产业', NULL, '合资', '20000万元（3087.0万美元）', '40000', '一般', '6', '3100', '900', '筹划', '无', '', '', '勃利县经济合作促进局', '贾利琦', '13846499855', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '甲酸钠是生产甲酸和草酸的主要原料之一，也是保险粉生产的原料，可用于制作还原剂、消毒剂、染印制剂、橡胶促进剂及航空工业和医药中间体等；在皮革加工、纺织染色及电镀工业中，可作为生皮处理剂、均染剂和促进剂；甲酸钠还可以用于人工造丝消光。建设内容：项目总投资2亿元，购置设备140台左右，项目达产后，实现销售收入4亿元、利润1.5亿元、税金4000万元。', '新材料产业', '复合材料', '黑龙江勃利经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174056055.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (33, '08072a12-850c-11ea-b0bb-ac1f6b639ec0', '大兴安岭塔河县年产3000吨蓝靛果种植基地项目', '大兴安岭', '塔河县', '大兴安岭-塔河县', '农、林、牧、渔业', '第一产业', NULL, '独资', '2000万元（308.7万美元）', '2500', '一般', '4', '500', '40', '筹划', '无', '', '', '塔河县招商局', '孟颖明', '13555090876', 'taheshangwuju@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '60', '蓝靛果是新型水果，欧美国家将其命名为“超级水果”，其营养价值和养生功效远高于蓝莓，在欧美市场得到大力开发和广泛认可，目前国内市场尚属空白期，市场潜力巨大。项目拟利用大兴安岭气候适宜蓝靛果生长的优势，进行唯一通过国家认证的品种“蓓蕾”的种植，建设一个中型蓝靛果种植基地2000亩，年产量2000吨-3000吨，', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江塔河经济开发区', '14', '2020-06-03 14:23:01', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525155729298.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (34, '081a04aa-73ca-11ea-b0bb-ac1f6b639ec0', '绥棱县山林秘境生态旅游区开发项目', '绥化', '绥棱县', '绥化-绥棱县', '其他', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '26000', '重点', '7.5', '4000', '200', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '100', '绥棱县地处小兴安岭南端西麓腹地，幅员面积4238平方公里，属全国生态功能区、是全省生态示范县。项目规划以森林、湿地风光为特色，结合东北民俗、林区文化、山村风情，融合自然景观和人文景观，依托绥棱丰富的森林旅游资源以及五一原始部落风景区，配套开发建设水上漂流、山风民俗、狩猎体验、餐饮住宿项目，同时连带开发大青观国家森林公园等相关旅游项目。', '旅游产业', '旅游', '黑龙江绥棱经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521201314289.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (35, '0827712c-82d4-11eb-94a7-00ff338109dc', '黑河自贸片区中俄跨境木浆上下游产业综合体项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '125000', '一般', '6', '23000', '10000', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '200', '俄罗斯阿穆尔州拥有森林面积2400万公倾，阿穆尔州林木总储量约为19.6亿立方米，其中16.9亿立方米为针叶林，2.7亿立方米为软质阔叶树种。树木储量中成熟林和过熟林为10亿立方米，具有极大的林业合作发展空间，在对岸生产木浆后运回国内进行生产加工，原材料可以满足本项目生产需求。拟在黑河自贸片区新建中俄跨境纸浆加工厂，项目境内占地10公顷，利用俄罗斯木材资源，计划与俄方和黑河木业企业进行境外合作，建设纸浆加工厂，在俄罗斯设立木质纤维素生产项目，利用境外木质纤维做原料，在黑河建设50万吨木浆生产项目，并生产纸板、包装纸等下游产品。\r\n', '木材加工产业', '造纸', '黑河边境经济合作区', '3', '2021-08-10 09:56:24', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (36, '08ad16f8-9d76-11ea-8a5d-00ff338109dc', '齐齐哈尔龙江县年产1万吨牛肉休闲食品加工项目', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '100000', '一般', '6', '20000', '2000', '筹划', '无', '', '', '龙江县经济合作促进局', '李晓东', '15946466566', 'ljxjhj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '120', '龙江县是畜牧养殖大县，处于世界黄金养殖带上，肉牛主要品种为西门塔尔和夏洛莱，品质优良。引进国内外先进生产设备和工艺，建设牛肉精深加工项目，开发绿色真空小包装、罐制品、干制品等熟食品，年生产能力1万吨.', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江龙江经济开发区', '17', '2020-06-04 13:59:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524122205758.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (37, '08b084ab-8444-11ea-b0bb-ac1f6b639ec0', '汽车底盘生产项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '10000', '一般', '7', '1500', '800', '筹划', '无', '', '', '大庆高新区管委会', '韩博强', '15164527375', 'hanboqiang@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '150', '随着大庆沃尔沃整车制造增产上量，对其一级零部件供应商在周边建厂需求越来越迫切，为满足整车就近配套建厂，完善大庆汽车产业链条，计划引入汽车底盘生产项目。市场前景方面，可以依托大庆沃尔沃整车产量，同时可辐射哈尔滨福特整车厂配套。项目建设的有利条件包括市场区位优势，大庆高新区已辟建汽车零部件产业园，可靠近整车厂就近建厂，实现集群化发展。\r\n项目规模为拟建设年产20万套汽车底盘项目，建设内容包括投资建设汽车底盘冲压、焊接、涂装、总装生产线，主要产品为沃尔沃在庆投产车型汽车底盘件相关产品。项目建设地点为大庆汽车产业园内，目标企业要求需是沃尔沃供应商。', '汽车制造产业', '汽车服务', '大庆高新技术产业开发区', '18', '2020-05-30 16:34:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422105032627.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (38, '08c01a16-7a0c-11e8-9615-ac1f6b639ec0', '哈尔滨火车站北广场CBD建设项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '1100000万元（169785.0万美元）', '270000', '一般', '15', '73333', '3000', '筹划', '无', '', '', '道里区招商局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区招商局', '于鹏怡', '18686775832', 'daolizsj@163.com', '50', '项目建设地点在哈尔滨市主城区中部，西邻海城街，北至经纬街，占地面积8.36万平方米，其中建设用地面积6.74万平方米，建筑面积12.8万平方米。项目拟依托在建哈尔滨火车站北出口的人流、物流、信息流集聚的优势，建设集商务、娱乐、购物、休闲、办公、集散、景观等功能于一体的城市综合体，成为哈尔滨火车站北广场周边的中央商务区。', '现代商贸产业', '现代商贸', '其它', '729', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161408482.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (39, '09897353-b007-11e8-8e63-ac1f6b639ec0', '黑河北安市年加工2000吨山特产品加工项目', '黑河', '北安市', '黑河-北安市', '农、林、牧、渔业', '第一产业', NULL, '独资', '14000万元（2160.9万美元）', '12000', '重点', '4', '3500', '2000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市的地理位置和得天独厚的条件，昼夜温差大，雨量充沛，独特的生长环境条件，造就了林中和低温草地上的种类繁多的野生植物。市域内有北安市林业局、通北林业局和沾河林业局，总经营面积100万公顷，林特产品品种丰富，蕴含产量大，并且全部为有机无公害绿色产品。有山梨、山丁子、山里红、榛子、山葡萄、野刺梅等野生果类植物；食用菌包括野生黑木耳、榛蘑、元蘑等；人工栽培黑木耳、猴头蘑、榛蘑、滑子蘑等。山野菜包括蕨菜、薇菜、老山芹等。项目占地面积25000平方米，总建筑面积24000平方米。购置年处理山特产品2000吨生产线五条。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江北安经济开发区', '100', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401095031953.docx');
