INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (41, '0a8f97d4-7261-11ea-b0bb-ac1f6b639ec0', '绥化兰西县 5000万只肉鸡养殖屠宰加工项目', '绥化', '兰西县', '绥化-兰西县', '农、林、牧、渔业', '第一产业', NULL, '独资', '80000万元（12348.0万美元）', '50000', '一般', '8', '10000', '3000', '筹划', '无', '', '', '兰西县经济合作服务中心', '车德威', '18245599222', 'lxxzsj@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '3000', '肉鸡养殖在我国有着悠久的历史，长期以来一直是我国农村家庭的主要副业之一，鸡肉也一直是我国居民非常喜爱的主要肉食品之一。当前，我国肉鸡养殖及屠宰加工企业正在进行整合，但相对于国外同行业企业而言，生产规模仍然较小，行业集中度有待进一步提升。兰西是肉鸡养殖大县，肉鸡饲养量常年保持在1500万只以上，但目前以散户饲养为主，规模化养殖量较小，生产出的成品鸡均属外消状态，急需引进一家大型养殖屠宰加工型企业，对肉鸡产业进行整合升级，走产业化发展之路。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江兰西经济开发区', '13', '2020-05-30 17:03:40', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200330163250260.docx');
