INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (45, '0be05496-6e5d-11ea-b0bb-ac1f6b639ec0', '黑河爱辉区冷水鱼养殖及加工项目', '黑河', '爱辉区', '黑河-爱辉区', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '74000', '重点', '3.1', '9761', '7978', '筹划', '无', '', '', '瑷珲对俄进出口加工基地', '刘洋', '17345605706', 'ahgyyq@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '30', '冷水鱼具有丰富的营养成分，冷水鱼与其他鱼相比，具有高蛋白、低脂肪的特点。它们中有许多珍稀种、名贵种, 并以生长速度快、肉质细嫩鲜美而著称于世, 成为淡水食用鱼类中的珍品或高档品，市场消费量很大。爱辉区地处黑龙江流域，水资源较丰富，污染程度较低，水生态环境良好。全区拥有宜养鱼水面15572亩，栖息着种类繁多的冷水性鱼类, 有7目12科90余种。\r\n项目建设内容包括苗种生产基地标准化鱼种池、成鱼池，冷水鱼深加工基地等，可以扩大爱辉区水产品产业链，有效地带动当地经济发展，增加农民收入，促进农业增值增收。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '638', '2020-06-04 14:39:18', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521200137869.doc');
