INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (47, '0c4d954b-63ec-11e8-aaec-ac1f6b639ec0', '汽车配件产业园招商项目', '哈尔滨', '五常市', '哈尔滨-五常市', '制造业', '第二产业', NULL, '独资', '1500000万元（231525.0万美元）', '1200000', '重点', '5', '295000', '80000', '筹划', '无', '', '', '五常市商务局', '王晓华', '19903611199', 'wuchangzsj@126.com', '五常市商务局', '王秀君', '15046037557', 'wuchangzsj@126.com', '500', '项目建设地点哈南工业新城牛家经济开发区，占地3.62平方公里，可容纳120户企业。目前入驻的企业有大众友邦、振飞汽车配件、明昊达等汽车配件企业。该园区是以哈尔滨大众友邦科技工业有限公司投资的二期项目为依托，主要是为长安福特汽车一级供应商来哈尔滨落户提供土地及厂房等配套设施。项目主要建筑办公楼、生产厂房、综合仓库、宿舍用房以及其他辅助用房等，项目建成后每户年销售收入1亿元，年利润总额约0.3亿元，投资收益率30%，全部投资回收期4-5年。园区以完善汽车配套产业链的功能为中心，吸引国内外有实力的汽车和汽车配套企业投资建厂，努力形成优势突出、特色鲜明、集群发展、带动性强的汽车配套产业园发展新格局。', '汽车制造产业', '汽车服务', '黑龙江五常经济开发区', '390', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (48, '0c57fb89-74e7-11ea-b0bb-ac1f6b639ec0', '马鞍村肃慎、辽金风情园项目', '七台河', '新兴区', '七台河-新兴区', '住宿和餐饮业', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '3500', '一般', '9', '1050', '300', '筹划', '无', '', '', '新兴区招商办', '夏士峰', '13029790055', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '500', '马鞍肃慎辽金风情园位于新兴区长兴乡马鞍村，村庄附近有五座距今一千一百余年的辽金时期军塞文化遗址--马鞍古山寨遗址和南北朝遗址，马鞍村是肃慎古都。拟建设肃慎博物馆一座，建筑面积2000平方米，拟投资2500万元；拟建设肃慎辽金风情园景区基础设施，占地面积130000平方米，建筑面积52000平方米；拟建设长4千米，宽6米的马鞍肃慎辽金风情园至映山红景区道路等7项工程。', '旅游产业', '旅游', '其它', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521173750170.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (49, '0d5481b8-7a0e-11e8-9615-ac1f6b639ec0', '中央大街购物广场并购改造项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '120000万元（18522.0万美元）', '67000', '一般', '6', '20000', '500', '筹划', '无', '', '', '道里区招商局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区招商局', '于鹏怡', '18686775832', 'daolizsj@163.com', '50', '项目建设地点在中央大街、西十一道街、西十二道街、尚志大街围合区域，占地面积1万平方米，建筑面积4.8万平方米。改造楼体地处哈尔滨最著名的商业区“中央大街”核心地段，具有无可比拟的区位优势。拟对原闲置商场进行并购和整体改造，建设以轻奢服饰、时尚餐饮、主题餐厅、体验消费、休闲娱乐、文化创新于一体的购物广场。建成后将为消费者带来全新的消费概念和生活体验，极大推动城市的商业发展。', '现代商贸产业', '现代商贸', '其它', '126', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521160141788.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (50, '0da3c2fd-732f-11ea-b0bb-ac1f6b639ec0', '青冈汉麻系列护肤品项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '重点', '2.5', '8000', '500', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '200', '汉麻天然、植物、有机日化用品是行业发展新趋势。高端科技的进步使日化行业向以天然原材料为主导的健康类产品市场推进。2019年，全球天然日化用品市场总值为142.55亿美元，并将以9.3%的年复合增长率成长。汉麻籽油天然无毒害，在美国、欧洲等发达国家，众多国际知名日化品牌商均已开展汉麻系列日化产品，市场前景广阔。', '生物医药产业', '生物医药', '黑龙江青冈经济开发区', '14', '2020-05-31 22:43:13', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521132035144.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (51, '0db151db-7f93-11ea-b0bb-ac1f6b639ec0', '15万吨甜菜加工项目', '齐齐哈尔', '拜泉县', '齐齐哈尔-拜泉县', '制造业', '第二产业', NULL, '独资', '5500万元（848.92万美元）', '9000', '一般', '4', '1800', '900', '筹划', '无', '', '', '拜泉县经济合作促进局', '武鹏', '13284525808', 'bqxzsj2005@126.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '拜泉县土质肥沃疏松，富含多种微量元素，年均降水量488.2毫米，无霜期平均122天，适宜甜菜等农作物生长。拟在拜泉县建设15万吨甜菜加工项目。项目达产达效后，预计年销售收入9000万元。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江拜泉经济开发区', '21', '2020-06-04 14:01:23', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523203721893.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (52, '0de61d7f-8443-11ea-b0bb-ac1f6b639ec0', '玉米秸秆综合利用开发项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '12800万元（1975.68万美元）', '17200', '一般', '5', '3000', '1412', '筹划', '无', '', '', '肇州县招商服务中心', '张立江', '13604892456', 'jhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '500', '项目以玉米秸秆为原料生产畜禽酵素发酵饲料和纤维固化燃料。产品主要特点是，多种菌混合相生互补，产品活菌含量高，酶活性强，质量性能稳定，易于保存，便于运输。玉米秸秆是我国最广泛、最价廉的饲草作物，加工成的秸秆生物颗粒饲料体积小，含水率低、利于包装，便于储存、运输，便于防火；不易变质、饲喂方便，市场前景广阔。\r\n项目计划占地15万平方米，达产后年产秸秆饲料13.5万吨；秸秆燃料5万吨，建设厂房25500平方米，办公及宿舍楼3000平方米及相关附属配套设施、设备等。', '节能环保产业', '秸秆综合利用', '黑龙江肇州经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144625175.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (53, '0e72d893-cf43-11eb-a12f-00ff338109dc', '年产1万吨豆制品加工项目', '黑河', '五大连池市', '黑河-五大连池市', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '18000', '重点', '5', '3500', '1000', '筹划', '无', '', '', '五大连池农业农村局', '王珏睿', '15246969527', '390111731@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '70', '项目投资估算1.5亿元。新建年产1万吨豆制品生产装置，年产大豆生产生豆浆5000吨、豆茸素饼2000吨、腐竹1500吨、千张1500吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江五大连池经济开发区', '2', '2021-08-06 16:06:53', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (54, '0eae0d39-6eb4-11e8-afa3-ac1f6b639ec0', '北林区现代物流园区建设项目', '绥化', '北林区', '绥化-北林区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '200000万元（30870.0万美元）', '300000', '重点', '7', '45000', '15000', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '800', '项目拟在东富工业园区规划占地面积60万平方米，主要建设铁路专用线、区域综合型物流节点、集甩挂运输示范枢纽、JIT、VMI示范基地、电商物流中心、城乡配送中心等内容。项目包含三大综合物流园区，一是借助营口港绥化陆港的铁海联运通道，推进集装箱业务运营、跨境电商平台打造和“互联网＋物流”仓储库建设。二是借助圣达冷链物流和华辰冷链物流的平台，建设粮油食品批发区、水产品批发区、互联网+快递物流集散区和冷链物流配送区等功能分区150000平方米。三是依托兴福天泽物流，拓展以工业物流、粮食物流为核心的综合物流服务。', '物流产业', '物流', '其它', '98', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (55, '0f16e32f-8474-11ea-b0bb-ac1f6b639ec0', '杂粮方便食品加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '15000', '一般', '6', '2000', '1000', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '杜蒙县是黑龙江省光热条件最好的县份之一，气候特点非常适宜杂粮杂豆的生长；杜尔伯特因此而成为我国杂粮杂豆的主产区之一。全县杂粮杂豆品种主要有谷子、高粱、荞麦、绿豆、红小豆等。2019年，全县杂粮杂豆种植面积35.9万亩，总产量6万吨。\r\n项目占地面积约3万平方米，土建9600平方米，加工车间5000平房子，库房3000平方米，办公室1600平方米。安装有机杂粮食品生产线一条，主要生产设备112套，购置有机无公害食品化验设备6套。将杂粮杂豆加工成营养、保健类食品。重点发展杂粮杂豆原浆饮料、杂粮粥、八宝粥、绿豆糕、杂粮休闲食品以及杂粮粉、营养配方粉等保健品，不断提高杂粮杂豆产品附加值。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江杜尔伯特经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152942975.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (56, '0f1b6f5e-7324-11ea-b0bb-ac1f6b639ec0', '滑雪场项目', '鸡西', '密山市', '鸡西-密山市', '租赁和商务服务业', '第三产业', NULL, '其他', '8000万元（1234.8万美元）', '4000', '一般', '7', '1200', '500', '筹划', '无', '', '', '密山市区域经济发展服务中心', '刘娜', '13351670999', 'hljmszsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '150', '项目计划用地3万平方米，规划总建筑面积2.5万平方米。项目建设完成后，年可接待20万人次。建设包括滑雪跑道、综合办公楼、道具租赁区、特产商品区、休息区、消防、垃圾处理及辅助设施等建筑。', '旅游产业', '旅游', '其它', '21', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521141105971.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (57, '0f3e3c50-9d6c-11ea-8a5d-00ff338109dc', '齐齐哈尔市富裕县白酒产业招商项目', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '农、林、牧、渔业', '第一产业', NULL, '独资', '11000万元（1697.85万美元）', '14000', '一般', '8', '1400', '140', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '2018年，全国规模以上白酒企业为1445家，中国白酒销售收入达到了5363亿元，比上年同期增长12.86%，累计实现利润总额1250亿元，比上年同期增长29.98%。占地面积50000平方米，包括生产车间、办公楼、储酒间、成品库房、酒窖等，同时引进先进生产工艺和设备。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富裕经济开发区', '22', '2020-06-04 14:00:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524111309188.docx');
