INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (59, '0f660dc1-811d-11ea-b0bb-ac1f6b639ec0', '大兴安岭呼玛县道地药材种子种苗繁育基地和规模生产基地建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '36000万元（5556.6万美元）', '16000', '重点', '10', '3600', '500', '筹划', '无', '', '', '呼玛县经济和发展改革局', '荆国英', '13504560895', 'humakjj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '200', '呼玛县地处寒温带，四季分明，植被类型多样，土壤类型多种，土壤有机质含量高，水质、土壤、大气无任何污染，为中药材生长提供了得天独厚的地理和气候条件，区域内大宗药材五味子、黄芪、柴胡、苍术、芍药、升麻、益母草等分布广泛，蕴藏量较大，储量可观。项目拟建设以金莲花、赤芍、白鲜、返魂草、水飞蓟等道地药材为重点种子种苗繁育基地和规模化生产基地5万亩，项目按计划推广应用后，正常年份按市值平均价格计算，以防风每公顷产干品3000 kg，当前国内市场价格（统）30元／kg，每公顷年产值为9万元，除去每公顷播种、抚育、采收等人工费以及管理费等1.4万元，每公顷年净收益7.6万元。', '生物医药产业', '生物医药', '黑龙江呼玛经济开发区', '14', '2020-06-03 14:52:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525145922727.docx');
