INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (67, '116c191d-74d1-11ea-b0bb-ac1f6b639ec0', '明水县玉米胚芽乳粉食品加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '18000万元（2778.3万美元）', '51000', '重点', '2', '9000', '3000', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '3000', '项目总投资1.8亿元，可为社会提供200名直接就业岗位和100兼职的工作机会。项目建成后，年可处理玉米5.3万吨，可形成年产玉米胚芽乳粉4300吨（占玉米的20％），玉米高筋粉5000吨（48-50％），玉米胚芽乳粉食品3000吨（占玉米15％）的能力。玉米高筋粉产品不添加任何胶类物质，防腐剂，抗氧剂，该粉不仅保留了玉米原有的色泽，香味及营养成份，同时具有抗衰老作用的亚油酸。明水玉米产量常年产量75万吨，其中久龙5号、龙聚1号等高淀粉品种淀粉含量70%以上,明水县玉米高筋粉及胚芽乳粉食品加工项目前景广阔。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江明水经济开发区', '21', '2020-06-02 14:33:37', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115857748.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (68, '11ceaceb-9d9e-11ea-8a5d-00ff338109dc', '重型机械整机与零部件再制造建设项目', '齐齐哈尔', '富拉尔基区', '齐齐哈尔-富拉尔基区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '一般', '2', '30000', '4000', '筹划', '无', '', '', '富拉尔基区经济合作促进局', '赵勇', '13079695776', 'flejzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '项目占地400亩。主要生产起重机、重型卡车、混凝土机械、挖掘机等系列、高空作业车系列等重型机械产品整机和零部件以及再制造产品。', '高端装备制造产业', '高端数控机床', '黑龙江富拉尔基经济开发区', '35', '2020-06-04 13:55:54', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524170842244.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (69, '120b0e89-597a-11e8-a5b9-ac1f6b639ec0', '大豆深加工项目', '哈尔滨', '巴彦县', '哈尔滨-巴彦县', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '35000', '一般', '5', '3200', '500', '筹划', '无', '', '', '巴彦县商务局', '吕海龙', '15045390788', 'byzs01@163.com', '巴彦县商务局', '王彦斌', '13603658552', 'byzs01@163.com', '120', '项目建设地点哈尔滨市彦县，占地面积1.8万平方米。巴彦县及周边50公里半径非转基因大豆年总产量15万吨，原料充足。拟建设加工车间、仓储库、综合办公楼、购置安装生产设备等。随着我国人口的增长和人民生活水平的不断提高，食用植物油脂的消费量越来越大。因此，精制食用油的加工市场广阔。项目达产后，可年产大豆压榨油2万吨，饲用豆粕10万吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江巴彦经济开发区', '211', '2020-05-29 14:39:02', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523150709321.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (70, '121f5ad2-75a3-11ea-b0bb-ac1f6b639ec0', '氧化石墨烯、高纯石墨及锂电池负极材料项目', '七台河', '市辖区', '七台河-市辖区', '采矿业', '第二产业', NULL, '独资', '36400万元（5618.34万美元）', '60000', '一般', '2', '18000', '10000', '筹划', '无', '', '', '七台河经济开发区投资合作促进局', '王显龙', '16604648525', '504218118@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '七台河市各类资源丰富,有煤炭、黄金、石墨、膨润土、花岗岩等十余种,尤以煤炭最为丰富。是国家保护性开采的三个稀有煤田之一。石墨烯因具有良好的抗拉性、透光性、导电性、导热性，被誉为新世纪的“材料之王”。目前七台河市辖区内已探明石墨储量4.78亿吨，矿物量3248万吨，具有储量丰富、品位高、鳞片大等特点，为产业发展提供了原料保障。建设内容：投资3.64亿元，建设氧化石墨烯、高纯石墨及锂电池负极材料生产线。', '新材料产业', '石墨烯', '黑龙江七台河经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521125413495.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (71, '1263225a-7d03-11e9-815b-ac1f6b639ec0', '深哈生态产业园', '哈尔滨', '松北区', '哈尔滨-松北区', '科学研究和技术服务业', '第三产业', NULL, '合作', '2000000万元（308700.0万美元）', '2850000', '重点', '10', '285000', '28500', '筹划', '无', '', '', '哈尔滨新区促进服务第一有限公司', '于滨乔', '18946108101', 'zyp@kaifaqu.com.cn', '松北区企业和投资服务局', '张鹏宇', '18345037603', '397727982@qq.com', '15000', '以科技创新发展为引领，重点发展科技创新及服务业、新一代信息产业、智能制造产业等新兴产业，将建设成为具有一定集聚规模、产业定位明确、配套设施齐全、运营管理规范、各类服务完善、入园成本合理的低碳智慧园区，努力打造成为哈尔滨人才集聚区和现代化产业体系建设先行区。', '新一代信息技术产业', '新一代信息技术', '哈尔滨高新技术产业开发区', '38', '2021-08-10 10:31:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (72, '1276b8e7-8475-11ea-b0bb-ac1f6b639ec0', '30万吨稻谷综合加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '60000', '一般', '5', '12000', '980', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '项目主要建设30万吨∕年稻谷综合深加工装置及建筑物，生产业务楼、公用设施等。日加工稻谷1000吨、年加工稻谷30万吨，日加工米糠200吨、年加工米糠6万吨，日加工米糠毛油34吨、年加工米糠毛油1万吨。年产大米蛋白5000吨、大米麦芽糖4万吨。\r\n自2006年以来，杜尔伯特县委、县政府提出了关于“打造西部沿江优质水稻产业带”的发展战略，2019年，杜尔伯特水稻种植面积发展到49.3万亩，生产稻谷4亿斤。杜尔伯特所产水稻品质优良，标准化生产发展较快，创建了国家级绿色食品原料水稻标准化生产基地50万亩，原料充足。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江杜尔伯特经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153255769.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (73, '12b74e76-695a-11e9-b4f9-ac1f6b639ec0', '大兴安岭呼玛县韩家园林业局北药（五味子）种植加工一体化建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '6326.5万元（976.5万美元）', '4200', '重点', '6.5', '1000', '120', '可研', '有', '', '', '韩家园林业局招商办', '赵国杰', '13846554980', 'hjyzsbj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '80', '北五味是名贵的药用植物，自然分布在黑龙江大小兴安岭、完达山、张广才岭、老爷岭等山区。近年野生五味子价格逐年上涨由1999年之前的8元/公斤，近年逐步攀升至60元/公斤左右，目前五味子已经开发出多项产品，市场缺口大，供需矛盾十分尖锐。建设1000亩商标准的五味子种植基地。包括:五味子栽培基地建设、五味子灌溉设施、种苗培育设施、耕地保护设施、农业机械投入、五味子技术培训等内容。建设加工五味子原果的现代化大型加工厂一处，年加工处理五味子42000吨、其中包装处理五味予果25650吨，加工五味子果汁、果酒、饮料，五味予口服液、五味子浓缩汁及五味子香精和五味子木脂素等深加工产品。', '生物医药产业', '生物医药', '其它', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525150514457.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (74, '12cc18b0-b0b5-11e8-8e63-ac1f6b639ec0', '黑河北安市优质肉牛养殖基地建设工程', '黑河', '北安市', '黑河-北安市', '农、林、牧、渔业', '第一产业', NULL, '独资', '18000万元（2778.3万美元）', '13000', '重点', '4.5', '3400', '2600', '可研', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '120', '肉牛养殖易于管理，运作灵活，投资较少，收效较快，利润可观，风险较低，市场潜力及发展前景较好。该项目位于北安市，建设内容为养殖加工一体化项目，养殖项目设计年存栏10000头，年出栏20000头肉牛；屠宰加工厂年20000头肉牛的屠宰规模。项目占地面积约80000平方米，建筑面积48000平方米、主要包括饲养区、饲料加工区、沼气池和生活工作区、肉牛屠宰综合加工车间、办公楼和其他生产、生活附属用房及污水处理车间。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江北安经济开发区', '77', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401093230501.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (75, '12fcb7cf-754f-11e9-815b-ac1f6b639ec0', '玉米须系列功能饮品及保健食品生产加工项目', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '其他', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '30000', '一般', '2', '8000', '3000', '筹划', '无', '', '', '龙江县经济合作促进局', '李晓东', '15946466566', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '120', '龙江县是黑龙江省三大玉米主产区之一，是齐齐哈尔市的玉米种、产、销的核心县份，处于世界“黄金玉米带”上。年播种玉米350万亩以上，玉米资源丰富，原料供应有保障。引进国内外先进生产工艺和设备，以玉米须为原料生产玉米须饮品和保健食品。玉米须营养丰富，含有脂肪油、树胶、生物碱、苹果酸、草酸隐黄质、谷甾酸和泛酸等多种人体代谢所必须营养物质，味甘、淡、平，具有具有降糖、降血压、降血脂、抗氧化、抗肿瘤、抗过敏等多种功效。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江龙江经济开发区', '36', '2020-06-04 14:04:21', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523120047260.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (76, '137fcbb8-7547-11e9-815b-ac1f6b639ec0', '天然苏打水化妆品“美丽产业”项目', '齐齐哈尔', '克东县', '齐齐哈尔-克东县', '其他', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '50000', '一般', '3', '15000', '2000', '筹划', '无', '', '', '克东县经济合作促进局', '苏金伟', '13384624027', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '100', '化妆品的构成主要由“乳化剂—水—油”三大部分组成，再加上各种植物提取液和微量元素。而我县恰恰具备牛初乳、天然苏打水、优质非转基因大豆油等资源，通过加工提取，可以媲美澳洲的绵羊油和日本的马油。\r\n规划占地面积3万平米。主要建设车间、检测化验室、研发中心等配套设施。购进安装生产线4条，及水处理、污水处理、检测仪器等设备。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江克东经济开发区', '57', '2020-06-04 14:06:08', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522113427612.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (77, '13b9ad10-74e0-11ea-b0bb-ac1f6b639ec0', '桃山区森帝酒具科技示范项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '合资', '1500万元（231.52万美元）', '6000', '一般', '1', '1500', '420', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '该项目由七台河森帝酒具公司建设，项目地址位于大明街西段，道路南侧，地理位置佳，产品效益好。自投产以来受到全国商家好评，森帝橡木酒桶是我市知名品牌。桃山区周边林业资源丰富，木材及其他生产材料供应充足。桃山区人才储备量大，专业人才充足。桃山区人口集中，商贸物流等产业集中，适合该领域的生产及销售。建设规模：办公楼4000平方，厂房10000平方，储藏室6000平方。建设内容：生产厂房10000平方，库房4000平方。', '高端装备制造产业', '食品加工设备', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143703896.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (78, '1409ca00-77da-11ea-b0bb-ac1f6b639ec0', '牡丹江市互联网融媒体项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '合作', '100000万元（15435.0万美元）', '50000', '重点', '10', '10000', '2500', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '该项目约占地1000 ㎡。主要建设影视摄影、文创、后期制作、互联网发布、融媒体合作、新媒体推广及音像产品摄录发行的融合体。其中一期为新建影视大棚，占地面积约 500㎡；二期为装修各休闲配套空间，建筑面积约500㎡。三期拟建设室外景拍摄地。 \r\n项目按使用功能分三个拍摄棚，一个录音棚。一号棚白色无影棚，满足日常拍摄需求，二号棚布景棚，满足室内情景剧拍摄需求。三号棚蓝箱棚，用于抠像拍摄，满足后期特效制作，虚拟演播使用，三号棚配备专业直播演播设备，可为直播提供推流服务。 功能区建设分为化妆间，服装间，休息室，会议室，后期制作中心，办公区，休闲区。', '电子商务产业', '电子商务', '牡丹江经济技术开发区', '24', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408163739813.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (79, '144f6c67-9e73-11ea-8a5d-00ff338109dc', '北药提取物生产项目', '伊春', '铁力市', '伊春-铁力市', '制造业', '第二产业', NULL, '独资', '14000万元（2160.9万美元）', '10000', '一般', '6', '2500', '500', '筹划', '无', '', '', '铁力市农业农村局', '李宝权', '13845885086', '13845885086@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '30', '规划占地面积2.5公顷，建筑面积1.5万平方米。建设生产车间、原辅料仓库，购置药材提取设备，项目建成后年产各种规格植物提取物500吨。', '中医药产业', '中医药', '黑龙江铁力经济开发区', '20', '2020-05-27 23:11:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525183248721.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (80, '14cefe46-7584-11ea-b0bb-ac1f6b639ec0', '牡丹江市国际水产品批发市场项目', '牡丹江', '市辖区', '牡丹江-市辖区', '批发和零售业', '第三产业', NULL, '独资', '18000万元（2778.3万美元）', '10000', '重点', '12', '1500', '400', '筹划', '有', '', '', '牡丹江市经合局', '丁琳', '18904509304', '1481876432@qq.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '该项目占地面积5万平方米，建筑面积3万平方米，将建设集产品展示交易区、冷冻仓储物流区、电子信息交易服务大厅、综合服务楼等多功能于一体的现代水产品生鲜批发市场，市场建成后主要以经营俄罗斯远东地区海产品及淡水鱼、牡丹江区域内食用水产品及外阜在牡销售的各类水产品', '现代商贸产业', '现代商贸', '牡丹江经济技术开发区', '18', '2020-05-29 15:32:56', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521165254690.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (81, '15745d2c-75a4-11ea-b0bb-ac1f6b639ec0', '七台河经济开发区工业大麻种植、提取，加热不燃烧新型烟草项目', '七台河', '市辖区', '七台河-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '30000', '一般', '2', '9000', '5000', '筹划', '无', '', '', '七台河经济开发区投资合作促进局', '王显龙', '16604648525', '504218118@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '我区拥有22.38万亩耕地，土地性质国有，与其他农业区域相比在土地流转和调整土地种植结构都具有优势。我市与省农科院、科学院都有战略合作协议，种源和技术支撑上有保障。目前我市地理纬度适合种植CBD含量最高的龙麻5号品种。开发区基础设施完备，实现了“七通一平”，土地均为净地，大大缩短了企业入驻进度。拟建设一条加热不燃烧新型烟草代替品生产线。', '中医药产业', '中医药', '黑龙江七台河经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522163544694.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (82, '15ae7968-72f6-11ea-b0bb-ac1f6b639ec0', '佳木斯市生态小镇项目', '佳木斯', '前进区', '佳木斯-前进区', '其他', '第三产业', NULL, '独资', '80000万元（12348.0万美元）', '25000', '重点', '13', '6000', '1500', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '800', '南岗村是我区唯一的自然村，紧邻市区和四丰山风景名胜区，按照城市化进程的加速和前进区的总体发展构想的要求，腾退现状村庄用地，大力发展产业项目，建设生态小镇。建设规模与内容①美丽乡村建设，土地流转后农民迁到指定位置统一安置。②乡村康养中心项目，用地面积约56公顷，规划建设3-5个兼具城市及田园风格的康养中心。③现代农业体验园项目，建设现代化温室大棚400个，主要种植蔬菜、花卉等经济作物，含采摘、现代农业、无土栽培等技术展示、推广等。④旅游娱乐中心项目，用地面积约50公顷，建设内容包括温泉旅游、民宿、影视城、游乐场等。', '康养产业', '康养', '其它', '3', '2021-08-10 10:41:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200331161233307.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (83, '15e6f14e-6d9e-11ea-b0bb-ac1f6b639ec0', '年处理30万吨玉米精深加工项目', '哈尔滨', '巴彦县', '哈尔滨-巴彦县', '制造业', '第二产业', NULL, '独资', '18000万元（2778.3万美元）', '73800', '一般', '5', '5280', '500', '筹划', '无', '', '', '巴彦县商务局', '吕海龙', '15045390788', 'byzs01@163.com', '巴彦县商务局', '王彦斌', '13603658552', 'byzs01@163.com', '120', '项目建设地点哈尔滨市巴彦县，占地面积约3.2万平方米，建设日处理玉米1000吨生产线一条。巴彦县玉米总产量160万吨左右，商品量90万吨，周边50公里半径内市县都是玉米主产区，种植业基础稳固，仓储能力充足，投资玉米深加工项目有着得天独厚的资源优势。项目达产后，日处理玉米1000吨，年处理玉米30万吨。年产玉米淀粉约27.2万吨、玉米油约1.2万吨、玉米蛋白粉约2.12万吨、纤维饲料约9万吨。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江巴彦经济开发区', '33', '2020-05-29 14:48:35', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523145558603.doc');
