INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (86, '17403f72-8540-11ea-b0bb-ac1f6b639ec0', '肇源县1000万平方米/年真皮纤维再生革加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '15000', '一般', '5', '4000', '500', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '20', '随着肇源经济开发区不断发展，皮革企业生产规模的不断扩大，制革固体废物（皮丝、屑、碎肉）产生量将不断增加，为了进一步加快园区皮革固废的治理步伐，充分利用皮革屑合理进行综合深加工，项目实施可使皮革固废得到充分利用，变废为宝，即可降低企业生产成本，为投资者带来丰厚的效益，又可保护环境。\r\n肇源经济开发区由绿特色食品产业园、皮革工业园、新肇粮食加工物流产业园组成，其中皮革工业园所产皮革固体废物6400吨，项目生产所需皮革屑、碎肉、下脚料、综合污泥等固体废物全部由皮革工业园区廉价提供，而且数量充足、供应稳定。\r\n项目规划占地面积5万平方米，建设产真皮纤维再生革生产线，年产再生革1000万平方米。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江肇源经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423165450235.doc');
