INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (90, '182f4805-ba0e-11eb-a12f-00ff338109dc', '植物秸秆干法制浆纤维素建设项目', '鹤岗', '东山区', '鹤岗-东山区', '制造业', '第二产业', NULL, '合资', '40000万元（6174.0万美元）', '64190', '重点', '3', '19257', '7873', '建设', '无', '', '', '黑龙江如柏科技有限公司', '毛赫男', '15546323039', '15546323039@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '130', '本项目利用自主研发的低温常压制浆工艺技术，以植物秸秆为原料，根据秸秆不同结构特性研发出的专用生产线，用废弃秸秆进行制浆，制浆尾液经过水处理分离，碱水回用，浓缩液利用生物技术产生沼气、沼渣和干物质生产土壤改良剂、有机肥等，实现制浆过程“全封闭、自循环、无排放”的节能环保全产业链、无排放制造工艺项目，主要产品有纸浆、造纸、秸秆纤维降解地膜、秸秆板材、生物有机肥、木质素、果胶、低聚糖等，实现了对秸秆的资源化利用，符合我国可持续发展战略。秸秆综合利用所需的配套机械设备还可拉动设备制造业联动。木质素、果胶、低聚木糖提取的深度开发带动相关食品、药品及化工产业的发展。按照工厂化工艺流程布局，在不同地域秸秆产', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:51:16', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (91, '18e7d72c-7281-11ea-b0bb-ac1f6b639ec0', '玉米精深加工项目', '绥化', '海伦市', '绥化-海伦市', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '30000', '重点', '6', '4200', '700', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '100', '玉米中含有大量的营养保健物质，在所有主食中玉米的营养价值和保健价值是最高的，有“黄金作物”之称。本项目是以玉米为原料，对其进行精深加工生产玉米糁、玉米面，在此过程中约能收回8%--12%的玉米胚芽，可以用来制取玉米油及饲料原料等。项目拟建设规模为年加工玉米5万吨，年产玉米糁2.5万吨、玉米面9000吨、玉米油500吨、饲料原料5000吨。项目计划占地面积20,000平方米，总建筑面积15,000平方米。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江海伦经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521190755413.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (92, '18ebf21e-7281-11ea-b0bb-ac1f6b639ec0', '绥棱县森林小火车旅游开发项目', '绥化', '绥棱县', '绥化-绥棱县', '其他', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '30000', '重点', '6.2', '8000', '600', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '300', '绥棱县具有“北大荒”特有的大森林、大田园、大湖泊、大湿地环境资源优势，六山一水三分田地貌更赋予了得天独厚的康养旅游资源。该项目重点依托原森工遗留窄轨铁路火车资源与我县田园风光、森林风光、河套风光，以及在建的阁山水库等沿途风光景色，总面积约10平方公里、全长30余公里的小火车旅游观光线路，突出红色抗联文化这条主线，营造“花香田园”“湖光山色”“森林秘境”三大主题风貌的森铁百里观光画廊。', '旅游产业', '旅游', '黑龙江绥棱经济开发区', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521202919741.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (93, '194ccbe1-7d2b-11e9-815b-ac1f6b639ec0', '黑龙江省嘉润养老机构管理有限公司松北区阳光文化活动中心及润福养老公寓项目', '哈尔滨', '松北区', '哈尔滨-松北区', '租赁和商务服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '21167.4', '一般', '6', '3596.83', '4379.26', '筹划', '无', '', '', '黑龙江省润福养老服务机构管理有限公司', '王先生', '15946330332', '15946330332@139.com', '松北区企业和投资服务局', '赵鑫', '15636009166', '249519431@qq.com', '30', '我国养老严峻形势。预计2020年，全国60岁以上老人将增加到2.55亿人左右，占总人口比重提升到17.8%左右;高龄老年人将增加到2900万人左右，独居和空巢老年人将增加到1.18亿人左右，老年抚养比将提高到28%左右;用于老年人的社会保障支出将持续增长;农村实际居住人口老龄化程度可能进一步加深。为积极应对人口老龄化，构建养老、孝老、敬老政策体系和社会环境，推进医养结合，加快老龄事业和产业发展。二期项目包括两栋建筑，建筑面积5.8万平方米。其中一个集医疗、康复、保健、教学、科研为一体的三级甲等医院,3.2万㎡；一个内含亚健康调理、药物温泉洗浴、水疗等大型理疗设施为一体的温泉水疗馆.2.5万㎡。', '康养产业', '康养', '哈尔滨高新技术产业开发区', '73', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (94, '1964caea-cf40-11eb-a12f-00ff338109dc', '大鹅深加工全产业链项目', '鹤岗', '绥滨县', '鹤岗-绥滨县', '制造业', '第二产业', NULL, '独资', '4000万元（617.4万美元）', '6000', '一般', '4', '1000', '250', '筹划', '无', '', '', '绥滨县商务局', '刘福林', '15145867636', 'sbnwhw@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '25', '依托绥滨县年产大鹅180万只以上，27个肉鹅养殖基地，绥滨白鹅地理绥标志、滨县地理标志农产品保护工程。项目计划投资1亿元人民币，主要建设内容为项目方围绕绥滨现有大鹅基地，在开发区谋划一处大鹅产业集聚区，建设集孵化、屠宰、熟食加工、制绒、羽绒服生产一体的全产业链项目，并在绥滨县收购一个有酒类生产资质的企业，冠以大鹅元素进行推广宣传，打造大鹅文化系列产业，打造鹅项目区域品牌，同时在项目方拟在鹤岗市建设羽绒服批发集散地。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '4', '2021-08-06 16:10:20', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (95, '19721040-7266-11ea-b0bb-ac1f6b639ec0', '佳木斯富锦市30万头生猪年养殖屠宰加工产业链项目', '佳木斯', '富锦市', '佳木斯-富锦市', '农、林、牧、渔业', '第一产业', NULL, '独资', '30000万元（4630.5万美元）', '194000', '一般', '1', '58200', '14500', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '350', '项目建设地点富锦市二龙山镇，在享受国家生猪养殖等政策外，还享受地方政策。占地面积32公顷，生猪养殖场建设地点3处，建设3个养殖场建设标准化猪舍，购入屠宰设备、食品肉肠、有机肥加工等设备。资源优势，富锦市畜牧饲料资源丰富，具有质优量大的粮食原料，其米糠、豆粕为发展饲料产业提供了优质丰富的物质基础。同时，具有当地饲料原料成本价格低的优势。可以保证饲料供应和降低养殖成本。区位优势，富锦市具有发展肉牛养殖，奶牛养殖，生猪养殖的规模小区养殖优势，具有大气、水环境等生态养殖优势，可为市场提供优质的畜牧产品。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144207923.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (96, '199a7421-8076-11ea-b0bb-ac1f6b639ec0', '城市停车场项目', '齐齐哈尔', '讷河市', '齐齐哈尔-讷河市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '8000', '一般', '3', '2000', '500', '筹划', '无', '', '', '讷河市经济开发区', '于贵臣', '13514627376', 'ysmb6006@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '10', '规划在讷河市中心城区建设停车场，新建停车场5处，规划总用地面积22500平方米，总建筑面积21000平方米，总停车泊位570个，全部为地下停车场。', '汽车制造产业', '汽车服务', '黑龙江讷河经济开发区', '38', '2020-06-04 14:04:51', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523110444184.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (97, '19adfbc9-c7f6-11ea-8088-00ff338109dc', '牡丹江市老黑山旅游综合体开发项目', '牡丹江', '西安区', '牡丹江-西安区', '租赁和商务服务业', '第三产业', NULL, '独资', '200000万元（30870.0万美元）', '100000', '一般', '10', '20000', '2000', '筹划', '无', '', '', '牡丹江市西安区经合局', '陈淼', '17758855770', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1000', '牡丹江市是黑龙江省东南部的政治经济文化中心，是我国对外开放的前沿城市，是中国十佳休闲旅游胜地，是中国优秀旅游城市，被称为“赛北江南”、“雪域天堂”。国内有直通哈尔滨、北京、上海、广州、大连、青岛和烟台航班，国际有直通韩国首尔航班，每年接待境内外入境旅游人数达750多万人次，并且承年递增，具有极大的旅游项目开发市场：一是老黑山公园地区特有的区位优势，以及独具特色的自然风貌与人文景观，为开发建设中央公园提供了有利条件。二是来牡游客必到景点镜泊湖，而老黑山又座落在必经镜泊湖的通路上，2011年，俄罗斯海参崴开通经老黑山直达镜泊湖旅游客运专线，这些国内外的游客，必将给老黑山中央公园带来可观的旅游观光业', '旅游产业', '旅游', '其它', '12', '2021-08-10 10:15:03', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200717142404326.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (98, '19c79354-72f5-11ea-b0bb-ac1f6b639ec0', '佳木斯市金融社区项目', '佳木斯', '前进区', '佳木斯-前进区', '金融业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '20000', '一般', '6', '5000', '1200', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '350', '前进区位于城中心优势区域，是金融和服务业的高端聚集区，流动人口大，商贸业发达，交通便利。周边现有人民银行佳木斯支行、哈尔滨银行佳木斯支行、佳木斯海关及市区最高端社区0454街区。目前，佳木斯市金融业规模较小、分布零散，急需一所多元化、专业化、现代化、高质量的金融中心，来满足佳木斯市及周边地区人们对金额的需求。项目占地面积约6万平方米，计划建三座金融中心大厦和一座高档商务酒店。其中金融中心大厦主要包括：各银行的经营场所和投资担保类营业网点。高档商务酒店主要包括：住宿、商务接待、中西餐厅、多功能娱乐厅和会议厅等。', '金融产业', '数字金融', '其它', '24', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523094001035.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (99, '1a92f641-837c-11ea-b0bb-ac1f6b639ec0', '齐齐哈尔泰来县猪肉深加工项目', '齐齐哈尔', '泰来县', '齐齐哈尔-泰来县', '农、林、牧、渔业', '第一产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '5', '3000', '300', '筹划', '无', '', '', '泰来县经济合作促进局', '袁彦冰', '13803635039', 'tljhjyyb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '以营养、卫生、安全的冷鲜肉为主导，并通过深加工生产低温和高温制品。过合作社的饲料营养、防疫管理、病理诊断和市场营销的专业技术服务，逐步引导培养社员改变传统养殖观念，帮助社员发展标准化、健康养殖。带动当地传统畜牧业\r\n向现代畜牧业升级转型。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江泰来经济开发区', '40', '2020-06-04 14:04:11', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523130458170.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (100, '1abdf8f7-8477-11ea-b0bb-ac1f6b639ec0', '年产5000吨中药饮片及3000吨保健品生产线建设项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '28000', '一般', '3', '8000', '1300', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '项目拟建设5000吨中药饮片及3000吨保健品生产线及仓库、综合办公楼及辅助用房，配套建设道路、绿化、给排水、供电等附属工程。杜尔伯特是黑龙江省中草药资源量最丰富的县份，盛产防风、黄芩、甘草等200余种道地药材。据统计，在《黑龙江省野生药材资源保护条例》所列的29种重点野生药材物种中，杜尔伯特有8种，其中有国内外驰名的“小蒿子”防风、甘草、远志、黄芩等国家重点保护的野生药材物种，以及桔梗、知母、柴胡、芡实等省重点保护野生药材物种。杜尔伯特环境质量优异，中草药资源丰富，品质上乘，在当地发展中成药、传统蒙药、药物提取等生物医药项目优势明显。\r\n', '中医药产业', '中医药', '黑龙江杜尔伯特经济开发区', '12', '2020-05-30 16:29:56', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161457561.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (101, '1b2e2761-88c9-11e8-af42-ac1f6b639ec0', '国际经贸科技城项目', '哈尔滨', '松北区', '哈尔滨-松北区', '租赁和商务服务业', '第三产业', NULL, '独资', '1500000万元（231525.0万美元）', '4500000', '重点', '15', '100000', '300000', '筹划', '无', '', '', '哈尔滨新区企业和投资服务局', '李文奇', '13936628056', '718475910@qq.com', '哈尔滨新区招商促进服务第一有限公司', '孙正中', '15542356660', '565985390@qq.com', '40000', '项目建设地点在哈尔滨市松北区，占地面积120万平方米，建筑面积198万平方米，拟分两期6年开发完成，构建以对俄贸易为核心，以会展经济为引领，集会议会展、国际总部、高新产业等复合功能于一体的国际经贸合作示范区。打造成为永不落幕的中俄政治中心、外交中心、科技展示交易中心；打造成为集创新金融、跨境电商、国际总部、宝能区域总部为一体，面向东北亚企业的商务总部基地；并为产业人才提供集购物中心、休闲街区、医疗配套、教育配套、人才用房等为一体的生态智能的服务配套。', '现代商贸产业', '现代商贸', '哈尔滨高新技术产业开发区', '371', '2020-05-26 11:02:14', '');
