INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (106, '1c477f57-757b-11ea-b0bb-ac1f6b639ec0', '牡丹江市通航产业项目', '牡丹江', '市辖区', '牡丹江-市辖区', '交通运输、仓储和邮政业', '第三产业', NULL, '合作', '100000万元（15435.0万美元）', '200000', '重点', '5', '20000', '7600', '筹划', '有', '', '', '牡丹江市经合局', '张舰', '13704531057', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1000', '项目主要分三期进行建设：\r\n一期筹建阶段（2019年 -2020年）：确定基地机场、确定使用机型、确定经营范围、申报筹建审批，注册成立通用航空公司。\r\n二期为园区建设（2021年-2022年）：引进国内外先进机型，组织研发、生产、销售。引入通用航空配套产业，开展配套服务。引入热销机型销售、维护5S店。建设自有机场。申请增加通用航空培训、经营。\r\n三期为运营试验期（2023年—2024年）：开展引进机型的组装生产、销售及运营维护。启动通用航空客运、货运、旅游及其它飞行服务。启动通用航空培训业务。组织小型飞行器航空展览。', '航空产业', '航空', '牡丹江经济技术开发区', '28', '2020-05-29 16:37:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403151700388.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (107, '1c5828e2-6d81-11ea-b0bb-ac1f6b639ec0', '猪肠衣精深加工及肝素钠产业化项目', '哈尔滨', '巴彦县', '哈尔滨-巴彦县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '8000', '一般', '5', '1200', '200', '筹划', '无', '', '', '巴彦县商务局', '吕海龙', '15045390788', 'byzs01@163.com', '巴彦县商务局', '王彦斌', '13603658552', 'byzs01@163.com', '50', '项目建设地点哈尔滨市彦县，占地面积约3.7万平方米，建设年产4000吨肠衣生产线一条；年提取高纯度肝素钠1000亿单位生产线一条；年产500吨真空包装肠肉制品生产线一条；500吨食品高温冷藏库一个；100吨食品低温冷藏库一个。进年来我国肠衣出口遍及世界50多个国家和地区，国际市场对肝素钠的需求十分强劲，随着人民生活水平的提高，国内外市场的需求量将逐年增长，市场前景广阔。项目达产后，年产4000吨肠衣，年提取高纯度肝素钠1000亿单位。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江巴彦经济开发区', '15', '2020-05-29 14:40:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523150450831.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (108, '1c71663c-757e-11ea-b0bb-ac1f6b639ec0', '牡丹江市爱民区创新创业大学城项目', '牡丹江', '爱民区', '牡丹江-爱民区', '房地产业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '50000', '重点', '13', '7500', '2850', '筹划', '有', '', '', '爱民区经济合作促进局', '闫海松', '15946359777', 'amqjhj@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '项目占地面积约24万平方米，建设分为四大区域，一期建设创新创业指导区占地面积约6万平方米，其中创新创业实训场地约4万平方米，教育交流中心约2万平方米；二期建设创客空间占地面积约6万平方米，主要针对基于兴趣与爱好，努力把各种创意转变为科技成果而服务于民；三期建设科技孵化中心占地面积约8万平方米，即高新技术创业服务中心，是国家创新体系的重要组成部分，是区域创新体系的重要核心内容；四期建设休闲居住区占地面积约4万平方米，主要针对创新创业群体，使其居有定所。', '现代商贸产业', '现代商贸', '其它', '13', '2020-05-29 15:29:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403153829151.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (109, '1cee5cf4-7d04-11e9-815b-ac1f6b639ec0', '生物质（秸秆）综合利用产业园建设项目', '绥化', '北林区', '绥化-北林区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '合作', '150000万元（23152.5万美元）', '242000', '重点', '5', '30000', '2000', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '400', '绥化市北林区秸秆年产量达到160万吨，其中玉米秸秆产量111.36万吨，水稻秸秆产量44.8万吨，大豆秸秆产量4万吨，秸秆综合利用空间十分广阔。产业园内拟包括秸秆生物有机肥及矿物质复合生物有机肥生产车间、生物有机饲料车间、秸秆燃料成型生产加工车间、秸秆饲料化、肥料化生产线成套设备制造车间、秸秆收储燃料成型生产线成套设备制造车间以及生物质（秸秆）热解气化燃气发电及供热项目和生物质燃料灰渣综合利用项目，最大化实现秸秆综合利用。', '节能环保产业', '秸秆综合利用', '绥化经济技术开发区', '32', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111611557.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (110, '1cf173c2-7555-11ea-b0bb-ac1f6b639ec0', '牡丹江年产1万吨大豆肽粉生产加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '合资', '50000万元（7717.5万美元）', '50000', '重点', '10', '5000', '1900', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '黑龙江省是全国大豆主产区，也是世界大豆的主要生产带，年产量560万吨。牡丹江市大豆常年种植面积200万亩，年均产量30万吨，年进口俄罗斯大豆20万吨，大豆为非转基因品种，具有很高的蛋白质含量，是国内广大消费者喜爱的健康食品。\r\n规划占地5万平方米。\r\n计划建设生产车间、库房、办公楼等生产及附属设施1.2万平方米，建设年生产大豆蛋白10000吨、大豆多肽2000吨生产线。采用国内先进生产设备和生产工艺，符合国家环保标准。', '农业及农副产品精深加工产业', '大豆深加工', '牡丹江经济技术开发区', '16', '2020-05-29 15:12:08', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522105439195.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (111, '1d1b021d-c0eb-11ea-8a5d-00ff338109dc', '佳木斯市10万吨乙二胺生产项目', '佳木斯', '桦南县', '佳木斯-桦南县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '188000', '一般', '2', '49000', '32000', '筹划', '无', '', '', '桦南县发展和改革局', '李冰', '13846116677', 'hnxjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '建设面积11万平方米，拟建设生产厂房、辅助车间、综合办公楼、管理用房、职工餐厅等，引进安装国际先进的生产装置、管道设施。购置转化釜、高压分离器、脱水塔、提馏塔、助催化剂反应器等设备。乙二胺主要用于有机合成和农药、活性染料、医药、环氧树脂固化剂等的制取。由于对二氧化碳、硫化氢、二硫化碳、硫醇、硫、醛、苯酚等的亲和力强，可用作汽油添加剂、润滑油、鱼油、矿物油和醇的精制用。此外，也用作纤维朊和蛋白朊等的溶剂，是环氧树脂固化剂和医药、农药、染料、纺织品整理剂、金属螯合剂、防腐剂、离子交换树脂、胶乳稳定剂、橡胶硫化促进剂、防冻液等的制造原料，附加值极高。', '生物医药产业', '生物医药', '黑龙江桦南经济开发区', '8', '2021-08-10 10:35:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200708151746893.docx');
