INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (113, '1d4a7fe0-9b30-11ea-8a5d-00ff338109dc', '大兴安岭呼玛县加格达奇林业局百泉小镇主题民宿项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '合资', '800万元（123.48万美元）', '1000', '一般', '6.3', '150', '50', '筹划', '无', '', '', '加格达奇林业局招商引资办公室', '蔺葳', '13845794556', 'cx-yx@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '百泉小镇自驾主题民宿占地面积1160平方米，现有15个房间，包括办公室1间，厨房1间、客房7间、餐厅5间，卫生间1间。项目拟对民宿内部装修，完成民宿区安全、旅游、交通标识牌等设施，进行休闲度假、娱乐购物等配套设施，以及消防设施、建设旅游厕所，内部清理，民宿周边绿化、服务设施建设，并进行民宿生活污水处理、道路建设、民宿村貌的美化。', '旅游产业', '旅游', '其它', '20', '2020-06-03 15:30:30', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145554019.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (114, '1d7f4ad4-8509-11ea-b0bb-ac1f6b639ec0', '5000辆LNG汽车改装及LNG综合利用项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '60000', '一般', '9', '3800', '1000', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '150', 'LNG 作为燃料广泛用于各行业，从全国需求来看，2020 年需求量达200亿立方米。LNG 汽车具有经济性明显、行驶里程长、 运输方便等优点，被认为是燃气汽车的发展方向，适合推广于城市 公交车、环卫车、长途大巴等，混燃动力改装等领域，市场潜力巨大。大庆天然气储量丰富，年产量在35亿立方米以上，LNG压缩原料充足。\r\n项目拟选址在大庆经济技术开发区，占地面积6万平方米,计划建设液化天然气工厂、车辆改装车间等，策划实施日生产压缩30万立 LNG、5000辆汽车改装及8套配送系统三个子工程。', '汽车制造产业', '汽车服务', '大庆经济技术开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151425907.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (115, '1d846c24-c330-11ea-8a5d-00ff338109dc', '年产10万吨高吸水性树脂（SAP）项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '130000万元（20065.5万美元）', '130000', '重点', '5.7', '25000', '35000', '筹划', '无', '', '', '大庆高新区石化产业促进中心', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '120', '高吸水性树脂（SAP）是一种超吸附聚合物，不溶于水，也难溶于有机溶剂，具有吸收自身重量几百倍甚至上千倍水的能力，且吸水速率快，保水性能好，即使加压也难把水分离出来，在石油、化工、轻工、建筑、医药卫生和农业等领域有着广泛的应用。随着农林科技产业的发展，未来大庆周边对农林保水用SAP的需求量将不断增长。目前作为商品的SAP主要有交联的聚丙烯酸钠盐、丙烯酸共聚物、聚丙烯酰胺等。随着农林科技产业的发展，未来大庆周边对农林保水用SAP的需求量将不断增长。项目以丙烯酸和烧碱为主要原料，丙烯酸由园区企业提供，烧碱外购。园区公用工程配套设施齐备。', '石化产业', '其它', '大庆高新技术产业开发区', '1', '2021-08-10 10:22:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200711123645180.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (116, '1df731bd-8470-11ea-b0bb-ac1f6b639ec0', '大数据集成服务建设项目', '大庆', '市辖区', '大庆-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '55000', '一般', '5', '6000', '1000', '筹划', '无', '', '', '大庆高新区管委会', '丁超', '18804593387', '418433790@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', '近年来，随着入驻企业越来越多，园区规模越来越大，聚集的人口快速增长，社会管理和公共服务的任务也越来越重，对园区的管理体制、运行机制和管理手段也提出了新的更高要求。为了加强对中心基地的管理，在高新区新建企业总部大楼，高新区管委会、相关部门将入驻办公大楼，同时，相关公安、消防等管理部门也在区内建设了配套设施。各政府部门将陆续搬迁进驻新的办公区，届时，政府的服务和管理条件都会有较大的改善。\r\n项目主要完善IT服务中心基础建设，建设视频云网络、移动网络指挥平台网络、政务外网虚拟化平台、互联网虚拟化平台。', '新一代信息技术产业', '新一代信息技术', '大庆高新技术产业开发区', '37', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422160606179.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (117, '1e94f50c-9e71-11ea-8a5d-00ff338109dc', '伊春丰林县红星北药种植及管护基地建设项目', '伊春', '丰林县', '伊春-丰林县', '农、林、牧、渔业', '第一产业', NULL, '独资', '3360万元（518.62万美元）', '1000', '一般', '13', '260', '36', '筹划', '无', '', '', '丰林县', '卢超', '13845820045', 'hxluchao@vip.qq.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '56', '丰林县红星镇具有发展北药的优越自然条件和种植基础，境内有多个单品种规模化北药种植基地，如清水河平贝种植基地、三杨林场刺五加野生抚育基地、汤南林场林下参五味子林下改培基地、霍吉河林场满山红保护基地、库斯特林场返魂草种植基地等，其中平贝种植基地通过中药材生产质量管理规范认证，红星平贝也是国家地理标志产品。\r\n建设内容:扩大现有北药种植基地规模，其中平贝基地、刺五加改培基地、林下参改培基、满山红改培基地、返魂草种植基地、林下灵芝人工种植基地在现有基础上分别发展到1200亩、3000亩、750亩、5000亩、500亩和300亩。项目建成后,可年产刺五加茎60吨、平贝药材200吨、林下参100吨、返魂草1', '中医药产业', '中医药', '其它', '21', '2020-05-27 23:14:26', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525181846961.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (118, '1ea5c484-7554-11ea-b0bb-ac1f6b639ec0', '牡丹江市优质矿泉水生产项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '合资', '30000万元（4630.5万美元）', '20000', '重点', '15', '2000', '500', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '为了充分开发牡丹江市的矿泉水资源，在经过市场的考察论证后，提出建设10万吨优质矿泉水生产项目。\r\n项目预计占地10万平方米，主要建设无菌矿泉水生产线，1条48000瓶/小时德国克朗斯全自动超净无菌PET瓶生产线，设计年产能10万吨。', '农业及农副产品精深加工产业', '矿泉水', '牡丹江经济技术开发区', '10', '2020-05-29 15:08:06', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403103753989.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (119, '1ed93196-cbe3-11ea-9952-00ff338109dc', '辰能生物质科技产业园', '牡丹江', '阳明区', '牡丹江-阳明区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '18000万元（2778.3万美元）', '20000', '一般', '10', '2000', '500', '筹划', '无', '', '', '阳明开发区', '陈  亮', '13836313927', 'gysfjd@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '牡丹江辰能生物质发电有限公司隶属于黑龙江新产业集团有限责任公司（原辰能集团），国有企业，是新产业集团控股的黑龙江新能源开发股份有限公司下属的子公司，年发电2.1亿度，年消耗生物质原料总量为30万吨，为保证电厂原料供给，集团利用电厂南侧闲置土地建设生物质科技产业园，新上食用菌包剩余物生产电厂所需生物质燃料项目，再上利用电厂剩余物草木灰生产肥料项目。形成完整的生物质产业链条。建设规模及主要内容：项目占地10万平方米，建设生产厂房、库房、配套用房5万平方米，新上生物质燃料生产线两条，生物质肥料生产线两条。', '节能环保产业', '秸秆综合利用', '黑龙江阳明经济开发区', '12', '2021-08-10 10:14:15', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200722141815973.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (120, '1f11a472-73b4-11ea-b0bb-ac1f6b639ec0', '北安市15万吨大豆深加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '191050', '一般', '2.13', '23434', '15000', '筹划', '无', '', '', '北安市招商服务中心', '韩国峰', '13846366020', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '120', '北安市地域广阔，土地肥沃，雨水充沛，自然条件优越，北安市域内现有耕地516万亩。绿色无公害基地面积占总耕地面积的50%以上，是国家级生态示范区和全国绿色食品大豆原料标准化生产基地。每年大豆产量达到100万吨以上。拟建项目采用低温豆粕的获取采用AB筒脱溶技术。大豆分离蛋白采用业内成熟的“碱溶酸沉”法，采用具有世界先进水平的引进设备，达到日处理大豆500吨，年加工大豆能力15万吨，主要生产精选大豆1.5万吨、高温粕2.5万吨、一级大豆油2万吨、大豆分离蛋白1.5万吨、醇法大豆浓缩蛋白1万吨、脱脂大豆蛋白粉1万吨、大豆组织蛋白1万吨及副产品3.7万吨。\r\n\r\n', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江北安经济开发区', '6', '2021-08-10 10:12:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521205105980.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (121, '1f4ab8ff-571f-11e8-a5b9-ac1f6b639ec0', '绿色能源5G基站装备制造及供电项目', '鹤岗', '绥滨县', '鹤岗-绥滨县', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '合资', '12000万元（1852.2万美元）', '5000', '一般', '8', '1500', '200', '筹划', '无', '', '', '绥滨县', '刘福林', '15145867636', 'sbxswj@126.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '200', '该项目主要是在绥滨县生产布局聚氨酯复合材料杆塔生产线以及绿色能源5G基站装备制造等项目。该项目为从事智慧城市、智慧能源、绿色能源、通信基站的基础设施建设及运营项目。项目的核心技术及产业应包括：轻、柔高效光伏组件、光电光热一体化组件、热电冷三联供系统、垂直轴低风速发电机、聚氨酯复合杆塔、绿色能源5G基站装备制造等多个板块。', '新能源产业', '光伏', '黑龙江绥滨经济开发区', '220', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522141908064.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (122, '1f6e9bdc-82d1-11eb-94a7-00ff338109dc', '黑河自贸片区有机功能性豆制品项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '合资', '30000万元（4630.5万美元）', '35000', '一般', '6', '5000', '1500', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '黑河自然资源独特，耕地资源富集，生态资源良好，境内耕地总面积约2800万亩，90%为黑土和草甸土，土壤有机质含量4%～6%之间，是全国平均水平的4～5倍，特别适于豆、麦、薯等多种作物生长。黑河地区大豆种植面积约1634.5万亩，产量250.6万吨，大豆各项营养指标均高于全国平均水平，大多数品种大豆蛋白和脂肪总含量60%以上，蛋白含量稳定在35%—41%、脂肪含量稳定在19%—24%，是食品加工的黄金比例。黑河地区种植的大豆均为非转基因大豆，具有产量高、营养丰富、高蛋白等特点。依托黑河现有资源及地域优势，拟在自由贸易试验区黑河片区内建设有机功能性豆制品加工厂，项目占地面积10万平方米，计划年加工', '农业及农副产品精深加工产业', '大豆深加工', '黑河边境经济合作区', '2', '2021-08-10 09:58:47', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (123, '1f75cde2-cf16-11eb-a12f-00ff338109dc', '年产2000吨淡水鱼休闲系列产品', '佳木斯', '同江市', '佳木斯-同江市', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '5000', '一般', '3', '1500', '500', '筹划', '无', '', '', '同江市农业农村局', '李锦成', '04542926930', '2669106937@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '30', '占地面积2万平方米，建设综合办公楼(含水族馆、产品展示厅)、生产车间、宰杀车间、鲜鱼暂养池、冷库、仓库、机修房、配电房及相应配套工程。购置休闲风味鱼干生产线2条、鱼罐头生产线1条。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '0', '2021-08-10 09:46:58', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (124, '1ff6afb2-7262-11ea-b0bb-ac1f6b639ec0', '佳木斯市健康大厨房项目', '佳木斯', '东风区', '佳木斯-东风区', '其他', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '40000', '一般', '5', '10000', '5000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '项目建设地点在东风区建国镇，占地面积30万平方米，项目主要建设主食加工区、蔬菜及山野菜加工区、肉类加工区、水产加工区、食用菌加工区、饮品区、佐餐调料区、高端食品区、食品研发检定中心、物联网及电商中心等主要功能区块及相关配套服务设施。东风区拥有我省东部地区最大的公铁物流园区，具备大宗物流、冷链物流、航空物流等有利条件，生态环境良好，优质地下水资源丰富，是进行绿色食品种养殖、发展绿色食品工业的理想场所。依托基础+工厂+种养殖户+线上线下销售体系，围绕绿色、无公害、非转基因主食、杂粮、蔬菜、肉食、佐餐、配菜、饮品等方面，打造“中国放心大厨房”，具有广阔的市场前景和巨大的发展潜力。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525102109763.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (125, '2018afa0-6e5d-11ea-b0bb-ac1f6b639ec0', '哈尔滨临空科技产业园项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '70000万元（10804.5万美元）', '90000', '一般', '4', '17500', '1900', '筹划', '无', '', '', '道里区企业和投资服务局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区企业和投资服务局', '于鹏怡', '18686775832', 'daolizsj@163.com', '200', '科技是经济增长的发动机，促进科技创新、加速科技成果产业化是推动产业升级的必由之路。太平机场被国家定为国际交通枢纽，现为中国东北地区最繁忙的三大国际航空港之一。依托国际枢纽港和临空经济区的建设，吸引国内外知名航空新材料、飞机零件制造等相关高科技研发企业进驻，临空科技产业园可以帮助企业实现研、产一体的市场转化。同时，又可以补充临空经济区的产业短板。位于群力哈西联络空间，计划占地5万平方米，拟建设航空高科技创新中心、创新创业孵化中心、飞机零件研发基地、企业总部基地及智慧示范社区，将打造成集航空高新技术研发、服务、投资、孵化、办公、示范为一体的高科技产业集群。', '航空产业', '航空', '其它', '33', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200325135443758.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (126, '202a078b-cf37-11eb-a12f-00ff338109dc', '豆奶加工项目', '双鸭山', '集贤县', '双鸭山-集贤县', '制造业', '第二产业', NULL, '独资', '60000万元（9261.0万美元）', '70000', '一般', '5', '13000', '3200', '筹划', '无', '', '', '集贤县经济合作交流中心', '胡晓强', '15545796181', 'jxkfqhxq@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '80', '项目依托集贤优质大豆资源优势，生产品牌原味豆奶、纯豆奶和有机豆奶。\r\n', '农业及农副产品精深加工产业', '大豆深加工', '其它', '2', '2021-08-10 09:44:01', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (127, '20321c64-69fc-11e8-98f3-ac1f6b639ec0', '年产10万吨小米乳饮料项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '42000万元（6482.7万美元）', '98000', '一般', '7', '6000', '2600', '筹划', '无', '', '', '肇州县经济合作促进办公室', '孟令君', '13163554343', 'zzxjhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '150', '项目建设地点在大庆市肇州县，占地面积5.5万平方米，建筑面积4万平方米。肇州县生产的托古小米远近闻名，可确保原料充足。拟建设小米乳饮品加工生产线一套及相关配套设施。小米乳是一种粮、药兼用的营养饮品，具有养气、克脾中热、益气等效用，是近几年来食品科学发展的一种新型保健营养型饮品，市场前景看好。项目达产后，年可生产小米乳饮料10万吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇州经济开发区', '192', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (128, '207deab2-69fa-11e8-98f3-ac1f6b639ec0', '精深加工大蒜、毛葱项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '40000', '一般', '3', '6000', '2000', '筹划', '无', '', '', '肇州县经济合作促进办公室', '唐福利', '13624665470', 'zzxjhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '40', '该项目建设地点在大庆市肇州县，该县种植大蒜6万亩，年产大蒜3万吨，原料充足。拟建设年产大蒜素10吨和毛葱汁（油）15吨的生产线及相关配套设施。产品对有害菌有明显的抑制和杀灭作用，具有调节肠胃、促进消化、增强食欲，降胆固醇、血脂、血糖及防癌等功效，是替代抗生素的理想产品，市场前景广阔。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇州经济开发区', '198', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523210653237.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (129, '20a5759d-73e0-11ea-b0bb-ac1f6b639ec0', '佳木斯市俄罗斯木材储备及加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '其他', '第二产业', NULL, '独资', '32000万元（4939.2万美元）', '25000', '一般', '5', '6500', '2000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '110', '俄罗斯是世界森林资源最为丰富的国家，主要集中分布在远东和东西伯利亚地区。抚远作为国家一类对俄客货运输口岸，在对俄远东木材跨境加工合作方面具有得天独厚的优势。进口的俄罗斯优质木材，经刨削加工后，可为下游企业按需提供木材，通过铁路、江海联运发往国内和出口至日本、韩国、北美等国家和地区，市场前景十分广阔。本项目位于经济开发区，占地面积7万平方米，主要建设内容包括生产加工区、集中烘干区、仓储监管区及综合服务中心四大板块。', '木材加工产业', '木材加工产业链', '黑龙江抚远经济开发区', '41', '2021-08-11 11:36:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102424097.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (130, '20efdba0-58d9-11e8-a5b9-ac1f6b639ec0', '安达市牛肉食品加工项目', '绥化', '安达市', '绥化-安达市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '40000', '重点', '3', '8000', '3200', '筹划', '无', '', '', '绥化市经济合作局', '鲁怡彤', '13763750328', 'suihuazhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '该项目位于绥化安达市，占地5万平方米，建筑物面积2万平方米（预冷保鲜生产厂房、原料存栏区、成品仓储库、冷库、恒温库、办公楼以及相应配套设施），购置罐头、特色牛肉加工生产线各2条。年产牛肉制品2万吨，其中肉牛真空预冷保鲜肉8000吨，小包装熟食产品2000吨，罐头食品5000吨，特色风味牛肉制品5000吨。绥化市西部有大量益牧草原，东部地区秸秆资源丰富，适于发展肉牛养殖业。肉牛饲养有传统优势和集群优势，辖区内有“全国肉牛发展优势区”，为发展牛肉食品加工提供了保障，适于发展优质牛肉加工项目。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江安达经济开发区', '197', '2020-05-27 11:21:54', '');
