INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (132, '212defd2-b9da-11eb-a12f-00ff338109dc', '进口水产品加工项目', '牡丹江', '东宁市', '牡丹江-东宁市', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '14000', '一般', '4', '2385', '940', '筹划', '无', '', '', '东宁市农业农村局', '周进华', '13704635822', 'dnszyccyb@128.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '25', '东宁位居中俄朝三角交界地带的中心，距离日本海直线距离50余公里，距黑龙江省进入太平洋的最近出海口和俄远东最大旅游城市符拉迪沃斯托克市（海参崴）153公里，区位优势明显。从俄罗斯进口主要有海参、扇贝、深海鱼、河蟹、虾等。新鲜的海产品大多需要较好的仓储条件和较短的运输时间才能保证其口味新鲜。目前，东宁进口海产品多处于直接销售或粗加工状态，这严重限制了其销售范围和时间，只有将进口海产品进行精深加工和综合利用，才能有效延长海产品的储存时间，扩大销售范围。项目计划建设5000平方m 的冷库，购置20台低温运输车，成立低温冷藏运输车队\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '2', '2021-08-10 09:53:19', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (133, '21b66792-804c-11ea-b0bb-ac1f6b639ec0', '齐齐哈尔富裕县灵芝产业招商项目', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '农、林、牧、渔业', '第一产业', NULL, '独资', '35000万元（5402.25万美元）', '25000', '一般', '5', '5000', '800', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '30', '富裕县气候特点、主要水系和土壤类型适合中草药种植。拟建灵芝大棚600栋，赤芝200万椴，野生灵芝100万椴，嫁接灵芝10万椴，10个灵芝基地，占地1000亩。项目达成后，预计年可实现销售收入2.5亿元，利润5000万元。', '中医药产业', '中医药', '黑龙江富裕经济开发区', '27', '2020-06-04 14:05:22', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522155648661.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (134, '223690d7-6d82-11ea-b0bb-ac1f6b639ec0', '巴彦县生猪产业化建设项目', '哈尔滨', '巴彦县', '哈尔滨-巴彦县', '制造业', '第二产业', NULL, '独资', '120000万元（18522.0万美元）', '96000', '一般', '10', '14300', '2100', '筹划', '无', '', '', '巴彦县商务局', '吕海龙', '15045390788', 'byzs01@163.com', '巴彦县商务局', '王彦斌', '13603658552', 'byzs01@163.com', '150', '项目建设地点哈尔滨市彦县，占地面积约24万平方米，建设1个存栏1200头基础母猪的种猪扩繁场；4个存栏5200头基础母猪的商品猪场；1个年产18万吨的饲料加工厂；1个200头公猪的公猪站；1个有机肥加工厂；农户配套建设500个年出栏1000头商品猪的育肥场；1个生猪屠宰及肉制品加工厂。以“标准化、技术化、生态化”模式建立种植-生猪养殖-农产品加工的完整产业链。巴彦县对畜牧业高度重视，素有“龙江生猪生产第一县”之称，是全国生猪生产基地县、全国首批畜牧业绿色发展示范县，全国生猪调出大县，“巴彦猪肉”获得农产品地理标识。项目达产后，年可出栏50万头商品猪，年加工肉灌制品4000吨。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江巴彦经济开发区', '33', '2020-05-29 14:40:04', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523150627126.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (135, '2249b172-734b-11ea-b0bb-ac1f6b639ec0', '佳木斯市玉米膨化食品生产加工项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '70000', '一般', '3', '10000', '5000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '汤原县位于黑龙江省东部、三江平原西部，是全国粮食生产先进县。玉米资源丰富，玉米总产常年稳定在60万吨。我县设有佳木斯市唯一的中央储备粮直属库，中储粮玉米年均库存量为117万吨，年可调用60万吨供项目使用。据调查，汤原周边区域玉米产量达389万吨，丰富的玉米资源为项目生产提供了充足的原料。本项目充分利用我县高品质的玉米资源，引进先进技术，生产食用方便、口感上佳的膨化食品，市场发展空间巨大。拟引进大型企业投资建设玉米膨化食品生产加工项目。建设生产车间，年加工玉米30万吨，生产玉米膨化食品10万吨。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江汤原经济开发区', '0', '2021-08-10 10:43:54', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707140547372.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (136, '226ba04c-734c-11ea-b0bb-ac1f6b639ec0', '佳木斯市医养结合项目', '佳木斯', '汤原县', '佳木斯-汤原县', '其他', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '8000', '一般', '15', '2000', '1000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '280', '汤原县生态环境良好，天蓝水绿，四季分明，适宜发展从健康管理、精神慰藉、健康照料、康复养老等全方位医养结合产业。项目采用养老加医疗相结合的养老护理模式，能够在满足老年人生活基本需求的基础上，更加注重老年人的身心健康，使老年人颐养天年。项目由老年公寓区（A区）、医疗服务区（B区）、公共配套设施区（C区）等三大功能区组成。规划总占地面积40000平方米，主要包括老年公寓、医疗康复中心并配套活动中心、小型商铺、办公楼等，并配备较为全面的康复理疗设备和生活娱乐设备等，可容纳100人，费用收取6000元/年。为全失能或部分失能老人提供日常生活料理、康复治疗、医疗护理等服务；为生活能自理老人提供日常生活帮助', '康养产业', '康养', '黑龙江汤原经济开发区', '4', '2021-08-10 10:44:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707110759363.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (137, '229098bd-6fae-11e8-a261-ac1f6b639ec0', '年产3万吨生物质固体成型燃料项目', '哈尔滨', '延寿县', '哈尔滨-延寿县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '3800', '一般', '10', '1000', '230', '筹划', '有', '', '', '延寿县招商服务中心', '张超群', '18545867165', 'yszsj2013@163.com', '延寿县招商服务中心', '刘建华', '15945967855', 'ljh555555@163.com', '150', '该项目建设地点在哈尔滨市延寿县，该地秸秆产量巨大，拟建设秸秆固体压块生产车间1500平方米、原材料堆场1.2万平方米，成品库1500平方米等，配套设备主要有粉碎机、秸秆固化机等，达到年产秸秆固体压块燃料3万吨的能力。该产品符合我国农村产业发展规划，原材料充足可就地取材，进行秸秆深加工，加快农民致富步伐，促进地方经济发展。依托单位技术力量雄厚，技术成熟可靠，市场前景广阔，水、电、燃料有保障。', '新能源产业', '生物质能', '黑龙江延寿经济开发区', '127', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (138, '22f32674-73c7-11ea-b0bb-ac1f6b639ec0', '佳木斯抚远市有机稻米生产示范区项目', '佳木斯', '抚远市', '佳木斯-抚远市', '农、林、牧、渔业', '第一产业', NULL, '独资', '18000万元（2778.3万美元）', '12000', '一般', '6', '3300', '1900', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '抚远是“国家绿色食品生产基地示范区”，境内的乌苏里江富含有机质和矿物质，是发展绿色有机水稻生产的理想水源。目前，乌苏镇灌区已完成田间配套工程建设，投入使用后，将改善31万亩耕地的种植条件。独特的地质条件、灌溉水源以及施用秸秆制作的有机肥，可使稻米中营养最大留存、保全、保鲜。利用稻田生态种养模式，放养畜禽鱼，可实现一田多用、一水多用、一季多收的最佳效果，有效节约了水土资源，提高资源利用效率。本项目建设地点位于乌苏镇，规划占地面积8万亩，主要建设内容包括有机稻米种植区、蔬菜种植区、畜禽水产养殖区、生态农业度假区、仓储加工区、有机农业研发中心及其它附属配套设施等。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '1234', '2020-07-23 14:54:20', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102743950.doc');
