INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (141, '2339c93c-6f00-11ea-b0bb-ac1f6b639ec0', '哈尔滨宾县中草药种植加工项目', '哈尔滨', '宾县', '哈尔滨-宾县', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '40000', '一般', '3.3', '3000', '200', '筹划', '无', '', '', '宾县经济合作促进局', '王亚芝', '15246631345', 'bxzsj@163.com', '宾县经济合作促进局', '刘士诚', '13359762527', '187142695@qq.com', '120', '项目计划发展30万亩种植基地，同时新建中草药加工项目。', '中医药产业', '中医药', '宾西经济技术开发区', '29', '2020-05-29 14:27:36', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524085806739.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (142, '233b39c5-732b-11ea-b0bb-ac1f6b639ec0', '望奎县冷冻干燥蔬菜加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '12000', '重点', '5', '3000', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '冷冻干燥蔬菜是按绿色食品标准生产的新鲜蔬菜在零下30摄氏度或更低温度下迅速冷冻，并在负压状态下使冰升华，从而获得脱水干燥的蔬菜，简称冻干蔬菜，国际上简称为FDF。该产品广泛应用于方便食品、快餐食品、特种保健品以及各种汤料。原料生产基地经国家绿色食品发展中心实地考察检测，其土壤、水质、空气三项主要指标均符合国家标准。具有营养、新鲜等特点的保鲜蔬菜食品倍受人们青睐，用量与日俱增。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江望奎经济开发区', '45', '2020-06-02 14:42:08', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111704605.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (143, '23b69c2a-c4d6-11ea-a922-00ff338109dc', '年产10万吨非离子表面活性剂项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '32000万元（4939.2万美元）', '135000', '重点', '9.3', '3895', '6208', '筹划', '无', '', '', '大庆经济技术开发区', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '随着合成洗涤剂生产量的扩大及非离子表面活性剂在高效水泥减水剂、造纸和油田生产等方面应用的发展，国内非离子表面活性剂的用量在逐年增加。离子表面活性剂具有性能优良和环保安全的特点，广泛应用于合成洗涤剂、个人卫生护理用品、纺织工业、造纸工业、农药工业、油田生产以及食品加工等工业部门，国内需求增长潜力很大。本项目年需环氧乙烷约7.7万吨，脂肪醇约6万吨。可由园区在建项目提供原料支撑，部分原料需外购。园区公用工程配套设施齐备。项目建成后，可实现年销售收入13.5亿元，年利税额6208万元，年利润额3895万元。', '石化产业', '其它', '大庆高新技术产业开发区', '0', '2021-08-10 10:15:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200713145738903.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (144, '2400f796-74df-11ea-b0bb-ac1f6b639ec0', '红岩村休闲观光园项目', '七台河', '桃山区', '七台河-桃山区', '住宿和餐饮业', '第三产业', NULL, '合资', '900万元（138.91万美元）', '3000', '一般', '3', '300', '90', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '300', '该项目拟打造集观光旅游，度假餐饮于一体的综合度假村。桃山区域内景色宜人，在三山两湖一条河的映衬下呈现出极美的画卷，红岩村空气宜人，适合度假以及休闲娱乐等项目开发建设。建设内容：观光园3000平方、绿色食品种植养殖场10000平方。', '旅游产业', '旅游', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140007284.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (145, '24141892-730e-11ea-b0bb-ac1f6b639ec0', '望奎县玉米系列产品加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '15000', '重点', '5', '3000', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '随着人民生活水平的提高，以高营养、新口味、富含多种保健功能的鲜玉米及玉米饮料、罐头和玉米羹等系列产品，不断受到人们的青睐。为鲜玉米产业迅速发展提供了广阔的平台。望奎县是玉米耕种大县之一，肥沃的寒地黑土非常适合甜玉米的生长。随着农业优化调整种植结构进一步深化，种植鲜玉米面积逐年增加，我县及周边市县鲜玉米产量可达100万吨，为甜玉米生产加工提供了充足原料保障。投资鲜玉米及深加工项目，回报率快，经济效益显著，市场前景广阔。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江望奎经济开发区', '18', '2020-06-02 14:31:40', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521121238038.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (146, '24e68ef2-a471-11e9-815b-ac1f6b639ec0', '山野菜、食用菌深加工项目', '鸡西', '鸡东县', '鸡西-鸡东县', '制造业', '第二产业', NULL, '其他', '8000万元（1234.8万美元）', '5000', '一般', '6', '1300', '1300', '筹划', '无', '', '', '鸡东县区域经济发展服务中心', '田军', '13904675001', 'jdxjhj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '100', '拟建设食用菌种植基地10万亩。建设年加工5000吨的山野菜及食用菌生产线，建设厂房及各种配套设施，购买保鲜加工设备。鸡东县共有天然林面积9.21公顷，林下有丰富的山野菜资源，有蕨菜、刺五加、刺嫩芽、柳蒿芽、蒲公英、黄花菜、薇菜、水芹菜、榛蘑、松茸、松散蘑，年可采集山野菜和菌类达3000余吨，人工栽培的有地栽木耳、平菇、滑子菇，年产鲜品在2350吨左右。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江鸡东经济开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165712247.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (147, '24ef4710-cf39-11eb-a12f-00ff338109dc', '100万头生猪养殖加工项目', '双鸭山', '集贤县', '双鸭山-集贤县', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '130000', '一般', '7', '15000', '3000', '筹划', '无', '', '', '集贤县经济合作交流中心', '胡晓强', '15545796181', 'jxkfqhxq@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '200', '新建存栏5万头种猪养殖示范场，新建年出栏100万头优质商品猪养殖基地，以及50万吨饲料加工厂、复合有机肥加工车间、养殖技术服务中心、储运中心以及生产用房等配套设施。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '2', '2021-08-06 16:14:44', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (148, '24f97201-72ee-11ea-b0bb-ac1f6b639ec0', '佳木斯市粮食精深加工及仓储物流项目', '佳木斯', '东风区', '佳木斯-东风区', '其他', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '60000', '一般', '3', '18000', '10000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '50', '项目位于东风区建国镇占地面积12万平方米，建筑面积10万平方米。主要建设高端粮食仓储库、粮食精深加工区、物流中转区等配套项目。稻米一直是本地农业的主要输出产品，通过技术改造、就地加工原料，既可为当地提供绿色大米，又实现原料优势地向产品优势地的转化。数据显示2011年-2016年中国大米类休闲食品销售量不断增长，年均增长率达3.78%，销售量从2011年的1350万吨增长至2019年的1800万吨。中国大米类休闲食品销售量的不断增长，也推动了的原料市场规模快速扩大，并且带动了物流、仓储等一些项目的快速发展。本项目建成投产后，经济技术指标优于国内同行业基准值，项目具有良好的经济效益和社会效益。', '农业及农副产品精深加工产业', '大豆深加工', '佳木斯高新技术产业开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525105628289.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (149, '250ef93b-7574-11ea-b0bb-ac1f6b639ec0', '牡丹江穆棱市木材集散中心建设项目', '牡丹江', '穆棱市', '牡丹江-穆棱市', '农、林、牧、渔业', '第一产业', NULL, '合资', '300000万元（46305.0万美元）', '2130000', '重点', '3.5', '86000', '118200', '筹划', '有', '', '', '穆棱市经济合作促进中心', '赵穆林', '18745347888', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '项目占地面积150万平方米，年储备木材及木制品1500万立方米，年木材及木制品交易量600万立方米，年木材及木制品交易额210亿元。\r\n主要建设内容由木材储备中心区、木材物流配送区、木材产品展示区、附属工程组成。其中木材储备中心区的规划用地80万平方米，物流配送区的规划用地20万平方米，木材产品展示区的建规划用地50万平方米。', '木材加工产业', '家具制造', '黑龙江穆棱经济开发区', '50', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403142708643.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (150, '26292287-734a-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产5万吨蓝莓系列保健品生产项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '33000万元（5093.55万美元）', '63000', '一般', '3', '15000', '8000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '80', '蓝莓果实是含有丰富高锌、高钙、高铁、高铜、高维生素的营养保健果品。它不仅具有良好的营养保健作用，还具有防止脑神经老化、强心、抗癌软化血管、增强人机体免疫等功能。蓝莓能够延缓记忆力衰退和预防心脏病的发生，因此被人们视为超级水果。多吃蓝莓或喝蓝莓汁有助预防结肠癌的发生还能预防别的癌症。汤原县适宜栽培蓝莓果，条件优良，资源充足，使发展蓝莓等小浆果有得天独厚的栽培基地。建设果汁浓缩车间、果汁灌装车间、办公综合楼、成品库、配电室、锅炉房等设施，购置安装浓缩果汁生产线3条，灌装生产线3条，最终形成年产蓝莓果汁饮料5万吨能力。\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江汤原经济开发区', '3', '2021-08-11 11:34:06', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707105928463.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (151, '265458cf-7581-11ea-b0bb-ac1f6b639ec0', '牡丹江市鸭绿江花园国际酒店项目', '牡丹江', '市辖区', '牡丹江-市辖区', '建筑业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '60000', '重点', '11', '9000', '3400', '筹划', '有', '', '', '牡丹江市经合局', '丁琳', '18904509304', '1481876432@qq.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '鸭绿江花园国际酒店项目占地面积5.7万平方米，规划总建筑面积15.2万平方米。其中：地上面积12.3万平方米，地下面积2.8万平方米。\r\n项目主要建设酒店、商住楼、商场、大型购物中心及电影院等，拟打造江南新区规模最大的国际酒店综合体。项目拟规划容积率2.16，绿化率40%。', '现代商贸产业', '现代商贸', '其它', '26', '2020-05-29 15:31:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521165831211.doc');
