INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (153, '26cbb752-8080-11ea-b0bb-ac1f6b639ec0', '二克浅特色旅游小镇项目', '齐齐哈尔', '讷河市', '齐齐哈尔-讷河市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '180000万元（27783.0万美元）', '60000', '一般', '4.5', '15000', '4000', '筹划', '无', '', '', '讷河市文体广电旅游局', '王淳', '15046272889', 'ysmb6006@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '200', '项目总投资180421万元。建设集电竞基地、大架山汽车越野营地、医疗服务机构、赛车跑道、机电产品极寒天气测试基地及配套基础设施为一体的旅游小镇。', '旅游产业', '旅游', '黑龙江讷河经济开发区', '47', '2020-06-04 14:04:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522170932214.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (154, '26d24351-739c-11e8-a795-ac1f6b639ec0', '哈尔滨通河县蓝莓养生基地项目', '哈尔滨', '通河县', '哈尔滨-通河县', '农、林、牧、渔业', '第一产业', NULL, '合资', '30000万元（4630.5万美元）', '10000', '一般', '10', '3000', '3000', '筹划', '无', '', '', '通河县旅游局', '沈重', '13351919001', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '80', '项目以蓝莓为主要种植品种，通过近6600亩的蓝莓种植形成一定的规模经济效应，结合生态种植、休闲采摘、蓝莓产品深加工、绿色生态健康旅游开发等提升产品附加价值获得高额收益，形成从蓝莓育苗、苗木种植、果实销售、蓝莓产品深加工、园区休闲养生的全产业链条。该项目拟建设蓝莓采摘园、蓝莓加工厂观光廊道、DIY作坊、蓝莓生态美食园、蓝调庄园等设施。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江通河经济开发区', '217', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524202916505.docx');
