INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (158, '27a804eb-8ad3-11eb-9405-00ff338109dc', '五大连池风景区火山民俗风情园项目', '黑河', '市辖区', '黑河-市辖区', '其他', '第三产业', NULL, '独资', '4500万元（694.58万美元）', '1500', '一般', '11.5', '350', '250', '筹划', '无', '', '', '五大连池风景区工信局', '张伟', '04567225321', 'fjqgxj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '五大连池风景区是国家5A级景区，景区内部环境优美、气候宜人。自1982年以来，先后荣获了世界地质公园、国家重点风景名胜区、国家森林公园、中国著名火山之乡等多项殊荣。每年前来景区游玩的旅客多达170余万人次。近年来，由于风景区新区的建设，大部分居民转移至新区居住，导致景区内多数民房处于闲置状态。据统计，目前景区龙泉村闲置民房多达200余套。本次项目拟利用现有民房改造为民宿住宅，打造集旅游观光、休闲度假、文化体验、娱乐采摘等功能于一体，室内与室外相结合的风情民宿园。项目计划改造民居200套。', '旅游产业', '旅游', '黑龙江五大连池风景区经济开发区', '1', '2021-08-06 16:26:17', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (159, '28335a10-7d27-11ea-b0bb-ac1f6b639ec0', '恒山区超薄石墨纸生产项目', '鸡西', '恒山区', '鸡西-恒山区', '制造业', '第二产业', NULL, '其他', '25000万元（3858.75万美元）', '25000', '一般', '5', '5500', '2700', '筹划', '无', '', '', '恒山区发展和改革局', '董勇霖', '04672457777', 'jxshsqfgj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '180', '超薄石墨纸具有超好的导热特性，主要应用在电子产品的导热、散热领域，超薄石墨纸是高端石墨纸产品，大量应用于通迅工业、医疗设备、超薄笔记本电脑和LED基板。建设年产5000吨超薄石墨纸生产线。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525093012394.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (160, '2847fe27-c643-11ea-8088-00ff338109dc', '年产10万吨聚羧酸减水剂项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '30500万元（4707.67万美元）', '120000', '重点', '7.3', '5306', '8049', '筹划', '无', '', '', '大庆高新区石化产业促进中心', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '随着国内市场对混凝土的质量要求越来越高，性能要求越来越综合化、多样化，绿色环保高效的聚羧酸减水剂市场占有率将进一步提升。2020年我国减水剂的用量将达到900万吨；黑龙江省尚未建设生产企业；建设该项目除满足本省需要外，还可以通过中俄经济走廊进入俄罗斯市场。项目主要原料为环氧乙烷，年需求量约9.7万吨，可通过现有项目供应生产原料，其余原料可通过外购解决。具有明显的技术优势和较高的性价比，预计未来需求将稳步增长。园区公用工程配套设施齐备。', '石化产业', '石化', '大庆高新技术产业开发区', '1', '2021-08-10 10:15:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200715103320634.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (161, '28cfeb4d-9b26-11ea-8a5d-00ff338109dc', '大兴安岭呼玛县年加工1万吨沙棘果提取沙棘籽油、沙棘黄酮项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '3800万元（586.53万美元）', '6000', '重点', '4.7', '800', '200', '筹划', '无', '', '', '加格达奇区发改局', '刘涛', '18645719911', 'jqswj03@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '80', '沙棘含有微量元，可以调节胃肠功能，保护肝脏，降血压、降血脂，保护血管，能够提高机体免疫力，具有止咳平喘、利肺化痰，也有美容养颜的作用，其系列产品在国外十分畅销，国内市场增长快速。项目拟利用大兴安岭地区近年快速扩大的种植资源，新建寒温带生物研发实验室、生产车间、库房、新建一条沙棘提取生产线、天然植物护肤品生产线，年加工处理沙棘10000吨，年提取沙棘黄酮 3 吨，沙棘油 100 万瓶。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江加格达奇经济开发区', '40', '2020-06-03 15:38:37', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134438373.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (162, '295e98d8-c074-11e8-b0d1-ac1f6b639ec0', '黑河孙吴县牛羊屠宰深加工项目', '黑河', '孙吴县', '黑河-孙吴县', '农、林、牧、渔业', '第一产业', NULL, '独资', '11000万元（1697.85万美元）', '31000', '重点', '2', '6000', '3500', '筹划', '无', '', '', '孙吴县招商局', '徐梦娟', '13009943778', '8422728@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '40', '孙吴县位于黑龙江省东北部，黑河市中部，现有草原用地53.4万亩，全县草原覆盖率7.98%。平均产草量200kg/亩左右，载畜量达60万个羊单位。孙吴全县牛存栏6万余头，羊存栏19.1万头。本项目设计年生产能力为 10 万吨牛羊肉，总投资10000万元。项目建成后，年可实现销售收入12000万元，利税750万元。项目占地面积30000平方米，建屠宰、分割车间等，直接将肉牛、羊转化成肉产品，并可以根据消费市场的不同要求，来进行不同的分割和包装，以满足国内外市场的不同需求，项目经济效益较好。\r\n\r\n\r\n', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江逊克经济开发区', '37', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200413093330047.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (163, '2a95e3d7-8213-11eb-94a7-00ff338109dc', '北安市年产1万吨山特产品加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '14000万元（2160.9万美元）', '12000', '重点', '4', '3500', '2000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市的地理位置和得天独厚的条件，昼夜温差大，雨量充沛，独特的生长环境条件，造就了林中和低温草地上的种类繁多的野生植物。市域内有北安市林业局、通北林业局和沾河林业局，总经营面积100万公顷，林特产品品种丰富，蕴含产量大，并且全部为有机无公害绿色产品。有山梨、山丁子、山里红、榛子、山葡萄、野刺梅等野生果类植物；食用菌包括野生黑木耳、榛蘑、元蘑等；人工栽培黑木耳、猴头蘑、榛蘑、滑子蘑等。山野菜包括蕨菜、薇菜、老山芹等。项目占地面积25000平方米，总建筑面积24000平方米。购置年处理山特产品2000吨生产线五条。', '现代商贸产业', '现代商贸', '黑龙江北安经济开发区', '0', '2021-08-10 10:03:56', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (164, '2afa1545-853d-11ea-b0bb-ac1f6b639ec0', '肇源县5万吨/年大豆深加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '50000', '一般', '4', '8000', '700', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '25', '目前人们生活水平和消费观念逐渐提高，对食品的品质和营养层次要求也越来越高，对高蛋白、低脂肪、低热量的大豆深加工产品需求十分旺盛。\r\n肇源位于世界三大黑土带之一松嫩平原腹地，是黑龙江省第一积温带上限，年有效积温2900-3100℃，全县年产大豆5000万吨，是黑龙江省大豆主产区。\r\n项目拟选址在肇源县经济开发区，规划占地面积8万平方米，建成后日处理大豆170吨，年加工大豆5万吨，主要产品：一级大豆油、豆粕、大豆分离蛋白、大豆蛋白肽、大豆异黄酮、大豆皂甙、大豆粉末磷脂、大豆甾醇、大豆多糖纤维饲料、维生素E、大豆肉干、大豆类休闲食品等。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江肇源经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423163354839.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (165, '2affdcfc-6df0-11e8-b8c9-ac1f6b639ec0', '尚志市文化旅游及健康养老服务项目', '哈尔滨', '尚志市', '哈尔滨-尚志市', '居民服务、修理和其他服务业', '第三产业', NULL, '合资', '100000万元（15435.0万美元）', '57000', '一般', '6', '16666', '5000', '筹划', '无', '', '', '尚志市商务局', '闫宏伟', '13136658887', 'w53343231@163.com', '尚志市商务局', '孙玉龙', '15084697345', 'w53343231@163.com', '30', '项目建设地点在尚志市周边乡镇及石咀山旅游景区，占地面积137万平方米，建筑面积120万平方米。尚志市水质达标率98%，市区空气质量二级以上天数296天，负氧离子含量丰富。拟建设老年公寓、老年大学、老年文化体育活动中心、康复体检中心、疗养中心等。随着社会老龄化问题日益严峻，加之缺乏足够的养老场所，项目的建设将有效的辐射整个尚志及周边地区，市场前景广阔。项目建成后，将可提供养老床位500余张。', '旅游产业', '旅游', '黑龙江尚志经济开发区', '183', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200324101048443.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (166, '2b2d4b81-79e3-11e8-9615-ac1f6b639ec0', '哈南工业新城机器人产业园建设项目', '哈尔滨', '平房区', '哈尔滨-平房区', '租赁和商务服务业', '第三产业', NULL, '其他', '67000万元（10341.45万美元）', '20000', '一般', '15', '2000', '500', '建设', '无', '', '', '平房区招商局', '孙树军', '13339409886', '350679462@qq.com', '平房区招商局', '庄红霞', '15124681324', '350679462@qq.com', '200', '项目建设地点位于哈尔滨市平房区，是黑龙江省第一家机器人产业园区，总规划面积3平方公里。园区所在的哈南工业新城是黑龙江省最大的产业集聚区，拥有坚实的产业基础。拥有民用航空产业国家高新技术产业基地、国家新型工业化装备制造产业示范基地等17个国家级产业基地。园区采取与哈尔滨工业大学合作共建的模式，辟建了“哈工大机器人产业化示范基地”，通过龙头企业的科研实力和品牌效应，拟引进国内外机器人行业企业，促进园区迅速形成产业集聚，打造全国重要的机器人产业示范基地。', '高端装备制造产业', '工业机器人', '哈尔滨经济技术开发区', '359', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (167, '2b5d779b-74d0-11ea-b0bb-ac1f6b639ec0', '勃利县国家森林公园开发项目', '七台河', '勃利县', '七台河-勃利县', '住宿和餐饮业', '第三产业', NULL, '合资', '56407万元（8706.42万美元）', '7860', '重点', '3', '2350', '850', '筹划', '无', '', '', '勃利县经济合作促进局', '王相彬', '13846489777', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '勃利县境内有首批国家级“国防教育示范基地”西山密塞，吉兴河林场森林公园、青松另森林公园、通天湖公园、九龙水库旅游开发区等，以及新兴的农家乐葡萄园、薰衣草庄园等。此外还拥有包括勃利黑陶、蓝靛果酒等独具特色的县域旅游商品。建设内容：青松岭生态休闲区、九龙湖滨水度假区、白桦林养生区、娱乐区、营地度假体验区。', '旅游产业', '旅游', '其它', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174433074.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (168, '2b8693dd-74e8-11ea-b0bb-ac1f6b639ec0', '新兴区石墨精深加工项目', '七台河', '新兴区', '七台河-新兴区', '采矿业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '37000', '一般', '4', '11000', '350', '筹划', '无', '', '', '新兴区招商办', '韩明晓', '13945858615', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '60', '七台河市各类资源丰富,有煤炭、黄金、石墨、膨润土、花岗岩等十余种,尤以煤炭最为丰富。是国家保护性开采的三个稀有煤田之一。石墨烯因具有良好的抗拉性、透光性、导电性、导热性，被誉为新世纪的“材料之王”。目前七台河市辖区内已探明石墨储量4.78亿吨，矿物量3248万吨，具有储量丰富、品位高、鳞片大等特点，为产业发展提供了原料保障。建设内容：建设年产2万吨天然球形石墨、1万吨天然石墨提纯生产线。', '新材料产业', '石墨', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521174216900.docx');
