INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (173, '2cbdedef-73e2-11ea-b0bb-ac1f6b639ec0', '佳木斯市风能利用项目', '佳木斯', '抚远市', '佳木斯-抚远市', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '120000万元（18522.0万美元）', '50000', '一般', '11', '11000', '6000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '随着经济水平的不断提高，开发绿色环保新能源成为能源产业发展方向。我市交通便利，基础设施完善，配套服务齐全，雨热同季，四季分明，主导风向较为明显，风能资源较为丰富，具备建设风电项目的条件。本项目能有效开发我市的风电资源，符合国家能源产业发展方向，有效提高风能资源的利用；缓解环境保护压力，实现经济与环境的协调发展；改善本地区电源结构，提高供电可靠性，满足本地区社会经济发展对电力的需求。本项目建设地点位于抚远市东部，主要建设内容包括风力发电机组、塔筒、箱式变电站、升压站等及其它附属配套设施。', '新能源产业', '风电', '其它', '31', '2020-06-02 14:26:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522142323367.doc');
