INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (177, '2f26aa93-69fb-11e8-98f3-ac1f6b639ec0', '年深加工10万吨玉米项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '40000', '一般', '4', '8000', '2500', '筹划', '无', '', '', '肇州县经济合作促进办公室', '唐福利', '13624665470', 'zzxjhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '40', '该项目建设地点在大庆市肇州县，该县2017年产玉米101万吨，项目原料充足。项目占地面积4万平方米，拟建设年加工玉米10万吨的生产线及相关配套设施，年产黄原胶1500吨，医药淀粉10000吨，蛋白质6000吨，玉米油2400吨，玉米油饼3500吨，玉米浆600吨，干玉米渣饲料6000吨，低聚糖5000吨，赖氨酸1600吨等。玉米产品市场潜力巨大，市场前景看好。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江肇州经济开发区', '196', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (178, '2f3a0885-754c-11e9-815b-ac1f6b639ec0', '大庆杜尔伯特蒙古自治县年产3000吨中药饮片项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '10000', '一般', '4', '2500', '1000', '筹划', '无', '', '', '杜尔伯特蒙古自治县农业农村局', '张虎成', '13059056597', 'zw362497762@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '中药饮片是我国传统的中药产业，随着中药产业化和市场化的不断扩大和升级，我国中药饮片加工产业呈现出持续发展的良好态势。目前，大庆市野生和人工种植的中草药面积达34.3万亩，总产量达到2.25万吨，发展中药饮片加工，具备明显的基础优势。该项目谋划投资1亿元，其中项目中药饮片加工区建设总投资为6000万元，中草药高标准种植示范基地和种子种苗繁育基地建设投资4000万元。建设中草药高标准种植示范基地5万亩，种子种苗繁育基地1000亩。年设计生产加工3000吨各类精制中药饮片和口服饮片。', '中医药产业', '中医药', '黑龙江杜尔伯特经济开发区', '39', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (179, '2f902af9-732c-11ea-b0bb-ac1f6b639ec0', '望奎县大鹅、鸭子、溜达鸡屠宰加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '2', '3000', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '随着人们生活水平不断提高，人们对餐饮业中的“铁锅炖”已是情有独钟，而“铁锅炖”的主要食材就是本地大鹅、鸭子及溜达鸡，市场对绿色禽产品需求十分旺盛。我县大鹅等禽类商品量近3000万只，周边市县可提供商品量5000万只。且禽类养殖多以水塘为依托食草为主，肉质细嫩，脂肪含量小，胆固醇含量低，是绿色环保食品。新上屠宰、加工绒、肝、掌、头、舌、肠、血等系列产品的全产业链加工项目，市场前景广阔。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江望奎经济开发区', '17', '2020-06-02 13:47:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200602110355841.doc');
