INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (184, '303a3e39-a470-11e9-815b-ac1f6b639ec0', '食用菌基地建设及深加工项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '其他', '12000万元（1852.2万美元）', '5040', '一般', '8', '1500', '200', '筹划', '无', '', '', '虎林市投资促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '80', '项目主要产品有：食用菌真空系列、食用菌罐头系列、食用菌干系列、食用菌鲜品系列。预计达到年加工食用菌8000吨，其中加工3000吨食用菌保健品，5000吨食用菌即食产品。需建设标准菇房24000平方米，标准厂房30000平方米，可温湿调控菇室46座左右及相关设备。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江虎林经济开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522140329878.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (185, '307597e9-9d62-11ea-8a5d-00ff338109dc', '佳木斯生态有机高蛋白大豆豆腐干加工项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '35000万元（5402.25万美元）', '39000', '重点', '4', '10000', '2900', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '50', '汤原县是黑龙江省产粮大县，所产大豆均为非转基因生态有机大豆，丰富的大豆资源可为项目建设提供充足的原料。豆腐干口感咸香爽口，硬中带韧，久放不坏。豆腐干营养丰富，含有大量蛋白质、脂肪、碳水化合物，还含有钙、磷、铁等多种人体所需的矿物质。建设生产车间，新上生产线，年加工大豆20000吨，生产豆干30000吨。项目达产达效后，年可实现销售收入3.9亿元，利润1亿元，税金2900万元。新增就业50人。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江汤原经济开发区', '34', '2021-08-11 11:34:37', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707104147514.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (186, '31252547-ce6d-11eb-a12f-00ff338109dc', '灵芝孢子粉产业发展项目', '牡丹江', '宁安市', '牡丹江-宁安市', '制造业', '第二产业', NULL, '独资', '6000万元（926.1万美元）', '12000', '一般', '3', '2000', '250', '筹划', '无', '', '', '宁安市农业农产品加工项目招商专班办公室', '吕凤满', '13845331777', 'nanync203@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '3000', '在东京城食用菌科技示范园区内，新建一处灵芝孢子粉加工车间、锅炉房及配套辅助工程，总建筑面积2500平方米，购置各类设备100台套。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '4', '2021-08-10 09:48:21', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (187, '31258462-9d80-11ea-8a5d-00ff338109dc', '玉米汁饮料加工项目', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '30000', '一般', '3', '6000', '700', '筹划', '无', '', '', '龙江县经济合作促进局', '李晓东', '15946466566', 'ljxjhj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '30', '引进国内外先进生产工艺和设备，建设年加工玉米8万吨、年产澄清型玉米汁饮料40万吨生产线及配套设施。玉米汁饮料含人体所需的各种糖、氨基酸、维生素、微量元素等营养成分，是新一代绿色健康饮品，市场前景良好。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江龙江经济开发区', '19', '2020-06-04 13:58:44', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524133435533.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (188, '3130e23c-72fc-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产2万吨调味品加工项目', '佳木斯', '同江市', '佳木斯-同江市', '制造业', '第二产业', NULL, '独资', '7061.37万元（1089.92万美元）', '15150', '一般', '7.7', '1022', '1350', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '60', '本项目计划总投资7061.37万元。计划占地面积2.5万平方米。建设厂房6528平方米,原料及成品仓库832平方米,综合用房4860平方米，晾晒场2100平方米；购置制冷设备、蒸气夹层锅、圆盘制曲机、压滤机等加工设备169台（套），完善相应的配套设施。年产酱油、醋、调味酱、豆腐休闲食品、调味食品2万吨。同江是国家级生态示范市、国家园林城、全国农业标准化示范县、全国粮食生产先进县、农产品质量安全县。种植业主要以水稻、玉米和大豆三大作物为主，加工原料充足。境内有黑龙江、松花江及大小河流十三条，市属水域面积34万亩，水资源充沛，完全可以满足该项目用水需求。', '高端装备制造产业', '食品加工设备', '黑龙江同江经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521135620347.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (189, '3140d014-6eb0-11e8-afa3-ac1f6b639ec0', '大豆暨粮食物流产业园建设项目', '绥化', '海伦市', '绥化-海伦市', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '重点', '5', '9000', '3000', '筹划', '无', '', '', '海伦市招商委', '李楠', '13904552355', 'hlzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '260', '随着国家玉米临储政策的取消,供给侧改革、农业种植结构调整和市场化运营加速,建设一批集仓储、加工、贸易、质检信息服务等功能于一体的国家级粮食物流园区显得尤为紧迫。海伦市目前没有大型专业化粮食物流园区,建设粮食物流产业园机遇难得,发展空间广阔。项目规划主要有5大功能区和5个专业区块，厂区总占地面积20万平方米，建筑面积18万平方米。', '物流产业', '物流', '黑龙江海伦经济开发区', '82', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (190, '31994075-7348-11ea-b0bb-ac1f6b639ec0', '佳木斯市养生五谷杂粮系列食品加工项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '30000', '一般', '4', '8000', '4000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '80', '汤原县地处黑龙江省东部三江平原腹地，杂粮资源较为丰富，杂粮品质较高。年产燕麦、谷子、高粱、黑豆、红豆、芸豆等杂粮杂豆品类丰富。依托丰富的优质杂粮资源，通过延伸加工链条有效提高产品转化率和附加值，谋划现磨即食养生五谷杂粮项目并开发即食类、膨化类、泥蓉类馅料等杂粮系列食品。养生五谷杂粮工艺主要是将杂粮经过60℃低温烘焙至熟，再通过不同种类的杂粮科学配比后研磨成粉状，冲调即食的养生食品。产品完整保留富含膳食纤维素和功能性色素的豆皮，营养价值较传统脱皮产品更高，根据不同种类配比有润肺止咳、健脾养胃、补钙壮骨、提高免疫力等功效。建设年加工10万吨杂粮、3万吨杂粮系列食品生产线及附属设施。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江汤原经济开发区', '5', '2021-08-11 11:32:45', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707110547771.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (191, '31aaf8b9-8215-11eb-94a7-00ff338109dc', '北安市秸秆纤维素乙醇加工生产项目', '黑河', '北安市', '黑河-北安市', '采矿业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '25800', '一般', '3.5', '5700', '2800', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '90', '北安作为农业市，年产秸秆约200万吨以上，原料丰富。秸秆在转化为生活燃料、秸秆还田、食用菌栽培、秸秆沼气化及肥料化利用、固化成型、秸秆碳化和秸秆能源化方面有着极好的前景。目前政府已跟农村合作社签订合同原材料有保证。克利尔（北京）环境科技发展有限公司已与北安市政府签订了秸秆综合利用项目的合同，并将于近期启动项目的建设和筹备工作。项目占地面积4万平方米，建筑面积3万平方米，建设生产线2条、年产纤维素乙醇7.5万吨。', '节能环保产业', '秸秆综合利用', '黑龙江北安经济开发区', '1', '2021-08-10 10:03:06', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (192, '31d55106-64a9-11e8-97d9-ac1f6b639ec0', '大榛子深加工项目', '哈尔滨', '通河县', '哈尔滨-通河县', '农、林、牧、渔业', '第一产业', NULL, '独资', '15000万元（2315.25万美元）', '5000', '重点', '15', '1050', '1050', '筹划', '无', '', '', '通河县林业局', '乔磊', '13936476777', 'thxlyj@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '30', '该项目建设地点在哈尔滨市通河县，规划占地面积16000平方米，拟建设大榛子加工厂一座，包括4个加工车间、办公楼、员工宿舍、锅炉房、冷库等土建工程及其他配套设施，年产20万吨大榛子食用油生产线2条。采购预榨、浸出、炼油、油脂精炼设备各二套。生产高档榛子油、榛子蛋白饮料和榛子系列休闲食品等，具有很高的营养价值。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江通河经济开发区', '201', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524203411441.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (193, '324fee08-83a9-11ea-b0bb-ac1f6b639ec0', '中医兽药产业化基地建设项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '16000', '一般', '5', '3200', '1000', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '40', '兽药是将中医药理论应用到动物身上，预防和治疗动物疾病，促进动物生长，包括单味、复方及中药为主的中西结合制剂，本项目适应当前市场需求，发展前景广阔。大同区中药材种植种类丰富，种植面积大，可充分满足项目的原料供给。\r\n项目拟建在大同经济开发区（食品园区），规划总占地面积1万平方米，其中办公室1000平方米、生产车间、辅助生产车间及仓库等9000平方米，新上中药制剂加工生产线、西药生产线、添加剂生产线及配套设施，建成后年产兽用原料药100吨、制剂80吨、中药提取精制产品220吨。', '中医药产业', '中医药', '黑龙江大同经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115145128.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (194, '3251e376-725b-11ea-b0bb-ac1f6b639ec0', '兰西县猪油产品生产加工项目', '绥化', '兰西县', '绥化-兰西县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '一般', '3', '9000', '2000', '筹划', '无', '', '', '兰西县经济合作服务中心', '车德威', '18245599222', 'lxxzszj@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '猪油，又称大油、荤油，为猪科动物猪的脂肪油，在西方被称为猪脂肪。猪油色泽白或黄白，具有猪油的特殊香味，深受人们欢迎。很多人都认为炒菜若不用猪油菜就不香。猪油的熔点较羊油、牛油低，一般低于人的体温，容易被人体吸收。它是饮食业使用最普遍的食用油。猪油与一般植物油相比，有不可替代的特殊香味，可以增进人们的食欲。经研究发现，猪油的性质是甘、微寒、无毒，它的主要功能就是解毒，长期食用可以除因硫磺摄入过多而引起的危害，并可以解除黄疸、黑疸、谷疸、酒疸和女劳疸五中疸疾，具有利肠胃、通小便、里血脉、散宿血等作用。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江兰西经济开发区', '20', '2020-05-31 22:44:43', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521131210957.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (195, '32e4f4c0-757c-11ea-b0bb-ac1f6b639ec0', '牡丹江市东宁市宝玉石城建设项目', '牡丹江', '东宁市', '牡丹江-东宁市', '采矿业', '第二产业', NULL, '合资', '110000万元（16978.5万美元）', '60000', '重点', '12.2', '9000', '3420', '筹划', '有', '', '', '牡丹江市经合局', '吕 强', '13144535888', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '在市委市政府的倡导下，入驻企业成立了宝玉石协会，加强了宝玉石行业管理，提供了配套服务。目前，河南镇平国际玉器城、苏州相王玉器城、上海静安寺珠宝古玩城等知名宝玉石市场成为“产业基地”的产品销售平台。\r\n项目总建筑面积20多万平方米，可容纳4000多家销售商户和200多家生产企业入驻，建设集宝玉石通关、保税、物流、融资、研发、鉴定、加工、展销、结算等功能为一体的宝玉石城。项目建成达产后，预计年加工宝玉石原料1000吨，生产成品80万件。\r\n', '文化创意产业', '文化创意', '黑龙江东宁经济开发区', '21', '2020-05-29 15:27:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522085408255.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (196, '33c4506c-7fba-11ea-b0bb-ac1f6b639ec0', '医疗耗材产业园项目', '齐齐哈尔', '铁锋区', '齐齐哈尔-铁锋区', '其他', '第三产业', NULL, '独资', '200000万元（30870.0万美元）', '400000', '一般', '8', '100000', '30000', '筹划', '无', '', '', '齐齐哈尔市铁锋区经合局', '崔海学', '14745662333', 'tfqzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '1000', '拟占地28万平方米，规划建设年产1千吨高分子材料医药用品、10万个一次性医用包等医用耗材产品。医疗耗材研发中心、生产车间、办公楼等。依托现有的齐齐哈尔恒鑫医疗用品有限公司，利用园区内现有28万平方米土地，引进上下游配套企业，形成产业链。', '高端装备制造产业', '高端医疗器械', '黑龙江铁锋经济开发区', '89', '2020-06-04 14:02:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523161738619.docx');
