INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (198, '34a1e5cd-8642-11e8-9218-ac1f6b639ec0', '液化天然气(LNG)项目', '大庆', '红岗区', '大庆-红岗区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '20000', '重点', '7.5', '4000', '1000', '筹划', '无', '', '', '红岗区招商局', '姜修业', '13009839007', 'honggangqu070@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '大庆市天然气专业园区一期初步规划占地面积1.63平方公里，可利用面积1.08平方公里。园区位于大庆铁人产业园区兴隆园区，北至杏十一路、西至东干璐、南至滨湖路、东至大广高速。园区重点发展压缩天然气（CNG）及液化天然气（LNG）的加工、储存、物流，及以天然气为燃料的相关产业。天然气园一期建成投产后，预计全年可实现销售收入超过60亿元，可实现日处理天然气600万立方米，LNG调峰储罐超过10万立方米。', '石化产业', '石化', '黑龙江红岗经济开发区', '180', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523210311018.docx');
