INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (210, '371670a8-b00b-11e8-8e63-ac1f6b639ec0', '北安市年产30万吨啤酒饮品生产项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '合资', '34742万元（5362.43万美元）', '97430', '重点', '2.4', '14442', '12580', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市位于哈尔滨、齐齐哈尔、伊春和黑河四座城市的中心地带,距离国家一类口岸260公里，市国家粮食标准化生产基地。随着人民生活水平的提高，啤酒消费量也在逐年增大，预计每年市场啤酒需求量均以100～200万吨递增。国内啤酒市场特别是中高档啤酒大多数均采用进口大麦生产，项目依托北安市的区位优势、对俄进口大麦的资源优势，年生产20万吨纯生啤酒和10万吨普通啤酒，具有良好的市场前景。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江北安经济开发区', '56', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401094600259.docx');
