INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (213, '3846d667-6fd2-11e9-88ef-ac1f6b639ec0', '博奥时代购物中心项目', '大庆', '让胡路区', '大庆-让胡路区', '批发和零售业', '第三产业', NULL, '其他', '5000万元（771.75万美元）', '5000', '一般', '3', '1500', '850', '可研', '有', '', '', '大庆市让胡路区商务局', '刘宇', '04596338534', 'swj6354686@163.com', '大庆市让胡路区商务局', '窦立才', '18646654003', 'swj6354686@163.com', '100', '博奥时代购物中心是由大庆市品诚房地产开发有限公司斥资3亿元投资兴建的集商住为一体的大型综合性商业地产项目。位于大庆市让胡路区西宾路255号，系让胡路区中心区范围内，总建筑面积10多万平方米，其中商场总建筑面积约40,000多平方米，商场共五层，地下一层、地面四层。', '现代商贸产业', '现代商贸', '其它', '34', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (214, '38508a2c-73dc-11ea-b0bb-ac1f6b639ec0', '佳木斯市玉米深加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '11000', '一般', '5', '3000', '1100', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '50', '玉米作为抚远主要农作物之一，年产量可达20万吨左右，加之周边市县及农场，玉米总产量可达百万吨，大量玉米原材料供应为发展玉米深加工奠定了坚实的基础。因此，在我市进行玉米加工，对满足市场需求和企业发展具有重要意义。依托我市丰富的玉米资源，采用高新技术加工、转化和综合利用生产精制玉米油、玉米淀粉、高麦芽糖浆、颗粒纤维饲料、分离蛋白等，引导玉米产业向着精深加工方向发展，提高玉米的附加值，使玉米资源得到合理利用，增加市场竞争力。本项目位于经济开发区，占地面积4万平方米，建设内容包括榨油车间、饲料生产车间、生物车间及其它附属配套设施等。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江抚远经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522135936997.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (215, '38557cde-6f04-11ea-b0bb-ac1f6b639ec0', '五大连池市大豆蛋白肉加工项目', '黑河', '五大连池市', '黑河-五大连池市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '21000', '重点', '3.2', '6260', '494.2', '可研', '无', '', '', '五大连池市经济合作中心', '李建松', '18645623498', 'wdlczsj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '60', '大豆蛋白肉是以优质大豆为原料加工而来的植物蛋白，蛋白质的含量远远高于一般动物肉类，而且食感、结构、色泽、韧性均与动物肉近似。挤压组织化蛋白产品可以作为肉类配料、营养平衡剂或模拟肉，可用于开发早餐食品、烘焙食品、快餐食品、休闲食品、罐头食品和宠物食品等多方面的新市场，具有广阔的市场前景。五大连池市稳定种植非转基因大豆400万亩左右，年产大豆约60万吨，是全国标准化绿色大豆原料种植基地。项目总占地面积3.5万平方米，总建筑面积37450平方米。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江五大连池经济开发区', '24', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200326095718747.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (216, '38760eb8-74d7-11ea-b0bb-ac1f6b639ec0', '明水县年产8000吨五谷杂粮粉项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '17000万元（2623.95万美元）', '16000', '重点', '6', '3100', '2560', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '160', '投资1.7亿元建设年产8000吨五谷杂粮粉项目。项目达产后，可形成年产五谷杂粮营养粉8000吨能力。项目占地面积5万平方米。厂房面积5100平方米，路面及绿化等基础配套工程1.6万平方米，配套绿色种植基地5000亩。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江明水经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521120124438.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (217, '388dfc2d-8214-11eb-94a7-00ff338109dc', '北安市年产3万吨脱水、冷冻蔬菜加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '18000', '一般', '3', '5000', '3000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '80', '北安市地域广阔，生态优良，土地肥沃，雨水充沛，自然条件优越，市域内现有耕地516万亩。北安市是我省绿色、有机蔬菜生产基地。境内有乌裕尔河、南北河、通肯河，共有支流26条。北安市地处寒温带，属于季风控制下的大陆性气候。春末、夏季、秋初多受南来暖空气、蒙古低压影响，多偏南风、气温高，降水多而集中，空气湿润。项目种植20000亩，种植油菜、生菜、白菜、西蓝花及青椒等多种蔬菜，并达到有机认证标准。蔬菜种植水源上游为乌裕尔河，水。项目占地5万平方米，新建保温库、冷库、蔬菜加工车间工程、脱水蔬菜生产线工程及速冻蔬菜生产线工程，年产有机蔬菜3万吨，速冻蔬菜7000吨，脱水蔬菜3000吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江北安经济开发区', '4', '2021-08-10 10:03:34', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (218, '38ad9614-72f4-11ea-b0bb-ac1f6b639ec0', '佳木斯市佳木斯大学科技产业园区项目', '佳木斯', '前进区', '佳木斯-前进区', '科学研究和技术服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '8000', '一般', '13', '2400', '150', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '佳木斯大学与前进区政府合作，利用佳木斯大学第三学区的建筑和场地，共建佳木斯大学科技产业园区项目。项目占地5万平方米，其中建筑面积1.8万平方米。前进区政府先后为该项目提供了必要的办公设施和用于现代农业技术应用实验的耕地18亩，其中温室大棚7栋、14亩。同时，我区正与佳木斯市青年企业家联合会和北京佳木斯商会等组织沟通联系，邀请企业家与入园企业结对，为创新创业人员提供就业帮助，并多方联系省内天使基金、投资公司，为园区企业提供资金支持。主要建设文化创意产业园、电子商务创业园、医疗科技产业园。', '电子商务产业', '电子商务', '其它', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523093758154.doc');
