INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (225, '39ec9aa7-6f34-11ea-b0bb-ac1f6b639ec0', '冰点食品项目', '哈尔滨', '宾县', '哈尔滨-宾县', '批发和零售业', '第三产业', NULL, '独资', '6000万元（926.1万美元）', '5000', '一般', '3', '1000', '500', '筹划', '无', '', '', '宾县经济合作促进局', '王亚芝', '15246631345', 'bxzsj@163.com', '宾县经济合作促进局', '刘士诚', '13359762527', 'bxzsj@163.com', '50', '休闲消费取代季节性消费随着休闲消费文化的普及、城市人口生活习惯的变化以及冰点产品的创新，我国越来越多的大中城市已出现冰点食品淡季消费快速增长的趋势。与消费习惯改变相对应的是，我国冰淇淋制造企业也从传统的“忙三月，吃一年”式的季节性生产转向全年连续生产。未来，城镇化继续快速推进将提升冰点食品的人均消费水平。同时，冷链储运系统等基础设施条件的不断改善，将进一步拓展冰点食品的产销范围。', '农业及农副产品精深加工产业', '乳品', '宾西经济技术开发区', '27', '2020-05-29 14:28:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524083953244.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (226, '3a0908c0-7232-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产20万吨山梨醇项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '55000', '重点', '5', '7000', '5000', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '本项目用地面积20万平方米，项目总建筑面积4万平方米，建设内容，年产药用级山梨醇15万吨，食用级山梨醇3万吨，食用级结晶山梨醇2万吨。资源优势，富锦市是我国以玉米种植为主的商品粮主产区，年际间玉米种植面积达到210万亩，百公里半径内，玉米产量约500多万吨。这些玉米原料资源，构成了富锦金象生化有限公司玉米淀粉生产优势。在基础上延长产品加工链条，可直接使用未经干燥的淀粉乳生产山梨醇。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富锦经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152522468.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (227, '3a79fc59-7669-11ea-b0bb-ac1f6b639ec0', '粉煤灰造环保纤维纸浆项目', '七台河', '茄子河区', '七台河-茄子河区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '13200', '一般', '4', '3400', '2000', '筹划', '无', '', '', '茄子河区招商局', '董广岩', '13946566656', 'qzhzsj2019@163.COM', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '150', '从粉煤灰超细纤维造纸，回收利用或废弃物降解，形成绿色循环，不污染环境，市场前景较好。建设内容：建设年产6万吨环保纤维纸浆生产线及附属设施。', '煤炭精深加工产业', '煤炭深加工', '其它', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522074732624.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (228, '3a83ff9b-83a6-11ea-b0bb-ac1f6b639ec0', '油气危化品运输和油气集成配套服务项目', '大庆', '市辖区', '大庆-市辖区', '科学研究和技术服务业', '第三产业', NULL, '独资', '5000万元（771.75万美元）', '6000', '重点', '3', '1800', '500', '筹划', '无', '', '', '大庆高新区管委会', '侯则良', '15904591117', 'dq6931@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '20', '油气危化品运输和集成配套服务主要包括:①油气长距离管道输送与城市输配;②油气田集输;③油气储运设施的结构、施工、安全及防护。能源作为国家最重要的战略物资，大庆油田进入后开采时代，油气服务产业作为保产的重要手段，投入资金占比逐年增加，在完成油气服务过程中的配套产业油气危化品运输和油气集成服务市场容量也在逐年增加。\r\n背靠大庆油田的区域优势，通过整合油气危化品运输和油气集成服务项目，定位服务大庆本地企业的同时，开展海外业务。\r\n主要建设油气危化品运输和油气集成配套服务运营中心，内容包括物流中心、智慧协调中心、检测和配套服务中心。\r\n\r\n', '高端装备制造产业', '石油装备', '大庆高新技术产业开发区', '14', '2020-05-30 16:31:43', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521160039047.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (229, '3a99b497-74e6-11ea-b0bb-ac1f6b639ec0', '东新民俗村景区', '七台河', '新兴区', '七台河-新兴区', '住宿和餐饮业', '第三产业', NULL, '独资', '11000万元（1697.85万美元）', '2000', '一般', '15', '600', '150', '筹划', '无', '', '', '新兴区招商办', '夏士峰', '13029790055', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '东新朝鲜民族村是七台河市最大的朝鲜族聚集村，村子附近发现2000多年前肃慎人居住遗址，有伪满开拓团、抗联遗址7处，东新特色大米远近闻名。新兴区已在东新朝鲜民族村完成了朝鲜村史展示馆、河堤公园、吊桥、民俗景观长廊、门球场等旅游项目建设，并修建了7000平方米虾蟹稻池。拟改造建设170户朝鲜民居，总面积17000平方米；拟对改造后的朝鲜民居实施石墨烯电暖设备安装等工程。', '旅游产业', '旅游', '其它', '22', '2020-06-01 16:50:51', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165952087.docx');
