INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (232, '3af79b3f-7675-11ea-b0bb-ac1f6b639ec0', '牡丹江市商业航天信息港项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '150000万元（23152.5万美元）', '170000', '重点', '9', '17000', '10000', '筹划', '有', '', '', '牡丹江市经合局', '朱丽华', '13766589614', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '150', '该项目拟分三期建设，预计占地31万平方米。\r\n一期拟投入5亿元，规划10万平方米用地，主要建设10至15套测控接收一体化系统以及业务运营中心、数据中心、行政运营保障管理用房，建筑面积1.5万平方米。二期拟投资10亿元，规划10万平方米用地，主要建设40至50套测控接收一体化系统以及产业推广中心、会展及培训教育中心，建筑面积3万平方米。三期规划11万平方米用地，预留产业发展区，主要建设功能数据服务、产业推广等，建筑面积5万平方米。', '金融产业', '数字金融', '牡丹江经济技术开发区', '18', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408155517169.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (233, '3afe66ff-73f4-11ea-b0bb-ac1f6b639ec0', '牡丹江市大健康产业开发项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '合资', '500000万元（77175.0万美元）', '300000', '重点', '10', '50000', '19000', '筹划', '有', '', '', '牡丹江市经合局', '勾志会', '18845763340', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1000', '大健康产业是具有巨大市场潜力的新兴产业，包括医疗产品、保健用品、营养食品、医疗器械、保健器具、休闲健身、健康管理、健康咨询等多个与人类健康紧密相关的生产和服务领域。\r\n依托牡丹江市7个森工局、6个地方林业局和2个农场广袤的自然资源，充分利用林业“天保工程”的政策优势，发挥好农业的种养殖经验和基础，推进中药材大品种规模化种植与养殖。依托各县（市）基础优势和俄罗斯野生资源优势，建设七个各具特色的中药材种养殖基地。\r\n建设内容：主要建设原材料基地园区用地、工厂建设、研究中心建设、物流中心、电商平台等基础设施建设，构建销售网络与知名电商合作。', '生物医药产业', '生物医药', '牡丹江经济技术开发区', '25', '2020-05-29 14:26:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522134715327.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (234, '3b8368a6-6633-11e9-b4f9-ac1f6b639ec0', '储能逆变器装备制造项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '30000', '一般', '5', '6000', '4000', '筹划', '无', '', '', '大庆市发改委', '衡畅', '16645398989', 'dqsnyk@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '储能逆变器是一类适合智能电网建设，应用在储能环节，以双向逆变为基本特点，具有一系列特殊性能、功能的变流器。我市正在建设大庆市可再生能源综合应用示范区，需要通过储能调峰推动能源结构不断优化、提高可再生能源消纳能力。储能逆变器是储能项目建设的核心装备，技术含量高、产品附加值大。项目主要建设储能逆变器研发基地，推动技术研发及产业化。伴随着未来储能产业的发展，储能逆变器在全国范围内拥有较大的市场潜力。', '汽车制造产业', '新能源汽车', '其它', '25', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523205054820.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (235, '3c04e49c-cf30-11eb-a12f-00ff338109dc', '复合肥生产项目', '鸡西', '密山市', '鸡西-密山市', '制造业', '第二产业', NULL, '其他', '50000万元（7717.5万美元）', '75000', '一般', '7', '7200', '2000', '筹划', '无', '', '', '密山市区域经济发展服务中心', '刘娜', '13351670999', 'hljmszsj@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '120', '项目计划用地15万平方米，规划总建筑面积20万平方米。购置全自动生产线2条及其配套设备。建设粉碎车间、生产车间、实验室、仓库、办公楼等建筑。\r\n', '农业及农副产品精深加工产业', '其它', '黑龙江密山经济开发区', '3', '2021-08-10 09:45:20', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (236, '3c588491-b9de-11eb-a12f-00ff338109dc', '健康大厨房项目', '佳木斯', '东风区', '佳木斯-东风区', '制造业', '第二产业', NULL, '独资', '150000万元（23152.5万美元）', '300000', '一般', '5', '30000', '3000', '筹划', '无', '', '', '佳木斯市东风区商务局和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '1000', '项目建设地点在东风区兴国村北侧，占地面积30万平方米（高新区食品园），项目主要建设主食加工区（各类功能型有机大米、有机杂粮、绿色无添加面粉等）、蔬菜及山野菜加工区（各类有机蔬菜、山野菜罐头、保鲜菜、净菜、酱菜）、肉类加工区（各类绿色无公害肉制品、熟食等）、水产加工区（各类绿色、无公害水产罐头、水产佐餐小菜、冷鲜水产制品等）、食用菌加工区（各类食用菌干品、腌制品、保鲜净品、即食小菜等）、饮品区（各类绿色浆果饮料、功能性饮品、速溶饮料及非转基因豆粉、豆浆饮料等）、佐餐调料区（绿色非转基因压榨大豆油、调和油、酱油、大豆酱等）、高端食品区（婴幼儿副食、孕妇及中老年营养补充食品、复合营养佐餐粉及紫苏油、', '农业及农副产品精深加工产业', '果蔬加工', '其它', '0', '2021-08-10 09:52:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (237, '3ca48b28-6e3c-11ea-b0bb-ac1f6b639ec0', '10万亩黑加仑种植与深加工项目', '黑河', '爱辉区', '黑河-爱辉区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '73000', '重点', '3.3', '5000', '2000', '筹划', '无', '', '', '瑷珲对俄进出口加工基地', '刘洋', '17345605706', 'ahgyyq@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '60', '黑加仑学名黑穗醋栗，属多年生小灌木。黑加仑含多种生物类黄酮（花青素）、18种氨基酸（蛋氨酸的含量是其它任何果实所不能比拟的）、多种矿物质（其中Ca含量为水果之冠）、醇类、酯类、多种维生素。据相关权威机构检测发现，黑加仑果汁含有能阻断强致癌物亚硝基吗淋合成的物质，对癌细胞具有一定抑制作用。黑加仑油还有有降脂、抑制血小板聚集的作用，可起到降血脂，防脑血栓，抗炎及防癌等独特功能，黑加仑色素是一种水溶性天然色素，具有广泛的用途。爱辉区地处大小兴安岭过渡地带，适合黑加仑生长，项目选址在瑷珲对俄进出口加工基地内，占地面积120亩，建筑面积6100平方米，年可加工黑加仑浓缩果汁10000吨，黑加仑果汁饮料5', '农业及农副产品精深加工产业', '果蔬加工', '其它', '600', '2020-06-04 14:37:27', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521200503043.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (238, '3cb7e625-9d67-11ea-8a5d-00ff338109dc', '2万亩北柴胡种植与深加工项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '独资', '11300万元（1744.16万美元）', '30000', '一般', '3.4', '4500', '1500', '筹划', '无', '', '', '瑷珲对俄进出口加工基地', '刘洋', '17345605706', 'ahgyyq@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '60', '北柴胡的药用价值与应用范围均居同类品种之首，用量呈逐年增长之势出口范围已增至30多个国家和地区。据不完全统计，近年国内市场每年所需东北的野生北柴胡多达3000吨。我区地处大、小兴安岭的过渡地带，野生北柴胡资源丰富，由于特殊的气候和环境，所产的北柴胡质地上乘，在市场上具有很高的认可度。但是现在市场上的柴胡制品还停留的初加工阶段，对于柴胡活性成分的提取和标准化饮片的开发利用是未来的趋势和亮点。该项目建设2万亩柴胡基地建设工程、柴胡活性物提取加工基地建设，年加工生产柴胡皂苷40吨、柴胡黄酮60吨，柴胡多糖50吨，柴胡精油10吨的柴胡活性物质加工提取基地。', '生物医药产业', '生物医药', '其它', '35', '2020-06-04 14:36:56', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524103531391.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (239, '3d301b9c-8537-11ea-b0bb-ac1f6b639ec0', '肇源县3万吨/年低聚木糖加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '80000', '一般', '3.4', '15000', '1200', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '45', '低聚木糖很难被动物的唾液、胃液、胰液和肠液消化，它的产热量几乎为零，其代谢不受胰岛素调节控制，因此低聚糖产品是糖尿病、肥胖病、高血脂等病人理想的糖源，市场前景广阔。\r\n肇源位于世界三大黑土带之一松嫩平原腹地，松花江、嫩江、第二松花江三江交汇处，北纬45度，是黑龙江省第一积温带上限，年有效积温2900-3100℃，是世界著名黄金黑土带，年产玉米13亿斤，年产花生1亿斤，玉米芯、花生壳等富含半纤维素类自然资源，是低聚木糖主要原料。\r\n项目拟选址在肇源县经济开发区，规划占地面积10万平方米，建成后，每年加工低聚木糖3万吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇源经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423155128412.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (240, '3d301c7c-7319-11ea-b0bb-ac1f6b639ec0', '佳木斯市有机产品示范区建设项目', '佳木斯', '郊区', '佳木斯-郊区', '农、林、牧、渔业', '第一产业', NULL, '独资', '35000万元（5402.25万美元）', '100000', '重点', '2', '28000', '8000', '筹划', '无', '', '', '佳木斯市郊区商务和经济合作局', '姜雪原', '18946430001', 'zsxxpt@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '2000', '依托郊区已被列入黑龙江省有机产品创建示范区的优势，重点引进有机产品种植、有机养殖和有机产品加工等领域,全面推进有机产品产业发展，建设有机种植、有机养殖与有机加工基地，构建有机产品产业的生产、加工、管理、信息、营销等完备运行体系，形成完整的有机产品开发产业链；通过有机产业规划把全区建成“四大”功能区，江北有机产业区、佳西有机产业区、佳南有机产业发展区、中部有机产业发展服务区。通过“四大”功能区的建设形成规模化的有机种植业、有机畜禽养殖业、有机水产养殖业、加工 业和贸易业有机结合，形成一个结构合理、环境优美、持续发展的良性循环体系。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525143539688.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (241, '3d57519a-63db-11e8-aaec-ac1f6b639ec0', '嘉荫县玉米淀粉及饲料加工项目', '伊春', '嘉荫县', '伊春-嘉荫县', '制造业', '第二产业', NULL, '独资', '14600万元（2253.51万美元）', '11200', '重点', '4', '1750', '1450', '筹划', '无', '', '', '嘉荫县招商引资服务中心', '张磊', '18645898766', 'jyzhyz@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '70', '（1）项目厂区占地5万平方米，建筑面积2万平方米，包括生产车间5000平方米、辅助生产车间2000平方米、 原料仓库1万平方米、成品仓库2000平方米、管理用房1000平方米。\r\n（2）安装玉米深加工生产线2条，购置浸泡罐、分离机、旋流器、干燥机、刮刀离心机、气流干燥系统等设备。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '其它', '197', '2020-05-31 22:31:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523214241457.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (242, '3df30221-804c-11ea-b0bb-ac1f6b639ec0', '果蔬储存深加工项目', '齐齐哈尔', '梅里斯达斡尔族区', '齐齐哈尔-梅里斯达斡尔族区', '农、林、牧、渔业', '第一产业', NULL, '独资', '5000万元（771.75万美元）', '4000', '一般', '5', '1000', '150', '筹划', '无', '', '', '梅里斯区经合局', '刘玉忠', '13845218996', 'zs6565158@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '项目拟占地20000平方米，主要从事各种果蔬水果储存及深加工等业务。建设果蔬存储大棚、深加工食品基地.每年储藏保鲜果蔬7500吨，保鲜储藏期为六个月，平均两个月周转一次；每年储藏保鲜水果4500吨，保鲜储藏期为六个月，平均两个月周转一次；其它储藏3000吨，保鲜储藏期为四个月，平均一个月周转一次.', '农业及农副产品精深加工产业', '果蔬加工', '其它', '29', '2020-06-04 14:02:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523163314072.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (243, '3df9e1f3-7df2-11e9-815b-ac1f6b639ec0', '肉制品精深加工项目', '哈尔滨', '通河县', '哈尔滨-通河县', '农、林、牧、渔业', '第一产业', NULL, '独资', '25000万元（3858.75万美元）', '16000', '重点', '4', '4500', '1800', '筹划', '无', '', '', '通河县农业局', '乔磊', '13936476777', 'thxnw@126.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '60', '建设屠宰车间、办公楼、冷库等土建工程及其他配套设施。项目建设周期为2年。2018年通河县计划实现生猪饲养量100万头以上，打造肉类产业链条，将产业发展成为富民富县的优势产业。目前，全国人均猪肉消费量约21公斤/年。因此市场前景看好,经济效益和社会效益显著。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江通河经济开发区', '27', '2020-05-28 11:50:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524195736204.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (244, '3dfcaab1-5724-11e8-a5b9-ac1f6b639ec0', '如柏科技秸秆干法制浆纤维素项目', '鹤岗', '东山区', '鹤岗-东山区', '制造业', '第二产业', NULL, '合作', '22000万元（3395.7万美元）', '16000', '重点', '5', '4500', '950', '建设', '有', '', '', '东山区人民政府', '杨永顺', '13945769291', 'dsqzsj@163.com', '东山区商务局', '贾利娜', '15545861797', 'hgzsgz@163.com', '150', '黑龙江如柏科技有限公司建设完成了2套2万吨制浆生产线（该示范装置属国内首台套），该项目完成技术公关近百项，2条日产40吨的制浆生产线带料试车已经完成，试验产出纸浆的各项技术指标均符合造纸行业标准。该项目需融资2000万元，年收购20万吨秸秆新建年产10万吨干法清洁制浆车间等。该项目秸秆的回收，既解决了农民冬天焚烧秸秆带来的污染问题，还能提高农民的收入，项目前景广阔。', '节能环保产业', '秸秆综合利用', '其它', '107', '2021-08-10 10:07:59', 'http://111.40.46.10:8800/zsyz/file/xmfile/20201223100211926.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (245, '3e27fffc-72f0-11e9-815b-ac1f6b639ec0', '山水旅游建设项目', '齐齐哈尔', '铁锋区', '齐齐哈尔-铁锋区', '住宿和餐饮业', '第三产业', NULL, '独资', '6000万元（926.1万美元）', '1400', '一般', '15', '400', '30', '筹划', '无', '', '', '齐齐哈尔市铁锋区经合局', '褚祺', '13796884433', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '100', ' 项目建设地位于齐齐哈尔市铁锋区扎龙镇卢屯村，距离齐齐哈尔市区仅3公里，距旅游名胜景区扎龙自然保护区20公里。占地面积约40万平米。拟建设以休闲观光、水上游乐、古榆文化等产业为一体的综合性旅游项目。项目占地约40万平方米。拟建设以休闲观光、水上游乐、古榆文化等产业为一体的综合性旅游项目。卢山古榆景点、游客接待中心、水上乐园、农耕体验园、环村自行车绿道。', '旅游产业', '旅游', '黑龙江铁锋经济开发区', '41', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524172250910.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (246, '3e430827-83a6-11ea-b0bb-ac1f6b639ec0', '年产10000吨丙烯酸酯橡胶项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '16800万元（2593.08万美元）', '31500', '一般', '4', '4500', '1500', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '目前国内丙烯酸酯橡胶（ACM）产量较低，大部分依赖进口。近几年，我国汽车生产以及销售数量在快速增长，ACM需求的绝对数量和相对比例上有较大增长，同时，二手汽车市场对丙烯酸酯橡胶的需求也极为巨大，因此本项目市场潜力巨大。\r\n项目拟建设在林源化工园区，规划占地面积25000平方米，建设办公室1000平方米、生产车间和仓储用房等24000平方米，新上丙烯酸酯橡胶生产线及相关配套设施达到年产丙烯酸酯橡胶10000吨。', '高端装备制造产业', '石油装备', '其它', '49', '2020-05-30 16:38:51', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111545012.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (247, '3e54b1c8-ca90-11eb-a12f-00ff338109dc', '龙江福300吨/日低温大豆粕及人造肉加工项目', '哈尔滨', '平房区', '哈尔滨-平房区', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '70000', '一般', '3', '7000', '500', '筹划', '无', '', '', '黑龙江龙江福粮油有限公司', '宋海涵', '13613612828', '66020001@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '120', '低温豆粕是近年来兴起的人造肉的主要原料，经过膨化、拉丝后可加工成各种口感、口味的人造肉食品。人造肉是目前肉制品最好的替代物，营养价值高，成本低，广受餐饮业喜爱。项目建成后可每天加工大豆300吨，产出低温大豆粕240吨。\r\n', '农业及农副产品精深加工产业', '大豆深加工', '其它', '10', '2021-08-10 09:49:22', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (248, '3eaa9c07-72f7-11ea-b0bb-ac1f6b639ec0', '佳木斯市杂粮深加工项目', '佳木斯', '前进区', '佳木斯-前进区', '其他', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '8000', '一般', '9', '1800', '150', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '佳木斯市具有优越的生态地理环境，日照充足、温度适宜、土地肥沃、水源清洁，非常适合各类杂粮的种植和生长，可规模化种植如小米、玉米碴、大豆、绿豆、红小豆等杂粮杂豆作物。项目占地面积8万平方米，建筑面积5万平方米，主要建设厂房、仓储库、办公楼及员工宿舍，形成年加工50万吨杂粮杂豆生产能力。', '农业及农副产品精深加工产业', '大豆深加工', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523095325557.doc');
