INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (259, '4052b87d-64a0-11e9-b4f9-ac1f6b639ec0', '嘉荫县5万吨绿色大豆精深加工项目', '伊春', '嘉荫县', '伊春-嘉荫县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '8800', '重点', '6', '2600', '270', '筹划', '无', '', '', '嘉荫县人民政府', '高远', '13504573143', 'jingmaowei2622421@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '110', '嘉荫县是国家级生态示范区，土地肥沃无污染，现有大豆种植面积80万亩，总产量9万吨。其中，高蛋白大豆播种面积达50万亩以上，产量5.6万吨，达到绿色A级食品标准。规划建筑面积2.5万平方米，建设大豆精深加工生产车间、原料仓库1万平方米、成品仓库、辅助用房等，购置大豆精深加工设备，生产腐竹、豆皮、豆干等产品。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江嘉荫经济开发区', '24', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521191010626.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (260, '4072dc7a-9d71-11ea-8a5d-00ff338109dc', '工业大麻产业招商项目', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '农、林、牧、渔业', '第一产业', NULL, '独资', '15000万元（2315.25万美元）', '18000', '一般', '4', '5000', '500', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '90', '而我县部分合作社有工业大麻的种植经验，土壤、温度、湿度等环境适合大麻生长。2019年10月，我县与黑龙江神力生物科技有限公司就工业大麻种植项目进行洽谈合作，双方达成初步意向，种植工业大麻6000亩。随着大麻种植量的不断增加，工业大麻加工产业将拥有广阔的市场。规划建设主体工程4.2万平方米，包括生产车间、设备、办公楼、成品库房等。购置设备125台(套）。', '生物医药产业', '生物医药', '黑龙江富裕经济开发区', '22', '2020-06-04 13:59:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524114728084.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (261, '40c2c1f9-571f-11e8-a5b9-ac1f6b639ec0', '新型环保无火焰供热设备生产项目', '双鸭山', '岭东区', '双鸭山-岭东区', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '2000', '重点', '6.5', '300', '270', '筹划', '无', '', '', '岭东区经济合作交流中心', '于婷婷', '18249427333', 'ldqjjhzjlzx@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '20', '该项选址位于岭东区岭西地区，拟建设年产200台（套）精醇添加助燃剂产生热能的无火焰供热设备生产线及相关配套设施，生产的新型环保无火焰供热设备，主要应用于工厂、粮食加工烘干车间、旅游景区、乡村及其它非集中供热区域，该设备具有节能、环保、供热成本低的特点，市场前景广阔。', '新材料产业', '复合材料', '其它', '143', '2020-05-26 11:02:14', '');
