INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (263, '40f905dd-767d-11ea-b0bb-ac1f6b639ec0', '牡丹江市石墨烯产业园建设项目', '牡丹江', '市辖区', '牡丹江-市辖区', '采矿业', '第二产业', NULL, '独资', '520000万元（80262.0万美元）', '780000', '重点', '7', '78000', '25000', '筹划', '有', '', '', '牡丹江市经合局', '苏振林', '18746336699', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '400', '项目规划总占地300亩，主要致力打造围绕石墨精深加工为主体的研发、生产、应用的国际化产业园。\r\n一期（起步区）规划占地24亩，总投资10亿元，主要建设电池双极板项目、辅助电极项目、高纯石墨项目、高纯石墨烯粉体项目等4个石墨烯基础性项目。二期规划总占地约200亩，主要引进碳材料深加工项目，总投资30亿元，主要为年产12万吨锂电负极材料、总容量25GW新型动力储能装备及总容量5GW动力锂电池项目。三期规划总占地28亩，建设石墨烯材料研发中心，总投资12亿元。主要研究石墨烯对材料的改性，为生产提供技术支持。', '新材料产业', '石墨烯', '牡丹江经济技术开发区', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408161349588.doc');
