INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (265, '4176bac6-72f0-11ea-b0bb-ac1f6b639ec0', '佳木斯市对俄出口塑编产品加工基地项目', '佳木斯', '东风区', '佳木斯-东风区', '制造业', '第二产业', NULL, '独资', '45000万元（6945.75万美元）', '50000', '一般', '3', '15000', '8000', '筹划', '有', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '本项目是依托东风区在厂房、机械加工、水电气供应、技术工人、对外物流、外贸出口等方面的成熟配套体系，以及区内企业在塑编颗粒制造、产品编织等方面的成熟经验，吸引有意发展塑编产业的企业共同建设对俄出口塑编产品加工基地项目。本项目计划占地面积9.31万平方米，吸引塑编产业上下游企业10户，建设成东北地区最大的对俄出口塑编产品基地。', '现代商贸产业', '现代商贸', '佳木斯高新技术产业开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525104039217.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (266, '41a41170-804c-11ea-b0bb-ac1f6b639ec0', '牛乳加工制品', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '21000', '一般', '5', '3400', '300', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '50', '富裕县地处北纬47度世界黄金奶源带，素有“乳乡”之称，是中国北方畜牧业发展项目区。拟建占地面积5000平方米，年产9000吨乳清粉及3000吨奶酪项目，引进乳清粉加工设备、奶酪加工及包装设备。项目达成后，预计年可实现销售收入2.1亿元，利润3400万元。', '农业及农副产品精深加工产业', '乳品', '黑龙江富裕经济开发区', '24', '2020-06-04 14:05:32', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522153722597.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (267, '41fcb1db-8219-11eb-94a7-00ff338109dc', '北安市农副产品批发市场建设项目', '黑河', '北安市', '黑河-北安市', '租赁和商务服务业', '第三产业', NULL, '独资', '12000万元（1852.2万美元）', '5500', '一般', '8.5', '1400', '935', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '300', '北安市是一个以农业、畜牧业为主的新型现代化城市。是黑龙江省重要的农副产品生产及流通城市，地处黑龙江省北部区域中心，境内有滨北、齐北、北黑三条铁路干线，前嫩、吉黑、绥北三条高速公路和黑大、碾北两条国、省级公路干线在北安交汇，是我国最北部铁路公路交通运输枢纽。是黑河地区商品流通的必经中转站。其中农副产品流通辐射半径可达100公里，覆盖人口约300万人。每年经由北安市发往各地的农副产品流通量可达到54万吨。该项目占地面积6万㎡，总建筑面积4万㎡，其中物流综合楼1万㎡，生资市场交易区1.5万㎡，物流配送中心0.5万㎡，仓储库1万㎡。预计总投资1.2亿元。预计年销售收入可达5500万元。', '现代商贸产业', '现代商贸', '黑龙江北安经济开发区', '4', '2021-08-10 10:00:06', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (268, '424c9427-703a-11e8-b881-ac1f6b639ec0', '5万吨猪、牛骨工项目', '哈尔滨', '宾县', '哈尔滨-宾县', '农、林、牧、渔业', '第一产业', NULL, '独资', '12000万元（1852.2万美元）', '20000', '一般', '2', '5000', '1000', '筹划', '无', '', '', '宾西开发区招商局', '刘立巍', '13674509277', 'bxkfqzsj@163.com', '宾西开发区招商局', '孙悦', '13603612329', 'bxkfqzsj@163.com', '200', '主要建设1套日处理5t以上的鲜骨抽提取生产线，2套成套设备（碎骨机、CIP自动清洗系统、传送机等），1栋加工仓储冷库、办公楼及厂区附属设施。', '农业及农副产品精深加工产业', '肉制品加工', '宾西经济技术开发区', '204', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524095951546.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (269, '42a07c35-cf43-11eb-a12f-00ff338109dc', '年产10万吨腐竹生产基地项目', '黑河', '五大连池市', '黑河-五大连池市', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '85000', '重点', '6', '17000', '10000', '可研', '无', '', '', '五大连池农业农村局', '王珏睿', '15246969527', '390111731@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '2000', '项目投资估算10亿元。总建筑面积为396000平方米，该项目建成后，年消耗大豆15万吨，加工腐竹等豆制品产品10万吨，将为五大连池市当地提供就业岗位2000个。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江五大连池经济开发区', '2', '2021-08-06 16:06:12', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (270, '42b2d724-821a-11eb-94a7-00ff338109dc', '北安市年产3万吨天然苏打水生产项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '合资', '8000万元（1234.8万美元）', '12000', '一般', '3', '2800', '1500', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市位于哈尔滨、齐齐哈尔、伊春和黑河四座城市的中心。是我国最北部的交通枢纽，是由黑河通往俄罗斯及东欧国家旅贸大通道的必经中转站。在当地火山活动断裂带地下岩层上存在着大量的天然苏打水，此苏打水形成于一万年以前，PH值在7.6-8.5之间，呈弱碱性，水质清纯而浑厚，口感干裂而滑口，富含铁，硒等十七种有益于人体的微量元素，具有很强的医疗保健功能。目前北安市现有海圣海圣饮品有限公司已经建成年产5万吨天然苏打水厂，有4口取水井，并已注册苏式品牌，与中石油签订销售协议，国内重要城市及省内已建成20多个营销点。拟项目新增年产3万吨天然苏打水、苏打水饮料。项目占地4万平方米，建筑面积2万平方米。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江北安经济开发区', '3', '2021-08-10 09:59:30', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (271, '42c714f3-731a-11ea-b0bb-ac1f6b639ec0', '佳木斯市中俄果蔬冷链物流园区建设项目', '佳木斯', '郊区', '佳木斯-郊区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '32000万元（4939.2万美元）', '30000', '重点', '3.5', '8500', '2100', '筹划', '无', '', '', '佳木斯市郊区商务和经济合作局', '姜雪原', '18946430001', 'zsxxpt@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '项目占面积10万平方米，总建筑面积8万平方米。年周转果蔬100万吨，饮品、农副产品20万吨，水产、肉禽20万吨。主要建设高低温冷库、周转仓库、整理车间、电子商务信息交易中心及锅炉房、配电室、制冷间等。配套建设厂区道路、停车场、水电热冷管线、绿化、围墙及大门。购置安装制冷、加工及配套设备686台套；通过本项目的建设，有助于加快项目业主自身发展，促进当地冷链物流行业发展，彻底改变农产品冷链物流配送交易中心的落后局面。提高当地冷链物流行业发展水平，实现鲜活商品的深度开发和精度加工，提高商品档次，向市场经营延伸，将直接为鲜活商品有效供给提供有力保障，并可辐射带动周边地区的冷链物流发展。', '物流产业', '物流', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525143703678.docx');
