INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (282, '45c4dbe4-cf2e-11eb-a12f-00ff338109dc', '100万只/年大鹅养殖加工项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '20000', '一般', '3', '5000', '1000', '筹划', '无', '', '', '大同区农业农村局', '隗立福', '18603692840', '18603692840@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '建设种鹅场20个，每个种鹅场饲养优良种鹅2000只，建孵化车间3000平方米，购置孵化器20台，建饲料加工厂2处，建设大鹅屠宰加工车间3万平方米，安装屠杀生产线2条，熟食生产线4条，可实现年屠宰加工100万只大鹅的生产能力。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '5', '2021-08-10 09:45:42', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (283, '462cf254-755a-11ea-b0bb-ac1f6b639ec0', '牡丹江市西安区一次性环保餐具项目', '牡丹江', '西安区', '牡丹江-西安区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '13000', '重点', '5', '2000', '760', '筹划', '有', '', '', '西安区经合局', '王丽艳', '17758855770', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '一次性可降解的环保淀粉餐具，是一种新型的包装产业项目，其发展态势势在必行，必将取代原始发泡塑料一次性餐盒。发展前景巨大。\r\n企业生产技术具有国际领先技术，由国家科技部推进的高科技环保项目——稻壳制冷成型一次性环保餐具项目生产线。该公司建成的这条生产线，其生产原料利用农业废弃物（稻壳）制成一次性餐具。使用后又可和为饲料和肥料，达到改善生态环境的目的。\r\n项目初期计划总投资10000万元，厂房、办公及相关土建工程预计10000平方米，两条环保餐盒生产线。', '高端装备制造产业', '食品加工设备', '牡丹江经济技术开发区', '705', '2020-07-06 10:38:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522095653505.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (284, '464f9900-cbe0-11ea-9952-00ff338109dc', '秸秆打包机项目', '牡丹江', '西安区', '牡丹江-西安区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '6000', '一般', '10', '1000', '500', '筹划', '无', '', '', '牡丹江市西安区经合局', '王丽娟', '17758855770', 'xajhj@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '随着社会经济快速发展，秸秆的回收和再利用市发展循环经济、建设节约型社会的意向重要举措，促进了对秸秆打包、压缩处理相关设备的需求。玉米作为我市主要经济作物，产量较大，每年收获之后产生大量秸秆，主要解决方式为集体焚烧，即污染环境，又浪费资源。为妥善解决秸秆回收、运输、再利用问题，谋划该项目。占地面积2万平方米，年产牵引式秸秆打包机600台。主要建设电焊车间、组装车间、打磨车间、加工车间和办公楼，总建筑3.7万平方米。    ', '高端装备制造产业', '农机装备', '牡丹江经济技术开发区', '10', '2021-08-10 10:14:43', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200722135753667.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (285, '46508b90-7373-11e8-a795-ac1f6b639ec0', '哈尔滨赛飞亚大东北禽业合作项目', '哈尔滨', '通河县', '哈尔滨-通河县', '制造业', '第二产业', NULL, '合资', '9000万元（1389.15万美元）', '8000', '一般', '4', '2400', '1600', '筹划', '无', '', '', '通河县省级经济开发区', '祝嘉程', '13936356707', 'thgykfq@126.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '50', '项目位于哈尔滨市通河县，哈尔滨赛飞亚大东北公司是内蒙古赛飞亚科技发展股份有限公司的全资子公司，公司注册资本1亿元。现已建成办公室、屠宰加工及冷冻房等各类配套设施，完全具备白羽鸡、樱桃谷肉鸭工厂化养殖及精深加工的良好基础，现寻求投资合作伙伴，开展业务合作，扩大产能，开拓市场。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江通河经济开发区', '185', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524215547776.docx');
