INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (287, '46b1e93d-77db-11ea-b0bb-ac1f6b639ec0', '牡丹江市增强现实（AR）项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '40000', '重点', '8', '6000', '2200', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '项目属于相关制造业，投资项目对其生产工艺流程、设施布置等都有较为严格的标准化要求，牡丹江市拥有充足的土地资源和人才资源，有利于增强现实（AR）项目的充分发展。\r\n项目用地规模为2.5万平方米，固定资产投资强度3000元/平方米。\r\n项目主要建设研发中心、推广中心和实验室，专注于分析增强现实的制作流程规范从搜集资料到输出发布成APP，重点研究3D模型和界面交互部分的制作流程，达到推广使用并盈利的阶段。', '新一代信息技术产业', '新一代信息技术', '牡丹江经济技术开发区', '18', '2020-05-29 16:33:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521135920677.doc');
