INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (291, '47ef3a2c-759e-11ea-b0bb-ac1f6b639ec0', '工业大麻种植、提取全产业链项目', '七台河', '市辖区', '七台河-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '67500', '重点', '1', '20250', '6000', '筹划', '无', '', '', '七台河经济开发区投资合作促进局', '赵  鹏', '19104648444', 'kfqtzhzcj@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '项目建设内容：\r\n1、年提取135吨工业大麻花叶生产车间；\r\n2、工业大麻种植园区，其中包含智能日光温室、普通种植大棚、育苗温室等；\r\n3、生产辅助用房：办公楼、科研楼（包含质检、试验检验等）、宿舍楼、食堂、门卫房、生产辅助用库房、生产辅助用动力中心（包含污水处理、蒸汽换热、消防水系统、动力电系统等）等辅助用房；\r\n4、厂区道路、厂区景观小品、厂区绿化、厂区围墙等。', '中医药产业', '中医药', '黑龙江七台河经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521125004236.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (292, '4866a182-63ed-11e8-aaec-ac1f6b639ec0', '京旗文化及朝鲜族风情村建设项目', '哈尔滨', '五常市', '哈尔滨-五常市', '租赁和商务服务业', '第三产业', NULL, '独资', '12000万元（1852.2万美元）', '6000', '重点', '5.5', '1800', '150', '筹划', '无', '', '', '五常市商务局', '王晓华', '19903611199', 'zhaoshangjuxmb@126.com', '五常市商务局', '王秀君', '15046037557', 'wuchangzsj@126.com', '100', '项目建设地点在哈尔滨市五常市，拟建设京旗博物馆、关帝庙、宣化上人故居、副都统衙门、京旗风情村及朝鲜族风情村等。五常市旅游资源极其丰富，自然景观独具特色。秀丽奇特的青山碧水和历史悠久的满族京旗文化及远近闻名的佛教圣地吸引着众多海内外游客。京旗文化是黑龙江满族文化的一个重要类型，拉林镇是京旗文化的摇篮，哈尔滨市委、市政府的相关文件已经把京旗文化列为哈尔滨特色文化的类型之一，京旗文化的旅游开发已经列入我省及哈尔滨市、五常市的旅游规划当中。', '旅游产业', '旅游', '其它', '118', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525101456896.docx');
