INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (297, '4902f831-74e2-11ea-b0bb-ac1f6b639ec0', '有色金属项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '合资', '3000万元（463.05万美元）', '3000', '一般', '4', '720', '360', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '该项目位于石油大道88号，黑龙江循环利用产业园区内，占地24500平方米，厂房均有园区统一建设，项目入驻即开工，重点围绕有色金属铜、铝、锌及贵金属循环利用的工艺和装备，包括各种二次资源，如废旧汽车、各类电池、家电、包装材料等以及这些资源的收集、解析、分类、分离、处理和回收利用。', '有色金属精深加工产业', '金属精深加工', '其它', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522080503338.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (298, '49509d27-7264-11ea-b0bb-ac1f6b639ec0', '佳木斯市年处理秸杆10万吨造纸项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '32000万元（4939.2万美元）', '31500', '一般', '8', '4000', '1200', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '400', '项目建设地点富锦市经开区，享受省级开发区优惠政策。占地面积15公顷。建设内容，年处理秸杆10万吨，年生产各种包装用纸和地膜纸9万吨。资源优势，富锦地势平坦，适合秋季秸杆机械大规模作业。由于本地气候特点，秸杆便于收储保管。富锦年际间产秸杆300多万吨，可为秸杆综合利用提供充足的原料。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '节能环保产业', '秸秆综合利用', '黑龙江富锦经济开发区', '6', '2021-08-11 11:34:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707105852662.docx');
