INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (302, '4ab6c742-5283-11e8-ba35-ac1f6b639ec0', '杂粮深加工项目', '双鸭山', '市辖区', '双鸭山-市辖区', '制造业', '第二产业', NULL, '独资', '16600万元（2562.21万美元）', '10000', '重点', '7', '2730', '2210', '筹划', '无', '', '', '双鸭山经济技术开发区', '陈迎迎', '15145904789', '55064375@qq.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '80', '杂粮是一种天然优质的绿色食品，富含膳食纤维、多种维生素等有利于人体健康的营养成份，消费市场前景广阔。该项目依托农场杂粮资源，通过延长有机杂粮种植和加工产业链条，实现杂粮生产、加工和销售一条龙，项目达产后实现年产10000吨/年综合杂粮、25000吨/年婴儿、老年、高端杂粮、10000吨/年有机杂粮蔬果、5000吨/年本草养生食品。', '农业及农副产品精深加工产业', '果蔬加工', '双鸭山经济技术开发区', '201', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (303, '4b223752-75a8-11ea-b0bb-ac1f6b639ec0', '温泉度假酒店项目', '七台河', '市辖区', '七台河-市辖区', '住宿和餐饮业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '1000', '一般', '15', '300', '100', '筹划', '无', '', '', '七台河开发区金沙实业公司发展战略部', '段红亮', '18346460010', 'kfqtzhzcj@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '200', '第一年完成项目所需前期手续包括土地整理等；第二年完成景区基础配套设施工作，围墙、绿化及地下管渠道建设整治，区内各场馆间道路，停车场，电力设施，供排水设施，消防设施，电信宽带设施、河道环境整治、森林生态游区盘山游步道、生态公厕所、管理用房等；第三年完成游赏接待设施建设，包括入口景门、广场、温泉山庄、游乐设施、景区温泉游泳馆、温泉水上娱乐中心等。', '旅游产业', '旅游', '黑龙江七台河经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522164256109.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (304, '4cc2a4c2-8230-11ea-b0bb-ac1f6b639ec0', '呼中区偃松籽加工项目', '大兴安岭', '塔河县', '大兴安岭-塔河县', '农、林、牧、渔业', '第一产业', NULL, '独资', '1250万元（192.94万美元）', '3700', '重点', '3.5', '400', '120', '筹划', '无', '', '', '呼中区农业农村局', '王志光', '13359625599', 'gw_hzqswj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '偃松属松科，分析结果表明，偃松油脂含量高达71%，油脂中不饱和脂肪酸含量在90%以上，其中包括亚油酸和花生四烯酸等多种不饱和脂肪酸，易为人体吸收利用，对降低血液中胆固醇含量、防止动脉硬化、降血脂、降血压具有独到的功效。在呼中自然保护以及其周边的新林林业局所属林区内，野生的偃松林面积广阔，据不完全统计，年产偃松籽量可达4000～5000吨。项目将充分利用资源优势，拟建设一个具有产加工能力1000 吨偃松系列产品的加工生产车间。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525143802359.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (305, '4d5cd8d4-82d4-11eb-94a7-00ff338109dc', '黑河自贸片区烘焙食品加工项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '合资', '1000万元（154.35万美元）', '2000', '一般', '4.5', '300', '200', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '黑河地处世界三大黑土带之一，黑河市是国家重要商品粮基地和绿色食品主产区，域内总耕地面积约2800万亩，粮食产量达103.5亿斤，是非转基因大豆、强筋春小麦、高品质专用玉米的重要产区，被农业农村部确定为全国绿色高质高效创建示范市。黑河地区是全省优质强筋小麦的最佳种植区，2020年全市小麦种植面积39万亩，占全省的67.8%。黑河小麦具有籽粒硬质、蛋白质含量和湿面筋含量高，面筋强度强，面团稳定时间较长，延伸性好的特点。且黑河市毗连俄罗斯，俄罗斯丰富的农业资源是中俄合作的重要领域。黑龙江温馨食品有限公司对外投资2家公司，在黑河有22处门店，拟与黑龙江温馨食品有限公司合作在二公河园区租赁标准化厂房。', '现代商贸产业', '现代商贸', '黑河边境经济合作区', '0', '2021-08-10 09:55:11', '');
