INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (317, '4fd81328-7330-11ea-b0bb-ac1f6b639ec0', '青冈县鲜食玉米深加工项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '一般', '2', '5000', '1000', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '100', '青冈县位于世界三大黑土带之一的松辽流域黑土带的核心区，早晚温差大，鲜食玉米品质优良，2019年第31届中国鲜食玉米、速冻果蔬大会在青冈召开，“青冈玉米糯又甜”得到人民广泛认可。被中国鲜食玉米、速冻果蔬大会授予“全国中高端鲜食玉米生产示范基地”，被阿里巴巴集团授予“天猫•青冈--黑龙江鲜食玉米正宗原产地，近年来，青冈县鲜食玉米产业发展迅速，以速冻加工为主，整个产业处于蓬勃发展期。国内大中城市鲜苞消费市场还未充分开发，甜玉米汁、罐头、速冻甜玉米粒等加工产品较少，速冻鲜食玉米粒储存、使用方便，市场开拓潜力巨大。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江青冈经济开发区', '16', '2020-05-31 22:42:59', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521132827747.doc');
