INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (322, '50e55f94-8212-11eb-94a7-00ff338109dc', '北安市年产10万吨玉米饲料项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '8000万元（1234.8万美元）', '22000', '一般', '5', '1500', '500', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '80', '北安市地域广阔，生态优良，土地肥沃，拥有草原136万亩，具有丰富的畜牧业养殖资源。市域内奶牛存栏2.3万头，肉牛存栏2.7万头，生猪存栏7.1万头，目前北安市即将新建规模为2万头肉牛的饲养基地一座，完达山乳业也将建设饲养规模为2万头奶牛的奶制品加工厂一座，未来北安市奶牛存栏量将达到4.3万头，肉牛存栏量4.7万头，生猪存栏量7.1万头。以北安市为中心100公里范围内均是玉米主产区与养殖业的主要饲养区，通过优越的地理位置将大大降低物流成本，提高企业竞争力，获取更高的利润。随着北安市及周边地区养殖业的快速发展，必将给饲料行业带来广阔的市场空间。本项目占地面积4万平方米，建筑面积2.5万平方米。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江北安经济开发区', '7', '2021-08-10 10:04:44', '');
