INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (331, '53255afb-6efd-11ea-b0bb-ac1f6b639ec0', '孙吴县汉麻生物脱胶建设项目', '黑河', '孙吴县', '黑河-孙吴县', '制造业', '第二产业', NULL, '独资', '6500万元（1003.27万美元）', '20580', '重点', '1', '5500', '1905.81', '筹划', '无', '', '', '黑河市孙吴县经济合作发展中心', '赵义友', '13329466003', '8422728@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '60', '汉麻纤维的排湿性是纯棉的3倍，可在1小时内将附着的细菌杀灭；汉麻织物可屏蔽95%以上的紫外线，具有极佳的透气性、耐热性、阻燃性和防紫外线性能。孙吴县地处小兴安岭山脉，气候特点非常适合汉麻日晒夜露，露浸脱胶，较之于其他地区日夜干旱无法露浸或连续阴雨发酵过度具有明显优势。孙吴县仅第五、六积温带就有近百万亩耕地适于种植汉麻，可充分利用汉麻生长期短优势，获得相对较高的经济效益，也可保证汉麻连续种植两年以上调茬的需要。项目建设规模为年加工汉麻原麻9500吨，年产汉麻精干麻5000吨，总投资6500万元，年实现销售收入20580万元，具有良好的经济经济效益。', '新材料产业', '复合材料', '黑龙江孙吴经济开发区', '3', '2021-08-06 16:24:43', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204601903.docx');
