INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (336, '54b9e3f7-736d-11e8-a795-ac1f6b639ec0', '沼渣纤维基地膜技术产业化项目', '哈尔滨', '通河县', '哈尔滨-通河县', '制造业', '第二产业', NULL, '合资', '5000万元（771.75万美元）', '7000', '一般', '3', '2100', '1400', '筹划', '无', '', '', '通河县能源办公室', '明月', '15045499877', 'mingyue99877@126.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '40', '项目建设地点在哈尔滨市通河县，占地面积10万平方米。县域水田160万亩，年产水稻秸秆80万吨，原料充足。拟建设加工车间、办公楼、仓储、等。该项目建成后将为生态农业和循环农业提供技术支撑和物质保障，生产的沼渣纤维基地膜，可用于覆盖周围200万亩水稻田，市场前景广阔。项目建成后，可年产沼气1000万立方米、沼渣纤维基底膜10万吨。', '新材料产业', '复合材料', '黑龙江通河经济开发区', '133', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524205249951.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (337, '550db333-c4d0-11ea-a922-00ff338109dc', '年产5万吨三元乙丙橡胶项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '80000万元（12348.0万美元）', '850000', '重点', '7', '12200', '16900', '筹划', '无', '', '', '大庆高新区石化产业促进中心', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '三元乙丙橡胶在汽车配件、电线电缆、建材等方面具有一定发展潜力，目前国内供应还存在一定缺口。北地区目前还没有三元乙丙橡胶的生产企业，未来黑龙江省在建材、汽车工业的发展均存在大量需求。乙丙橡胶与硅橡胶、氟橡胶等特种橡胶相比，又具有较好的物理、机械加工性能。主要应用于建筑、电线电缆、汽车工业等领域。2021-2025年间，我国三元乙丙橡胶的需求增速将保持在5%左右，预计2025年消费量将达到约52万吨。本项目利用大庆地区乙烯、丙烯等原料发展中高端三元乙丙橡胶，可增加国内相应产品自给率，还能提高资源的本地深加工水平，供应当地汽车工业及高性能建材产业发展。', '石化产业', '其它', '大庆高新技术产业开发区', '2', '2021-08-10 10:16:18', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200713142123578.docx');
