INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (342, '56ca7eb0-7393-11e8-a795-ac1f6b639ec0', '安达市年产1万吨丁基橡胶项目', '绥化', '安达市', '绥化-安达市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '25000', '重点', '5', '4000', '1000', '筹划', '无', '', '', '安达市招商办公室', '郑楠', '13946990006', 'adzsbgs@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '80', '丁基橡胶是合成橡胶的一种，主要用作各种轮胎的内胎、无内胎轮胎的气密层、各种密封垫圈，在化学工业中作盛放腐蚀性液体容器的衬里、管道和输送带，农业上用作防水材料。2018年底国内丁基橡胶市场需求量约为40万吨，自给率仅为1/3，多数为国外进口，产品市场供不应求。安达市毗邻大庆，既有原料优势，又有下游工业需求，市场前景可观。该项目拟占地5万平方米，主要建设丁基橡胶厂房、生产线2条、办公楼及其他附属设施。', '新材料产业', '复合材料', '黑龙江安达经济开发区', '128', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (343, '56eda76e-63ea-11e8-aaec-ac1f6b639ec0', '年产25万吨饮用水项目', '哈尔滨', '五常市', '哈尔滨-五常市', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '9000', '重点', '5', '2600', '700', '筹划', '无', '', '', '五常市商务局', '王晓华', '19903611199', 'wuchangzsj@126.com', '五常市商务局', '王秀君', '15046037557', 'wuchangzsj@126.com', '150', '项目建设地点在哈尔滨市五常市,占地面积3万平方米。五常市大小河流297条，自然泡沼400多个，矿泉水达到国家级标准的有10余处，原料充足。拟建设办公楼、生产车间、库房等，新上矿泉水生产线2条。五常市矿泉水属微碱性，有利于维持正常的渗透压和酸碱平衡，促进新陈代谢，市场前景广阔。项目达产后，可年产矿泉水25万吨。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江五常经济开发区', '209', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (344, '5729e016-8516-11ea-b0bb-ac1f6b639ec0', '日处理鲜奶600吨乳品深加工项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '8500万元（1311.97万美元）', '37845', '一般', '6', '1500', '858', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '2019年全球牛奶产量5.23亿吨，相比2018年的5.18亿吨，提高了0.96%。2019年全球牛奶消费量1.88亿吨，相比2018年的1.87亿吨，提高了0.56%。根据农业农村部等九个部门2018年12月联合印发的《关于进一步促进奶业振兴的若干意见》，力争到2025年全国奶类产量达到4500万吨。给奶业振兴行动提供新的增长机会。\r\n目前蒙牛已落户大庆经开区，经开区农业公司已与相关企业合作建设标准化牧场，为项目建设提供充足奶源。\r\n项目总投资8500万元。工厂项目占地面积2万平方米，包括综合办公楼、联合生产车间、原辅料库、动力车间、制冷站、污水处理等设施。生产奶粉、奶酪、干酪素等乳制品。', '农业及农副产品精深加工产业', '乳品', '大庆经济技术开发区', '9', '2020-05-30 16:32:24', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154526818.docx');
