INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (347, '57938927-9e5c-11ea-8a5d-00ff338109dc', '翠河湾漂流度假山庄建设项目', '伊春', '大箐山县', '伊春-大箐山县', '住宿和餐饮业', '第三产业', NULL, '合作', '3000万元（463.05万美元）', '1200', '重点', '10', '300', '20', '筹划', '无', '', '', '大箐山县发展和改革局', '李庭海', '13846604823', '1006475903@qq.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '20', '架设横跨永翠河徒步索道，连接山庄漂流码头和对面原始森林，建设森林小屋、摄影观景长廊、建造兴安杜鹃观景台；扩建艺术绘画长廊，打造知名大自然艺术写生基地；扩展水面，建造大型垂钓场，开展冬季垂钓和冬游项目；利用闲置土地建造山庄绿色有机蔬菜和瓜果采摘园。', '旅游产业', '旅游', '其它', '27', '2020-05-31 22:30:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525155003149.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (348, '57aebca6-b006-11e8-8e63-ac1f6b639ec0', '北安市年加工大豆15万吨项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '191050', '重点', '2', '23434', '15000', '筹划', '无', '', '', '北安市招商服务中心', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '北安市地域广阔，土地肥沃，雨水充沛，自然条件优越，北安市域内现有耕地516万亩。绿色无公害基地面积占总耕地面积的50%以上，是国家级生态示范区和全国绿色食品大豆原料标准化生产基地。每年大豆产量达到100万吨以上。拟建项目采用低温豆粕的获取采用AB筒脱溶技术。大豆分离蛋白采用业内成熟的“碱溶酸沉”法，采用具有世界先进水平的引进设备，达到日处理大豆500吨，年加工大豆能力15万吨，主要生产精选大豆1.5万吨、高温粕2.5万吨、一级大豆油2万吨、大豆分离蛋白1.5万吨、醇法大豆浓缩蛋白1万吨、脱脂大豆蛋白粉1万吨、大豆组织蛋白1万吨及副产品3.7万吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江北安经济开发区', '64', '2021-08-06 16:22:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200319095055066.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (349, '57b0d723-73b2-11ea-b0bb-ac1f6b639ec0', '北安市玉米浸泡水深加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '10596.25万元（1635.53万美元）', '13256.88', '重点', '3.99', '3787.68', '946.92', '筹划', '无', '', '', '北安市招商服务中心', '韩国峰', '13846366020', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '70', '玉米浸泡水中蛋白质含量约为3%，植酸含量为0.8%,可以提取肌醇，也可以制取蛋白饲料，可以变废为宝，经济效益可观。北安象屿金谷生化科技有限公司玉米深加工生产过程中，每天产生玉米浸泡水1500吨，原料有保障。项目在北安健康产业园内建设，占地面积3万平方米，建筑面积3.2万平方米。项目总投资10596.25万元，项目建成后，每年可实现营业收入11084.5万元，所得税946.92万元，利润总额3787.68万元，投资回收期3.99年。\r\n\r\n', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江北安经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401084920333.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (350, '57db265a-6e0b-11e8-b8c9-ac1f6b639ec0', '尚志市玉米深加工项目', '哈尔滨', '尚志市', '哈尔滨-尚志市', '制造业', '第二产业', NULL, '合资', '29000万元（4476.15万美元）', '23000', '一般', '5', '6000', '1900', '筹划', '无', '', '', '尚志市商务局', '闫宏伟', '13136658887', 'w53343231@163.com', '尚志市商务局', '孙玉龙', '15084697345', 'w53343231@163.com', '50', '项目建设地点在尚志市开发区，占地面积5万平方米，建筑面积2.5万平方米。尚志市玉米种植面积5.4万公顷，总产量56.9万吨，相邻的县市玉米产量近百万吨，原料充足。拟建设玉米化验室、生产车间、办公楼等，购置生产线。玉米糖浆广泛应用于酿酒，食品等领域，国内外市场需求量较大，市场前景广阔。项目建成后，可年产商品淀粉27万吨、结晶葡萄糖20万吨、啤酒专用糖浆10万吨。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江尚志经济开发区', '213', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200324094928852.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (351, '58b49e44-74c7-11ea-b0bb-ac1f6b639ec0', '大豆深加工', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '6100万元（941.53万美元）', '19800', '一般', '3', '2660', '1300', '筹划', '无', '', '', '勃利县经济合作促进局', '杨春梅', '13846433024', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '本项目生产大豆分离蛋白、大豆粉末磷脂、色拉油、一级大豆油、饲料豆粕。该项目使用的的主要原料是大豆及大豆加工剩余的豆粕和油脚，大豆分离蛋白是是从大豆浸出豆油后的低温豆粕中提取的；大豆磷脂产品是从大豆浸废料中提取的，通过深加工、再加工和高科技手段来达到变废为宝、增加经济附加值和经济效益。建设内容：新建年加工大豆3万吨生产线，包括大豆调和油、大豆蛋白各类产品生产线等四大类9种产品', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江勃利经济开发区', '22', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522175339450.docx');
