INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (353, '59a56563-5266-11e8-ba35-ac1f6b639ec0', '高纯石墨深加工项目', '鹤岗', '兴安区', '鹤岗-兴安区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '35200', '重点', '5', '10000', '3000', '筹划', '无', '', '', '兴安区人民政府', '乔坤', '13329589991', 'xinganzhaoshang@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '200', '项目建设地点位于鹤岗市兴安区，占地面积4万平方米，其中建筑面积2万平方米。鹤岗市萝北县石墨采矿能力可达年400万吨，选矿35万吨，依靠鹤岗市丰富的石墨资源，项目采用高温提纯法，年产球形石墨6万吨，购置生产与检测设备200套，并配套相关辅助工程。', '新材料产业', '石墨', '黑龙江鹤岗经济开发区', '49', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (354, '59b702c4-7587-11ea-b0bb-ac1f6b639ec0', '牡丹江市阳明区爱河物流园项目', '牡丹江', '阳明区', '牡丹江-阳明区', '交通运输、仓储和邮政业', '第三产业', NULL, '合作', '50000万元（7717.5万美元）', '20000', '重点', '12.5', '4000', '1500', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '阳明区在东北亚区域产业布局和哈牡绥东对俄进出口加工带中凸显商贸物流核心区功能，成为立足牡丹江，服务黑龙江东部地区、吉林南部地区，辐射俄罗斯远东乃至东北亚区域的物资集散地和物流中心。\r\n项目占地22万平方米，建筑面积 15万平方米。\r\n利用牡丹江市原爱河火车站铁路基础和专用线，建设钢材、石材、建材、木材、农机、工业生产资料、汽车及配件等大宗物品区域物流集散中心，主要建设陆铁联运、物流仓储、堆场、加工配载配送、商务交易服务、综合管理和交通物流公共信息平台等基础性服务功能区。同时配套建设水、电、气等基础设施。\r\n', '物流产业', '物流', '黑龙江阳明经济开发区', '13', '2020-05-29 15:38:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521163302579.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (355, '5a0fb504-6ca8-11ea-b0bb-ac1f6b639ec0', '阿什河左岸--1905时尚文化产业园', '哈尔滨', '阿城区', '哈尔滨-阿城区', '租赁和商务服务业', '第三产业', NULL, '独资', '80600万元（12440.61万美元）', '200000', '重点', '4', '30000', '10000', '可研', '有', '', '', '阿城区企业和投资服务局', '杜进军', '13703678853', 'aczsyz@163.com', '阿城区企业和投资服务局', '郜效岩', '13936368827', 'aczsyz@163.com', '5000', '本项目引入文化创意+会展经济+旅游度假+休闲娱乐四种产业组合的全新业态，层次丰富、形式多样，构建起产业聚集性质的多元文化创意综合产业。阿城是大金帝国的开国都城金上京之所在，也是满族先世---女真人的肇兴之地。为中国北方著名的四大古都之一，是当时东北亚的政治、经济、军事、文化中心，有着“东方之珠”的美誉。总用地面积15万平方米（东区9万平方米、西区6万平方米）。文化建筑修缮面积13300平方米、道路面积30000平方米、绿化面积45000平方米、绿地率30%、广场停车场面积18000平方米，建设期2年。', '旅游产业', '旅游', '其它', '104', '2020-06-03 14:09:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200601093612289.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (356, '5a33c34e-846d-11ea-b0bb-ac1f6b639ec0', '和牛饲养及屠宰加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '20000', '一般', '7', '3000', '1500', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '和牛肉作为顶级食材，以“入口即化”“鲜嫩多汁”“雪花肉”闻名遐迩。近年来和牛产业在全球不断延伸拓展，未来我国的牛肉消费增速是空前巨大的，作为高端牛肉代表，其优质的口感，和蕴含的饮食文化，一直被海内外食客所津津乐道，未来国内外和牛肉将有很大的市场空间。项目采用龙头企业+合作社+基地+养殖户的农业产业化发展模式，引导企业开发系列深加工产品，积极扩大绿色肉类加工规模。\r\n项目占地12.9万平方米，建筑面积1.88万平方米，主要建设生产车间9500平方米，成品库6700平方米，办公区及生活区2600平方米，新上屠宰加工生产线1条 ，配套建设饲料厂区给水、污水处理、排水、采暖、消防、道路、绿化等附属设施。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江杜尔伯特经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151856224.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (357, '5a84c296-9e63-11ea-8a5d-00ff338109dc', '汤旺县石林民俗体验文化小镇项目', '伊春', '汤旺县', '伊春-汤旺县', '租赁和商务服务业', '第三产业', NULL, '合资', '12000万元（1852.2万美元）', '4000', '重点', '10', '1200', '240', '筹划', '无', '', '', '汤旺县招商局', '李胜坤', '13796519091', 'yczsb2011@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '230', '拟建集民俗民宿、农家餐饮、娱乐购物、自驾车营地、冬季极寒体验、冰雪游园于一体的民俗文化体验小镇，总占地面积约20万平方米。', '旅游产业', '旅游', '其它', '22', '2020-05-31 22:29:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525164014564.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (358, '5aa34275-9494-11e8-8e63-ac1f6b639ec0', '30万吨粮食深加工项目', '齐齐哈尔', '富拉尔基区', '齐齐哈尔-富拉尔基区', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '136000', '一般', '5', '25000', '3000', '筹划', '无', '', '', '富拉尔基区经济合作促进局', '赵勇', '04526853535', 'flejzsj@163.com', '齐齐哈尔市经济合作促进局', '宋照亮', '18604523993', 'jhjzsb@163.com', '500', '项目建设地点在富拉尔基区开发区，占地面积5万平方米，建筑面积7万平方米，拟建设加工车间、办公楼、研发中心和仓储库等基础设施。达到年加工水稻、玉米、杂粮杂豆等粮食30万吨以上能力。富拉尔基经济开发区内有哈尔滨谷物交易所（10万吨杂粮、30万吨水稻、200万吨仓储物流）；厦门象屿集团（200万吨粮食贸易物流项目）；黑龙江和美泰富有限公司（水稻收储能力30余万吨，玉米收储20余万吨 ）；龙盐齐齐哈尔盐业有限公司（50万吨粮食仓储）等多家粮食仓储企业，同时富拉尔基地理位置优越，周边辐射龙江县、甘南县、泰来县等农业大县，粮源充足，富拉尔基工业基础雄厚、交通便利,因此发展粮食深加工项目市场潜力巨大。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江富拉尔基经济开发区', '173', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522143407865.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (359, '5b247039-7313-11ea-b0bb-ac1f6b639ec0', '佳木斯市文娱综合体项目', '佳木斯', '向阳区', '佳木斯-向阳区', '其他', '第三产业', NULL, '独资', '300000万元（46305.0万美元）', '200000', '一般', '15', '20000', '8000', '筹划', '无', '', '', '佳木斯市向阳区商务和经济合作局', '刘汉彬', '18904546633', 'jmsxyqjhj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '800', '项目拟选址佳木斯大学南侧、学府街路西地段。项目计划占地面积26万平方米，建筑面积50万平方米。建设内容为大型儿童娱乐城，室内游泳馆、篮球、排球、网球、羽毛球、乒乓球等场地，室内健身瑜伽馆、演艺城、民俗馆、特色纪念品馆等，同时配建高档住宅及临街商业。项目所处地段，地势平坦，交通便利，属商业用地，项目建设及拓展基本有保障。项目建设的给水、排水、供电、供热、通讯等基础设施能够保障项目顺利建设。', '文化创意产业', '文化创意', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522190106926.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (360, '5b914b6f-807c-11ea-b0bb-ac1f6b639ec0', '玉米饮料项目', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '30000', '一般', '3', '6000', '2000', '筹划', '无', '', '', '齐齐哈尔市龙江县经合局', '王晓玲', '15663228616', 'ljxjhj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '30', '引进国内外先进生产工艺和设备，建设年加工玉米8万吨、年产澄清型玉米汁饮料40万吨生产线及配套设施。玉米汁饮料含人体所需的各种糖、氨基酸、维生素、微量元素等营养成分，是新一代绿色健康饮品，市场前景良好。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江龙江经济开发区', '14', '2020-06-04 13:58:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524133101344.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (361, '5bb79f51-79fd-11ea-b0bb-ac1f6b639ec0', '牡丹江市VR产业园项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '合资', '500000万元（77175.0万美元）', '300000', '重点', '11', '45000', '17000', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1000', 'VR产业园项目计划依托企业在VR领域的引领带动、资源整合的核心优势，打造VR产业聚集区和VR体验区两大组团。\r\nVR产业园拟建14栋楼宇，共计6万平米的产业空间，将VR产业园打造成为黑龙江域内最大的VR产业基地。\r\nVR产业园主要建设两大模块：\r\n一期计划设立研发设计中心、装备制造中心、内容制作中心、产业孵化中心等，吸引行业企业入驻，形成产业聚集。通过动漫学院“产学融合”育才模式，培养应用型高科技人才。\r\n二期计划建设VR体验区，实现线上线下相结合的用户体验，打造VR应用体验新时代。', '新一代信息技术产业', '新一代信息技术', '牡丹江经济技术开发区', '47', '2020-05-29 16:35:18', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200409085926038.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (362, '5c7d6332-7283-11ea-b0bb-ac1f6b639ec0', '年产2.5万吨有机大米项目', '绥化', '海伦市', '绥化-海伦市', '制造业', '第二产业', NULL, '其他', '3800万元（586.53万美元）', '10000', '重点', '3.5', '900', '200', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '60', '有机食品也叫生态或生物食品，是目前国际上对无污染天然食品比较统一的提法。海伦市年水稻种植面积80万亩，总产40万吨，其中高品质的富锌富硒大米产量较高。该项目依托海伦市得天独厚的资源优势和地域优势，围绕优质富硒水稻生产基地建设，搞好有机大米的精加工，提高种植优质水稻的经济效益。该项目计划占地面积20,000平方米，总建筑面积15,000平方米，拟建规模为年生产有机大米2.5万吨。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江海伦经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521190616431.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (363, '5cd43d62-5199-11e8-ba35-ac1f6b639ec0', '年产30万吨玉米深加工产品项目', '双鸭山', '友谊县', '双鸭山-友谊县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '15000', '重点', '6', '4500', '1400', '筹划', '无', '', '', '友谊县农业局', '吕东旺', '13946652769', 'yyzhaoshangju@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '100', '友谊县玉米资源丰富，该项目拟在友谊县内利用资源优势建设年产10.28万吨淀粉（高麦芽糖浆）、10万吨淀粉糖浆等产品为主，年产7800吨玉米色拉油、1.74万吨玉米胚芽粕、1.86万吨玉米黄粉、4.84万吨玉米纤维渣等产品为辅的生产线，形成玉米综合加工产业链，达到充分、合理利用玉米，满足市场对玉米淀粉和淀粉糖浆需求的同时带动当地农产品加工相关行业的发展。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江友谊经济开发区', '211', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (364, '5cd99144-7285-11ea-b0bb-ac1f6b639ec0', '海伦剪纸文化园建设项目', '绥化', '海伦市', '绥化-海伦市', '其他', '第三产业', NULL, '独资', '4000万元（617.4万美元）', '8000', '重点', '3.8', '1100', '400', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '30', '剪纸艺术是汉族传统的民间工艺，是中华民间艺术中的瑰宝。海伦剪纸工艺流传甚为广泛，有着雄厚的群众基础和显著的艺术成果，投资优势明显。项目拟建成集剪纸的推广、策划、加工、销售为一体的剪纸文化园一座，使其成为全国最大的剪纸加工基地。项目计划占地面积15,000平方米，总建筑面积10,000平方。主要建设剪纸会展中心、策划推广宣传中心、加工销售中心、附属设施等。', '旅游产业', '旅游', '黑龙江海伦经济开发区', '19', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521192233440.doc');
