INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (369, '5dd36fa9-7d57-11e9-815b-ac1f6b639ec0', '碎米精深加工项目', '哈尔滨', '五常市', '哈尔滨-五常市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '18000', '一般', '4', '5220', '887.4', '筹划', '无', '', '', '五常市商务局', '王晓华', '19903611199', 'zhaoshangjuxmb@126.com', '五常市商务局', '王秀君', '15046037557', 'zhaoshangjuxmb@126.com', '100', '项目建设地点在哈尔滨市五常市， 规划占地面积18000㎡，拟建设碎米精深加工厂一座，包括碎米加工主体车间1座，库房3座，建设供电、供水、供热等生产运转环节，及水处理、化验室、计量、厂区道路、办公楼、绿化等设施。在国内碎米精深加工市场前景广阔,很多米厂对稻谷加工过程中产生的碎米,通常用作饲料,其经济价值比整粒米低30%~50%,碎米的深加工还尚未得到很好地开发利用，这也说明碎米在米厂的合理利用具有良好的前景和经济效益,值得推广应用，碎米精深加工项目属于新兴行业，利用碎米精深加工生产的大米蛋白粉、淀粉糖浆，能大大增加稻米的附加值，是循环经济行业，发展空间广阔。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '22', '2020-05-26 11:02:14', '');
