INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (372, '5e09947a-c7fa-11ea-8088-00ff338109dc', '牡丹江市横道河子俄罗斯风情小镇旅游开发项目', '牡丹江', '海林市', '牡丹江-海林市', '租赁和商务服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '20000', '一般', '10', '2000', '1000', '筹划', '无', '', '', '海林经合局', '王鑫', '18645259766', 'hlzsj@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '1000', '横道河子镇是一座百年古镇，有1901年至1905年建成的俄式风格建筑近200栋，有着悠久的历史和上世纪的俄国文化脉络。横道河子镇是黑龙江省中东铁路沿线历史遗存保留最完整的小镇。不仅有北国风情，更具欧陆风光，是俄罗斯建筑和中东铁路的交叉产物，是中俄文化相互浸染的结晶。\r\n1.1.2市场前景分析\r\n横道河子俄罗斯风情小镇旅游景区是国家AAAA级旅游景区。景区位于横道河子镇域内，景区景点覆盖全镇。横道河子镇，始建于1897年，因修建中东铁路得以建镇和发展。是中国历史文化名镇、全国特色景观旅游名镇、东北虎之乡。', '旅游产业', '旅游', '其它', '6', '2021-08-10 10:14:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200717145436999.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (373, '5e1834a0-7325-11ea-b0bb-ac1f6b639ec0', '石墨新能源高新产业园项目', '鸡西', '密山市', '鸡西-密山市', '制造业', '第二产业', NULL, '其他', '500000万元（77175.0万美元）', '1000000', '一般', '7', '80000', '20000', '筹划', '无', '', '', '密山市区域经济发展服务中心', '刘娜', '13351670999', 'hljmszsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '8000', '项目计划用地800亩，规划总建筑面积25万平方米。购入石墨烯、石墨电池、石墨正极材料生产线。建设生产车间、仓储库房、研发综合楼、宿舍、绿化工程等。项目建成达产达效后，可年生产石墨烯350吨、石墨烯电池5万吨、正极材料10万吨。', '新材料产业', '石墨', '黑龙江密山经济开发区', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521142159046.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (374, '5e6f19aa-73f0-11ea-b0bb-ac1f6b639ec0', '牡丹江市爱民区黑宝药业股份有限公司对外合作招商项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '50000', '重点', '7', '7500', '2850', '筹划', '有', '', '', '牡丹江市经合局', '闫海松', '15946359777', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '熊胆粉有保护肝、明目、促进肝组织恢复作用，增加免疫机能、增加胆汁分泌、改善胆汁脂质构成等作用，有降血糖及抗疲劳作用。熊胆粉及制品应用广泛，市场供不应求。\r\n项目扩建熊胆粉原料生产车间1500平方米。\r\n建设内容：新建制药固体制剂、口服液制剂、水丸制剂、软膏制剂、软胶囊制剂、酒剂、中药提取车间等1万平方米；新购进制药、化验设备154台套；新建熊胆粉生产舍、繁育监控、试验中心等84000平方米；扩容和改造公共工程，年产熊胆粉25吨，熊胆系列药品2.1亿支（瓶）。', '生物医药产业', '生物医药', '牡丹江经济技术开发区', '10', '2020-05-29 14:23:45', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522142403725.doc');
