INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (378, '5f00dfed-b00e-11e8-8e63-ac1f6b639ec0', '北安市年加工2万吨马铃薯项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '15881', '重点', '5', '3357', '3260', '可研', '有', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '70', '北安市位于黑龙江省正北部，环境和气候适宜马铃薯种植，是我省重要的马铃薯生产基地，马铃薯资源丰富。项目年处理鲜马铃薯2万吨，产品为马铃薯油炸鲜薯片、膨化食品、复合薯片、速冻薯条及颗粒全粉。建设年产1400吨脱水马铃薯鲜薯片生产车间1座、年产1000吨马铃薯复合薯片生产车间1座、年产1000吨速冻马铃薯块生产车间1座、年产5000吨马铃薯条生产车间1座。项目总投资1亿元。项目达产后年销售收入15881万元，利润3357万元，实现税金3260万元。\r\n\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江北安经济开发区', '45', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401093030569.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (379, '5f2baa98-bb6b-11eb-a12f-00ff338109dc', '中草药材种植深加工项目', '哈尔滨', '木兰县', '哈尔滨-木兰县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '30000', '一般', '5', '3000', '580', '筹划', '无', '', '', '木兰县投资合作服务中心', '尉天宇', '13104004402', 'mlzhaoshangju@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '30', '中药材基地建设2万亩，主要种植五味子、刺五加、蒲公英及其它选中品种。建设半成品生产加工厂一座及其配套设施。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '8', '2021-08-10 09:50:45', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (380, '5f460ed8-6eb3-11e8-afa3-ac1f6b639ec0', '明水县农产品物流园项目', '绥化', '明水县', '绥化-明水县', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '22000万元（3395.7万美元）', '16000', '重点', '3', '4000', '1000', '筹划', '无', '', '', '明水县招商引资局', '李艳军', '13804860069', 'hljms666@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '63', '随着明水县绿色食品的迅猛发展，每年需求果蔬、肉类、水（海）产品存储量逐步增加，货物运输需求强烈。明水县城区内中小型冷储保鲜库房布局分散，而且使用年限均在8年以上，亟待建设集冷藏、保鲜、中转、储运和信息化服务于一体的现代化大型物流园。该项目总投资2.2亿元，拟建设地点位于明水县食品产业园区，占地面积6万平方米，主要建设农产品交易区、物流区、冷鲜仓储区、加工区、综合区五大功能区。', '物流产业', '物流', '黑龙江明水经济开发区', '74', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (381, '5f5c2c27-7282-11ea-b0bb-ac1f6b639ec0', '鲜食玉米冷链物流产加销一体化项目', '绥化', '海伦市', '绥化-海伦市', '农、林、牧、渔业', '第一产业', NULL, '其他', '30000万元（4630.5万美元）', '20000', '重点', '6', '4500', '850', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '390', '鲜食玉米营养丰富，风味独特，属高蛋白低脂肪食品，深受市场欢迎，具有极大的市场商机。鲜食玉米作为新兴产业，在我国农业和农村经济发展中的地位日趋重要，已成为我国广大农村和农民最主要的经济来源和农村新的经济增长点。项目拟建设规模为年生产鲜食玉米1.5亿穗。项目计划占地面积40,000平方米。主要新建冷库1.5万平方米，新建冷链物流加工车间1万平方米，设备系统及附属设施3套。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江海伦经济开发区', '29', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521191707454.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (382, '5f6c113b-7265-11ea-b0bb-ac1f6b639ec0', '佳木斯市三江平原汽车农机产业城项目', '佳木斯', '富锦市', '佳木斯-富锦市', '批发和零售业', '第三产业', NULL, '独资', '200000万元（30870.0万美元）', '175000', '一般', '10', '19000', '7000', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '500', '项目拟建于黑龙江省富锦市电子商务园区南部，享受《富锦市招商引资扶持奖励政策》。占地面积20公顷。建设三个中心、五大区域。区位优势，富锦市位于黑龙江省东部，国家批准的副中心城市，是区域性商品物流中心，交通枢纽，辐射周边八个市县及农垦农场200多万人口。市场优势，近年来，汽车产业呈现出迅猛发展之势，富锦市现有自用车辆每年以20－30%的速度递增，给汽车产业服务业提供了发展机遇和空间。', '汽车制造产业', '汽车服务', '其它', '11', '2020-06-02 14:38:30', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145302859.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (383, '5ff73022-843b-11ea-b0bb-ac1f6b639ec0', '聚丙烯低发泡板材项目', '大庆', '龙凤区', '大庆-龙凤区', '其他', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '18000', '一般', '5', '2000', '3500', '筹划', '无', '', '', '龙凤区投资促进服务中心', '张二伟', '19804595671', 'lfqzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '80', '聚丙烯发泡利用其优良的耐热性、卫生性、隔热性和良好的环境效应，可广泛应用于包装业、工业、农业、交通运输业、军事工业、航天工业及日用品等领域，尤其作为包装材料、车内装饰材料和隔热材料使用更具优势，聚丙烯发泡材料以其独特而优越的性能正成为泡沫片材领域中的热点，市场前景良好。大庆石化公司可提供项目所需原料。\r\n项目拟选址龙凤经开区，总投资为1亿元，规划占地面积2万平方米，建筑面积1.5万平方米。装置建成后可实现年生产10000吨聚丙烯低发泡板材。主要建设聚丙烯低发泡板材生产装置及配套设施，包括厂房、仓库、储存间等附属设施。', '石化产业', '石化', '黑龙江龙凤经济开发区', '25', '2020-05-30 16:37:22', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140005727.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (384, '602ef951-58d2-11e8-a5b9-ac1f6b639ec0', '10万吨大豆系列产品精深加工项目', '绥化', '海伦市', '绥化-海伦市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '20000', '重点', '5', '6000', '2000', '筹划', '无', '', '', '绥化市经济合作局', '鲁怡彤', '13763750328', 'suihuazhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '300', '该项目位于绥化市海伦经济技术开发区，年加工大豆10万吨，生产一级大豆油1.75万吨、饲料用豆粕6万吨、大豆分离蛋白500吨、大豆蛋白肽300吨、大豆异黄酮20吨、大豆皂甙30吨、维生素E5吨、大豆甾醇10吨、大豆多糖纤维饲料1.6万吨。投资用于建设厂房及购置生产、提取设备等。绥化市大豆品质优良，无污染，油脂含量达22.5％，蛋白质含量达44.5％以上，临近县市为黑龙江省最重要的大豆产区，经济半径范围内产量在100万吨以上，非常适合大规模的大豆精深加工。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江海伦经济开发区', '196', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (385, '6052ef68-73bf-11ea-b0bb-ac1f6b639ec0', '肉制品加工专用大豆组织化蛋白生产项目', '黑河', '嫩江县', '黑河-嫩江县', '制造业', '第二产业', NULL, '独资', '9112.17万元（1406.46万美元）', '17000', '一般', '1.82', '5000', '2805.28', '筹划', '无', '', '', '嫩江市招商服务中心', '周茂波', '18724317888', 'njzhoumaobo@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '60', '随着社会物质文明的发展，市场对高蛋白、低脂肪、低胆固醇的健康食品需求将越来越大。大豆组织化蛋白产品由于具有营养价值高，功能作用大，咀嚼韧性大、口感好等特点，在国内市场主要用于肉类替代品，可以提高产品的蛋白质含量；在国外市场，大豆蛋白类产品几乎用于各种食品和保健品之中，无论使用的数量还是品种，远远超过中国。目前国内大豆分离蛋白的年消费量超过 20 万吨，年消费增长率高达 10%。项目总投资9112.17万元，达产后，生产能力 5000 吨/年，年实现销售收入 1.7亿元，利润8500万元，税金2805.28万元。\r\n\r\n\r\n', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江嫩江经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401102609437.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (386, '605e583a-755c-11ea-b0bb-ac1f6b639ec0', '牡丹江市方便米饭加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '12000万元（1852.2万美元）', '22600', '重点', '5', '2653', '648', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '300', '牡丹江市是我国优质大米的主产区，原料丰富，绿色有机，优越的自然条件使大米粒白如玉，米香四溢，闻名遐迩。\r\n项目占地200亩，建设年处理大米7500吨生产线及相关配套设施，达到年加工方便米饭6000吨，年产盖浇饭1800吨，泡饭1820吨，炒饭1400吨，汤饭980吨等。', '农业及农副产品精深加工产业', '水稻深加工', '牡丹江经济技术开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403113700220.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (387, '607a3f5d-8475-11ea-b0bb-ac1f6b639ec0', '5000吨/年低温真空有机脱水蔬菜加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '20000', '一般', '5', '2500', '420', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '项目占地面积约30000平方米，形成年产5000吨脱水蔬菜能力。引进技术和设备，建设标准化厂房、库房、仓库、晒场以及相应配套设施。\r\n果蔬干制目前占世界果蔬贸易量的近2∕3，我国脱水蔬菜出口量居世界第一，年出口平均增长率高达18.5%。果蔬干制保持了原果蔬的色香味而具有松脆的口感，低热量、高纤维，富含维生素和多种矿物质，不含防腐剂，携带方便，保存期长等特点，目前，采用真空干燥技术的高档脱水蔬菜在国内、国外都有广泛的市场，生产高档果蔬干制制品，将有广阔的市场空间。2019年，杜尔伯特瓜果、蔬菜类产量达到45766吨，原料充足。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江杜尔伯特经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154100147.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (388, '60ca7707-73e0-11ea-b0bb-ac1f6b639ec0', '佳木斯市滨江度假酒店项目', '佳木斯', '抚远市', '佳木斯-抚远市', '住宿和餐饮业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '21000', '一般', '5', '6000', '2500', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '180', '生态和文化旅游已成为抚远发展最快、最具活力的优势产业。抚远市沿江生态资源保存良好，景色宜人，湖泊泡沼、星罗棋布，独具特色的原始风貌和难得的富氧、绿色、清静宜人的环境，为人们提供了亲近自然、放松心情的度假旅游基地，打造告别喧嚣、回归宁静的“天然氧吧”、净化心灵的人间仙境，为广大游客提供休闲、度假的专业化和多样化的服务。为填补我市旅游接待能力的不足，建设滨江度假酒店项目，进而加快旅游产业发展步伐。本项目建设地点位于滨江公园，占地面积6万平方米，主要建设住宿区、滨水休闲区、中俄餐厅、商务接待区等。', '旅游产业', '旅游', '其它', '182', '2021-08-11 11:37:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707101959081.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (389, '60f5295f-d873-11ea-9c62-00ff338109dc', '玄武岩棉生产项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '4000万元（617.4万美元）', '5000', '一般', '3', '1500', '800', '筹划', '无', '', '', '黑龙江云凯新能源科技有限公司', '迟云全', '18249626799', '18249626799@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '80', '该项目由黑龙江云凯新能源科技有限公司投资建设，公司拟引进一条年生产成品5万吨的大型全自动新型岩保温材料生产线，全自动岩棉生产线。目前国内建材市场岩棉产值规模极大，经专业机构分析，建材市场对岩棉总需求还有巨大的缺口，供需严重失衡。据近年来该产品的销售价格测算，可创纯利润1500万元，取得较好经济效益与社会效益。', '新材料产业', '其它', '其它', '4', '2021-08-10 10:10:52', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200807140429667.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (390, '60f6b126-8535-11ea-b0bb-ac1f6b639ec0', '肇源县3万吨/年大米深加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '一般', '3', '20000', '1500', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '04598242585', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '方便米饭、营养米线以大米为原料，其优点是方便、快捷、卫生、营养、好吃，符合大多数中国人饮食习惯，已逐淅代替其它方便食品，占中国方便食品市场主导地位，市场前景广阔。\r\n肇源位于世界三大黑土带之一松嫩平原腹地，水稻面积98万亩，产量11.3亿斤，“肇源大米”被中央电视台评为初级农产品地理标志品牌，区域品牌价值83.53亿元，水稻“五优稻四号”荣获2018中国黑龙江首届国际大米节银奖，鲶鱼沟公司“吉源香1号”获得2019中国黑龙江第二届国际大米节银奖。\r\n项目规划占地面积10万平方米，建设年产方便米饭、营养米线、营养米粉等产品3万吨生产线及配套设施。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江肇源经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521163624570.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (391, '610c8a60-5328-11e8-ba35-ac1f6b639ec0', '新型节能环保保温墙材项目', '双鸭山', '市辖区', '双鸭山-市辖区', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '40000', '重点', '3', '9600', '6800', '筹划', '无', '', '', '双鸭山经济技术开发区', '陈迎迎', '15145904789', '55064375@qq.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '80', '该项目拟建设在双鸭山经济技术开发区，占地面积3万平方米，主要建设生产车间一个，储藏间一个，STP真空绝热板生产线5条，设计年生产新型节能环保保温墙材500万立方米。产品具有良好的高热组，底线性，膨胀比低的特点。产品采用纳米材料和真空工艺，导热系数可以达到0.006W/(m·k)以下，防火等级达到A1级，项目前景十分广阔。', '新材料产业', '复合材料', '双鸭山经济技术开发区', '108', '2020-05-26 11:02:14', '');
