INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (397, '62f37647-738a-11e8-a795-ac1f6b639ec0', '大豆综合加工项目', '绥化', '绥棱县', '绥化-绥棱县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '8000', '重点', '5', '2400', '1000', '筹划', '无', '', '', '绥棱县招商局', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '200', '目前，国内油脂大多是由转基因原料生产，随着人们对自身健康意识的增强，产自东北地区的非转基因油脂的需求将日益增长。绥棱县已经形成了完整的产加销体系，周边市县年产绿色大豆超过300万吨。该项目拟占地5万平方米，主要建设厂房、办公楼等附属设施及购置设备。设计年处理大豆20万吨，主要产品为一级大豆油7000吨，三级豆油1.3万吨，低温豆粕12万吨，大豆磷脂500吨，醇提大豆浓缩蛋白2万吨，大豆糖蜜1万吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江绥棱经济开发区', '188', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (398, '63098013-8570-11e8-8699-ac1f6b639ec0', '10MW秸秆沼气发电、产热、制肥循环经济项目', '绥化', '庆安县', '绥化-庆安县', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '18000万元（2778.3万美元）', '7000', '重点', '9', '2000', '900', '筹划', '无', '', '', '庆安县项目招商中心', '董树贵', '18245529900', 'qazsjd@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '80', '该项目利用秸秆发酵产生的沼气进入发电机组发电上网，沼渣沼液经加工处理后可得到有机颗粒肥，所生产的肥料供给当地及周边的蔬菜种植园区及大田使用，能够保证全部被市场消纳，实现循环经济。项目占地约8万平方米，投资约1.8亿元，建成后年可利用玉米秸秆12万吨，年产沼渣80000m³，年生产沼渣颗粒有机肥4万吨。发电机组产生的余热，能够回收转化成热能，可供暖面积20万㎡。', '新能源产业', '生物质能', '黑龙江庆安经济开发区', '71', '2020-05-26 11:02:14', '');
