INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (404, '654285f6-a16c-11ea-8a5d-00ff338109dc', '年产1万套燃料电池电堆项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '80000万元（12348.0万美元）', '90000', '一般', '15', '5400', '2310', '筹划', '有', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '300', '本项目建设总占地面积80000平方米，总建筑面积60000平方米，主要建设生产线2条、生产车间、成品库房、办公、实验室等。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，可依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新能源产业', '氢能', '大庆经济技术开发区', '11', '2020-05-30 16:00:15', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529132231536.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (405, '6544ff53-8213-11eb-94a7-00ff338109dc', '北安市年加工1000吨野生桦褐孔菌项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '60000', '一般', '2', '14000', '12000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '30', '桦褐孔菌所含的SOD(超氧化物岐化酵素)是灵芝的55倍,巴西蘑菇的23倍,猴头菇的25倍。具有很好的治疗糖尿病、防止高血压、抗癌、抗衰老、抑制传染性病毒等作用。不仅在医药方面应用广泛，还可以作为食品的辅助品，发展前景良好。且哈尔滨工业大学食品工程学院在桦褐孔菌食品方面已取得了完善的成果。项目技术条件成熟。北安市林业资源丰富，市域内有林地56万公顷，森林面积100万公顷。已知野生菌类储量2万吨。具有稳定的生产原料来源。本次项目占地面积6万㎡，建筑面积2万㎡，计划年加工野生桦褐孔菌1000吨。产出桦褐孔菌精粉800吨，桦褐孔菌饼干600吨，饮料1000吨。', '现代商贸产业', '现代商贸', '黑龙江北安经济开发区', '2', '2021-08-10 10:03:46', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (406, '65586bb1-9c38-11ea-8a5d-00ff338109dc', '佳木斯市米糠油精深加工系列产品建设项目', '佳木斯', '桦川县', '佳木斯-桦川县', '制造业', '第二产业', NULL, '独资', '13500万元（2083.72万美元）', '38500', '一般', '4', '3300', '5800', '筹划', '无', '', '', '桦川县商务和经济合作局', '石建刚', '15046478536', 'hczsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '60', '项目占地面积5万平方米，新建筑面积23700平方米，建设精炼车间、糠蜡精制车间、谷维素与VE车间、包装车间、综合仓库、办公楼、动力车间及消防水池、污水处理站等设施。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江桦川经济开发区', '12', '2020-06-02 14:23:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522222742043.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (407, '6579bfeb-7677-11ea-b0bb-ac1f6b639ec0', '牡丹江市数据中心项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '6000', '重点', '10', '1000', '600', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '牡丹江市地理位置优越，处在世界公认的发展大数据产业“黄金纬度”。地质结构稳定，远离地震带，没有台风等自然灾害，可为数据中心的安全运营提供可靠保障。\r\n项目占地面积约6000平方米，规划1栋机房建筑，总机柜数约800架，可承载1.6万台服务器。\r\n建设东北总部数据基地项目，通过建立东北基地，对工业大数据进行深度挖掘，利用数据驱动促进高新区制造业转型升级、催生物联网+、云计算、工业软件等新技术、新业态。\r\n', '金融产业', '数字金融', '牡丹江经济技术开发区', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408155651333.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (408, '65b7ce2b-74d4-11ea-b0bb-ac1f6b639ec0', '明水县粘甜玉米系列休闲食品加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '13000万元（2006.55万美元）', '9500', '重点', '4', '2850', '665', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '目前国内市场上开发的甜玉米的产品还处于初级阶段，主要以鲜食为主，各类深加工产品生产量偏少，特别是真空保鲜包装产品，市场缺口较大。另一方面，中国休闲食品市场潜力巨大，年市场需求高达千亿元，国内企业如果能抓住这一战略机遇期，将会迎来企业的高速发展和快速突破总投资1.3亿元的粘甜玉米系列休闲食品加工项目，这对于明水县而言，是难得的“脱贫”项目。项目总投资1.3亿元，可安置就业岗位100个。项目达产后，年可实现销售收入9500万元（玉米片、方便粥、方便米线等产品平均按每吨9500元计算），利润3325万元，税金665万元。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江明水经济开发区', '33', '2020-06-02 14:35:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521113145832.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (409, '65c7be4f-74e1-11ea-b0bb-ac1f6b639ec0', '桃山区制药科技示范项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '合资', '14000万元（2160.9万美元）', '1200', '一般', '15', '360', '84', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '200', '该项目拟建于大明街与三号大道交汇处，占地100000平米，打造现代医药生产加工基地，集中开发抗生素和化学医药产品，快速推进中药加工技术研发和北药资源的深度开发。主要研发抗菌、抗癌、抗血栓医药，目前在技术等领域寻求合作。', '生物医药产业', '生物医药', '其它', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165250807.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (410, '65d88f97-7d22-11ea-b0bb-ac1f6b639ec0', '恒山区等静压石墨生产项目', '鸡西', '恒山区', '鸡西-恒山区', '制造业', '第二产业', NULL, '其他', '15000万元（2315.25万美元）', '15000', '一般', '4', '3500', '1650', '筹划', '无', '', '', '恒山区发展和改革局', '董勇霖', '04672457777', 'jxshsqfgj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '200', '等静压石墨是上世纪60年代发展起来的一种石墨新型材料，具有耐热性好、结构精细致密、均匀性好、热膨胀系数低、耐化学腐蚀性强、导热导电性好、各向同性和优异的机械加工性能、抗热震性能，广泛应用于冶金、化学、电气、航空宇宙及原子能工业领域，而且随着科技的发展，应用领域还在不断扩大。建设年产3000吨等静压石墨生产线。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525093058767.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (411, '66441fd4-7550-11ea-b0bb-ac1f6b639ec0', '牡丹江市东宁市进口鲜活水产品冷藏加工项目', '牡丹江', '东宁市', '牡丹江-东宁市', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '20000', '重点', '5', '2000', '760', '筹划', '有', '', '', '东宁市招商局', '刘庆', '13069794555', 'jhjxmglk@163.com', '牡丹江市经济合作促进局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '冷冻水产品市场日益繁荣，花色品种日趋丰富，随着社会经济的快速发展，对冷冻水产品的需求不断增大。冷藏水产品因其食用方便加上能较好保持鲜嫩味美的特点，已逐渐成为冷冻水产品销售的主要形式，受到了国内外市场欢迎。\r\n项目规划占地面积2万平方米，建设内容：鲜活海产品养殖池，冷藏库，加工车间，仓储库房等。\r\n设计年加工生产海产品4000吨，采用国内先进生产设备和生产工艺，符合国家环保标准。建设期2年。', '现代商贸产业', '现代商贸', '黑龙江东宁经济开发区', '13', '2020-05-29 14:34:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522112341406.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (412, '66e5a96f-747a-11ea-b0bb-ac1f6b639ec0', '牡丹江市林口县绿色食药产业园建设项目', '牡丹江', '林口县', '牡丹江-林口县', '农、林、牧、渔业', '第一产业', NULL, '独资', '500000万元（77175.0万美元）', '260000', '重点', '13', '39000', '15000', '筹划', '有', '', '', '牡丹江市经济合作促进局', '周其双', '13604604677', 'lkxzsjbgs@163.com', '牡丹江市经济合作促进局', '张智明', '18645358188', 'jhjxmglk@163.com', '1200', '项目一期主要建设产学研实践基地；种禽、苗木研发繁育基地；标准化大鹅养殖、沙棘、马铃薯、北药种植示范基地。\r\n项目二期建设北药、沙棘、马铃薯、大鹅等农副山产品加工厂房、购置设备，配套办公楼、食堂等附属设施、道路绿化等。\r\n项目三期建设绿色食品展示中心、电商平台、沙棘大鹅产品品牌示范店、特色产品餐饮示范店、乡村体验式农业+旅游田园综合体、物流中心等。', '生物医药产业', '生物医药', '黑龙江林口经济开发区', '271', '2020-05-29 14:27:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522113332754.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (413, '686738e3-72f6-11ea-b0bb-ac1f6b639ec0', '佳木斯市现代物流园区项目', '佳木斯', '前进区', '佳木斯-前进区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '15000', '一般', '10', '4500', '900', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '500', '佳木斯市为国家大型商品粮基地，矿产资源丰富，从俄罗斯进口的矿产、木材、钢材、化工原料等资源和产品日益增长，对俄出口的粮食、蔬菜等农畜产品和机电、轻纺、日用品等产品规模不断扩大，为现代物流业发展提供了广阔的空间。项目占地面积约39万平方米，物流园区内包括公共服务区、仓储区、流通加工区、包装区、配送中心、分检中心、区域运输组织中心，构建物流信息平台，达到资源共享。同时配套金融、商住、餐饮等服务设施。建设地点距离安庆路约500米，距离同三公路南出口约4.5公里，距离市中心约6.5公里，紧邻规划建设中的双合路，该路东起高新区西至同三公路万兴收费站，交通十分便利。', '物流产业', '物流', '其它', '18', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523094356147.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (414, '689c0bf6-730a-11ea-b0bb-ac1f6b639ec0', '望奎县大豆综合加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '50000', '重点', '3', '10000', '300', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '项目采用先进技术，在加工大豆油的同时，从大豆种皮中提取果胶，以提高大豆的加工转化率，利用大豆豆粕生产大豆异黄酮、大豆低聚糖、浓缩蛋白、大豆皂甙、豆渣纤维等产品。这些产品在食品、医药等领域对人类预防疾病、保健、及改善生命质量具有一定作用。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江望奎经济开发区', '15', '2020-06-02 13:49:51', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521124239700.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (415, '68d3002b-7585-11ea-b0bb-ac1f6b639ec0', '牡丹江市绥芬河市清洁能源产业园项目', '牡丹江', '绥芬河市', '牡丹江-绥芬河市', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '84000万元（12965.4万美元）', '150000', '重点', '5.6', '15000', '6000', '筹划', '有', '', '', '绥芬河市经合促中心', '周秀华', '13836380329', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '牡丹江市是全国重要的对俄口岸，俄罗斯液化石油气资源十分丰富，牡丹江市可以利用完善的交通和便利的地理条件建设清洁能源产业园项目。项目规划占地面积：2.5平方公里；建设内容：建设LPG转运站，含LPG存储区、铁路装卸区、消防配套设施、中控室、综合楼等；40座5000立方米的LPG球形储罐，10台LPG装车泵，5台LPG卸车压缩机，6座火车栈桥等。\r\n\r\n', '物流产业', '物流', '绥芬河边境经济合作区', '37', '2020-05-29 15:36:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521164317560.doc');
