INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (430, '6e53f837-7af4-11ea-b0bb-ac1f6b639ec0', '科技印刷包装项目', '鸡西', '鸡冠区', '鸡西-鸡冠区', '制造业', '第二产业', NULL, '其他', '10000万元（1543.5万美元）', '18000', '一般', '4', '2300', '1200', '筹划', '无', '', '', '鸡冠区投资合作促进局', '肖锋', '13504867678', 'jgqzsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '60', '在国家“十三五”规划和产业结构调整的大方针下，包装印刷品面临巨大的市场投资机遇，行业有望迎来新的发展契机。项目建设拟选址鸡西（鸡冠）产业园区，计划总投资1亿元，占地面积2万平方米，建筑面积2.4万平方米。建有生产车间、仓储库房、办公楼、宿舍、绿化工程等。主要生产彩盒、食品、药品、礼盒、烟酒包装、纸箱、不干胶贴纸等印刷包装产品。', '包装产业', '包装', '黑龙江鸡西经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525092232836.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (431, '6e5e013d-72f1-11ea-b0bb-ac1f6b639ec0', '佳木斯市工业服务保障园和中国造纸博物馆、工业产业展览展示综合建设项目', '佳木斯', '东风区', '佳木斯-东风区', '其他', '第三产业', NULL, '独资', '250000万元（38587.5万美元）', '1000000', '一般', '5', '50000', '8000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '18545400563', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '3000', '本项目主要利用原佳木斯造纸厂建设爱国产义教育示范基地、博物馆、遗址公园、创意产业园等。优化城市布局，统筹城市布局调整和产业聚集发展。佳木斯造纸厂是我国“一五”期间苏联援建的156项重点工程之一，历史悠久，曾经是我国造纸企业的标志，被称为亚洲第一大造纸厂，更是中苏友谊的象征，为国家经济发展做出过突出贡献，所具有的工业遗产价值对展示其对中国工业化的贡献度具有重大意义和重大价值。内涵丰富的文旅项目是近年来旅游项目的热点，本项目借鉴北京“798艺术区”和沈阳“中国工业博物馆”的设计理念及风格，规划在对佳木斯造纸厂进行充分保护的基础上，加以修缮、改造和再利用，形成类似的创意旅游基地。', '旅游产业', '旅游', '其它', '18', '2020-06-01 10:23:13', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525094923382.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (432, '6ee817d2-a16e-11ea-8a5d-00ff338109dc', '年产3万平方米膜电极项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '11000万元（1697.85万美元）', '26515', '一般', '6', '2000', '1000', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '本项目建设总占地面积32000平方米，总建筑面积46000平方米，主要建设成品库房、办公、实验室、化验室、门卫室、生产车间等，搭建全自动化膜电极封装生产线两条，可年产膜电极3万平方米。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，可依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新能源产业', '氢能', '大庆经济技术开发区', '11', '2020-05-30 16:00:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529133706715.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (433, '6f39d90f-7d26-11ea-b0bb-ac1f6b639ec0', '锂离子电池负极材料生产项目', '鸡西', '恒山区', '鸡西-恒山区', '制造业', '第二产业', NULL, '其他', '100000万元（15435.0万美元）', '150000', '一般', '4', '31500', '16000', '筹划', '无', '', '', '恒山区发展和改革局', '董勇霖', '04672457777', 'jxshsqfgj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '400', '锂离子电池负极材料具有能量密度大、循环寿命长、高充放电效率等特点，而且污染小，广泛应用于电动汽车、航空航天、生物医学工程等领域。建设年产50000吨负极材料生产线。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525093333760.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (434, '6f671e1a-5715-11e8-a5b9-ac1f6b639ec0', '煤制乙二醇项目', '鹤岗', '南山区', '鹤岗-南山区', '制造业', '第二产业', NULL, '合资', '360000万元（55566.0万美元）', '195900', '重点', '6.3', '57394', '14660', '可研', '有', '', '', '鹤岗市睿泽化工科技有限公司', '吴成魁', '15604880123', '18846884235@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '300', '该项目位于鹤岗市煤化工园区A区，占地面积60.2公顷。主要建设：合成装置、辅助生产装置、公用系统、气化装置等。煤制乙二醇技术近两三年在国内得到了长足发展，本项目利用已经成熟的关键生产技术，发挥后发优势，具有技术先进、投资省、综合能耗低、成本低的优势。目前我国乙二醇生产能力和产量不能满足实际生产的消费，依托当地丰富的煤炭资源新建或扩建煤制乙二醇生产项目，市场前景广阔。', '煤炭精深加工产业', '煤炭深加工', '黑龙江鹤岗经济开发区', '158', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (435, '6f690af8-8462-11ea-b0bb-ac1f6b639ec0', '光伏组件和电池片项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '800000万元（123480.0万美元）', '1000000', '一般', '8', '100000', '20000', '筹划', '无', '', '', '大庆高新区管委会', '程兆全', '13945954869', '16645396016@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '5000', '2020年国内光伏受竞价项目补贴、户用光伏继续实施单独管理等政策影响，新增装机有望达45GW以上，并有望进一步超预期，需求大幅回暖确定性强，同时国际市场需求不断上升，中国光伏产业在国际市场具有明显的领先优势，未来发展趋势向好。\r\n项目占地面积50万平方米，建设年产10GW光伏组件生产线及生产厂房、仓储、等辅助设施。', '新能源产业', '光伏', '大庆高新技术产业开发区', '34', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422142809858.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (436, '6f6a9694-7d58-11e9-815b-ac1f6b639ec0', '稻米油生产项目', '哈尔滨', '五常市', '哈尔滨-五常市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '18000', '一般', '4', '5220', '887.4', '筹划', '无', '', '', '五常市商务局', '王晓华', '19903611199', 'zhaoshangjuxmb@126.com', '五常市商务局', '王秀君', '15046037557', 'zhaoshangjuxmb@126.com', '150', '项目建设地点在哈尔滨市五常市，拟占地面积3万平方米， 建筑面积20000平方米；原品库5000平方米；材料库2000平方米；成品库2000平方米；冷库1000平方米；辅助用房500平方米；办公用房2000平方米。拟购置稻米油生产线2条，检测设备及运输设备3台（套）。 稻米油是以稻米副产品米糠为原料，生产稻米毛油（米糠原油）。稻米原油经预处理，脱胶、碱炼、水洗、脱色、冬化、脱臭等工序制得稻米一级油，具有很高的营养价值，它是一种与橄榄油齐名的健康营养油，深受高血脂、心脑血管疾患人群喜爱。达产年形成5万吨的生产加工能力。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江五常经济开发区', '18', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (437, '6f6f06f1-74da-11ea-b0bb-ac1f6b639ec0', '北药种植基地及深加工项目', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '30000万元（4630.5万美元）', '100000', '一般', '7', '4000', '1000', '筹划', '无', '', '', '勃利县经济合作促进局', '王伟', '13664641999', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '中药饮片作为一种经过加工炮制的中药材，可以更好地储存和保护中药材的药性，临床用药更加方便和安全，加上全民对健康养生需求的释放，对健康理念的深入，市场需求量大。中药材市场基本保持供求稳定发展的状况，优质无公害中药材品种、市场大宗品种和临床常用品种多数处于供应不足状态，大力发展药材种植前景好。建设内容：种植柴胡、黄芪、五味子等中药基地8万亩、育苗基地8000亩、中药健康食品系列产品5000吨。', '中医药产业', '中医药', '其它', '22', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521121818016.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (438, '6f8af797-7284-11ea-b0bb-ac1f6b639ec0', '年产1万吨五谷杂粮营养粉项目', '绥化', '海伦市', '绥化-海伦市', '农、林、牧、渔业', '第一产业', NULL, '其他', '5000万元（771.75万美元）', '12000', '重点', '3', '1800', '400', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '100', '五谷杂粮是中国传统膳食的主体，是人体能量的主要来源。随着人们生活水平的不断提高，人们对食品中营养成分的平衡性、适味的口感、丰富的品种，有了更高的需求。目前，五谷杂粮营养普遍存在加工粗糙，口感和品质远远不能满足消费者要求，高品质的速融杂粮营养粉是目前市场上的稀缺品，市场需求巨大。项目拟建规模为年产五谷杂粮营养粉1万吨。项目计划占地面积30,000平方米，总建筑面积19,000平方米。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521191436627.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (439, '705026e2-77d5-11ea-b0bb-ac1f6b639ec0', '牡丹江市危废化物处理中心项目', '牡丹江', '市辖区', '牡丹江-市辖区', '其他', '第二产业', NULL, '合资', '10000万元（1543.5万美元）', '5000', '重点', '10', '1000', '300', '筹划', '有', '', '', '牡丹江市林木林纸产业招商专班', '杨永刚', '13845394569', 'jhjxmglk@153.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@153.com', '100', '该项目是变废为宝项目，初衷是将生产、生活中产生的对环境有害的固体、液体废物进行物理、化学、生物的改造，使这些废物再次变为可利用的产品，进入生产再循环或者变成对环境没有危害的产物进行填埋，减少这些产生废物的企业的处理压力，也减少对环境的破坏，利国利民利企业。\r\n项目建设5个标准厂房及原料堆放场地，主要是放置处理危化品的设备厂房及堆放原料的仓库，处理后的可利用产品基本随处理随销售。', '新能源产业', '生物质能', '牡丹江经济技术开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408162726608.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (440, '707b3a79-75b4-11ea-b0bb-ac1f6b639ec0', '3000吨/年粗酚精制项目', '七台河', '茄子河区', '七台河-茄子河区', '制造业', '第二产业', NULL, '独资', '3800万元（586.53万美元）', '3500', '一般', '3', '1000', '500', '筹划', '无', '', '', '茄子河区招商局', '董广岩', '13946566656', 'qzhzsj2019@163.COM', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '20', '主要产品为苯酚、间甲酚、邻甲酚和混二甲酚，市场前景较好。建设内容：3000吨/年粗酚精制项目，主要产品为苯酚840吨/年，间甲酚900吨/年，邻甲酚330吨/年和混二甲酚320吨/年。', '新材料产业', '复合材料', '其它', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522074510697.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (441, '70b4fc4c-7398-11e8-a795-ac1f6b639ec0', '城市休闲旅游区建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '合资', '31000万元（4784.85万美元）', '16000', '一般', '6', '4800', '3200', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj@126.com', '70', '该项目拟建于沿松花江亲水平台。项目建设内容：旅游集散中心及停车场：按照城市旅游集散中心标准建设；游船码头；酒吧一条街;旅游休闲街区；演艺剧场等。项目拟建地主要为居民创造一个既能观赏松花江、又能休闲娱乐的活动场所，又可在松花江上开展游船水上旅游的项目。', '旅游产业', '旅游', '黑龙江通河经济开发区', '111', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524211140721.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (442, '7120aaf6-9c09-11ea-8a5d-00ff338109dc', '反季节蔬菜气调保鲜库项目', '鸡西', '鸡东县', '鸡西-鸡东县', '交通运输、仓储和邮政业', '第三产业', NULL, '其他', '2000万元（308.7万美元）', '1500', '一般', '5', '450', '400', '筹划', '无', '', '', '鸡东县区域经济发展服务中心', '田军', '13904675001', 'jdxjhj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '80', '东北地区地理位置和气候条件特殊，冬季蔬菜无法自给自足，需向南方购入，整个冬季蔬菜的价格是蔬菜产地山东的1.5—2倍。对此，在本地建设反季节蔬菜气调保鲜库市场前景极为可观。建设厂房3500平方米、反季节蔬菜保鲜库2000平方米，年储蔬菜达到5000吨。综合用房一套，包括厂房3500平方米、气调保鲜库2000平方米、办公室、采后处理室、检验检疫室等。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '41', '2020-06-01 16:26:48', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165135463.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (443, '717f9c40-cf44-11eb-a12f-00ff338109dc', '野生菇、木耳保鲜即食食品', '大兴安岭', '漠河市', '大兴安岭-漠河市', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '3000', '一般', '12.5', '800', '67.5', '筹划', '无', '', '', '漠河市商务局', '张明亮', '15714678669', '643678033@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '30', '占地面积5万平方米，主要开发野生菇鲜品、保鲜野生菇产品及高端野生菇产品研发和木耳精深加工，提取木耳多糖和木耳素。', '农业及农副产品精深加工产业', '其它', '其它', '2', '2021-08-05 16:42:08', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (444, '71b5838e-7586-11ea-b0bb-ac1f6b639ec0', '牡丹江市东宁市国际冷链物流项目', '牡丹江', '东宁市', '牡丹江-东宁市', '交通运输、仓储和邮政业', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '20000', '重点', '15', '2000', '400', '筹划', '有', '', '', '牡丹江市经合局', '于学勇', '15945731616', 'dnzsj@126.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '牡丹江市物产丰富，农业合作贸易频繁，但是货运损耗是农业贸易持续健康发展的一项重要损失，因此，将尤其适合农副产品输运的冷链物流提上发展日程，让运输成本、损耗变低，效率变高。\r\n项目规划面积8.5万平方米：\r\n1、建设主要仓储冷藏中心40000平方米，库容总量50000吨。\r\n2、建设加工分装车间（物流配送中心），总面积10000平方米，日加工能力1000吨。\r\n3、建设综合办公楼7400平方米、职工宿舍7600平方米、检疫检测中心2000平方米、货运车辆停车区10000平方米(车位106个）、停车场及其他配套设施5000平方米。\r\n4、建设鲜活暂养池50000平方米。\r\n5、建设食品展示区1000。', '物流产业', '物流', '黑龙江东宁经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403163808176.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (445, '71d9f020-7551-11e9-815b-ac1f6b639ec0', '食用菌生产基地及产业化项目', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '其他', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '20000', '一般', '3', '5000', '600', '筹划', '无', '', '', '龙江县经济合作促进局', '李晓东', '15946466566', 'ljxjhj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '300', '龙江县是国家商品粮基地县，是农业大县，秸秆、壳类等粮食作物附产物丰富，自然环境优越，水质优良，适宜食用菌栽培。县内拥有农业技术推广中心，建有食用菌技术培训基地，是传统食用菌栽培地区，开发此项目易于推广。目前，龙江县建设了山泉镇、鲁河乡、错海林场三个食用菌生产基地，建设标准化大棚540栋，每栋标准化食用菌棚建筑面积400㎡，可挂黑木耳菌包2万袋。拟引进先进技术和菌种，开发建设日光温室食用菌基地，并进行食用菌的罐制、干制等的深加工，拉长产业链。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江龙江经济开发区', '41', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524134350807.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (446, '71da96b4-7302-11ea-b0bb-ac1f6b639ec0', '中药批发市场建设项目', '绥化', '庆安县', '绥化-庆安县', '租赁和商务服务业', '第三产业', NULL, '独资', '3000万元（463.05万美元）', '6000', '重点', '3', '1000', '150', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '1000', '庆安县环境优势明显，有人参、党参、刺五加、五味子等100多种中药材，且中药人工种植面积大。庆安交通便利，处于黑龙江省中心地带，铁路、公路四通八达。利用资源、交通优势，建设占地面积30000㎡，交易大厅2000㎡，营业门市面积2500㎡，库房面积1000㎡，容纳固定摊位500个的大型中药批发市场，可辐射整个东北地区，市场前景广阔。', '中医药产业', '中医药', '黑龙江庆安经济开发区', '12', '2020-05-30 17:12:26', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525103425723.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (447, '72113bf7-7a31-11ea-b0bb-ac1f6b639ec0', '佳木斯市马铃薯精深加工项目', '佳木斯', '同江市', '佳木斯-同江市', '农、林、牧、渔业', '第一产业', NULL, '独资', '17985万元（2775.98万美元）', '22960', '一般', '5.7', '4120', '413', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '项目选址在同江经济开发区，项目占地面积36660平方米，其中建筑占地面积24780平方米。建设年产2000吨薯片生产线一条，年产20000吨速冻薯条生产线一条，年产2800吨雪花全粉生产线一条。同江市及周边地区土壤类型主要为黑土和草甸土，其中草甸土占全市土壤总面积的61.2%，黑土占21.1%，土质疏松肥沃，土壤氮磷钾含量丰富，PH值适中，保水保肥能力强；与此同时，区域内有松花江、黑龙江两江流过，地下水含量丰富，水质较好，这为马铃薯的种植提供良好的土壤和水资源条件，适应马铃薯的生长，品种优、产量高，非常适宜进行马铃薯深加工，为本项目提供了充足的原料资源。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江同江经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112040797.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (448, '72a07327-8b2f-11e8-8e63-ac1f6b639ec0', '森林公园度假村、游乐园项目', '鹤岗', '兴安区', '鹤岗-兴安区', '租赁和商务服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '8000', '一般', '8.5', '2400', '1360', '筹划', '无', '', '', '兴安区人民政府', '乔坤', '13329589991', 'xinganzhaoshang@163.com', '鹤岗市商务局', '韩旭', '13199591989', 'hgzsgz@163.com', '400', '项目选址位于鹤岗市青石山将军石山庄，是国家3A级景区，占地面积10万平方米，其中建筑1万平方米，水上项目占地5万平方米。将军石山庄自然生态条件良好，野生动植物资源丰富，一年四季景色迷人，各具特色。经多年投资开发，目前园区内基础设施比较完备，通讯网络覆盖整个园区，交通方便，年可接待省内外游客10余万人次。项目建设旅游度假村2处，游览索道、滑雪场、温泉浴场、游乐园等各1处，并对外招商经营性项目。', '旅游产业', '旅游', '其它', '93', '2021-08-10 10:38:23', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200708105426059.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (449, '72d1a67e-7df9-11ea-b0bb-ac1f6b639ec0', '鲜优配送项目', '鸡西', '城子河区', '鸡西-城子河区', '交通运输、仓储和邮政业', '第三产业', NULL, '其他', '5000万元（771.75万美元）', '4000', '一般', '7', '800', '240', '筹划', '无', '', '', '城子河区发展和改革局', '张岩', '15561731621', '546713334@qq.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '240', '我国生鲜行业正处于不断发展之中，从其市场交易规模来看，2018年其市场交易规模达到2103.2亿元，较2017年（1402.8亿元）增长49.9%，保持了较快的发展速度。预计未来几年，其市场将持续被资本市场看好，2020年其交易总额预计将达到3470亿元。项目占地面积6000万平方米，建设接待室、加工车间、包装车间、恒温储藏库及其他附属运输、给排水、消防、供电等设施。', '物流产业', '物流', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525100543951.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (450, '72f64430-8669-11e8-9218-ac1f6b639ec0', '年产20万吨聚碳酸酯（PC）项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '200000万元（30870.0万美元）', '203000', '一般', '7', '32000', '55000', '筹划', '无', '', '', '大庆高新技术产业开发区管理委员会', '张天宇', '13339392732', 'daqingepz@163.com', '大庆高新技术产业开发区管理委员会', '张文涛', '18004598739', 'gaoxinfazhan@163.com', '100', '项目拟建于林源园区，总占地约20万平方米，装置占地12万平方米。拟建设年产20万吨聚碳酸酯项目生产装置及相应配套辅助设施。上游原料由大庆石化公司提供。聚碳酸酯（PC）项目属于高性能工程塑料产品，其用途广泛，2015年表观需求量约为170万吨，自给率仅为30%。预计2020年国内PC需求量将达到220万吨/年；2020-2025年间年均需求增长率5.5%，预计到2025年，国内PC消费量将增长至255万吨/年左右。市场前景广阔。项目达产后，可年产20万吨聚碳酸酯（PC）。', '石化产业', '石化', '大庆高新技术产业开发区', '124', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423141515688.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (451, '73eab6cb-73cc-11ea-b0bb-ac1f6b639ec0', '绥棱县食用菌种植及综合深加工项目', '绥化', '绥棱县', '绥化-绥棱县', '农、林、牧、渔业', '第一产业', NULL, '独资', '8000万元（1234.8万美元）', '6800', '重点', '5', '1700', '170', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '160', '2019年，绥棱县黑木耳种植面积达到1万亩，年产干木耳1000吨。大球盖菇、香菇、滑子蘑、猴头、榆黄蘑1300多万袋，年产鲜品4000吨。该项目依托绥棱县丰富的黑木耳资源进行技术嫁接转化，设计建设或改造黑木耳调味品生产厂房、生产设备及相应原料车间等配套设施。项目全部达产后，年可加工黑木耳系列系列产品3000吨，黑木耳营养米粉、黑木耳糊、配方营养粥1500吨、黑木耳鲜面、挂面、瘦身食品2000吨，各类果味黑木耳果糕1000吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江绥棱经济开发区', '21', '2020-05-30 17:16:20', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521200455004.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (452, '74082041-7558-11ea-b0bb-ac1f6b639ec0', '牡丹江市阳明区年产40万吨燃料乙醇项目', '牡丹江', '阳明区', '牡丹江-阳明区', '农、林、牧、渔业', '第一产业', NULL, '独资', '100000万元（15435.0万美元）', '150000', '重点', '7', '15000', '5700', '筹划', '有', '', '', '阳明区商务局', '吴强', '13384539996', 'ymqzhb@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '牡丹江市是玉米主产地之一，发展燃料乙醇的主要原料就是玉米，因此在牡丹江市发展该项目可以就近获取充足原料。\r\n项目建设占地20万平方米，建筑面积8.6万平方米，建设厂房、办公室、生产流水线等。\r\n项目年深加工120万吨玉米，生产燃料乙醇40万吨。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江阳明经济开发区', '47', '2020-05-29 15:13:55', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522103532718.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (453, '740d27b8-7572-11ea-b0bb-ac1f6b639ec0', '牡丹江市东宁市梅花鹿养殖、加工项目', '牡丹江', '东宁市', '牡丹江-东宁市', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '4100', '重点', '10', '1000', '300', '筹划', '有', '', '', '东宁市招商局', '周兆明', '13836341678', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '20', '我国在鹿茸及鹿产品深加工方面还处于初级阶段，只是以鹿茸片等初加工产品的形式上市，市场上缺少以鹿产品为主要原料的保健品、食品等深加工产品。深加工产品可使鹿产品增值几倍、几十倍，为养鹿业和鹿产品加工业带来无限商机，其发展前景十分广阔。经考察东宁市的纬度、日照、温度等自然环境较适合鹿的生活和生产。\r\n项目建设内容及规模：建设年饲养能力1万只鹿的养殖场；建设鹿舍、运动场、围栏、青贮窖等附属设施；建设鹿繁育中心一处；购置青贮饲料粉碎机等车机具；建设鹿产品加工厂一处；购置加工设备等配套设施；设置种鹿购置费800万元。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江东宁经济开发区', '16', '2020-05-29 14:30:17', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403141502179.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (454, '742fa3b3-7260-11ea-b0bb-ac1f6b639ec0', '佳木斯市高端养生养老中心建设项目', '佳木斯', '东风区', '佳木斯-东风区', '其他', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '30000', '一般', '5', '7000', '4000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '项目规划占地面积3万平方米，建筑面积6万平方米，主要建设社会养老中心、老年人康复中心、医疗中心、配套建设一座老年文化活动中心、健身馆、会议厅、门球场等设施，打造高端医养结合养老中心。项目主要建设地点有两处可供选择，第一处为佳木斯市建国镇北侧（该地块北临松花江，南临长安东路。）第二处为佳木斯市东风区南兴社区原造纸厂南门（该地块属养老服务类性质建设用地，现为净地）。', '康养产业', '康养', '其它', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525101432568.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (455, '74300d50-9cd5-11ea-8a5d-00ff338109dc', '麦饭石综合开发项目', '齐齐哈尔', '碾子山区', '齐齐哈尔-碾子山区', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '3500', '一般', '5', '1050', '350', '筹划', '无', '', '', '碾子山区经合局', '胡春艳', '13045244456', 'nzsqzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '30', '建设地点原土特公司院内，占地约30000平方米。主要建设集办公、研发、仓储、生产、运输、销售六大功能为一体的麦饭石综合开发项目。产品包括麦饭石日化品类、小家电类、保健用品、麦饭石食品等。', '非金属矿物制品产业', '特种陶瓷', '其它', '23', '2020-06-04 14:02:09', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523171253449.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (456, '7438a3ff-804b-11ea-b0bb-ac1f6b639ec0', '大米制品', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '22000', '一般', '5', '6500', '2000', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '40', '富裕县是优质东北大米生产基地，是黑龙江省西部的产粮大县，水稻面积达到70万亩。拟建年产万吨大米系列制品生产加工项目，引进方便米饭、营养早餐、米粉、米酒、米胚和米乳饮料等生产线。预计年可实现销售收入2.2亿元，利润6500万元。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江富裕经济开发区', '38', '2020-06-04 14:05:36', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522153534454.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (457, '74c505a0-7394-11e8-a795-ac1f6b639ec0', '松花江温泉水城建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '合作', '50000万元（7717.5万美元）', '20000', '一般', '8', '6000', '4000', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '200', '项目建设地点在哈尔滨市通河县，占地面积约150亩，该地地热资源丰富，适合开发此项目。拟建设温泉度假酒店、温泉水上乐园、温泉养身会馆、温泉康体中心、温泉街等。黑龙江省国土资源厅勘探结论，通河县乌鸦泡镇五四村“通热1井”，为全省流量最大的地热井，一口地热井可为8平方米居住面积进行冬季供热。项目建成后将满足游客需求。\r\n', '旅游产业', '旅游', '黑龙江通河经济开发区', '115', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524212305271.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (458, '74ef9b29-9e88-11ea-8a5d-00ff338109dc', '梅花山养老基地项目', '伊春', '伊美区', '伊春-伊美区', '其他', '第三产业', NULL, '独资', '120000万元（18522.0万美元）', '48000', '重点', '8', '14400', '2880', '可研', '无', '', '', '伊春新昊绿色旅游集团', '赵德友', '13804853103', '275033850@163.com', '伊春市经济合作局', '宿岩', '15545089999', '670633330@qq.com', '850', '建设三甲级医院标准，总建筑面积3.2万平方米，建设养老公寓，设置养老床位数1000张，配套建设餐厅、图书室、娱乐室、会议室、管理办公室、物业办公室等。', '旅游产业', '旅游', '其它', '20', '2020-05-27 23:11:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525210550263.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (459, '755f90a9-74d8-11ea-b0bb-ac1f6b639ec0', '明水县年屠宰50万只肉羊综合加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '13000万元（2006.55万美元）', '60000', '重点', '2', '7500', '3500', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '220', '该项目总投资1.3亿元，固定资产投资9000万元。项目的建设可以吸收、安置下岗工人和社会闲散劳动力220人项目达产后，日屠宰肉羊2000只，年屠宰肉羊50万只、生产羊肉1.7万吨。该项目符合我国畜牧业近期的发展重点，在利用公司现有肉羊、技术和条件的基础上，通过扩大繁育规模，对推广优质的良种肉羊提高肉羊肉的适口性、营养性和保健性将起到一定作用；其次，本项目的建设符合肉羊发展趋势，产品价格更具优势，通过优质肉羊生产的规模化、产业化，对整体提高肉羊的品质都具有积极意义。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江明水经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115645576.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (460, '7581db7b-b9d8-11eb-a12f-00ff338109dc', '生猪养殖加工一体化项目', '牡丹江', '东宁市', '牡丹江-东宁市', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '21000', '一般', '15', '6000', '1000', '筹划', '无', '', '', '东宁市农业农村局', '周进华', '13704635820', 'dnszyccyb@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '东宁市为“九山半水半分田”的地理概貌，资源丰富，养殖饲料充足，为我市生猪养殖提供了优势条件。经考察东宁市的大气环境、水源和土壤环境质量都符合国家质量标准，适宜作为生猪养殖的生产基地。建设5万头生猪标准化养殖场，配套1.5万亩新型饲料基地、科研所和生猪屠宰厂、冷藏库以及冷链物流设施。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '3', '2021-08-05 13:53:58', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (461, '75956242-7d33-11ea-b0bb-ac1f6b639ec0', '滴道区粉煤灰综合利用项目', '鸡西', '滴道区', '鸡西-滴道区', '制造业', '第二产业', NULL, '独资', '6000万元（926.1万美元）', '9000', '一般', '5', '1200', '780', '筹划', '无', '', '', '滴道区发展和改革局', '刘丹祥', '13351177676', 'ddqfgj2455@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '55', '粉煤灰是煤燃烧后产生的废弃物, 主要由火力发电厂通过烟气过滤、电分离等方法收集后排放。建设年产20万立方米粉煤灰加气混凝土、水泥等高附加值产品。主要建设生产车间厂房、库房、仓库、等其他辅助用房。', '煤炭精深加工产业', '煤炭深加工', '其它', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525102850682.docx');
