INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (463, '7617fbad-b9db-11eb-a12f-00ff338109dc', '东河畜禽养殖及种养加综合循环产业园项目', '牡丹江', '西安区', '牡丹江-西安区', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '70000', '重点', '5', '20000', '2600', '筹划', '无', '', '', '西安区农业农村局', '牛立辉', '13903631155', 'mdjzd@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '200', '项目选址温春镇东河畜牧场，总占地面积734万平方米，通过建立“种-养-加”一体化经营与秸秆资源化利用模式，打造一座畜禽养殖及种养加综合循环产业园区。主要建设粮食种植基地、万头养猪场、万头肉牛养殖场、万只鹅、鸡、鸭养殖基地、十万只鹌鹑养殖基地，以及畜禽屠宰加工厂、大型食品加工厂、有机肥加工厂。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '5', '2021-08-10 09:53:07', '');
