INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (467, '7779b5e2-736e-11e8-a795-ac1f6b639ec0', '通用航空机场建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '交通运输、仓储和邮政业', '第三产业', NULL, '其他', '22000万元（3395.7万美元）', '30000', '一般', '3', '9000', '6000', '筹划', '无', '', '', '通河县交通局', '闫少君', '18003660001', 'thljiji@126.com', '通河县招商局', '王吉星', '15045499337', 'thzsj@126.com', '110', '项目建设地点在通河县通河镇，拟建设长度为1200米，宽为30米的机场跑道，建设还包括通航运营区、行政商业研发区、航空产业配套区、生活配套区、休闲旅游区、通航休闲娱乐区等。该项目建成后将成为集产业、商业、生活娱乐为一体的具有特色的通用航空小镇。', '航空产业', '航空', '黑龙江通河经济开发区', '74', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524213059987.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (468, '7793d917-83a8-11ea-b0bb-ac1f6b639ec0', '20万吨/年玉米胚芽油加工项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '23000万元（3550.05万美元）', '27000', '一般', '5', '5000', '2000', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '2020年，我国居民人均年食用油消费量为20公斤，消费需求总量将达到2900万吨，玉米油按消费比例达到20%，则有580万吨的需求量，要达到欧美国家的70%，玉米油需求量将为1820万吨，市场需求空间巨大。大同区及周边玉米种植面积777万亩，年产量达500万吨，丰富的玉米资源，使得原材料供应充足。\r\n项目拟建在大同经济开发区（食品园区），总占地面积6万平方米，主要建设玉米胚芽油初榨车间、精炼车间、包装车间、仓储设施及配套设施，安装玉米破碎系统、干燥与风送系统、玉米胚芽预处理、预榨膨化、浸出工艺及相关设备等。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江大同经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143029307.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (469, '77f67fe5-74d9-11ea-b0bb-ac1f6b639ec0', '勃利县蓝靛果种植基地及深加工项目', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '20000万元（3087.0万美元）', '13000', '一般', '5', '3900', '1300', '筹划', '无', '', '', '勃利县经济合作促进局', '耿元海', '13349321335', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '勃利县蓝靛果资源十分丰富，是蓝果的原产地，2014年获得了勃蓝靛果地理标识，目前种植面积1.6万亩，年产量3000吨。建设内容：蓝靛果种植面积3000亩，年加工果汁、冷果冻、浓缩果汁、果酒、蓝靛果色素提起、药材、保健品1万吨。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '19', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174833430.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (470, '78cbe145-74d6-11ea-b0bb-ac1f6b639ec0', '明水县南瓜籽油及南瓜籽蛋白加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '25000万元（3858.75万美元）', '15000', '重点', '3', '4500', '462', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '270', '本项目总投资2.5亿元，可安置270余人闲散待就业劳动力，有助于缓解我县就业压力。以南瓜籽精深加工为主要生产方向，主要进行南瓜籽油和南瓜籽蛋白的高效提取、精深加工，充分结合我县籽用南瓜资源特点，对南瓜籽资源进行了深度开发，开发具有显著生物活性的高附加值南瓜籽产品。本项目引进高端生产加工设备，充分应用酶反应、低温压榨技术、喷雾干燥等先进技术工艺，能够同时高效提取南瓜籽油和南瓜籽蛋白，较好地保持南瓜籽油脂的营养和功能成份的稳定性而且所得饼粕质量好，具有很高的营养价值和显著的生物活性，符合我国食品发展方向，是农产品加工产业政策、发展趋势的具体体现的需要。\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江明水经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521114608245.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (471, '78cd783f-7349-11ea-b0bb-ac1f6b639ec0', '佳木斯市鹰山户外运动基地开发项目', '佳木斯', '汤原县', '佳木斯-汤原县', '其他', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '10000', '一般', '10', '3000', '1200', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '鹰山位于大亮子河国家森林公园，汤原县西北30公里处，小兴安岭南麓，亮子河畔，海拔721米，距佳木斯市76公里，是山岳型自然风景旅游区。因山体像一只展翅翱翔的雄鹰而得名，周围群山环绕，河流密布，是黑龙江省东部户外登山运动爱好者首选户外运动目的地，现已成功晋升为国家A级景区。鹰山户外运动基地以鹰山景区为依托，整合灰坝资源点，打造拓展、探险、露营、穿越为一体的户外休闲运动基地。主题定位为：动感鹰山，快乐无限。主要建设鹰山景区、户外拓展基地、岩壁探险公园、山洞宾馆、灰坝露营地、鹰山—陶家湾穿越线路、观光缆车等，建筑面积建筑面积16000平方米左右。', '旅游产业', '旅游', '黑龙江汤原经济开发区', '2', '2021-08-10 10:44:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707140128684.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (472, '78f30139-9bd8-11ea-8a5d-00ff338109dc', '亚布力旅游小镇建设项目', '哈尔滨', '尚志市', '哈尔滨-尚志市', '租赁和商务服务业', '第三产业', NULL, '合资', '1500000万元（231525.0万美元）', '350000', '重点', '15', '100000', '33333', '筹划', '无', '', '', '尚志市商务局', '闫宏伟', '13136658887', 'w53343231@163.com', '尚志市商务局', '孙玉龙', '15084697345', 'w53343231@163.com', '500', '项目建设地点在哈尔滨尚志市亚布力镇至亚布力锅盔山脚下，占地面积5.32平方公里。亚布力是哈牡客专重要一站，建有世界闻名的亚布力滑雪场，负氧离子含量高，自然资源丰富。拟建设东北民俗体验园、冰雪文化体验区等旅游景区，并建设游客接待中心、度假酒店、地产品商业街等。该项目将向冰雪旅游、体育赛事、健康产业等方向发展。项目建成后将接待游客60万人。凭借亚布力滑雪场的品牌优势，将吸引各地游客，项目前景广阔。', '旅游产业', '旅游', '黑龙江尚志经济开发区', '81', '2020-06-03 14:07:54', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200602105801900.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (473, '79568676-8218-11eb-94a7-00ff338109dc', '北安市啤酒大麦产业一体化项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '合资', '75000万元（11576.25万美元）', '97000', '一般', '5', '15000', '13000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市位于哈尔滨、齐齐哈尔、伊春和黑河四座城市的中心，距黑河市248公里，黑河市与俄罗斯阿穆尔州首府布拉戈维申斯克市隔江相望，俄罗斯阿穆尔州首府布拉戈维申斯克市，属季风性气候，冬季严寒少雪,夏季凉爽多雨，水资源十分丰富，土地资源丰富，且地价租金便宜，适合大麦种植。北安市地下水中富含矿质锶，对啤酒的生产有很大的优越性。项目采用境外种植方式、境内北部山区种植及境外订单模式。拟建项目种植大麦6.6万公顷（100万亩），亩产达到400公斤，年产大麦40万吨，生产啤酒5万吨及1万吨精酿啤酒，生产饲料4万吨，总占地15万平方米，总建筑面积15万平方米。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江北安经济开发区', '2', '2021-08-10 10:00:35', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (474, '79a404a7-6f26-11ea-b0bb-ac1f6b639ec0', '医疗器械生产项目', '哈尔滨', '宾县', '哈尔滨-宾县', '制造业', '第二产业', NULL, '独资', '8000万元（1234.8万美元）', '10000', '一般', '2.5', '1000', '800', '筹划', '无', '', '', '宾县经济合作促进局', '王亚芝', '15246631345', 'bxzsj@163.com', '宾县经济合作促进局', '刘士诚', '13359762527', 'bxzsj@163.com', '80', ' 项目占地1万平方米，总投资8000万元（固定资产投资+流动资金）建设地址：黑龙江省哈尔滨市宾县区域内，拟建设现代化全自动生产线，自有技术研发中心，研发高端前沿医疗器械。项目投入运营后，年实现销售收入1亿元、利润1000万元、税金800万元。（详见附件）', '高端装备制造产业', '高端医疗器械', '宾西经济技术开发区', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524085422040.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (475, '79dca80e-ba09-11eb-a12f-00ff338109dc', '生猪标准化养殖基地建设项目', '伊春', '嘉荫县', '伊春-嘉荫县', '农、林、牧、渔业', '第一产业', NULL, '独资', '15000万元（2315.25万美元）', '30000', '一般', '2', '7500', '3000', '筹划', '无', '', '', '嘉荫县招商引资服务中心', '焦爽', '15245885588', 'jyzsyz@136.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '100', '项目位于嘉荫县原红旗林场场址，距嘉荫县城约13公里。项目总百地面积25公顷，总建筑面积73000平方米，建设娠舍、分娩室、保育舍、后备种猪舍、隔离舍等猪舍76栋，配套建设管理用房、库房、粪污处理中心等，规划年出栏商品育肥猪15万头。该项目于2017年开工建设，现已完成68栋猪舍主体工程，后因企业资金链断裂，现已停工。为推进已落地项目尽快建成投产，拟新引进社会资本完成剩余工程建设。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '14', '2021-08-10 09:52:05', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (476, '79f3bcc8-b7c3-11e8-b0d1-ac1f6b639ec0', '肇东市松花江大型养老中心项目', '绥化', '肇东市', '绥化-肇东市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '8000', '重点', '8', '2400', '800', '筹划', '无', '', '', '肇东市招商局', '付吉丽', '13845128005', 'zd-zsyzj@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '肇东市与省会哈尔滨市仅一江之隔，只需15分钟车程，进入哈市区内仅18分钟车程，301快速通道和五源路快速通道横穿全境，滨江大道纵贯东西紧邻松花江黄金水道。本项目充分发挥区位优势，利用松花江68公里文化生态旅游资源，建设占地面积5万余平方米，总建筑面积达20万平方米，包括中心公园、老年住宅公寓、商业、酒店、养护中心、老年病医院、康复中心等。', '康养产业', '康养', '黑龙江肇东经济开发区', '71', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (477, '7a0c1d0f-a2f0-11e9-815b-ac1f6b639ec0', '黑蜂产品开发建设项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '其他', '7000万元（1080.45万美元）', '18000', '一般', '3', '2900', '2600', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '500', '新建厂房2000平方米、库房1800米。新上蜂蜜、蜂王浆、花粉、蜂制品四条生产线，达到年生产800吨蜂蜜、蜂王浆20吨、蜂胶5吨、蜂花粉80吨、蜂蜜花粉酒500吨的生产规模。建设生产车间、库房、办公楼、职工宿舍、食堂等设施。', '生物医药产业', '生物医药', '黑龙江虎林经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145442010.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (478, '7a2da59c-b236-11eb-9405-00ff338109dc', '漠河市黑龙江省源头界江异国风情游项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '其他', '第三产业', NULL, '独资', '5000万元（771.75万美元）', '1500', '重点', '11', '450', '350', '筹划', '无', '', '', '漠河市商务局', '梁忠元', '13845791136', 'mohezhaoshang@163.com', '大兴安岭地区商务局', '李晓倩', '13845720336', 'dqzsyqb@163.com', '20', '漠河市境内黑龙江是全国最长、最大界江，源头洛古河至黑河市江段长900公里，水量丰富，江宽水深，水流平稳，从这里乘坐游艇可畅游大马场、北极村、古城岛（雅克萨古战场）、吴八老岛、八十里大湾，直达黑河与五大连池相连，沿途两岸峰峦叠嶂、风光旖旎，“不亚于三峡，不逊于漓江”。项目将以漠河中俄两岸城市风光为依托，游艇以每小时20—30公里的航速旅游观光，在游艇上设置餐饮、娱乐等休闲设施，使游客既可饱览黑龙江风光，又能享受游艇的休闲娱乐，主要建设游艇观光码头、小酒吧等休闲场所以及打造观光游艇。', '旅游产业', '旅游', '黑龙江漠河经济开发区', '5', '2021-08-06 16:19:03', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (479, '7a396d14-74e4-11ea-b0bb-ac1f6b639ec0', '轮胎裂解项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '独资', '16000万元（2469.6万美元）', '20000', '一般', '2', '6000', '2400', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '该项目位于黑龙江东部循环利用产业园区内，通过对轮胎破碎、分拣等工艺循环再利用，制作地胶系列产品。轮胎破碎生产线引进德国先进设备，年破碎轮胎能力2万吨，将废旧轮胎经轮胎破碎、粗碎、细碎等工序将轮胎破碎分选为钢丝、毛丝、4-8目胶粒、26-60目胶粉等产品，钢丝和毛丝是冶金行业抢手的原材料。', '高端装备制造产业', '交通装备', '其它', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152112961.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (480, '7a5f2528-6e4f-11ea-b0bb-ac1f6b639ec0', '化工中间体项目', '哈尔滨', '依兰县', '哈尔滨-依兰县', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '30000', '一般', '4', '8000', '1040', '筹划', '无', '', '', '依兰县投资促进合作中心', '冯巍', '18845755333', 'ylzsj2013@163.com', '依兰县投资促进合作中心', '项广大', '15603619000', 'ylzsj2013@163.com', '60', '该项目是以苯胺、亚硝酸钠、氟化氢、氢氧化钠碱液、浓硫酸、石粉等为原料，采用无水氟化氢法生产氟苯化合物的新建项目，占地面积约为4.32万平方米，建筑面积2.16万平方米，主要建设内容为车间、仓库、办公楼、配电房、锅炉房、冷冻车间、化验室、罐区、氟石膏处理等。', '石化产业', '石化', '黑龙江依兰经济开发区', '18', '2020-05-28 11:54:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200325121702265.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (481, '7a72255e-9d79-11ea-8a5d-00ff338109dc', '帐篷营地项目', '齐齐哈尔', '碾子山区', '齐齐哈尔-碾子山区', '住宿和餐饮业', '第三产业', NULL, '独资', '1500万元（231.52万美元）', '1000', '一般', '5', '300', '30', '筹划', '无', '', '', '碾子山区经合局', '胡春艳', '13045244456', 'nzsqzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '30', '建设集餐饮、住宿、服务为一体的服务中心，营地包括服务区、宿营区和休闲区三大区域。宿营区主要建设帐篷露营基地、汽车露营基地、服务区主要建设度假木屋、公共卫浴用房、餐饮；休闲区主要建设汽车影院、真人CS等体验项目。', '旅游产业', '旅游', '其它', '13', '2020-06-04 13:59:02', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524124605889.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (482, '7a9c55c3-ba1a-11e8-b0d1-ac1f6b639ec0', '嫩江硬质春小麦专用粉及深加工产          品、 主食工业化项目', '黑河', '嫩江县', '黑河-嫩江县', '制造业', '第二产业', NULL, '独资', '12800万元（1975.68万美元）', '46600', '重点', '4.6', '11000', '2000', '筹划', '无', '', '', '嫩江县招商局', '周茂波', '18724317888', 'njxzsj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '165', '嫩江县域内土地广袤，耕地面积1026.39万亩，其中县属耕地面积648.25万亩。强筋春小麦种植面积为全省之首，粮食产量年均30亿斤，是全国产粮大县，素有“北国粮仓”之美誉。嫩江县红皮硬质春小麦种植面积为70万亩，年产21万吨，麦作产区土质肥沃、光照时间长、纬度高、昼夜温差大，因而具有面筋强度高、面味好，固体可溶性高的特性，适宜开发小麦精深加工产业。本项目建日处理小麦500吨专用面粉生产线、日生产50吨杂粮挂面生产线，项目建成后生产时间按300天/年计算，可年加工小麦15万吨，年生产各类面粉11.25万吨、次粉0.75万吨、麸皮3万吨、杂粮挂面1.5万吨。\r\n\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江嫩江经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401095620324.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (483, '7af2433b-7392-11e8-a795-ac1f6b639ec0', '养生养老项目', '哈尔滨', '通河县', '哈尔滨-通河县', '居民服务、修理和其他服务业', '第三产业', NULL, '合作', '30000万元（4630.5万美元）', '15000', '一般', '7', '4500', '3000', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '80', '项目建设地点在哈尔滨市通河县，该县旅游资源丰富，依托铧子山负氧离子含量较高和二龙潭生态湿地优势，为该项目建设提供了优越条件。拟建设旅游和养老接待中心、“氧洞”、温泉疗养、老年人活动室、医院、疗养院等。项目建成后，可保证老年人旅游观光与养生养老的综合体验，符合现代老年人养生养老需求，预计可接待千人以上，市场前景广阔。', '康养产业', '康养', '黑龙江通河经济开发区', '140', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524205817447.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (484, '7b032e86-74e9-11ea-b0bb-ac1f6b639ec0', '标准化养殖产业园区项目', '七台河', '新兴区', '七台河-新兴区', '农、林、牧、渔业', '第一产业', NULL, '合资', '49950万元（7709.78万美元）', '5000', '一般', '3', '1500', '450', '筹划', '无', '', '', '新兴区招商办', '尚福全', '15246400505', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '450', '建设规模为父母代肉种鸡60万套、肉种鸭30万只，以及配套的15万吨/年全价饲料加工生产线、1万吨/年有机肥粪污处理场。总建筑面积25.8万平方米，新建育雏种鸡舍20栋、育成和产蛋种鸡舍80栋、标准化种鸭舍70栋，粪污处理场1座，购置安装种鸡、种鸭、饲料加工和粪污处理生产线设备356台套，建设繁育、养殖生产—加工—冷储—配货—发货一条龙现代产业园区物流智能系统。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521173614560.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (485, '7b932df6-7263-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产25万立方米无甲醛秸秆生态板项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '90000万元（13891.5万美元）', '80000', '一般', '5', '20000', '7500', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '项目建设地点富锦市经开区，享受省级开发区优惠政策。占地面积15公顷，建筑面积10公顷。建设内容，购置生态板生产线1条，设备共300台(套）。项目投产后年生产无甲醛生态板25万立方米。资源优势，富锦地势平坦，适合秋季秸杆机械大规模作业。由于本地气候特点，秸杆便于收储保管。富锦年际间产秸杆300多万吨，可为秸杆综合利用提供充足的原料。区位优势，富锦经开区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '节能环保产业', '秸秆综合利用', '黑龙江富锦经济开发区', '14', '2020-06-02 14:34:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151247368.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (486, '7c236fe9-732b-11ea-b0bb-ac1f6b639ec0', '望奎县地产果深加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '10000', '重点', '5', '2000', '300', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '200', '奎县卫星镇位于呼兰河北岸，丘陵地形分布广泛，非常适合各种果树种植。年均种植面积2509亩，地产果年商品量300万公斤，而且果质鲜脆、绿色无污染，适合加工罐头、果酒、果脯及果汁饮料。目前望奎县尚无一家大型果制品深加工企业，该项目市场前景看好。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江望奎经济开发区', '14', '2020-06-02 14:41:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111914335.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (487, '7c4aa258-73c7-11ea-b0bb-ac1f6b639ec0', '佳木斯市20万吨稻米精深加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '14500', '一般', '6', '3900', '1500', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '抚远地处三江平原腹地，肥沃的土质，充足的光照，适宜的雨量，为农业发展提供天然保障。抚远市属耕地面积264万亩，其中，水稻种植面积达152万亩，年产水稻近百万吨。经由江水灌溉产出的稻米品质优、口感好，深加工后的米制食品含有丰富的蛋白质、脂肪、多糖、矿物质等营养素。本项目建设地点位于经济开发区，占地面积5万平方米，主要建设内容包括生产车间、包装车库、成品库、办公楼、地坪、烘干塔及其它附属配套设施等。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江抚远经济开发区', '71', '2021-08-11 11:37:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102037960.doc');
