INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (489, '7cb2d7b6-8a59-11e8-82a4-ac1f6b639ec0', '羊鼻山石墨矿“探、采、选、加”一体化项目', '双鸭山', '岭东区', '双鸭山-岭东区', '采矿业', '第二产业', NULL, '其他', '30000万元（4630.5万美元）', '15000', '重点', '7', '4400', '3630', '筹划', '无', '', '', '双鸭山市同力科达资源开发有限公司', '金明浩', '14784690688', '393455417@qq.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '100', '羊鼻山石墨矿勘探普查区面积11.7平方公里，现普查工作已经完成50%，阶段性普查报告已经提交，推断石墨矿石量605.6万吨，矿物量29.8万吨，平均品位6.23%。石墨呈大鳞片状。该项目拟建在双鸭山市新材料（石墨）产业园区（也可另选址），建设期：4年，采用“探、采、选、加”一体化模式，年开采矿石60万吨（具体以采矿证批复为准）；加工石墨精粉3万吨；高纯石墨3万吨；球型、膨胀石墨等系列产品3万吨。（具体合作事宜可致电或面谈）', '新材料产业', '石墨', '其它', '48', '2020-05-26 11:02:14', '');
