INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (496, '7e2f0881-863d-11e8-9218-ac1f6b639ec0', '现代物流配送基地建设项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '12000', '一般', '10', '2000', '700', '筹划', '无', '', '', '杜蒙县经济贸易合作服务中心', '奚晓东', '13684595710', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '500', '项目建设地点在杜尔伯特蒙古族自治县泰康镇，占地面积8万平方米，建筑面积7万平方米。为满足杜蒙县境内市场的需求，拟对外招商建设现代物流配送基地。拟建设厂房、仓库、车库等辅助用房，铺设道路，电缆等。项目将涵盖建材五金、农牧果蔬、家具家电、日杂百货等多个领域，并将配备物流信息电子平台，实现全国货物信息共享。杜尔伯特蒙古族自治县铁路、公路、水路等交通网络纵横交错，是哈大齐工业走廊的重要交通枢纽，有很好的建设物流基地基础。', '物流产业', '物流', '黑龙江杜尔伯特经济开发区', '126', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (497, '7e75492b-7524-11e9-815b-ac1f6b639ec0', '苏打水生产加工项目', '齐齐哈尔', '拜泉县', '齐齐哈尔-拜泉县', '制造业', '第二产业', NULL, '独资', '6500万元（1003.27万美元）', '10000', '一般', '5', '2000', '1100', '筹划', '无', '', '', '齐齐哈尔市拜泉县经合局', '武鹏', '04527668888', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '80', '天然苏打水的天然小分子团（分子团60Hz）结构和富含均衡的离子态矿物质及微量元素极易被人体吸收，长期饮用能够清除人体内的酸性代谢物，调节人体酸碱度，改变酸性体质。拟在拜泉县投资建设天然苏打水项目，建设周期为2年，引进天然苏打水生产线1条，年可加工生产天然苏打水5万吨。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江拜泉经济开发区', '38', '2020-06-04 14:05:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522141633541.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (498, '7f0385c4-aa5a-11e8-8e63-ac1f6b639ec0', '孙吴县沙棘系列产品开发产业化项目', '黑河', '孙吴县', '黑河-孙吴县', '农、林、牧、渔业', '第一产业', NULL, '合资', '8000万元（1234.8万美元）', '29000', '重点', '2.78', '3500', '1300', '可研', '有', '', '', '孙吴县招商局', '赵义友', '13329466003', '8422728@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '80', '孙吴县大果沙棘种植面积达十万余亩，沙棘油“维生素宝库”之称，每百克沙棘果中维生素C可高达800~850毫克，沙棘含有人体必需的微量元素为11种。项目建设生产及辅助生产用房4万平方米；建设沙棘原料基地种植5万亩；年产沙棘浓缩汁80吨、沙棘果粉30吨、沙棘果汁油1.8吨、沙棘果皮油4.2吨、沙棘籽油5吨、沙棘果皮36吨、沙棘自粕67吨、沙棘饮料2000吨、沙棘果酒800吨。年可实现销售收入29000万元，利润3500万元，税金1300万元。\r\n\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江孙吴经济开发区', '122', '2021-08-10 10:11:59', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521193552947.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (499, '7f207eaf-72f3-11ea-b0bb-ac1f6b639ec0', '佳木斯市高铁新商圈项目', '佳木斯', '前进区', '佳木斯-前进区', '房地产业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '30000', '一般', '10', '8000', '2000', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '1000', '项目区域依托高铁站、公铁联运交通枢纽及和平路南北贯通等先进配套基础设施，辐射周边能力强。哈佳高速铁路已于2018年10月开通，高铁站选址地位于林海路中段北侧，与项目地隔街相望。佳木斯和平街下穿工程已于2018年5月投入使用，起到有效连接佳木斯南北两侧大动脉作用。林海路与先锋路之间，将成为我市新一轮发展的重点区域。项目主要打造集吃、住、行、购物、娱乐、体验为一体的大型综合体，总投资10亿元占地面积约11万平方米，主要建设商贸中心、娱乐中心。商贸中心主要包括大型商贸购物广场、星级酒店、办公写字楼及地方特色营销中心。娱乐中心主要包运动健身会馆、室内各类球馆、电子游戏室、室内滑冰、滑雪、水上游乐中心等', '现代商贸产业', '现代商贸', '其它', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523093714471.doc');
