INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (502, '7f572620-73c5-11ea-b0bb-ac1f6b639ec0', '年产5万吨营养速食米项目', '绥化', '庆安县', '绥化-庆安县', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '10000', '重点', '2', '2500', '375', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '50', '人们对营养速食米的需求量将大大增加，营养速食米销售总体呈上升趋势。庆安县是优质大米之乡，年生产优质大米60万吨，米质优良，口感好。该项目采用优质大米为原料，采取蒸煮的方法，即用蒸汽进行汽蒸，其目的是使大米在水、热和时间的作用下，吸收水分，并使淀粉糊化，蛋白质变黑（即大米蒸熟）。该项目拟建设年产5万吨营养速食米加工厂，新建生产车间、库房、仓储等，新上2条生产线。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江庆安经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204043065.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (503, '8014b29d-7a0e-11e8-9615-ac1f6b639ec0', '哈尔滨火车站周边区域综合改造招商项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '800000万元（123480.0万美元）', '200000', '一般', '15', '53333', '500', '筹划', '无', '', '', '道里区招商局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区招商局', '于鹏怡', '18686775832', 'daolizsj@163.com', '50', '项目建设地点在哈尔滨市主城区中部，占地面积5.8万平方米，建筑面积27万平方米，其中地上建筑面积23.7万平方米，地下建筑面积3.67万平方米。拟依托哈站人流、物流、信息流、资金流集聚优势和辅助功能,建设发展集高端写字楼、文化创意、五星级酒店购物中心、餐饮为一体的城市综合体，打造功能完善的火车站周边CBD。', '现代商贸产业', '现代商贸', '其它', '121', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161031979.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (504, '802f1677-6cc5-11ea-b0bb-ac1f6b639ec0', '绿色农产品深加工产业园项目', '哈尔滨', '呼兰区', '哈尔滨-呼兰区', '制造业', '第二产业', NULL, '合资', '400000万元（61740.0万美元）', '150000', '一般', '10', '8000', '560', '筹划', '无', '', '', '呼兰区企业和投资服务局', '乔德龙', '13936229188', 'zhaoshangju2011@126.com', '呼兰区企业和投资服务局', '石海荣', '13351614077', 'zhaoshangju2011@126.com', '800', '项目占地面积约1平方公里。园区围绕建设呼兰健康产业城的总体规划，在产业定位上充分利用省内农牧业资源，以乳类、豆类、薯类、肉类、玉米等为主要原料，以粮食产品、休闲食品、肉类食品、饮料制品为主导，同步发展食品检验、包装、仓储、物流等配套服务产业，打造省内绿色食品重要生产加工和出口基地，形成配套设施完善的现代化绿色食品产业园区。区内铁路、公路、航空、水运“四位一体”的交通网络，是连接黑龙江及俄罗斯、东欧、东北亚地区的重要通道。呼兰经济开发区是新建的省级开发区，规划区内现状土地以一般农田为主，立足农业资源基础，拉长“食尾”，做大“工尾”，发展高品质食品加工，加速食品产业园区产业链集群发展。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江呼兰经济开发区', '80', '2020-06-01 09:26:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529192919404.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (505, '8038c6d0-6fad-11e8-a261-ac1f6b639ec0', '山野菜加工项目', '哈尔滨', '延寿县', '哈尔滨-延寿县', '制造业', '第二产业', NULL, '独资', '3200万元（493.92万美元）', '3000', '一般', '4', '720', '180', '筹划', '无', '', '', '延寿县招商服务中心', '张超群', '18545867165', 'yszsj2013@163.com', '延寿县招商服务中心', '刘建华', '15945967855', 'ljh555555@163.com', '150', '项目建设地点在哈尔滨市延寿县，占地面积1.2万平方米，建筑面积3200平方米。全县山野菜资源丰富，储量大，可采面积达10万亩左右，原料充足。拟建设生产车间、厂房、办公楼等附属用房，新上生产线等。山野菜无污染，营养价值高，近年来受到消费者的亲睐，市场前景广阔。项目达产后，可年产速冻山野菜1200吨和山野菜冻干300吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江延寿经济开发区', '216', '2020-05-26 11:02:14', '');
