INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (508, '80c13034-751e-11e9-815b-ac1f6b639ec0', '特种漆包线项目', '齐齐哈尔', '富拉尔基区', '齐齐哈尔-富拉尔基区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '52500', '一般', '3', '8000', '3000', '筹划', '无', '', '', '齐齐哈尔市富拉尔基区经合局', '赵勇', '13079695776', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '100', '漆包线是绕组线的一个主要品种。漆包线是电机、电器和家用电器等产品的主要原材料,特别是近几年电力工业实现了持续快速增长,家用电器的迅速发展,给漆包线的应用带来较广阔的领域。项目依托铜冶炼龙头企业黑龙江紫金铜业正在兴建的其年产15万吨阴极铜项目(年底即可投产)。', '有色金属精深加工产业', '金属精深加工', '黑龙江富拉尔基经济开发区', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522142357557.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (509, '8117cbf1-a170-11ea-8a5d-00ff338109dc', '年产10万吨燃料电池石墨双极板项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '17000万元（2623.95万美元）', '15000', '一般', '8', '2000', '1300', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '本项目占地面积17000平方米，总建筑面积20000平方米，主要建设成品库房、办公、实验室、化验室、门卫室、生产车间等，年产燃料电池石墨双极板10万吨。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新能源产业', '氢能', '大庆经济技术开发区', '8', '2020-05-30 16:01:42', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529135156220.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (510, '81727123-8509-11ea-b0bb-ac1f6b639ec0', '漠河市龙文化主题公园开发项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '居民服务、修理和其他服务业', '第三产业', NULL, '合作', '8150万元（1257.95万美元）', '4500', '重点', '7', '1200', '130', '建设', '有', '', '', '漠河市商务局', '张明亮', '15714678669', 'mhcxw1982@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '60', '漠河市位于祖国最北端—金鸡之冠，素有“神州北极”的美誉，是纯正的天然大氧吧、“全国十佳避暑小镇”，无与伦比的生态环境使漠河成为稀有的天然净土，集聚了我国最密集的高品质寒温带林业生态景观，全国唯一可以观赏北极光和体验极昼极夜的地方，北极村景区已升级国家级AAAAA级旅游景区。项目依托优越的旅游资源，借助黑龙江中国最大、最北界江，以“龙”文化为主题元素，公园内设置入口服务区、森林休闲运动区、龙文化祈福区、主题餐饮住宿区、龙文化展示区等五个功能区，主要建设申请吉尼斯纪录的巨型龙头、龙生九子文化广场等设施，建设集住宿、餐饮、休闲、度假、观光为一体的综合性旅游项目。', '旅游产业', '旅游', '其它', '18', '2020-06-03 15:00:24', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522150859971.doc');
