INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (513, '81fbca96-60aa-11e9-b4f9-ac1f6b639ec0', '五大连池康养城项目', '黑河', '五大连池市', '黑河-五大连池市', '其他', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '10000', '重点', '10', '2000', '1200', '筹划', '无', '', '', '五大连池市经济合作中心', '张宏生', '18545210485', 'wdlcsjhzx@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '五大连池市位于黑龙江省北部，被誉为“中国十大休闲城市”。四季分明、夏无酷暑，气候宜人，7月份气温最高，平均20.8℃，市内无工业污染，空气中负氧离子含量高，矿泉资源独具特色，是亚洲第一个矿泉城。随着我国人口结构经历了从年轻型向老龄化的转变，巨大的老年人消费群体、老年人消费能力和老年人市场需求，必定需要巨大的康养产业。项目建设中高档养老住宅、高级公寓、联体别墅、老年人文化活动中心、老年人用品销售中心、护理医院、矿泉理疗中心、特色老年饮食街、以及家政保安、物流、银行、邮局、保险、老年人主题公园等配套服务设施。', '旅游产业', '旅游', '黑龙江五大连池经济开发区', '42', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524110142969.docx');
