INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (516, '8233b9b8-6e0c-11e8-b8c9-ac1f6b639ec0', '尚志市绿色食用菌综合生产加工项目', '哈尔滨', '尚志市', '哈尔滨-尚志市', '制造业', '第二产业', NULL, '合资', '13000万元（2006.55万美元）', '27000', '一般', '5', '2850', '570', '筹划', '无', '', '', '尚志市商务局', '闫宏伟', '13136658887', 'w53343231@163.com', '尚志市商务局', '孙玉龙', '15084697345', 'w53343231@163.com', '60', '尚志市被中国食用菌协会命名为“中国黑木耳之乡”、“中国黑木耳主产基地县”。项目拟选址在尚志经济开发区，规划面积4万平方米，种植区面积8500平方米，达产年拟形成菇类（鲜品）6000吨、冻干食用菌1000吨、食用菌即食美食产品1000吨、黑木耳（干品）2000吨的生产加工能力。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江尚志经济开发区', '203', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200324093718386.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (517, '8240dc7a-73dd-11ea-b0bb-ac1f6b639ec0', '佳木斯市现代化肉牛养殖基地项目', '佳木斯', '抚远市', '佳木斯-抚远市', '农、林、牧、渔业', '第一产业', NULL, '独资', '50000万元（7717.5万美元）', '35000', '一般', '5', '10000', '5000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '80', '抚远市地处黑龙江、乌苏里江交汇的三角地带,市域经济主要以种植业为主,属中温带湿润大陆性季风气候,四季分明,冬季长冷,夏季短热,雨水充沛,光照充足,年平均温度2.2℃,年平均降水量591.2毫米,适宜牧草、肉牛生长。抚远市耕地面积广阔,农作物种类丰富，秸秆年产量近百万吨，为制作青贮饲料提供了良好保障，同时利用休耕地种植紫花苜蓿等优质牧草，可大幅降低养牛成本，提高牛肉质量，养殖利润十分可观。本项目建设地点位于海青乡，占地面积20万平方米，建设内容包括养殖场区，饲料仓储区，屠宰生产线，有机肥厂等配套设施。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '20', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522140422762.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (518, '827cf298-6e5e-11ea-b0bb-ac1f6b639ec0', '年产6000吨蓝靛果忍冬种植与深加工项目', '黑河', '爱辉区', '黑河-爱辉区', '制造业', '第二产业', NULL, '独资', '31000万元（4784.85万美元）', '120175', '一般', '3.2', '16677.3', '4169.3', '筹划', '无', '', '', '瑷珲对俄进出口加工基地', '刘洋', '17345605706', 'ahgyyq@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '蓝靛果富含糖类、有机酸、矿物质、黄酮类等丰富营养价值，具有清热解毒，治疗心血管疾病，稳定血压，治疗老年人贫血，健脾开胃，养颜益寿，增加和补充少年儿童营养成份，防止毛细血管破裂，改善肝脏的解毒功能，抗肿瘤，增加白细胞，抗炎和抗病毒能力，市场前景广阔。黑河地处达小兴安岭交界处，属寒温带大陆性季风气候，很适宜野生蓝靛果忍冬的生长和繁殖。项目建筑面积7270㎡，购置蓝靛果忍冬果酒生产线、蓝靛果忍冬果醋生产线、黄酮生产线、花青素生产线各一条。\r\n\r\n\r\n', '农业及农副产品精深加工产业', '果蔬加工', '其它', '537', '2020-06-04 14:38:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521200012640.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (519, '82834016-cf32-11eb-a12f-00ff338109dc', '黑蜂田园生态综合体', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '合作', '12000万元（1852.2万美元）', '10000', '一般', '9', '1300', '260', '筹划', '无', '', '', '虎林市农业农村局', '蔺国正', '13274583123', 'hls_lb@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '150', '打造黑蜂田园生态综合体项目，1、建设100家示范蜂场2万群；2、年产黑蜂雪蜜1000吨；3、神顶峰蜂场蜂窖冷库；4、蜂产品精深加工厂房建设；5、森林蜂博物馆康养民宿蜂疗旅游项目。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:45:00', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (520, '82f5c480-843f-11ea-b0bb-ac1f6b639ec0', '优质米粉生产项目', '大庆', '林甸县', '大庆-林甸县', '制造业', '第二产业', NULL, '独资', '24000万元（3704.4万美元）', '60000', '一般', '4', '6000', '2000', '筹划', '无', '', '', '林甸县项目推进管理办公室', '段福臣', '13351393013', 'ldzsyz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '180', '林甸县水稻资源丰富，全县每年种植水稻38万亩、连续多年获评全国产粮先进县，原料充足。林甸县稻米除了口粮外，出口和深加工转化率低，稻米加工处于初加工或粗加工水平， 稻米的深加工、高效转化已成为稻米增值、增效的重要途径。稻米进行有效的深加工全利用，可使稻谷加工前后的产值比粗加工增值近3倍，能够解决卖稻米难、稻米低价运营和大量压库的问题。\r\n项目规划占地面积约300亩，拟新建6万吨/ 年快餐米粉生产线1 条；建设稻谷原料仓储、原料预处理车间、生产车间、包装及后处理车间、成品库等。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江林甸经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521142639505.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (521, '83192ae3-73be-11ea-b0bb-ac1f6b639ec0', '嫩江市杂粮谷物（大豆）饮料产业化项目', '黑河', '嫩江县', '黑河-嫩江县', '制造业', '第二产业', NULL, '独资', '5700万元（879.79万美元）', '15900', '一般', '1.62', '3500', '500', '筹划', '无', '', '', '嫩江市招商服务中心', '周茂波', '18724317888', 'njzhoumaobo@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '项目主要以玉米、大米 、小麦、小米、大豆等五谷杂粮为主要原料，通过挤压机直接膨化或间接膨化生产出具有天然五谷清香、风味独特且含有高膳食纤维的各种形状的全营养谷物早餐、瘦身谷物早餐及适合特殊人群作主食的保健谷物早餐产品。杂粮谷物饮料以大豆为原料，采用国内先进的工业化技术生产手段，科学配比各种营养素蛋白质、脂肪、碳水化合物、矿物质、微量元素含量而生产的健康饮品，产品包括谷物浓浆饮料（大豆浓浆等）、大豆清汁饮料（大豆清汁等）。 项目总投资2700万元，年加工大豆6000 吨，产9 万吨全营养大豆植物蛋白饮料。实现销售收入15900万元，利润5246.52万元，上缴税收500万元。\r\n\r\n', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江嫩江经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401101603716.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (522, '8329fc05-7fad-11ea-b0bb-ac1f6b639ec0', '马铃薯产业化项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '55000万元（8489.25万美元）', '4400', '一般', '7', '1200', '300', '筹划', '无', '', '', '甘南县经济合作促进局', '赵文涛', '18045237733', 'yw@yw-brg.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '50', '甘南县农业资源丰富，气候、土壤条件适宜，马铃薯种植历史悠久，本地农民积累了丰富的马铃薯种植经验。在兴十四现代科技园区建成省级马铃薯种薯科研育种基地1万亩，建成马铃薯综合销售中心（具有线上销售平台、物流配送）1个。该项目占据市场前沿，技术含量高，对全县企业升级具有较强的影响带动作用。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江甘南经济开发区', '40', '2020-06-04 14:05:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522161843407.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (523, '83b18654-a171-11ea-8a5d-00ff338109dc', '年产5万吨石墨烯节能润滑油项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '26000万元（4013.1万美元）', '35400', '一般', '8', '4000', '3000', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '本项目计划占地30000平方米，建设成品库房、办公、实验室、化验室、门卫室、罐区、生产车间等，建设年产能力为50000吨石墨烯润滑油生产线1条。大庆石化、大庆炼化现有高品质石蜡基润滑油基础油7万吨，为发展本项目提供优质原料；高品质石油焦19万吨，可用于生产石墨烯基金属磨损智能修复材料（石墨烯粉体）。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，可依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新材料产业', '石墨烯', '大庆经济技术开发区', '6', '2020-05-30 16:02:21', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529135910081.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (524, '83cea8bc-73f6-11ea-b0bb-ac1f6b639ec0', '牡丹江市白蛋白提取项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '合资', '10000万元（1543.5万美元）', '5000', '重点', '10', '1000', '200', '筹划', '有', '', '', '牡丹江市生物医药专班', '赵鲲', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '70', '人血白蛋白主要用于失血、创伤、严重烧伤等引起的低适应症；预防和治疗低蛋白血症；治疗肝硬化及肾病引起的水肿或腹水；用于心肺分流术、烧伤及血液透析的辅助治疗，成人呼吸窘迫综合症和血容量休克的紧急治疗。\r\n建设内容包括厂区总平面工程、办公楼、质检研发楼、血制生产车间等土建部分、血制生产车间配套的辅助公用工程设施等，同时安装发酵、纯化、灌装等设备。', '生物医药产业', '生物医药', '牡丹江经济技术开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401165519858.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (525, '83fb696f-8518-11ea-b0bb-ac1f6b639ec0', '年产10万吨改性聚丙烯系列产品项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '25000', '一般', '7', '3000', '4000', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '150', '改性聚丙烯具有高强度、高抗冲性、阻燃性、弹性等多种优异的性能，广泛应用于建筑、装饰、家居用品、工业容器等领域。电子、电气行业用量较大的为ABS、聚丙烯、高抗冲聚苯乙烯、AS等。2016年国内汽车产量已达2800万辆，需各种塑料约240万吨/年,若加上社会维修需求量,汽车塑料需求量将达到500万吨/年，其中各种专用料约为400万吨，聚丙烯是汽车中应用量最大的塑料品种之一,未来我国改性塑料行业存在较大的发展空间。\r\n本项目规划占地面积4万平方米，投入60台（套）改性聚丙烯生产及加工设备生产线,计划建成可实现年产10万吨改性聚丙烯生产及加工基地。', '石化产业', '石化', '大庆经济技术开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521155307519.docx');
