INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (527, '84240802-807a-11ea-b0bb-ac1f6b639ec0', '牧区人居环境改善项目', '齐齐哈尔', '讷河市', '齐齐哈尔-讷河市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '25015.72万元（3861.18万美元）', '18000', '一般', '5', '5000', '500', '筹划', '无', '', '', '讷河市经合局', '唐晓恒', '18724487777', 'ysmb6006@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '本工程为牧区人居环境改善项目，建设非遗传承中心和民宿区，建设用地802300平方米，总建筑面积82000平方米。通过该项目建设，达到改善百路村居民生活环境，从而建立打造产业兴旺，生态宜居。形成居住、生产、生活、旅游于一体多元化经济主体。', '旅游产业', '旅游', '黑龙江讷河经济开发区', '14', '2020-06-04 14:01:45', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523195707240.doc');
