INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (529, '847aec07-cf11-11eb-a12f-00ff338109dc', '10万吨水稻秸秆纤维', '佳木斯', '桦南县', '佳木斯-桦南县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '14000', '一般', '2.5', '4200', '800', '建设', '无', '', '', '桦南县农业农村局', '张本刚', '13846112399', 'nw141@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '60', '该项目是以水稻秸秆为原料，通过粉碎发酵研磨等工序将秸秆加工成纤维（机械浆）。在全面禁止固废造纸原料紧缺包装物需求急剧增长的情况下，可填补造纸原料不足。\r\n', '农业及农副产品精深加工产业', '水稻深加工', '其它', '2', '2021-08-10 09:47:37', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (530, '8534b425-821a-11eb-94a7-00ff338109dc', '北安市年产8万吨玉米饮料加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '48000', '重点', '3', '5000', '2000', '可研', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '玉米汁饮料是以玉米为原料，采用淀粉酶、糖化酶酶解工艺，水解玉米中的淀粉，生产出澄清透明的饮料。玉米汁饮料富含人体所需的各种糖、氨基酸、维生素、微量元素等营养成份，从外观上看如啤酒澄清透亮，并带有一股谷物的清香,是新一代的健康饮品。随着人们保健意识的增强，玉米汁饮料越来越受到消费者的青睐，市场发展前景广阔。本项目主要产品为年产8万吨玉米汁饮料。占地8万平方米，建设厂房、仓库、办公室等建筑面积3万平方米，建设玉米汁饮料生产线一条及附属设施。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江北安经济开发区', '2', '2021-08-10 09:59:17', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (531, '857eb0c1-75b0-11ea-b0bb-ac1f6b639ec0', '岚棒山红色旅游景点建设项目', '七台河', '茄子河区', '七台河-茄子河区', '其他', '第三产业', NULL, '合资', '20000万元（3087.0万美元）', '22000', '一般', '1', '2000', '1800', '筹划', '无', '', '', '茄子河区招商局', '于海明', '13009963111', 'qzhzsj2019@163.COM', '七台河市经合局', '郑宏图', '13846468119', 'zgzsqth@163.com', '200', '抗联文化的源头，未来红色旅游景区的核心，七台河市委市政府已把开发岚棒山抗联遗址列入到总体规划，筹备建设东北抗联二路军总部纪念馆，努力打造红色旅游基地。目前已经完成遗址周围土地和道路建设用地收储12万平方米，修建了通达京石泉遗址的简易道路。准备建设历史博物馆、英雄纪念碑，发展农家乐，果蔬采摘园等配套旅游项目。', '旅游产业', '旅游', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134709173.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (532, '85baa409-73f2-11ea-b0bb-ac1f6b639ec0', '生猪屠宰加工项目', '哈尔滨', '木兰县', '哈尔滨-木兰县', '农、林、牧、渔业', '第一产业', NULL, '独资', '50000万元（7717.5万美元）', '180000', '一般', '5', '10000', '1000', '筹划', '无', '', '', '木兰县', '陈立峰', '13144515222', 'mlzhaoshangju@126.com', '木兰县投资合作服务中心', '尉天宇', '13104004402', 'mlzhaoshangju@126.com', '500', '本项目生猪屠宰车间生产设备拟选用国内先进的屠宰生产线，日处理能力3000多头，年处理100万头以上。由于生产规模大，因此规模经营效益高。设备机械化、自动化程度高。项目采用一系列的机械化、自动化措施，取代传统的手工作业，尤其是采用计算机自动检疫、检验系统，采用多道气动传输系统。 (生猪)清洗、分割、预冷、检疫、包装、冷藏等工序实行密闭化、无菌化，流水化，所有的传输系统实现悬空作业，避免了宰后生猪的二次污染。 ', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江木兰经济开发区', '46', '2020-05-29 15:17:05', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522102437664.docx');
