INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (534, '86a01ea4-6969-11e8-a82b-ac1f6b639ec0', '成良生态农业有限责任公司年加工10万吨绿色食品大豆项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '合作', '16000万元（2469.6万美元）', '50000', '重点', '5.5', '5000', '1500', '建设', '有', '', '', '呼玛县工业园区', '李旭东', '13604874966', 'hmxswj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '呼玛县具有丰富的水土光热资源，地处高纬度地区，远离污染源，耕地肥沃，大豆品质优良，年种植大豆保持在80万亩以上，占耕地总面积的70％以上。呼玛县成良生态农业有限公司于2015年4月注册成立，占地6万余平方米，主营业务是粮食作物的收购、储存、烘干；粮、油加工及饲料加工等。已形成粮食仓储能力5万吨钢结构储备库1座（长204米×宽54米），粮食日烘干能力500吨和300吨烘干塔各一座，日烘干粮食800吨；粮食临储库2座（面积2000余平方米）。项目拟合作完成10万吨绿色有机食品大豆系列产品加工项目，生产高级精制油和大豆蛋白等产品。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江呼玛经济开发区', '211', '2020-06-03 15:05:13', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161528019.docx');
