INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (536, '87285847-b38a-11eb-9405-00ff338109dc', '漠河市野生菇、木耳保鲜即食食品项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '1500', '重点', '4', '400', '300', '筹划', '无', '', '', '漠河市商务局', '梁忠元', '13845791136', 'mohezhaoshang@163.com', '大兴安岭地区商务局', '李晓倩', '13845720336', 'dqzsyqb@163.com', '25', '漠河市位于大兴安岭西北端，有林地面积71万公顷，空气清新，地表径流无污染且富含多种矿物质和稀有元素，因此各种野生菇类天然、零污染，而且秋季雨水充沛，产量巨大，具备深加工条件。该项目建设地点在漠河市工业园区。主要开发野生菇鲜品、保鲜野生菇产品、研发高端野生菇产品、进行木耳精深加工，提取木耳多糖和木耳素。项目占地面积5万平方米，计划厂房占地15000平方米，其中，办公楼3000平方米，研发楼3000平方米，生产车间及配套设施9000平方米。主要建设菌种繁育室、菌包生产车间、培养室、加工车间。', '农业及农副产品精深加工产业', '其它', '黑龙江漠河经济开发区', '9', '2021-08-10 09:49:57', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (537, '8742f854-7df0-11e9-815b-ac1f6b639ec0', '山野菜精加工项目', '哈尔滨', '通河县', '哈尔滨-通河县', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '11000', '重点', '3', '3000', '1800', '筹划', '无', '', '', '通河县林业局', '张毅成', '13796206003', 'thxlyj@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '50', '该项目建设地点在哈尔滨通河县，规划占地30000平方米，拟建设加工车间、办公楼、员工宿舍、冷库等土建工程及其他配套设施。通河县自然资源富集，林下山产品资源极为丰富。主要有山野菜、野生菌、野生坚果、蜂产品等四大类50余种，野菜蕴藏量7200吨，采集量1100吨。山野菜生长在自然无公害环境中，具有无污染、鲜嫩、芳香等独特滋味。该项目自然资源供应充足，发展前景看好。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江通河经济开发区', '36', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524200625598.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (538, '87813746-6f08-11ea-b0bb-ac1f6b639ec0', '五大连池市百万吨精深加工大豆工业园区项目', '黑河', '五大连池市', '黑河-五大连池市', '制造业', '第二产业', NULL, '独资', '448179万元（69176.43万美元）', '1298500', '重点', '5.84', '76637', '25545', '可研', '有', '', '', '五大连池市经济合作中心', '李建松', '18645623498', 'wdlczsj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '400', '五大连池市大豆产区在全国属核心区，气候适合大豆生长，出产大豆品质优良，周边100公里内大豆平均产量维持在300万吨以上。项目依托优质非转基因大豆资源，将大豆加工产业规划为市域发展主导产业，全力打造以大豆食品加工产业为主体的百亿级绿色食品生产基地。项目生产高品质大豆油、功能性大豆蛋白肽、大豆低聚糖肽粉、矿泉酱油等产品，四个项目互相吃配利用，形成配套齐全的的大豆产业链，年加工大豆100万吨，实现了大豆行业“吃干榨尽”的模式，提高了国产大豆的附加值，符合国家及地方社会和经济发展需要，具有良好的市场前景。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江五大连池经济开发区', '6', '2021-08-10 10:12:29', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521205454362.docx');
