INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (541, '88519f28-843d-11ea-b0bb-ac1f6b639ec0', '天然矿泉水项目', '大庆', '林甸县', '大庆-林甸县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '66000', '一般', '3', '11000', '4000', '筹划', '无', '', '', '林甸县项目推进管理办公室', '段福臣', '13351393013', 'ldzsyz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '400', '林甸县地热资源静态储量1810亿立方米，是国内特大型中低温地热田。地热多蕴藏在900-2400米之间，井口温度在40-60℃之间，3000米以下水温可达100℃以上。2011年，以高分值通过国土资源部复审，再次被命名为“中国温泉之乡”。林甸县水中富含硒、硅、碘、锌等20多种等多种有益于人体健康的微量元素，是含碘品位较高的碳酸钠型矿泉水，水质世界一流。\r\n新建年产饮用矿泉水40 万吨生产线，加工厂房,办公楼、仓库、宿舍楼等附属设施，占地面积10公顷。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江林甸经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140701039.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (542, '8878d129-7395-11e8-a795-ac1f6b639ec0', '年产2万吨完全生物降解塑料项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '6500万元（1003.27万美元）', '24000', '重点', '3', '2300', '1000', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '完全生物降解塑料是以淀粉、聚乙烯醇、甘油为主要原料，添加增塑剂、增强剂及湿强剂等复合助剂制造而成，具有降解完全（100%降解，而可降解塑料为10—40%）、强度好、易回收、无污染的特点。是替代现行普通塑料（PE）的新型产品。完全降解塑料技术工艺简单、原料易得、生产过程无污染。该项目拟占地3万平方米，主要建设完全生物降解塑料车间、年产完全生物降解塑料2万吨流水线及附属设施。', '新材料产业', '复合材料', '黑龙江望奎经济开发区', '138', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (543, '88cc9cf2-811e-11ea-b0bb-ac1f6b639ec0', '呼玛县物流园区建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '租赁和商务服务业', '第三产业', NULL, '合资', '16000万元（2469.6万美元）', '6000', '重点', '10', '1800', '400', '建设', '有', '', '', '呼玛县工业园区', '李旭东', '13604874966', 'hmxswj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '60', '现代物流产业被认为是国民经济发展的动脉和基础产业，目前呼玛县及周边地区还没有一个大型、完善的物流企业,每年煤炭运输量120-160万吨，铁矿石运输量40-60万吨，野果、野菜、粮食运输量10-20万吨，货物周转量 1 亿吨公里， 年平均增长将达到10%至15%。项目拟在呼玛县工业园区二期规划区建设以运输、仓储、配送、包装等物流服务功能为一体的综合性物流园，规划仓储建筑面积20000平方米，配送中心及办公建筑面积6000平方米，货车停车区占地面积15000 平方米。', '物流产业', '物流', '黑龙江呼玛经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525145551725.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (544, '8917c379-73e1-11ea-b0bb-ac1f6b639ec0', '佳木斯市经济开发区保税物流中心项目', '佳木斯', '抚远市', '佳木斯-抚远市', '其他', '第三产业', NULL, '独资', '40000万元（6174.0万美元）', '29000', '一般', '5', '8000', '4000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '抚远莽吉塔港是连接我国内陆、俄远东、韩国、日本、加拿大、美国等国家和地区的重要水上交通枢纽。经济开发区保税物流中心建成后，将充分展现其交易速度快、配送时间短、物流成本低、报关程序简化的强大优势，从而带动抚远跨境电子商务及其周边相关产业的发展。本项目建设地点位于经济开发区，占地面积20万平方米，主要建设内容包括查验场地、仓储库房、冷藏库房、海关监管库、商品展示交易中心以及保税办公楼等。', '物流产业', '物流', '黑龙江抚远经济开发区', '39', '2021-08-11 11:37:02', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102343409.doc');
