INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (555, '8aaea4a6-776e-11e8-91c3-ac1f6b639ec0', '日用工艺美术陶瓷生产线建设项目-1', '齐齐哈尔', '依安县', '齐齐哈尔-依安县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '5', '3000', '1000', '筹划', '无', '', '', '依安县工业园区管理委员会', '于东洋', '18245261000', 'swjzsc@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '300', '项目建设地点在齐齐哈尔市依安县陶瓷产业园区，占地面积6万平方米，建筑面积8万平方米。依安县有丰富的砂质高岭土矿，已探明储量在230亿吨，原料充足。拟建设综合办公楼、厂房、仓储库等基础设施。随着人民生活水平的提高，对日用工艺陶瓷的需求量逐年增加，该项目产品能够满足东北三省及内蒙古建材市场的需求，还可辐射日韩、朝蒙和俄远东地区建材市场。项目达产后，可年产日用工艺陶瓷产品10万件。', '非金属矿物制品产业', '日用陶瓷', '黑龙江依安经济开发区', '128', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522074912279.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (556, '8ad10b74-69fb-11e8-98f3-ac1f6b639ec0', '年加工3万吨甜玉米项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '13000', '一般', '5', '3000', '400', '筹划', '无', '', '', '肇州县经济合作促进办公室', '唐福利', '13624665470', 'zzxjhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '30', '项目建设地点在大庆市肇州县，占地面积2万平方米，建筑面积1.6万平方米。肇州县是玉米大县，年产玉米150万吨以上，原料充足。拟建设生产车间及附属设施，购置生产设备，达到年加工甜玉米系列产品3万吨的能力。甜玉米营养价值高，适口性好，受到消费者的欢迎，市场潜力巨大。该项目年产保鲜甜玉米穗2000万吨，玉米粒及玉米粳5000万罐。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇州经济开发区', '189', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523211534124.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (557, '8adaa401-73c6-11ea-b0bb-ac1f6b639ec0', '佳木斯市俄罗斯非转基因大豆精深加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '19000', '一般', '6', '5500', '2500', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '近年来随着我国大豆需求量不断加大，中俄双边关系的不断深入，我市依托俄罗斯远东地区土地资源和独特的区位优势、便捷的交通条件，在俄罗斯发展大豆种植，通过水路、陆路运回抚远，在我市建设精深加工基地，以俄罗斯非转基因大豆为原料，利用现代化高新技术进行大豆精深加工，生产绿色健康的大豆油、休闲食品、调味品等产品，实现“农头工尾”的价值翻倍。本项目建设地点位于经济开发区，占地面积7万平方米，主要建设内容包括生产车间、包装车库、成品库、办公楼、地坪、烘干塔及其它附属配套设施等。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江抚远经济开发区', '41', '2021-08-11 11:37:18', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102130955.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (558, '8b639204-7553-11ea-b0bb-ac1f6b639ec0', '牡丹江市玉米发酵产业园项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '合资', '300000万元（46305.0万美元）', '350000', '重点', '9', '35000', '10000', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '2000', '随着我国畜牧产业的发展，玉米深加工产品赖氨酸、蛋氨酸、氨基酸等高档饲料产品供不应求，市场前景更加广阔。\r\n项目规划占地面积100公顷，拟建设年产120万吨淀粉玉米深加工生产线及配套玉米仓储系统，年加工转化玉米240万吨，产品包括商品淀粉、淀粉糖、变性淀粉、山梨醇、赖氨酸、葡萄糖、玉米多肽等，配套建设300蒸吨高温高压锅炉及发电系统。', '农业及农副产品精深加工产业', '玉米深加工', '牡丹江经济技术开发区', '49', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403103346922.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (559, '8b880fd0-cf2e-11eb-a12f-00ff338109dc', '2000吨/年板蓝根提取生产项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '16000', '一般', '3', '4800', '4200', '筹划', '无', '', '', '大同区农业农村局', '隗立福', '18603692840', '18603692840@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '60', '建设预处理车间、提取车间、动力车间、原辅料仓库、办公室、综合楼、辅助用房、水泵房、污水机房、门房及总图工程，占地3.3万平方米。年可加工板蓝根8000吨，生产提取物2000吨。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '2', '2021-08-10 09:45:36', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (560, '8c16f727-72ff-11ea-b0bb-ac1f6b639ec0', '佳木斯市年加工30万吨水稻产业化基地项目', '佳木斯', '同江市', '佳木斯-同江市', '农、林、牧、渔业', '第一产业', NULL, '独资', '30427万元（4696.41万美元）', '159600', '重点', '1', '45000', '8500', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '283', '项目选址在同江经济开发区及各乡镇。项目建设用地10万平方米，位于同江市经济开发区；建设内容包括：散粮卸货库、大米加工车间、米糠加工车间、副产品库、辅材库、成品库、工作塔、稻壳库、米糠库、稻壳粉碎打包车间、烘干车间、30座立筒仓、机修及配件库、综合办公楼、地磅房，配套锅炉、动力车间、绿化及公用配套工程等。同江市水稻种植面积60万亩，年产量33万吨。地域辽阔、地势平坦，土壤以黑色腐殖土为主，有机质含量高，耕层深厚，土质肥沃，适宜各种农作物种植。水资源丰富、交通便利、地缘和区位优势明显。是优化种植业结构，确保粮食生产安全的需要；是促进农业增效、农民增收的需要；是延长稻谷加工产业链条，提升产品附加值的', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江同江经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112942239.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (561, '8cddefa1-8438-11ea-b0bb-ac1f6b639ec0', '20万吨/年苯乙烯项目', '大庆', '龙凤区', '大庆-龙凤区', '其他', '第二产业', NULL, '合作', '100000万元（15435.0万美元）', '200000', '一般', '7', '16000', '10000', '筹划', '无', '', '', '龙凤区投资促进服务中心', '王宏伟', '17804596555', 'lfqzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '300', '该项目主要产品为苯乙烯，年产量200000吨，副产品为甲苯，年产量3000吨。苯乙烯（Styrene，C8H8）是用苯取代乙烯的一个氢原子形成的有机化合物，乙烯基的电子与苯环共轭，不溶于水，溶于乙醇、乙醚中，暴露于空气中逐渐发生聚合及氧化。工业上是合成树脂、离子交换树脂及合成橡胶等的重要单体。大庆石化公司可提供项目所需原料。\r\n项目规划占地面积76567平方米，建筑面积58000平方米，总投资10亿元，新建年产20万吨苯乙烯生产装置、配套液体罐区、液化氢罐区、装卸车泵房、控制化验室、变配电室、循环水设施、消防设施、厂区管廊和地下管网等。', '石化产业', '石化', '黑龙江龙凤经济开发区', '43', '2020-05-30 16:38:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134930194.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (562, '8d2f3a9d-c0d8-11ea-8a5d-00ff338109dc', '阿城汉麻生物科技产业园', '哈尔滨', '阿城区', '哈尔滨-阿城区', '制造业', '第二产业', NULL, '合作', '200000万元（30870.0万美元）', '1000000', '重点', '3', '100000', '80000', '筹划', '无', '', '', '阿城区企业和投资服务局', '修立文', '13206755557', 'aczsyz@163.com', '阿城区企业和投资服务局', '郜效岩', '13936368827', 'aczsyz@163.com', '2400', '工业大麻产业是生物可再生的绿色新材料产业，具有“升级、替代、颠覆”传统资源型产业及石化产业的特性，有极大的发展空间，涉及衣食住行美医能源等众多行业，行业空间基础大。项目定位世界领先的汉麻生态产业“硅谷”，以生态健康为魂，现代农业为基，现代工业为主。在2021年~2025年，实现阿城核心种植区60万亩汉麻，形成汉麻绿色建材、生物复合材料、汉麻浆粕、汉麻食品、汉麻生活用品、美妆日化、保健医药等汉麻生物大健康产业集群，实现超百亿产值，项目核心区规划用地面积1000亩，首期规划用地200亩。', '农业及农副产品精深加工产业', '其它', '黑龙江阿城经济开发区', '25', '2021-08-10 10:38:03', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (563, '8d91e8db-853f-11ea-b0bb-ac1f6b639ec0', '肇源县1万吨/年肉制品深加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '70000', '一般', '7', '16000', '1400', '筹划', '无', '', '', '大庆市肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '35', '目前，国际国内市场上，尤为短缺的是肉质无污染牛羊肉制品，不但价格昂贵，而且数量缺口较大。 肇源县位于“哈大齐”节点地带，紧邻人口密度高且消费水平高的三个大城市，辐射范围大，市场前景极好。\r\n全县黄牛存量9.3万头、奶牛存量2万头、生猪存量97.4万头、羊存量59.9万只，优质畜牧产品为项目发展奠定了良好的原料基础。\r\n项目主要建设年产1万吨肉制品深加工生产线1条，主要产品是以猪、牛、羊肉为原料制成熏肉制品、酱肉制品、干腊制品、速冻肉食品及肉制品罐头。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江肇源经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423165059245.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (564, '8db8b0f4-846b-11ea-b0bb-ac1f6b639ec0', 'LNG罐式集装箱及供气系统项目', '大庆', '市辖区', '大庆-市辖区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '合资', '8000万元（1234.8万美元）', '15000', '一般', '4', '2500', '550', '筹划', '无', '', '', '大庆创业广场有限责任公司', '曹海涛', '13936951630', 'daqingcygc@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '80', '国际上天然气的运输有80%靠管路输送,其余20%靠LNG方式运输,液化天然气运输设备,是与我国重点支持的能源基础建设息息相关的，是有很大发展前途的一种设备，本项目发展前景广阔，具备一定的市场可行性。\r\n该项目依托大庆市独有的石油石化资源和LNG相关存储运输业务经验，其中大庆石化公司机械厂有多年的制造各种低温液体贮槽的工作经验,同时也收集了许多国外同行制造LNG同类产品的技术资料并多次向有关专家咨询了解LNG罐式集装箱的有关情况,有能力研制LNG罐式集装箱并投入批量生产。\r\n该项目拟建设年产100台LNG罐式集装箱以及LNG运输车相关配套零部件生产线及配套设施。', '高端装备制造产业', '石油装备', '大庆高新技术产业开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422153326190.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (565, '8dc463de-cf18-11eb-a12f-00ff338109dc', '农业机械设备生产加工', '佳木斯', '郊区', '佳木斯-郊区', '制造业', '第二产业', NULL, '独资', '3000万元（463.05万美元）', '4500', '一般', '4', '1350', '600', '筹划', '无', '', '', '佳木斯市郊区农业农村局', '周福亮', '04545617533', 'jq6116934@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '30', '占地10万平方米，生产农业机械设备。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:46:37', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (566, '8dc681c8-843a-11ea-b0bb-ac1f6b639ec0', '改性塑料项目', '大庆', '龙凤区', '大庆-龙凤区', '其他', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '60000', '一般', '7', '6000', '3000', '筹划', '无', '', '', '龙凤区投资促进服务中心', '王宏伟', '17804596555', 'lfqzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '90', '根据东北地区及国内市场状况，本项目初步确定生产聚烯填充母料、功能性母料及专用料，品种包括：纳米聚烯烃填充母料、聚烯烃防老化母料、防雾滴农膜母料、多功能性农膜母料、阻燃料、抗菌防霉母料、降解母料、发泡母料、抗静电母料、保鲜母料等。大庆石化公司可提供项目所需原料。\r\n拟投资建改性塑料厂区，年生产改性塑料5万吨以上，厂区总占地面积5.8万平方米，建筑面积5万平方米，总投资4亿元。主要建筑物包括厂房四栋，内含分级装置及储料仓等相关装置，建设办公楼及其他附属设施。', '新材料产业', '复合材料', '黑龙江龙凤经济开发区', '14', '2020-05-30 16:37:52', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521135659357.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (567, '8e81adbe-ba04-11eb-a12f-00ff338109dc', '粮油精深加工项目', '双鸭山', '四方台区', '双鸭山-四方台区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '200000', '一般', '5', '10000', '20000', '筹划', '无', '', '', '四方台区农业农村局', '孔凡伟', '13895889009', 'sftnw@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '200', '四方台区黑土土质肥沃，物产丰富，盛产玉米，为生产提供优质的原材料；另一方面四方台区交通便利，且距市区较近，更方便运输，也能为企业减少运输过程中的费用，从减少企业支出方面为企业增加效益。拟引进一家集食用植物油及其相关副产品科研、生产、仓储、贸易、物流于一体的老牌综合性油脂加工企业，致力于食用油精炼、专用油脂、食品原辅料等农产品精深加工，拥有先进生产装置与自动化生产流水线，以满足逐年扩大的市场需求。', '农业及农副产品精深加工产业', '玉米深加工', '其它', '2', '2021-08-05 16:52:59', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (568, '8f1211b5-757f-11ea-b0bb-ac1f6b639ec0', '牡丹江市东宁市河北新区商贸旅游综合体项目', '牡丹江', '东宁市', '牡丹江-东宁市', '建筑业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '17000', '重点', '8.5', '1765', '700', '筹划', '有', '', '', '东宁市招商局', '于学勇', '15945731616', 'dnzsj@126.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '该项目可使东宁市成为新的中俄贸易中转中心、休闲旅游度假、购物疗养中心，每年可吸引游客、接待客商30万人次，对促进东宁市总部经济发展起到极大的促进作用。\r\n项目总建筑面积11.55万平方米。地下一层：超市5000平方米；一层：名牌服饰、手表、首饰、手机、宝玉石、中俄特色商品等销售中心，8500平方米；二层：健身中心、美容会馆、中医理疗中心，8500平方米；三层：电影院、图书馆、游乐场、快餐，8500平方米；四层至十三层：东侧宾馆，西侧住宅，共85000平方米。', '现代商贸产业', '现代商贸', '黑龙江东宁经济开发区', '28', '2020-05-29 15:31:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522083633274.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (569, '8f8f4312-7a11-11ea-b0bb-ac1f6b639ec0', '佳木斯市食用菌系列产品开发项目', '佳木斯', '同江市', '佳木斯-同江市', '农、林、牧、渔业', '第一产业', NULL, '独资', '2106万元（325.06万美元）', '1850', '一般', '6', '365', '182', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '300', '项目选址在同江市经济开发区和各乡镇，占地面积1万平方米，开发食用菌种植基地37.5亩。年产食用菌1500吨，即白色金针菇、杏鲍菇和秀珍菇各500吨。同江是国家级生态示范区和绿色食品基地，中温带大陆性季风气候，无霜期150天，是发展食用菌基地的理想区域。同江市地处林区，木材加工和枝桠等废弃物多，利用其代替木材生产食用菌，资源条件优越。同江市种植食用菌历史较久，但食用菌生产的品种大多为常规品种，引进先进生产工艺和最新食用菌品种，形成工厂化栽培，市场前景广阔。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江同江经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112705123.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (570, '8fba48a3-8440-11ea-b0bb-ac1f6b639ec0', '杂豆精深加工项目', '大庆', '林甸县', '大庆-林甸县', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '8000', '一般', '4', '1500', '800', '筹划', '无', '', '', '林甸县项目推进管理办公室', '段福臣', '13351393013', 'ldzsyz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '40', '未来，我国杂粮杂豆增长速度将在10%以上，杂粮杂豆产品市场遍及国内外,市场前景将十分广阔。林甸县绿豆、小豆、 黑豆等杂粮资源丰富，原料充足。       \r\n项目建设杂粮深加工生产线及配套设施，建成后，年生产豆沙1000吨、豆沙包1000吨、春卷600吨；年可生产绿豆淀粉1000吨、绿豆粉丝、绿豆方便面等产品1000吨、绿豆饮料1000吨的。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江林甸经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144040509.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (571, '8fe61966-74db-11ea-b0bb-ac1f6b639ec0', '结晶木糖醇生产线建设项目', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '8000万元（1234.8万美元）', '14500', '一般', '3', '2500', '1000', '筹划', '无', '', '', '勃利县经济合作促进局', '李宝武', '13904670260', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '木糖醇是一个新兴的产业，生产技术可塑性强，木糖醇对酸、热有较高的稳定性，不容易发生美拉德反应，成为低热值食品甜味剂，广泛应用于低热值食品配方。建设内容：年产1万吨结晶木糖醇生产线。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江勃利经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174610458.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (572, '904cd0b7-7668-11ea-b0bb-ac1f6b639ec0', '年产2万吨高纯石墨项目', '七台河', '茄子河区', '七台河-茄子河区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '20000', '一般', '5', '2000', '2000', '筹划', '无', '', '', '茄子河区招商局', '董广岩', '13946566656', 'qzhzsj2019@163.COM', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '150', '石墨含量在99.9%以上的石墨叫高纯石墨。是理想的无机非金属，用于坩埚舟皿、单晶炉用加热器、电火花加工石墨、烧结模具、电子管阳极、金属涂镀、半导体技术用的石墨坩埚、发射电子管、闸流管和汞弧整流器用的石墨阳极、栅极等。建设内容：年产2万吨高纯石墨，主要设备为艾奇逊高温炉。', '新材料产业', '石墨', '其它', '4', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522073909640.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (573, '91d36400-8085-11ea-b0bb-ac1f6b639ec0', '休闲食品加工项目', '齐齐哈尔', '拜泉县', '齐齐哈尔-拜泉县', '制造业', '第二产业', NULL, '独资', '35000万元（5402.25万美元）', '150000', '一般', '3', '20000', '5000', '筹划', '无', '', '', '拜泉县经济合作促进局', '武鹏', '04527668888', 'bqxzsj2005@126.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '30', '拜泉县是马铃薯的传统主产区，具有发展马铃薯产业的资源优势。拟在拜泉县建设占地5万平，年可加工马铃薯30万吨的休闲食品生产线1条。项目达产达效后，预计年销售收入15亿元。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江拜泉经济开发区', '58', '2020-06-04 14:05:54', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200417162935350.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (574, '920c53e7-730a-11ea-b0bb-ac1f6b639ec0', '望龙山国际滑雪场建设项目', '绥化', '庆安县', '绥化-庆安县', '其他', '第三产业', NULL, '其他', '8000万元（1234.8万美元）', '5000', '重点', '5.3', '1500', '240', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '60', '望龙山坐落在小兴安岭支脉庆安县曙光林场内，占地1477公顷，年平均气温2-10℃，冬季山下积雪厚度达40厘米，山上积雪厚度70厘米。望龙山雪质良好，硬度适中，年积雪期120天，滑雪期100天。距离庆安县城区仅65公里，距离哈尔滨144公里，交通便利，是当地和周边地区旅游者的滑雪首选。望龙山滑雪场的开发，可以冬季滑雪，夏季滑草，还可以集望龙山国家森林公园为一体的滑雪场、漂流区、人工湖、娱乐中心、狩猎场、森林木屋和森林浴场旅游景区。', '旅游产业', '旅游', '黑龙江庆安经济开发区', '12', '2020-05-30 17:13:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521205608106.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (575, '927f630d-8472-11ea-b0bb-ac1f6b639ec0', '生猪屠宰及饲料加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '20000', '一般', '7', '6000', '2000', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '杜尔伯特县生猪饲养环境好、资源丰富，饲养的生猪品质好。随着人民生活水平的提高，人们的消费结构已经向营养型、方便型、保健型发展，建设大型的猪肉制品深加工企业，市场前景可观。同时，生猪养猪需要大量的饲料，目前国际国内对饲料的市场需求也还有很大的空间。2019年，杜尔伯特肉牛出栏量为7.5万头，奶牛存栏量为7.35万头，肉羊出栏量为30.09万只，生猪出栏量为17.46万头，原料充足。\r\n项目占地5万平方米，建筑面积3.7万平方米，建设年屠宰生猪10万头及年生产1万吨生物有机颗粒饲料生产线及仓储、厂房等设施。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江杜尔伯特经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152105567.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (576, '92c97866-8515-11ea-b0bb-ac1f6b639ec0', '果蔬深加工项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '2000万元（308.7万美元）', '11057', '一般', '8', '2500', '3100', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '150', '本项目主要产品有洁净菜、果蔬脆片、蔬菜精华素、速冻蔬菜、脱水蔬菜、蔬菜汁。随着生活质量与健康水平要求的不断提高以及生活节奏加快，人们越来越注重自身的保健，人们对果蔬的需求正由“数量消费”向“质量消费”转变，即要求新鲜、方便、营养、安全的洁净果蔬产品，脱水蔬菜市场前景广阔。\r\n项目总投资2亿元，占地面积4000平方米，建设2000吨果蔬深加工生产线及配套设施。', '农业及农副产品精深加工产业', '果蔬加工', '大庆经济技术开发区', '13', '2020-05-30 16:32:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154307627.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (577, '92f3b545-807e-11ea-b0bb-ac1f6b639ec0', '湖羊养殖及加工项目', '齐齐哈尔', '拜泉县', '齐齐哈尔-拜泉县', '制造业', '第二产业', NULL, '独资', '55000万元（8489.25万美元）', '50000', '一般', '5', '10000', '800', '筹划', '无', '', '', '齐齐哈尔市拜泉县经合局', '武鹏', '04527668888', 'bqxzsj2005@126.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '30', '拜泉县境内畜牧资源丰富，适宜饲养黄肉牛、山绵羊、生猪，畜产业前景广阔。拟在拜泉县投资建设湖羊养殖及加工项目，占地1500亩，建设羊舍、饲料库、青贮室、配种室、加工厂等设施，年可养殖加工湖羊50万支。项目达产达效后，预计年销售收入5亿元。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江拜泉经济开发区', '15', '2020-06-04 14:01:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523202234175.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (578, '938387aa-77db-11ea-b0bb-ac1f6b639ec0', '牡丹江市VR游戏开发项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '40000', '重点', '8', '6000', '2280', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '项目用地规模340亩，固定资产投资强度3000元/平方米。\r\n（1）游戏内容商，全开放式游戏内容平台，用最直接的分层模式，保障游戏开发收益，打造全新游戏供应生态平台，给玩家带来每时每刻的体验迭代。\r\n\r\n（2）游戏仓生产，125度仿生视场角，1080p双眼独立高清分辨率，10mm/秒-167mm/秒均的精准仓体调节，带给用户无死角畅游新世界的真实享受。\r\n\r\n（3）APP开发，提供最新的游戏资讯，无止境的游戏下载，最开放的大众平台，随时随地的互动语音，游戏在这里变得不再枯燥。\r\n\r\n（4）线下实体店，最酷炫的视觉盛宴，最生动的现场互动，最多样的游戏交流，最丰富的合作产品，打造全新的社交体验馆。', '新一代信息技术产业', '新一代信息技术', '牡丹江经济技术开发区', '22', '2020-05-29 16:34:18', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521135738489.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (579, '9410ee49-7d24-11e9-815b-ac1f6b639ec0', '秸秆沼气发电与生态循环综合利用项目', '绥化', '望奎县', '绥化-望奎县', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '41800万元（6451.83万美元）', '20000', '重点', '8', '5000', '2000', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '该项目位于绥化市望奎县，计划占地面积11.5万平，建设综合办公楼、厂房、仓库、收储站等设施，购置原料收集设备、运输和预处理系统设备，建设20座有效容积500立厌氧消化器、5台2MW沼气内燃发电机组、沼气发电上网与余热回收系统、沼肥利用系统等。年处理秸秆24.3万吨，年产沼气3852万立，可发电8040万度，可产热力238万吨（可供暖面积约22万平），可产有机肥4.92万吨。预计项目建设期16个月。', '节能环保产业', '秸秆综合利用', '黑龙江望奎经济开发区', '26', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (580, '9488c90e-7a35-11ea-b0bb-ac1f6b639ec0', '佳木斯市肉牛产业化基地建设项目', '佳木斯', '同江市', '佳木斯-同江市', '农、林、牧、渔业', '第一产业', NULL, '独资', '14474.9万元（2234.2万美元）', '6200', '一般', '7.8', '1845', '461', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '项目选址在同江经济开发区及各乡镇。其中养殖区规划面积90亩，屠宰加工区规划面积3万平方米。项目存栏肉牛5000头，其中饲养母牛4800头，引入种公牛200头。为了便于防疫、示范及饲料地布局，建设项目分为五个不同饲养区，每个饲养区1000头。饲养品种以西门塔尔肉牛为主。建设内容主要有：肉牛生产区、生物肥生产区、生活管理区、综合办公楼包含实验室，办公、职工食堂及宿舍、兽医室、门卫地磅房、消防水池、车库、屠宰加工区及公用工程等。引进饲草饲料加工设备18台套、粪污清理与处理设备6台套、生产辅助设备9台套、屠宰生产线1条。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江同江经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111451856.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (581, '95462400-5719-11e8-a5b9-ac1f6b639ec0', '大型商业中心项目', '鹤岗', '兴安区', '鹤岗-兴安区', '租赁和商务服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '20000', '一般', '5', '6000', '1000', '筹划', '无', '', '', '兴安区人民政府', '乔坤', '13329589991', 'xinganzhaoshang@163.com', '鹤岗市商务局', '韩旭', '13199591989', 'hgzsgz@163.com', '400', '该项目选址位于鹤岗市兴安区，占地面积2万平方米，建筑面积80000平方米。兴安区主城区范围目前内无大型综合性购物商场，随着城区人口的迅速增长，不能满足消费者购物及文化生活的需要。项目计划建设一个城市商业中心，内容包括:一、二层为购物中心、综合超市，三层为美食广场、文化设施、影院，负一层为地下停车场。', '现代商贸产业', '现代商贸', '黑龙江鹤岗经济开发区', '42', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (582, '95f9a2a5-73cb-11ea-b0bb-ac1f6b639ec0', '绥棱县20万吨大豆综合加工项目', '绥化', '绥棱县', '绥化-绥棱县', '农、林、牧、渔业', '第一产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '重点', '6.5', '8000', '700', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '200', '绥棱县是“中国优质大豆之乡”，是省内大豆主产区，种植历史悠久。2019年，域内大豆种植面积101万亩，产非转基因优质大豆约18万吨，大豆蛋白质平均含量高达40%以上，项目发展空间十分巨大。该项目主要依托县域丰富的非转基因大豆资源开发建设。拟占地10万平方米，主要建设厂房、办公楼等附属设施及购置设备。设计年处理大豆20万吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江绥棱经济开发区', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521202527766.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (583, '96687e88-74df-11ea-b0bb-ac1f6b639ec0', '纸业生产项目', '七台河', '桃山区', '七台河-桃山区', '制造业', '第二产业', NULL, '合资', '500万元（77.17万美元）', '300', '一般', '15', '30', '21', '筹划', '无', '', '', '桃山区商务局', '刘国胜', '15046407771', 'zsbtsq@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '40', '该项目拟在大明街彩虹桥以西200米处建设，填补我市该领域空白，项目总投资500万元，建设两条生产线，初步解决我市卫生用纸生产不足的局面。同时，在满足本市需求的前提下可辐射周边市县及周边农场。主要生产神龙、紫丁香、金源等10余个品牌的优质卫生纸。生产厂房3000平方，库房5000平方。', '高端装备制造产业', '造纸装备', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145758669.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (584, '96cb4ac5-7268-11ea-b0bb-ac1f6b639ec0', '兰西县玉米休闲食品生产加工项目', '绥化', '兰西县', '绥化-兰西县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '一般', '4', '5000', '1000', '筹划', '无', '', '', '兰西县经济合作服务中心', '车德威', '18245599222', 'lxxzsj@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '600', '玉米是三大粮食作物中最适合作为工业原料的品种，也是加工程度最高的粮食作物。玉米加工业的特点是加工空间大、产业链长、产品极为丰富，包括淀粉、淀粉糖、变性淀粉、酒精、酶制剂、调味品、药用、化工等八大系列，但主要是淀粉及酒精，其它产品多是这两个产品更深层次的加工品或生产的副产品，这些深层次的加工品或副产品其价值相当高即具有较高的附加值，随之便可带来高利润。玉米食品加工也工业生产加工不同，往往处于次要位置，但其使用价值同样可贵，同样具有广阔的市场空间。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江兰西经济开发区', '19', '2020-06-02 13:48:41', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521125203999.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (585, '97536269-58d8-11e8-a5b9-ac1f6b639ec0', '20万吨碎米综合加工项目', '绥化', '北林区', '绥化-北林区', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '25000', '重点', '4', '7500', '3000', '筹划', '无', '', '', '绥化市经济合作局', '鲁怡彤', '13763750328', 'suihuazhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '200', '随着水稻加工精度的提高和产品分级整理的加强，大米生产过程中碎米产生量不断增多，增加了粮油企业对碎米利用的紧迫感，我市各类水稻加工企业年加工处理水稻200多万吨，可产生近20万吨碎米，推进碎米深加工利用可进一步延伸粮油加工企业产业链，带来可观的经济效益。该项目位于绥化市北林区东富工业园区，占地10万平方米。建设大米淀粉、大米蛋白粉、大米淀粉糖浆生产线，购置相关配套设备并建设其他附属设施。年加工碎米10万吨，年产大米淀粉1.5万吨，大米蛋白粉0.75万吨，大米淀粉糖浆8万吨。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '193', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (586, '97c7896f-cbea-11ea-9952-00ff338109dc', '家具制造有限公司项目', '牡丹江', '海林市', '牡丹江-海林市', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '31000', '一般', '5', '3000', '800', '筹划', '无', '', '', '海林市经合办', '邓喜强', '15045310222', 'hlzsj@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '厂房及附属设施的建筑面积：1.6万平方米；\r\n年产量：欧式实木家具（酒柜、书架、餐桌、茶几、电脑桌、电视柜）为主，等年生产能力5000立方米。集成材生产能力达1000立方米。生产设备先进程度：主要以欧式实木家具（酒柜、书架、餐桌、茶几、电脑桌、电视柜）为主，设计理念采用北方传统的实木加上南方的金属与塑料框架的完美结合，体现了实木家具的现代风格。\r\n生产工艺：采用北方传统的实木加上南方的金属与塑料框架的完美结合，体现了实木家具的现代风格。 \r\n环保设施：本工程建成之后，符合国家现行的环境保护有关法规，不会对该地区的生态环境现状产生不良破坏，同时采取可行污染治理措施，使各项指标均保证达到国家标准.', '木材加工产业', '家具制造', '海林经济技术开发区', '9', '2021-08-10 10:13:21', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200722151145339.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (587, '97cb8cb6-6eb5-11e8-afa3-ac1f6b639ec0', '瓷石开发项目', '绥化', '绥棱县', '绥化-绥棱县', '采矿业', '第二产业', NULL, '独资', '6000万元（926.1万美元）', '3000', '重点', '6', '900', '300', '筹划', '无', '', '', '绥棱县招商局', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '120', '马子良瓷石矿矿体长度大于1000米，宽300—500米，厚度大于30米，体积900—1200万立方米，估算矿石量2000万吨。利用马子良优质瓷石矿产资源可生产墙地砖、全瓷砖、釉面砖、陶瓷锦砖及国际流行的玻化砖、釉面瓷质砖、西式瓦、劈裂砖、大型丝网装饰砖、金属光泽面砖等。黑龙江市场上的瓷类产品98%为外地厂家生产，若利用本地资源建厂，经济效益将十分可观。', '非金属矿物制品产业', '日用陶瓷', '黑龙江绥棱经济开发区', '23', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (588, '97dd7835-7573-11ea-b0bb-ac1f6b639ec0', '牡丹江市汉麻全产业链生产加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '500000万元（77175.0万美元）', '600000', '重点', '5.5', '90000', '34000', '筹划', '有', '', '', '牡丹江市经合局', '柴立强', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '500', '项目一期工程，种植汉麻达到30万亩，投资10亿元。生产初加工产品以长纤维、短纤维、麻籽（麻仁、麻油、麻蛋白）、麻屑加工、CBD提取为主，可实现工业销售收入13.6亿元，收益2亿元。\r\n项目二期工程，到2023年实现种植汉麻100万亩，投资20亿元。其中初加工产品项目投资8亿元，加工长纤维2.3万吨、短纤维4.2万吨、麻籽6万吨、生产板材30万立方米、提取CBD 40吨；同时深加工高附加值产品项目投资12亿元，向脱胶麻条、功能性食品&饮品、化妆品、保健品及药品等深加工产品方向发展。', '农业及农副产品精深加工产业', '工业大麻', '牡丹江经济技术开发区', '78', '2020-05-29 15:23:59', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522091626804.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (589, '97ecdbeb-cf3e-11eb-a12f-00ff338109dc', '光伏+食用菌产业项目', '鹤岗', '兴山区', '鹤岗-兴山区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '21000', '一般', '2', '6300', '50', '筹划', '无', '', '', '鹤岗市兴山区商务局', '李想', '13634689092', 'hgxsqswj@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '20', '该项目主要依据黑龙江鼎尊生物科技有限公司主要从事食用菌菌种研发、菌种培育、食用菌菌种工厂化生产、食用菌菌种销售、木耳种植，木耳批发零售等业务资源，利用技术支撑，生产木耳等食用菌类，拟占地100公顷，年产干木耳600万斤，可建设1000个木耳吊袋大棚。产品主要用途作为具有减低血液凝固，减慢血小板凝聚，防止血液中腥固醇沉积等功能的黑木耳产品，被越来越多的消费者所认可，市场需求量迅速扩大，为黑木耳精深加工产业的发展带来了良好的机遇。', '农业及农副产品精深加工产业', '其它', '其它', '5', '2021-08-06 16:12:06', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (590, '989d827d-9d6f-11ea-8a5d-00ff338109dc', '航空聚集示范区招商项目', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '35000万元（5402.25万美元）', '36000', '一般', '6', '6500', '650', '筹划', '无', '', '', '富裕县经济合作促进局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '该通用航空产业在国际上已经发展得比较成熟，具有一定的产业规模。我国通用航空产业近年来发展较快，但总体规模较小，与发达国家相比差距较大。项目建设地点在塔哈镇，航空复合材料、数控加工中心建设项目', '航空产业', '航空', '黑龙江富裕经济开发区', '15', '2020-06-04 14:00:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524113949030.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (591, '98b0b8f0-845c-11ea-b0bb-ac1f6b639ec0', '物流枢纽项目', '大庆', '市辖区', '大庆-市辖区', '交通运输、仓储和邮政业', '第三产业', NULL, '合作', '70000万元（10804.5万美元）', '86000', '一般', '7', '10000', '5000', '可研', '无', '', '', '大庆高新区管委会', '大庆高新区新兴产业促进中心', '18645926543', '16645396016@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '3000', '大庆市雄厚的产业基础、多元化的产业结构，带来了旺盛的原材料、产成品的仓储、运输、配送等物流需求，为物流枢纽发展奠定了坚实的市场基础，未来3年内大庆周边20公里半径内年物流总量超过700万吨。\r\n项目选址大庆高新区，位于安萨路以北，G10以西地块，规划占地面积214.43公顷（3216.44亩），规划建筑物基底总面积108.34万平方米，总建筑面积69.57万平方米。项目投资7亿元，物流枢纽按照“一园、七区”的空间结构进行布置，即大庆国际物流枢纽和其内部七个功能分区。', '物流产业', '物流', '大庆高新技术产业开发区', '3', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422134622142.doc');
