INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (593, '98bf55f4-73dc-11ea-b0bb-ac1f6b639ec0', '佳木斯市食用菌种植项目', '佳木斯', '抚远市', '佳木斯-抚远市', '农、林、牧、渔业', '第一产业', NULL, '独资', '10000万元（1543.5万美元）', '9000', '一般', '4', '2500', '1000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '45', '抚远市河流众多，水质清洁，空气流畅，光照条件好，为食用菌的种植提供了良好条件。食用菌种类繁多：双孢菇、金针菇、杏鲍菇、蟹味菇、灰树花、木耳等，为进行工厂化周期栽培提供了多种选择。本项目可采用“公司+基地+农户”收购、销售、加工一条龙，科工贸为一体的产业化经营模式，辐射面较广，带动面较大，具有广阔的发展前景。本项目建设地点位于通江乡，占地面积3.5万平方米，主要建设内容包括食用菌大棚、加工厂房、原料库、拌料袋装车间、灭菌室、接种室及配套排灌温控设施等。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '34', '2021-08-11 11:36:09', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102629191.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (594, '98c95b0b-7a3e-11ea-b0bb-ac1f6b639ec0', '年产10万吨红豆沙项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '18000', '一般', '4', '3000', '200', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '70', '项目占地85.3亩，总建筑面积72280平方米，购置洗豆机、煮豆锅、压滤机、真空包装机、数控铣床、数控车床、搅拌锅、金属检测机、浓缩罐系统、燃气锅炉等生产检测设备40套。达到年生产30万吨红豆沙的生产规模。新建生产车间、仓库、研发楼、办公楼、污水处理站、门卫及其他配套设施。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江虎林经济开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522135935415.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (595, '99045154-6dad-11ea-b0bb-ac1f6b639ec0', '智慧物联产业园项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '40000', '一般', '5', '6000', '670', '筹划', '无', '', '', '道里区企业和投资服务局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区企业和投资服务局', '于鹏怡', '18686775832', 'daolizsj@163.com', '50', '随着信息技术的发展，智能物联产业在工业、农业、物流、电力、交通、环保、水利、医疗、安保、家居、园区等领域具有广泛的应用空间，市场前景广阔。项目拟选址哈尔滨市群力新区，朗江路、群力第一大道、三环路部分围合区域，规划用地面积2.62万平方米，建筑面积9.2万平方米，用地性质为商业。计划采取引进、合作、培育等方式，快速集聚一批国家、省、市物联网领域高层次科研力量和研发机构，按照统一规划、市场运作、鼓励企业参与的原则，建立健全物联网技术创新和产业发展所需的各级各类服务平台及相对完整的物联网产业生态链。拟引进5G、人工智能、区块链、边缘计算等新技术方面的战略投资者。', '新一代信息技术产业', '新一代信息技术', '其它', '92', '2020-05-29 15:30:54', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144833362.docx');
