INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (599, '9a0c3b6d-7399-11e8-a795-ac1f6b639ec0', '中国雪屯旅游开发项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '5', '3000', '2000', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '50', '该项目建设地点在通河县东部的乌拉浑林场，充分利用丰富的自然资源和林场地形，拟建设东北团圆饭餐饮基地（主做东北特色餐饮）、雪原特色民宿（集餐饮、特色住宿、文化体验等功能于一体）、越野车体验基地（打造户外越野车运动基地）、山地自从车赛道（在林场中建设国家标准山地自行车赛道）和林下种养殖基地（利用李林地资源，发展种植业、养殖业等）。项目建成后将满足周边及旅客需求。', '旅游产业', '旅游', '黑龙江通河经济开发区', '111', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524210641198.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (600, '9a0fcd8d-732a-11ea-b0bb-ac1f6b639ec0', '30万吨稻米深加工项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '独资', '35000万元（5402.25万美元）', '20000', '一般', '6', '6000', '1200', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '100', '将稻米深加工成精米、米粉、蛋白粉、淀粉糖、米糠油等产品，计划年加工30万吨稻米。建设生产车间4000平方米；原材料库房3000平方米；成品库房1500平方米；碎米、油糠库房1000平方米；检验室500平方米；办公楼1000平方米。购买碾米机、色选机、砻谷机、滚筒筛、抛光机等设备10套。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '19', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145043309.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (601, '9a3148d0-a174-11ea-8a5d-00ff338109dc', '马口铁罐制造及彩印项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '30000万元（4630.5万美元）', '50000', '一般', '6', '5000', '4000', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '大庆经开区绿色包装产业园，规划占地3.8万平方米、建筑面积3.4万平方米，由园区定制化代建5栋生产车间、1栋办公楼、1栋宿舍楼和1个共享研发检测中心。本项目计划入驻绿色包装产业园，打造干粉罐、易撕盖、底盖、塑胶及印铁于一体的乳制品包装生产基地。本项目支持企业独资、合资、合作。可由政府先行代建厂房，企业在规定时限内回购，亦可租用现有厂房，租金方面给予一定支持。', '非金属矿物制品产业', '日用陶瓷', '大庆经济技术开发区', '5', '2020-05-30 16:04:48', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529142116318.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (602, '9a3d2c91-8443-11ea-b0bb-ac1f6b639ec0', '汽车车身件生产项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '10000', '一般', '7', '800', '800', '筹划', '无', '', '', '大庆高新区管委会', '韩博强', '15164527375', 'hanboqiang@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '随着大庆沃尔沃整车制造增产上量，对其一级零部件供应商在周边建厂需求越来越迫切，为满足整车就近配套建厂，完善大庆汽车产业链条，计划引入汽车车身件生产项目。市场前景方面，可以依托大庆沃尔沃整车产量，同时可辐射哈尔滨福特整车厂配套。项目建设的有利条件包括市场区位优势，大庆高新区已辟建汽车零部件产业园，可靠近整车厂就近建厂，实现集群化发展。\r\n项目规模为拟建设年产50万套汽车车身件项目，建设内容包括投资建设汽车车身件冲压、焊接生产线，主要产品为沃尔沃在庆投产车型汽车车身件相关产品。项目建设地点为大庆汽车产业园内，目标企业要求需是沃尔沃供应商。', '汽车制造产业', '汽车服务', '大庆高新技术产业开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422104727315.doc');
