INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (606, '9b9812b5-8444-11ea-b0bb-ac1f6b639ec0', '高档酱油生产项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '4236万元（653.83万美元）', '18000', '一般', '3', '1800', '1630', '筹划', '无', '', '', '肇州县招商服务中心', '张立江', '13604892456', 'jhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '75', '酱油行业具有发展速度快、产量大、品种多、销售面广、经济效益好等特点。本项目建成以后，将满足本地区农产品精深加工的需求，提高农产品的综合经济效益，对种植业有极大地促进作用。\r\n项目计划占地20000㎡，建筑面积23680㎡，主要为：建设酿造车间4400㎡、灌装车间1600㎡、原料库房8000㎡、成品库房6000㎡、办公及宿舍楼2400㎡、门卫室80㎡、污水处理间400㎡、锅炉房及消防水池800㎡、围墙及大门600m、场区道路及硬化4000㎡、场区景观绿化800㎡、场区给排水及消防管网400m、场区电外网200m及购置粉碎机、炒麦机、圆盘制曲机、压滤机等生产设备设施100台。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江肇州经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145356191.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (607, '9c385493-9d6c-11ea-8a5d-00ff338109dc', '道地药材种植加工项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '55000万元（8489.25万美元）', '28000', '一般', '7', '8000', '800', '筹划', '无', '', '', '甘南县经合局', '赵文涛', '18045237733', 'gnxzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '新建道地荮材加工车间及附属设施，购置安装生产设备。种植道地药材3万亩，年产道地药材7万吨。', '中医药产业', '中医药', '黑龙江甘南经济开发区', '19', '2020-06-04 14:00:29', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524111359100.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (608, '9c78f8dd-8669-11e8-9218-ac1f6b639ec0', '茬地免耕覆秸多功能精密播种机制造项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '30000', '一般', '6', '8333', '3000', '筹划', '无', '', '', '大庆经济技术开发区', '丁聪', '18546646456', 'dingcong777@vip.qq.com', '大庆经济技术开发区', '李兵直', '13936853439', 'xcpark@126.com', '60', '茬地免耕覆秸多功能精密播种机集种床整备、侧深施肥、精量播种、覆土镇压，喷施封闭除草剂和秸秆均匀覆盖等功能于一体，为实现精密播种、秸秆全量还田、培肥地力、蓄水保墒，改善土壤环境，防止水、土、肥流失提供了切实可行的装备技术保障，在不经任何处理的玉米、小麦等作物原茬地上，一次进地可完成种床清秸整备，精量播种（玉米、大豆、花生），市场前景广阔。项目拟建设年产500台精密播种机生产线及相关配套设施。', '高端装备制造产业', '农机装备', '大庆经济技术开发区', '158', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523205604530.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (609, '9c9459e3-74e6-11ea-b0bb-ac1f6b639ec0', '新兴区红胜村生态采摘园项目', '七台河', '新兴区', '七台河-新兴区', '住宿和餐饮业', '第三产业', NULL, '合资', '3000万元（463.05万美元）', '800', '一般', '3', '240', '50', '筹划', '无', '', '', '新兴区招商办', '夏士峰', '13029790055', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '为加速乡村振兴战略，推动乡村旅游发展，新兴区依托五台山、倭肯河、新老七台河优美的自然风光，肃慎、辽金、南北朝悠久的历史文化，丰富的生态农业资源，拟打造一条以红胜村生态采摘园--马鞍肃慎辽金风情园--东新朝鲜族民俗村为线路的精品乡村旅游项目。红胜村生态采摘园前两期工程投资1044万元，主要分水培蔬菜示范区、花卉盆栽水果示范区、休闲娱乐区、绿植观赏区，建设完成10栋高效节能日光温室，已完成2000平方米的生态主题餐厅主体建设。拟建设高效节能日光温室20栋，预计投资600万元；建设200亩浆果采摘园及相关配套设施，预计投资200万元；拟建设可移动式冰雪娱乐项目，预计投资380万元等8项工程。', '旅游产业', '旅游', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522170053873.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (610, '9ca82ded-c0e4-11ea-8a5d-00ff338109dc', '黑果腺肋花楸（不老梅）种植及深加工项目', '哈尔滨', '延寿县', '哈尔滨-延寿县', '农、林、牧、渔业', '第一产业', NULL, '合作', '17000万元（2623.95万美元）', '80000', '重点', '2', '24000', '12000', '筹划', '无', '', '', '延寿县招商服务中心', '刘建华', '15945967855', 'yszsj2013@163.com', '延寿县招商服务中心', '张超群', '18545867165', 'yszsj2013@163.com', '150', '黑果花楸又称不老梅，是一种水果，果实从成熟到开花结果需105至110天，有很强的耐寒能力（可耐零下42度的低温）和耐干旱性，延寿县黑果花楸种植区域在北纬44°——45°范围内，黑土地种植，生长期长，日照时间长而充足，以施用农家肥为主，无公害无污染，营养成分丰富，非常适宜黑果花楸的种植与深加工。每100g不老莓新鲜果实含花青素物质2144mg,是红酒的2000倍，野生蓝莓的3倍以上。新建基地2万亩，年产花青素提取及天然食品、果酒类加工厂一处，拟占地面积50000平方米', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江延寿经济开发区', '6', '2021-08-10 10:36:39', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (611, '9cc51267-7261-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产2万吨调味品项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '39000万元（6019.65万美元）', '54000', '一般', '5', '9000', '3000', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '项目建设地点富锦市经开区，享受省级开发区优惠政策。占地面积3公顷，总建筑面积2公顷。建设内容，建设现代化生产车间及库房，引进先进酱油、食醋、豆酱生产设备及附属包装设备。资源优势，百公里半径内，年际间大豆产量达到100多万吨，具有大豆品质好，蛋白含量达到40%的优质原料优势，为大豆食用产品深加工奠定了产业延伸基础。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江富锦经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151515359.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (612, '9cf570a7-6d73-11ea-b0bb-ac1f6b639ec0', '自贸区俄罗斯中草药资源国际物流仓储库及科技研发项目', '黑河', '市辖区', '黑河-市辖区', '交通运输、仓储和邮政业', '第三产业', NULL, '合资', '13374万元（2064.28万美元）', '17013', '重点', '3', '4370', '1456', '筹划', '无', '', '', '黑河自贸片区管委会', '尹世跃', '18645648686', '6102277@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '俄罗斯野生中草药及林下种植有明显优势，生态环境好，土壤污染少，野生中草药资源丰富，现有1000多种药用植物。项目拟在黑河自贸区内规划厂区面积30000平方米，总建筑面积2000平方米，在境外种植基地种植中药材或者进口俄罗斯优质的绿色中草药，重点发展跨境中药种植、加工、研发产业。', '生物医药产业', '生物医药', '黑河边境经济合作区', '2', '2021-08-06 16:21:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521201045127.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (613, '9d39ab02-8473-11ea-b0bb-ac1f6b639ec0', '30万只肉羊屠宰加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '12000', '一般', '4', '3000', '1200', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '项目占地2万平方米，主要建设厂房及配套设施，其中屠宰车间300平方米。拟建设屠宰车间、屠宰车间内建设冷冻库、深加工车间、深加工车间内建设速冻库、冷藏库、建设综合办公楼、建设待宰圈，购进主要屠宰及深加工设备、配套建设冷库、污水处理、供电等公用配套设施。该项目主要从事肉羊屠宰、加工鲜冻肉食品、调理类食品、熟制酱卤制食品、肠衣加工、动物油脂及其他方便食品生产、羊副产品及生物制品生产、销售。建成后，年屠宰肉羊30万只，生产羊肉4000吨，其中深加工羊肉2000吨。\r\n近年来，羊肉已成为我国城乡居民膳食结构中不可少的食品，为发展肉羊提供了良好机会。2019年，杜尔伯特肉羊出栏量为30.09万只，原料充足。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江杜尔伯特经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153421551.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (614, '9da3a22e-cf44-11eb-a12f-00ff338109dc', '野生蓝莓、红豆一体化加工', '大兴安岭', '漠河市', '大兴安岭-漠河市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '5000', '一般', '11.5', '1500', '81', '筹划', '无', '', '', '漠河市商务局', '张明亮', '15714678670', '643678034@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '项目占地面积5.5万平方米，主要建设花青素提取车间、蓝莓鲜果包装车间、蓝莓罐头加工车间、蓝莓浓缩果汁加工车间，新建集旅游、观光、采摘一体的接待中心及相关配套设施。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '0', '2021-08-05 16:33:28', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (615, '9dca5a7d-7006-11ea-b0bb-ac1f6b639ec0', '龙嘉100万吨煤焦化及循环经济系统项目', '鹤岗', '东山区', '鹤岗-东山区', '采矿业', '第二产业', NULL, '合作', '105171万元（16233.14万美元）', '264686', '重点', '5', '24535', '50000', '建设', '有', '', '', '东山区人民政府', '贾闯', '15604680500', 'dsqzsj@163.com', '东山区商务局', '贾利娜', '15545861797', 'hgzsgz@163.com', '1248', '该项目是鹤岗市东山区人民政府2009年招商引河北汇源炼焦制气集团投资兴建，在2013年东山区再次通过招商引进鸡西龙嘉集团投资兴建，是鹤岗市重点和黑龙江省重点项目，厂址位于鹤岗市煤电化产业园，占地面积26.67公顷，依托鹤岗市丰富的煤炭资源优势，项目建成后年产煤焦油4.916万吨、硫磺840吨、硫铵1.175万吨、焦炭98.2万吨。', '煤炭精深加工产业', '煤炭深加工', '黑龙江鹤岗经济开发区', '1', '2021-08-10 10:08:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200327164030743.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (616, '9dfbe69e-804b-11ea-b0bb-ac1f6b639ec0', '玉米深加工项目', '齐齐哈尔', '梅里斯达斡尔族区', '齐齐哈尔-梅里斯达斡尔族区', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '10000', '一般', '7', '3000', '300', '筹划', '无', '', '', '梅里斯区经合局', '刘玉忠', '13845218996', 'zs6565158@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '30', '项目拟占地15000平方米。主要建设办公楼、车间、仓库、食堂、宿舍及其他附属设施。项目建设日处理1000吨玉米淀粉生产线、酶法多孔变性淀粉生产线、超高麦芽糖浆生产线、无水葡萄糖生产线及热电配套工程。', '农业及农副产品精深加工产业', '玉米深加工', '其它', '26', '2020-06-04 13:55:20', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200417093444937.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (617, '9e13f03b-725f-11ea-b0bb-ac1f6b639ec0', '佳木斯市25公里旅游带项目', '佳木斯', '东风区', '佳木斯-东风区', '其他', '第三产业', NULL, '独资', '60000万元（9261.0万美元）', '80000', '一般', '4', '24000', '16000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '18545400563', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '50', '项目拟选址在东风区建国镇-松江乡，占地面积80万平方米，项目建设分为稻田观光基地、果蔬采摘园、休闲垂钓区、候鸟观赏区、杏花欣赏村、特色小镇等6个部分。建国镇、松江乡属于近郊乡镇，农业生产重点以水稻、果蔬种植为主。围绕建国镇、松江乡现有特色生态农业基础，按照农田田园化、产业融合化、城乡一体化的发展路径，以自然村落、特色片区为开发单元，全域统筹开发，项目建设把农业观光、农耕体验、休闲娱乐、养生度假等有机结合起来，打造集现代农业、休闲旅游、田园社区等产业为一体的旅游观光带，东风区是佳木斯东出口，直面三江腹地，为观光旅游业提供了较好的客源市场，辐射周边经济区人口近1200万，市场前景十分广阔。', '旅游产业', '旅游', '黑龙江佳木斯经济开发区', '3', '2021-08-10 10:44:36', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200331155939353.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (618, '9e1665a0-9b2a-11ea-8a5d-00ff338109dc', '加格达奇林业局森林药材基地建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '6000万元（926.1万美元）', '6000', '重点', '6', '1000', '150', '筹划', '无', '', '', '加格达奇林业局招商引资办公室', '蔺葳', '13845794556', 'cx-yx@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '60', '大兴安岭野生中药材资源十分丰富，据统计，仅黄芪、苍术、赤芍、沙参、百合、断肠草、柴胡、龙胆等药用植物就有600余种，储量高达170多万吨。项目拟利用大兴安岭地区丰富的药用植物资源，在加林局施业区建设森林野生药材种质种源保护基地、森林药材人工种植基地、森林药材种子种苗繁育基地建设，保护基地5万亩，人工种植基地1万亩，种子种苗繁育基地1000亩。', '生物医药产业', '生物医药', '其它', '13', '2020-06-03 15:30:52', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521141633116.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (619, '9e1e4b38-732d-11ea-b0bb-ac1f6b639ec0', '青冈县汉麻轻工纺织项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '100000', '重点', '4', '10000', '2000', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '汉麻纤维有很好的毛细效应和透气性，吸湿量大，穿着舒适凉爽，且有抑菌、耐热、耐晒、天然绿色等优异特性。汉麻纤维优良的吸湿、透气、防腐、抑菌、低静电等特性，优于亚麻成为亚麻纤维替代品，被子、床垫、枕芯、毛巾等汉麻系列产品，已成为时尚。', '农业及农副产品精深加工产业', '工业大麻', '黑龙江青冈经济开发区', '21', '2020-05-31 22:42:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521133358537.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (620, '9e25b102-72f4-11ea-b0bb-ac1f6b639ec0', '佳木斯市教育城项目', '佳木斯', '前进区', '佳木斯-前进区', '教育', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '5000', '一般', '10', '1400', '200', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '300', '佳木斯市民营学校、特长专业学校、出国留学机构、辅导学校一般规模较小、分布零散、教学质量参差不齐，急需一所多元化、专业化、现代化、高质量的学校，来满足佳木斯市及周边地区人们对高端教育的需求。该项目拟占地8万平方米，主要建设幼儿园部、小学部、初中部、高中部、图书馆、健身馆、食堂、宿舍等符合现代化学校标准的配套设施。项目选址在前进区警校棚改待开发地块，将来齐全、成熟的配套设施必定吸引更多的人口入住，也将带来巨大的教育需求，市场前景良好。', '农业及农副产品精深加工产业', '现代商贸', '其它', '28', '2020-06-01 15:27:50', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523093739918.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (621, '9e80c33c-b22a-11eb-9405-00ff338109dc', '呼玛县年产2万吨大豆蛋白加工项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '21000万元（3241.35万美元）', '45637', '重点', '4', '6763.49', '3060', '筹划', '无', '', '', '呼玛县农业农村局', '王鹏展', '18645719920', 'hmxwpz@163.com', '大兴安岭地区商务局', '李晓倩', '13845720336', 'dqzsyqb@163.com', '300', '呼玛县具有丰富的水、土资源，地处高纬度地区，远离污染源，耕地肥沃，大豆品质优良，年种植大豆保持在80万亩以上，占耕地总面积的70％以上。呼玛县工业园区总规划面积128.79公顷，现在可利用工业建设用地40公顷；园区内基础设施建设齐全，已达到“七通一平”标准，交通便利。该项目主要建设年加工10万吨大豆，年产1.5万吨大豆油生产线，年产2万吨大豆蛋白生产线，8000吨大豆纤维生产线，包括75吨蒸汽锅炉和污水处理系统。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江呼玛经济开发区', '7', '2021-08-06 16:33:29', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (622, '9e967bec-84fe-11ea-b0bb-ac1f6b639ec0', '漠河市野生蓝莓酒开发项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '农、林、牧、渔业', '第一产业', NULL, '独资', '3600万元（555.66万美元）', '8000', '重点', '3.5', '1120', '380', '筹划', '无', '', '', '漠河市商务局', '张明亮', '15714678669', 'mhcxw1982@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '大兴安岭山野果资源十分丰富，各种山野果平均每年允收量在20万吨以上。漠河市及周边林业局（包括呼中林业局、图强林业局、西林吉林业局）是野生蓝莓生长的集中地段，平均每年允收量在9840吨以上。项目建设果酒发酵车间、酒窖污水净化池等设施，并购置安装生产机械设备和水电配套工程设备，项目达产后预计年消耗山野果约3000吨，占四局允收总量的30.5%原料供应充足；预计年生产高档蓝莓果酒600吨，其中：野生蓝莓冰酒200吨、蓝莓白兰地果酒100吨、蓝莓干红200吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江加格达奇经济开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522154038862.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (623, '9e9e691b-843f-11ea-b0bb-ac1f6b639ec0', '10万吨/年粘玉米加工项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '11052.64万元（1705.97万美元）', '37450', '一般', '4', '3500', '1500', '筹划', '无', '', '', '肇州县招商服务中心', '张立江', '13604892456', 'jhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '肇州县是粘玉米主产区，一直居全省前列，2019年产优质粘玉米10余万吨，原料充足。未来3-5年内，粘玉米种植面积将达到14-17万公顷，鲜穗和粘玉米加工产品的出口具有相当大的市场前景。\r\n本项目拟占地面积30000㎡，建筑面积19600㎡。项目建成后，达到年处理鲜粘玉米10万吨规模，生产粘玉米苞、玉米饼、玉米面条等系列速食产品。主要建设生产车间(二层) 9000㎡、冷库2000㎡、原料库2000㎡、成品库2000㎡、办公楼（四层）4000㎡、门卫及秤房100㎡、锅炉房300㎡、配电室及消防泵房200㎡。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江肇州经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521142856803.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (624, '9f0e3d5c-8460-11ea-b0bb-ac1f6b639ec0', '医药产业园盘活项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '196800万元（30376.08万美元）', '970000', '一般', '3', '68000', '97000', '筹划', '无', '', '', '大庆高新区管委会', '程兆全', '13945954869', '16645396016@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '1000', '生物医药是国家鼓励发展的战略新兴产业，大庆高新区建有高标准的生物医药产业园，在生物医药研发生产、医药销售网络等方面具备一定的产业基础。\r\n医药产业园已投资19.68亿元，其中固定资产投资13.15亿元。寻求合作伙伴改造或利用现有基础设施，包括现有包含生物制剂、保健食品、食品生产线26条，其中部分生产线技术工艺。项目改造或充分利用现有基础设施，建成全部投产后，估算年产值约97亿元，实现利税约16.5亿元。', '生物医药产业', '生物医药', '大庆高新技术产业开发区', '23', '2020-05-30 16:34:08', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422141510811.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (625, '9f36d0c5-6de9-11e8-b8c9-ac1f6b639ec0', '焦粒制气项目', '鹤岗', '南山区', '鹤岗-南山区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '合资', '37800万元（5834.43万美元）', '14165.47', '重点', '9', '4200', '1800', '可研', '有', '', '', '鹤岗市征楠煤化工有限公司', '吴成魁', '15604880123', '18304681668@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '200', '该项目位于鹤岗市循环经济产业园，主要建设备输煤装置，焦粉气化装置，煤气净化装置，空分站，储罐以及配套公用工程和设施。项目以焦粒为原料，对焦粒进行气化反应生产煤气，气化炉产生的煤气作为燃料置换现有焦炉内的焦炉煤气，被替换出的焦炉煤气经压缩、净化、合成、液化、提氢工段生产出LNG和氢气。项目建成后，年可生产LNG 8.5万吨。', '煤炭精深加工产业', '煤炭深加工', '黑龙江鹤岗经济开发区', '169', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (626, '9fa25001-757d-11ea-b0bb-ac1f6b639ec0', '牡丹江市阳明区俄罗斯国际广场项目', '牡丹江', '阳明区', '牡丹江-阳明区', '建筑业', '第二产业', NULL, '合资', '43000万元（6637.05万美元）', '30000', '重点', '14.3', '3000', '1140', '筹划', '有', '', '', '牡丹江市经合局', '吴强', '13384539996', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '600', '项目规划占地面积8万平方米，主要建设大型超市、商务宾馆、电影院、健身中心、写字楼、特色小吃商街、鲜花水果街区等业态。项目总建筑面积16万平方米，预建设面积15万平方米的主体楼一座，其余附属建筑物1万平方米，将成为具有餐饮、休闲、娱乐、住宿、休闲绿地、特色商业街区等功能的综合性服务设施及办公场所。', '现代商贸产业', '现代商贸', '黑龙江阳明经济开发区', '17', '2020-05-29 15:28:41', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403153459758.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (627, '9fb03787-a173-11ea-8a5d-00ff338109dc', '年产100吨石墨烯粉体项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合作', '50000万元（7717.5万美元）', '60000', '重点', '6', '9000', '7000', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'daqingepz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '300', '本项目计划占地20万平方米，主要建设5条三联厂房生产线，每条生产线配套建设三个成品库房，一个原材料库房，总计建设15个成品库房，5个原料库房。省内鸡西等地具有大鳞片石墨资源，可为项目提供原料保障；此外，大庆石化、大庆炼化还可提供高品质石油焦19万吨，中蓝石化拥有商品化甲烷、丙烷、丙烯等基础化工原料，可为石墨烯衍生品制备提供原料。经开区正在建设能源互联网项目，2020年底可实现大工业用电0.43元/kwh，充足电力资源能有力的保障项目用电。经开区借与让胡路区开展一体化招商契机，可依托让胡路区人才市场招聘优势，可为项目提供充足的用工保障。', '新材料产业', '石墨烯', '大庆经济技术开发区', '12', '2020-05-30 16:04:05', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529141416041.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (628, '9fd23aa2-cbe1-11ea-9952-00ff338109dc', '东宁市河北新区商贸旅游综合体项目', '牡丹江', '东宁市', '牡丹江-东宁市', '房地产业', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '17000', '一般', '5', '3000', '500', '筹划', '无', '', '', '东宁市经合局', '于学勇', '15945731616', 'dnzsj@126.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '1、基础设施完善。东宁城市建设秉承“一河居中、两岸繁荣、中欧合壁、江南风情”的理念，近年来河北新区基础设施建设逐步完善，党政办公中心、人民办事大厅、各党政机关先后迁至河北新区，带动当地经济发展；东宁博物馆、河滨公园、九年一贯制学校等公共设施的建立使河北新区人气汇集，提升发展潜力。\r\n2、高档住宅林立。商贸综合体项目地处河北新区中心位置，东临东宁市党政办公中心，周边有宏达雅苑、金朋小区、龙腾家园、和谐家园、金港湾、明珠观邸及高档别墅小区，西临北河沿平房区，居住人口约3万余人。\r\n3、商业基础较好。建禄酒业、华俄经贸、鑫吉沃汽车销售中心等企业建设在河北新区，对整个地区的经济发展起到积极的辐射带动作用。', '文化创意产业', '其它', '黑龙江东宁经济开发区', '3', '2021-08-10 10:14:35', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200722140733360.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (629, 'a039ddf0-7a0a-11e8-9615-ac1f6b639ec0', '欧陆风情街区改造项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '60000万元（9261.0万美元）', '15000', '一般', '5', '4000', '500', '筹划', '无', '', '', '道里区招商局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区招商局', '于鹏怡', '18686775832', 'daolizsj@163.com', '100', '项目建设地点在哈尔滨市中央大街辅街红砖街至红霞街区域，占地面积900平方米，建筑面积8000平方米。拟对辅街的保护建筑的原有风貌进行维护修缮，对相关建筑按照业态定位风格进行装饰性改造。并进一步丰富商业业态，构建多元商业及文化空间，打造具有欧陆风情，集餐饮、商务、民宿酒店于一体的文化休闲街区和旅游目的地。项目建成后，将成为哈尔滨最具商业价值的核心区域。', '现代商贸产业', '现代商贸', '其它', '147', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153332634.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (630, 'a03ac082-73c3-11ea-b0bb-ac1f6b639ec0', '冷链物流仓储基地建设项目', '绥化', '庆安县', '绥化-庆安县', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '11000万元（1697.85万美元）', '6627', '重点', '6', '1893', '400', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '120', '围绕产业结构调整，利用绿色食品、特色农产品优势形成集农副产品销售、畜禽屠宰冷链物流及配套商务等多功能于一体的冷链物流仓储基地建设项目，建设冷链物流仓储基地（包括蔬菜、水果、粮油、干调等农副产品交易、畜禽屠宰及冷链物流、配套设施等）。本项目的建设有助于提高我县食品流通、保鲜，保证人们正常生活健康食品需求将具备一定意义。本项目占地80亩，总建筑面积35500平方米。建设冷库仓储配送区、中心功能区和综合配套区等。', '物流产业', '物流', '黑龙江庆安经济开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204614709.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (631, 'a08b2de8-7fad-11ea-b0bb-ac1f6b639ec0', '新鹤城商贸综合体项目', '齐齐哈尔', '龙沙区', '齐齐哈尔-龙沙区', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '79000万元（12193.65万美元）', '70000', '一般', '5', '16000', '1500', '筹划', '无', '', '', '龙沙区经济合作促进局', '张桓', '15845202234', 'lsqjhzx@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '130', '项目占地面积21万平方米，建筑面积62万平方米。建设集商贸物流、商务金融、休闲购物、旅游度假、医疗养老、高尚人居等多元化功能为一体的城市综合体项目。建设集商贸物流、商务金融、休闲购物、旅游度假、医疗养老、高尚人居等多元化功能为一体的城市综合体项目。', '康养产业', '康养', '其它', '90', '2020-06-04 14:03:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523150242668.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (632, 'a0b3c087-74d7-11ea-b0bb-ac1f6b639ec0', '明水县年产5000吨对俄脱水蔬菜加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '6000万元（926.1万美元）', '5000', '重点', '4', '1500', '500', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '60', '项目总投资6000万元，达产后，可形成年产脱水蔬菜5000吨，预计种类鲜菜用量40000吨。可为社会提供60余名就业岗位机会。由于气候寒冷，远东边远地区的居民在冬春季节食用鲜菜比较困难，所以对脱水蔬菜有一定的需求。消费市场主要集中在北部几个行政区，像堪察加州、马加丹州、楚科奇自治区、雅库特自治共和国、以及哈巴罗夫斯克北部等地区。除了远东经济区之外，西部的几个行政区也有消费，如克拉斯诺雅尔斯克边疆区等。主要消费品种有：元葱丝、甘蓝丝、胡萝卜丝、土豆泥干片、以及甜椒、大蒜、蘑菇等。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江明水经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115740209.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (633, 'a0ca4958-9e92-11ea-8a5d-00ff338109dc', '南岔县瓢舀鱼冷水鱼繁育养殖基地建设项目', '伊春', '南岔县', '伊春-南岔县', '批发和零售业', '第三产业', NULL, '独资', '5000万元（771.75万美元）', '2000', '一般', '10', '500', '50', '筹划', '无', '', '', '南岔县政府', '颜秉君', '13845873559', 'ncshangwuju@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '25', '伊春市关东三奇商贸有限公司于2017年1月成立，同年2月注册“瓢舀鱼”品牌，名称来源于东北谚语“棒打狍子瓢舀鱼，野鸡飞到饭锅里”。公司以瓢舀鱼品牌为基础，形成集科研、孵化、养殖、流通、加工、销售于一体的全产业链经营模式，以冷水性鱼类为主打产品，向客户提供绿色、健康、安全、原生态、高品质的东北水特产品。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江南岔经济开发区', '24', '2020-05-27 23:09:34', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525221838806.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (634, 'a0da6f1b-75a7-11ea-b0bb-ac1f6b639ec0', '醉氧金沙特色餐饮旅游商业街项目', '七台河', '市辖区', '七台河-市辖区', '住宿和餐饮业', '第三产业', NULL, '合资', '2000万元（308.7万美元）', '1000', '一般', '7', '300', '100', '筹划', '无', '', '', '七台河开发区金沙实业公司发展战略部', '段红亮', '18346460010', 'kfqtzhzcj@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '300', '建设内容：酒店集团、快捷宾馆、旅游运营商、旅行社、特色工艺品店、时尚品牌店、蛋糕店、主题餐厅、地方特色风味小吃店、酒吧、茶社、咖啡馆、会所、小型主题客栈、KTV、SPA店、水疗店、游戏厅等。', '旅游产业', '旅游', '黑龙江七台河经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522164704973.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (635, 'a0fc51f3-739a-11e8-a795-ac1f6b639ec0', '二龙潭国家湿地公园建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '20000', '一般', '5', '6000', '4000', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '30', '该项目建设地点在二龙潭境内。二龙潭位于松花江沿岸最大的内陆湖泊，距通河镇东20公里处，由沃进泡和哈什哈泡组成。拟建设服务管理区（湿地访客中心、停车场、游船码头、湿地生态餐厅等）、宣教展示区（湿地探索中心、生态探索中心，在合理利用区修建湿地观鸟屋、观光休闲栈道、垂钓长廊等）和外部扩展区域（湿地生态度假村、滨湖营地等）。项目拟建地周围的湿地有着丰富珍贵的动植物资源，是不可多得的旅游资源。', '旅游产业', '旅游', '黑龙江通河经济开发区', '104', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524210205141.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (636, 'a15e04d6-73f3-11ea-b0bb-ac1f6b639ec0', '牡丹江市养老产业项目', '牡丹江', '市辖区', '牡丹江-市辖区', '住宿和餐饮业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '30000', '重点', '10', '5000', '1000', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '养老产业项目是以“邻里式养老”为理念，以专业服务为核心，倾心为长者提供安全适老的居所，倾心为长者打造健康舒适的精致生活。\r\n项目预计占地100亩，建筑面积6.4万平方米。其中包括4500平万米的中央金十字配套，3000平方米风雨连廊，容积率为1.0，绿地率35%是低密度社区。邻里式养老，不脱离社会和子女，适老化产品和服务体系，打造居家体验。', '康养产业', '康养', '牡丹江经济技术开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522135507502.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (637, 'a166b7ab-735d-11ea-b0bb-ac1f6b639ec0', '青冈县玉米秸秆木糖醇项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '60000', '重点', '3', '10000', '500', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '300', '以玉米秸秆为原料发展木糖醇项目，利用酶解法、酸泡法生产木糖醇，平均12吨秸秆可生产1吨木糖醇。木糖醇产品规模和技术已经达到世界领先水平，国际竞争力优势显著，我县玉米秸秆资源可利用空间较大，秸秆木糖醇价位较高，为生产木糖醇提供前提基础。\r\n', '节能环保产业', '秸秆综合利用', '黑龙江青冈经济开发区', '13', '2020-05-31 22:41:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521133514750.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (638, 'a16b9d29-82d3-11eb-94a7-00ff338109dc', '黑河自贸片区影视文化产业项目', '黑河', '市辖区', '黑河-市辖区', '其他', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '18000', '一般', '8', '5400', '2900', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '黑河，这片美丽而神奇的土地，自从上个世纪80年代开始，就吸引着国内知名的影视剧组。潺潺流淌的小河、奔流不息的大江、一望无际的开阔地、亭亭玉立的白桦林，还有碧蓝的天空、广阔的原野、秀丽的河套、自然的天籁。依托这些风景秀丽的景色，近年来更是成为剧组纷至沓来、演员频频光顾的影视拍摄热地。迄今为止，在黑河拍摄取景的著名影视作品已有20多部，其中，耳熟能详的影视作品有《闯关东》、《大院子女》、《年轮》、《狂吻俄罗斯》、《这里的黎明静悄悄》、《红月亮》等。', '文化创意产业', '文化创意', '黑河边境经济合作区', '0', '2021-08-10 09:56:40', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (639, 'a1c03f98-95ee-11e8-8e63-ac1f6b639ec0', '8万吨/年电铅冶炼项目', '伊春', '金林区', '伊春-金林区', '制造业', '第二产业', NULL, '合作', '49500万元（7640.32万美元）', '300000', '重点', '6', '19000', '23000', '建设', '有', '', '', '伊春金林铅冶炼有限公司', '杨绍军', '15304130001', 'ycjlky@163.com', '西林招商办', '宋雪双', '13945876577', 'yczsb2011@163.com', '790', '1、建设内容：铅原料仓及配料系统、氧气底吹熔炼——还原炉烟化炉车间、电解车间、贵金属车间、铜浮渣处理、粉煤制备、氧气站、鼓风空压机房、软水站、工业锅炉房、污酸污水处理站、厂区内配电系统、循环水系统及辅助设施。', '汽车制造产业', '新能源汽车', '其它', '38', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523215052173.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (640, 'a1d0c670-54b2-11e8-a5b9-ac1f6b639ec0', '进口俄罗斯木材加工项目', '双鸭山', '饶河县', '双鸭山-饶河县', '制造业', '第二产业', NULL, '独资', '5000万元（771.75万美元）', '6000', '重点', '3', '1800', '450', '筹划', '无', '', '', '饶河县经济合作交流中心', '宋树江', '13895860200', 'rhzsyzj@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '40', '饶河县有国家一类客货运输口岸，与有着丰富森林资源的俄罗斯远东地区仅一江之隔。俄罗斯远东地区森林资源虽然十分丰富，但开发利用却还处于较低水平。饶河口岸基础设施齐备，通关便捷顺畅，从饶河口岸进口俄罗斯木材具有得天独厚的优势。该项目利用饶河县的木材资源优势，拟建设占地面积20000平米原料场、生产车间、烘干窑、成品仓库、产品展厅等基础设施，达到年加工木材10000立方米。', '木材加工产业', '家具制造', '黑龙江饶河经济开发区', '29', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (641, 'a27ce2fa-63ed-11e8-aaec-ac1f6b639ec0', '年产30万立方米秸秆人造板项目', '哈尔滨', '五常市', '哈尔滨-五常市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '22000', '重点', '3', '6000', '3000', '筹划', '无', '', '', '五常市招商局', '王晓华', '19903611199', 'wuchangzsj@126.com', '五常市招商局', '王秀君', '15046037557', 'wuchangzsj@126.com', '220', '项目建设地点在哈尔滨市五常市，占地5万平方米，建筑面积4万平方米。五常市有耕地428万亩，每年产出大量农作物秸秆，原料充足。拟建设生产车间、综合仓库、办公及宿舍用房、食堂、动力及其他辅助用房等，并引进生产设备。该项目将解决秸秆焚烧对大气环境造成的污染，并代替木材成为新型材料，市场前景广阔，项目达产后，可年产30万立方米秸秆人造板。', '木材加工产业', '家具制造', '黑龙江五常经济开发区', '136', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (642, 'a27e5158-767e-11ea-b0bb-ac1f6b639ec0', '牡丹江市阳明区高岭土综合开发项目', '牡丹江', '阳明区', '牡丹江-阳明区', '采矿业', '第二产业', NULL, '合资', '10000万元（1543.5万美元）', '14000', '重点', '7', '1400', '400', '筹划', '有', '', '', '牡丹江市直专班', '吴强', '13384539996', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '牡丹江市建设高岭土综合开发鉴于其地理和交通因素，可以占领东北市场，同时依托绥芬河口岸优势，产品可辐射俄罗斯远东地区、韩国和日本。项目规划占地20万平方米，建筑面积8万平方米，建设原料库、成品库、成型车间、烧炼车间、彩绘车间、其他配套用房，购置梭式窑、压胚车等设备。', '新材料产业', '复合材料', '黑龙江阳明经济开发区', '15', '2020-05-29 16:21:17', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143505887.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (643, 'a29c8be0-846f-11ea-b0bb-ac1f6b639ec0', '医疗健康大数据服务项目', '大庆', '市辖区', '大庆-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '60000', '一般', '3', '10000', '4000', '筹划', '无', '', '', '大庆高新区管委会', '丁超', '18804593387', '418433790@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', '基于互联网的数据传输与分析技术，大数据在医疗行业的应用已逐步受到市场的关注，越来越多的企业开始发展互联网及移动医疗服务，大数据的应用也被逐渐提上日程，市场前景广阔。\r\n项目主要构建千万人数据量级的自然人大型健康队列重大疾病临床生命组学数据库、多层次精准医疗知识库体系和生物医学大数据共享平台；探索准确的健康大数据的分析策略、建立大规模健康管理及疾病预警体系；突破新一代生命组学的分析技术，研发系列生物标志物、靶标和制剂；壮大医疗健康产业发展，不断提升优质医疗资源的共享和可及性。', '新一代信息技术产业', '新一代信息技术', '大庆高新技术产业开发区', '26', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422160239225.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (644, 'a2c7aeee-823f-11ea-b0bb-ac1f6b639ec0', '水飞蓟种植加工项目', '齐齐哈尔', '依安县', '齐齐哈尔-依安县', '农、林、牧、渔业', '第一产业', NULL, '独资', '12000万元（1852.2万美元）', '27000', '一般', '6', '2800', '300', '筹划', '无', '', '', '依安县经济合作促进局', '杨东辉', '13019099333', 'ya7022270@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '120', '新建一个订单种植10万亩的水飞蓟种植加工基地，在齐齐哈尔经济开发区建设炭基产业园和水飞蓟加工厂，项目总占地面积7000公顷，其中种植水飞蓟10万亩, 水飞蓟加工厂6公顷,当年加工水飞蓟15000吨,提炼水飞蓟素600吨，调和油500吨，饮料500吨，酱油300吨，醋300吨，酒300吨。', '中医药产业', '中医药', '黑龙江依安经济开发区', '39', '2020-06-04 14:06:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521155141228.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (645, 'a2ed8fe6-7a2c-11ea-b0bb-ac1f6b639ec0', '珍宝岛国家湿地公园建设项目', '鸡西', '虎林市', '鸡西-虎林市', '租赁和商务服务业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '7500', '一般', '15', '2200', '200', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '50', '项目年可接待30万人次。建设以下功能区：湿地科普文化长房、摄影绘画展示墙、湿地浴场、湿地体验频道、树屋木屋度假区、房车露营地、湿地露营地、湿地探险区、湿地娱乐场、山地自行车运动、水上娱乐园、湿地餐厅、户外拓展训练基地。', '旅游产业', '旅游', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522141222505.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (646, 'a34e66da-c335-11ea-8a5d-00ff338109dc', '玉米深加工产业链项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '92285万元（14244.19万美元）', '177200', '重点', '7.5', '14300', '10963.9', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', '13115395234@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '国内玉米深加工企业可生产200余种产品，杜蒙县仅能生产赖氨酸、苏氨酸等有限几个品种。重点围绕淀粉系列、酒精系列和功能性系列开发生产下游产品，延伸产品链条，优化产品结构。玉米深加工业已经成为拉动区域经济发展和吸引投资的重要领域，发展潜力很大。根据国家和省的有关政策，大庆市委市政府出台了《关于促进产业发展意见》，为发展粮食加工产业提供了政策支持。黑龙江省玉米自然成熟度好，各项卫生指标符合国家标准，内在品质和绿色安全特色优势突出。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江杜尔伯特经济开发区', '7', '2021-08-10 10:18:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200711131630296.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (647, 'a34ee14e-73ce-11ea-b0bb-ac1f6b639ec0', '大数据产业园建设项目', '绥化', '绥棱县', '绥化-绥棱县', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '35000万元（5402.25万美元）', '23000', '重点', '9', '3800', '650', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '350', '随着物联网、云计算的发展，数据仓库、数据安全、数据分析、数据挖掘等围绕大数据的商业价值利用逐渐显现。大数据产业园作为大数据企业的孵化器，正迎来广阔的发展机遇和空间。绥棱县积极在数字经济方面先行试水，启动建设了数据小镇一期项目。该项目主要建设旅游大数据中心、健康医疗大数据中心、绿色食品溯源大数据中心、云计算中心、遥感卫星数据备份中心等项目。', '新一代信息技术产业', '新一代信息技术', '黑龙江绥棱经济开发区', '29', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521202252350.doc');
