INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (650, 'a463bd1d-69b1-11ea-b0bb-ac1f6b639ec0', '嫩江市年产10万吨燕麦乳加工项目', '黑河', '嫩江县', '黑河-嫩江县', '制造业', '第二产业', NULL, '独资', '13670万元（2109.96万美元）', '40000', '一般', '3', '5000', '1500', '筹划', '无', '', '', '嫩江市招商服务中心', '周茂波', '18724317888', '1071109202@qq.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '80', '燕麦的营养价值逐步得到世人的广泛认可，功能性食品和保健食品倍受消费者欢迎。燕麦乳产品是饮用方便 、口味浓郁的健康产品，因此开发前景看好，市场每年以 15%-22%的速度增长。嫩江市耕地面积1026.39万亩，气候特点适合燕麦生产，该项目是对燕麦进行综合加工利用，生产燕麦乳产品。项目总投资13670万元，设计年加工 10 万吨燕麦乳产品，年处理燕麦 1 万吨。参考目前国内市场上相近产品定出厂价（4000 元/吨），达产后可实现年产值 4 亿元，利润 5000万元，税金1500万元。', '农业及农副产品精深加工产业', '其它', '黑龙江嫩江经济开发区', '2', '2021-08-06 16:21:39', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200319151707624.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (651, 'a481f54c-725e-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产10万吨麦芽糊精项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '40000', '一般', '5', '6000', '4000', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '项目建设地点富锦市经开区，享受省级开发区优惠政策。占地面积8公顷，总建筑面积4万平方米。建设内容，年产10万吨麦芽糊精。资源优势，富锦象屿金谷生化科技有限公司年产75万吨优质玉米淀粉，可为配套企业提供原料保障。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富锦经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152954381.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (652, 'a4d33afc-9b27-11ea-8a5d-00ff338109dc', '加格达奇综合物流园项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '租赁和商务服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '18000', '重点', '7', '4500', '500', '可研', '有', '', '', '加格达奇区发改局', '刘涛', '18645719911', 'jqswj03@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '加格达奇是齐齐哈尔以北最大的中心城市，项目拟利用独特的区位优势建设黑龙江省西北部农副产品和林下、山特产品、中药材物流配送和交易中心，集市场信息、现代仓储、展销、交易装卸、配送、运输以及质检、与生活配套等多元服务功能于一体的现代化综合物流园。拟投资3亿元，建设建设内容包括物流配送中心（农副商品仓储配送区、林木产品仓储配送区、矿产品仓储配送区等）；产品交易区（农副商品交易区、林木产品交易区、矿产品交易区等）；综合办公区等设施。', '物流产业', '物流', '黑龙江加格达奇经济开发区', '26', '2020-06-03 15:34:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521135515928.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (653, 'a53bcf7f-bc2a-11eb-a12f-00ff338109dc', '绿豆深加工项目', '哈尔滨', '木兰县', '哈尔滨-木兰县', '建筑业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '20000', '一般', '5', '4000', '500', '筹划', '无', '', '', '木兰县投资合作服务中心', '尉天宇', '13104004402', 'mlzhaoshangju@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '30', '新建生产加工厂房，烘干室，冷冻库，储藏库、食品加工生产线等相关配套设施。主要产品：速溶绿豆粉、绿豆汁饮料等。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '7', '2021-08-10 09:50:29', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (654, 'a60c4e22-9b37-11ea-8a5d-00ff338109dc', '北药（五味子）种植加工一体化建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '6326.5万元（976.5万美元）', '5000', '重点', '6.2', '1000', '300', '可研', '有', '', '', '韩家园林业局招商办', '赵国杰', '13846554980', '57390196@QQ.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '100', '野生五味予在韩家园林业局及沿塔河、呼玛河、盘古河及江岛屿上都有分布，不完全统计野生五味子面积达1000公顷左右。项目拟利用周边地区大气、水、土壤无污染，灌溉用充足的优势，建设10000亩高标准的五味子种植基地，以及加工五味子原果为主的现代化大型加工厂一处，生产五味子果汁、果酒、饮料，五味子口服液、五味子浓缩汁及五味子香精和五味子木脂素等深加工产品。', '生物医药产业', '生物医药', '其它', '18', '2020-06-03 15:12:52', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154949937.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (655, 'a645b73b-738d-11e8-a795-ac1f6b639ec0', '30万吨水稻全产业链项目', '绥化', '北林区', '绥化-北林区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '重点', '5', '10000', '1300', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '100', '借助北林区水稻资源优势，依托河夹芯子国家现代农业水田示范区，建设100万亩高端化水稻生产基地，重点发展适口型水稻基地、鸭稻、蟹稻等绿色水稻和有机水稻种植，利用物联网系统实现全程可追溯、可监控。实行专品种种植、加工、销售。利用米糠、稻壳、碎米等加工副产品，生产米糠油、谷维素、维生素E、糠粕深加工、膳食纤维、L-乳酸菌等高附加值产品，利用废弃的稻壳生产白炭黑、活性炭等下游产品，打造生态循环经济链条。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '288', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521114514598.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (656, 'a753244b-82d4-11eb-94a7-00ff338109dc', '黑河自贸片区国际收储物流综合体建设项目', '黑河', '市辖区', '黑河-市辖区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '40000万元（6174.0万美元）', '55000', '一般', '7', '6000', '3500', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '200', '黑河市是国家重要商品粮基地和绿色食品主产区，域内总耕地面积约2800万亩，粮食产量达103.5亿斤，是非转基因大豆、强筋春小麦、高品质专用玉米的重要产区。建设集粮食收购、储备、加工于一体，项目总用地面积12万平方米，总建筑面积15万平方米，仓储容量70万吨，其中黑河自贸区C地块内仓容10万吨（大豆、中草药等），占地面积1.68万平方米，建筑面积2.1万平方米，俄罗斯布拉戈维申斯克桥头区内仓容10万吨，占地面积1.68万平方米，建筑面积2.1万平方米，白山建设仓容50万吨的粮食、木材、中草药等收购、储备、加工于一体得综合体，占地面积8.64万平方米，建筑面积10.8万平方米。', '物流产业', '物流', '黑河边境经济合作区', '7', '2021-08-10 09:54:56', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (657, 'a7c2d874-9d6e-11ea-8a5d-00ff338109dc', '肉牛产业招商项目', '齐齐哈尔', '富裕县', '齐齐哈尔-富裕县', '农、林、牧、渔业', '第一产业', NULL, '独资', '150000万元（23152.5万美元）', '50000', '一般', '10', '15000', '1500', '筹划', '无', '', '', '富裕县经合局', '丁力', '13763468188', 'fyzsj0885@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '60', '富裕县具有得天独厚的肉牛养殖条件。是省委、省政府确定的牧业县和全省第一、二期牧业技术改造试点县，被国家农业部确定为全国牧区开发工程示范县，并进入全国畜牧兽医科技百强县行列引进国际先进的肉牛屠宰生产线及设备，生产高端雪花牛肉、分割牛肉及腊牛肉、五香牛肉、牛肉培根、牛肉干、牛肉松、罐头等牛肉制品。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江富裕经济开发区', '73', '2020-06-04 14:00:20', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524113000421.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (658, 'a7d208ce-8243-11ea-b0bb-ac1f6b639ec0', '200MW风电平价项目', '齐齐哈尔', '依安县', '齐齐哈尔-依安县', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '149722.89万元（23109.73万美元）', '80000', '一般', '7', '20000', '2000', '筹划', '无', '', '', '依安县经济合作促进局', '杨东辉', '13019099333', 'ya7022270@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '项目总装机容量200MW，安装66台单机容量3.0MW和1台单机容量2.0MW的风电机组，选用公司自主生产的MY3.0-121型、MY2.0-121型风机。新修场内外检修道路，1座220KV升压站，67台风机基础及箱变基础、35KV集电线路、220KV送出线路。', '新能源产业', '风电', '黑龙江依安经济开发区', '44', '2020-06-04 13:59:42', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524115940085.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (659, 'a7e2d4a9-7a25-11ea-b0bb-ac1f6b639ec0', '佳木斯市赫哲鱼文化产品、旅游工艺品开发项目', '佳木斯', '同江市', '佳木斯-同江市', '其他', '第三产业', NULL, '独资', '9000万元（1389.15万美元）', '7500', '一般', '6', '1252', '248', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '项目建设地点为同江市同江市街津口赫哲族乡。以赫哲族传统鱼文化系列产品开发为宗旨，拟建年生产能力500吨的鱼类系列产品加工厂，主要加工以鲑鱼为主的旅游速食产品；建设企业+农户的旅游工艺品生产联合体，制作以鱼皮、鱼骨、桦树皮为主的旅游工艺品10万件。项目占地面积约2万平方米，建设内容：一是工艺品制作车间、产品设计室等基础设施，建设配套的基础设施及生产线设备购置；二是鱼食品加工车间、冷库、成品库等基础设施建设，产品生产线设备购置；三是技术人员培训。', '旅游产业', '旅游', '其它', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112452986.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (660, 'a7fc5106-7286-11ea-b0bb-ac1f6b639ec0', '豆粉、豆奶粉生产项目', '绥化', '海伦市', '绥化-海伦市', '农、林、牧、渔业', '第一产业', NULL, '独资', '16000万元（2469.6万美元）', '20000', '重点', '4.5', '3600', '650', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '300', '大豆营养价值高、受众广泛，海伦市作为黑龙江省大豆主产区之一，所生产的大豆具有产量和品质的双重优势。该项目是以寒地黑土非转基因大豆为主要原料，采用国际最先进的半干法加工工艺，无需浸泡大豆即可生产优质的豆浆，最大限度的保留大豆里的活性物质及微量元素，节约水资源的同时能减少对环境的污染。该项目预计年可生产豆粉、豆奶粉2万吨。项目计划占地面积30,000㎡，总建筑面积19,000㎡。主要建设内容包括厂房、车间、办公室及购置设备等。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江海伦经济开发区', '22', '2020-05-31 22:33:15', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521194402048.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (661, 'a84453d5-846b-11ea-b0bb-ac1f6b639ec0', '年产2万吨豆粉加工及仓储项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '21000', '一般', '5', '3200', '2800', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '豆粉是一种营养丰富，易为人体消化吸收，并且具有一定保健作用的现代天然食品，它不含胆固醇、乳糖而含有大量的亚油酸和亚麻酸等不饱和脂肪酸，具有降低血液胆固醇和血脂功能，未来大豆食品产业将加快发展，市场空间更加广阔。\r\n2019年杜蒙县种植大豆面积13.2万亩，产非转基因大豆2.1万吨，随着大豆产业发展，种植面积将逐年扩大，原材料充足。\r\n项目占地4万平方米，配套购置年产20000吨豆粉生产设备、化验检测设备、污水处理设备、供电、供水、供暖等辅助设施。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江杜尔伯特经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151739222.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (662, 'a8619f9e-734b-11ea-b0bb-ac1f6b639ec0', '佳木斯市中草药饮片加工项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '32000万元（4939.2万美元）', '50000', '一般', '3', '12000', '5000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '汤原县境内森林资源丰富，生态环境优良，空气、土壤、水质、气候等自然条件非常适合中草药材的人工种植。汤原县境内药材资源共有61科、185种，其中动物类8科、15种，植物类53科、170种。中药材产地就地加工中药饮片，能节约产地对中药材的粗加工及运输费用，降低生产成本，提高经济效益和社会效益。在工序上可减少二次加工浸泡等环节，从源头控制中药饮片质量，提高疗效和用药安全，有效提高市场声誉及占有率，市场前景十分广阔。建设加工厂一座，占地面积26500平方米，建设内容包括：生产车间、原料及包装盒辅料仓库、成品仓库、分装车间、办公楼、实验室及其设备设施等。', '中医药产业', '中医药', '黑龙江汤原经济开发区', '2', '2021-08-10 10:43:24', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707140738694.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (663, 'a866fac4-7df1-11ea-b0bb-ac1f6b639ec0', '汽车公园建设项目', '鸡西', '城子河区', '鸡西-城子河区', '租赁和商务服务业', '第三产业', NULL, '合作', '50000万元（7717.5万美元）', '10000', '一般', '15', '3000', '500', '筹划', '无', '', '', '城子河区发展和改革局', '张岩', '15561731621', '546713334@qq.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '300', '项目占地面积20万平方米，建设房车（旅居车）营位80个，自驾车（非旅居车）营位100个，帐篷区5000平方米。综合服务接待中心面积1500平方米。建设汽车展区、赛场、商业接待区、汽车科技展览馆、企业文化展览馆、汽车主题影院、主题商街、室内主题乐园、主题游乐设备、主题演义、主题餐饮街、汽车酒店等。', '汽车制造产业', '汽车服务', '其它', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525100332590.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (664, 'a90f007e-74d3-11ea-b0bb-ac1f6b639ec0', '马铃薯淀粉、粉丝加工', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '3500万元（540.22万美元）', '5100', '一般', '4', '800', '400', '筹划', '无', '', '', '勃利县经济合作促进局', '高东海', '13946533666', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '勃利县是全国商品粮基地县，原料供应充足，可以实现大规模、集约化生产。勃利县劳务市场活跃，劳动力资源与周边地区和发达地区相比，资源比较富集，用工价格比较低廉，就业人员培训基础好，可为企业提供充足的技术工人。建设内容：建设两条生产线，一条是淀粉生产线，日加工马铃薯200吨，年可加工10万吨马铃薯，产出30吨的淀粉，另一条是全自动粉丝生产线，可日产粉丝2吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江勃利经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174511812.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (665, 'a92aa2e7-73b7-11ea-b0bb-ac1f6b639ec0', '安达市年产20万吨碳五碳九深加工项目', '绥化', '安达市', '绥化-安达市', '制造业', '第二产业', NULL, '独资', '49000万元（7563.15万美元）', '127000', '重点', '2', '26000', '14000', '筹划', '无', '', '', '安达市经济合作促进中心', '刘航睿', '13634595066', 'adzsbgs@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '50', '年产20万吨碳五碳九深加工项目拟投资49000万元，拟选址在精细化工产业园，主要建设内容为10万吨/年碳五分离装置、10万吨/年碳九分离装置、3万吨/年碳五石油树脂生产装置、12万吨/年碳九石油树脂生产装置、厂房、综合办公楼、厂区道路及配套辅助设施。', '新材料产业', '复合材料', '黑龙江安达经济开发区', '12', '2020-05-31 22:36:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521163351084.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (666, 'a9eda946-7d4f-11ea-b0bb-ac1f6b639ec0', '年产1万吨石墨纸及密封件项目', '鸡西', '梨树区', '鸡西-梨树区', '制造业', '第二产业', NULL, '独资', '8000万元（1234.8万美元）', '15000', '一般', '2', '4500', '2500', '筹划', '无', '', '', '梨树区发展和改革局', '彭勇', '18646782657', 'lsqxmb@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '60', '本项目以可膨胀石墨为原料，在高温膨化炉内膨胀后，通过布料机、压延机、剪切机、卷纸机等工序生产石墨纸。根据密封需求，石墨纸可以与金属、有机高分子材料等复合，按照密封件性能、尺寸要求加工成密封件产品。项目占地面积2.7万平方米，建筑面积1.5万平方米。建设布料机、压延机、剪切机、卷纸机等年产1万吨石墨纸及密封件生产线。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525105358109.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (667, 'aa1424ce-79f2-11e8-9615-ac1f6b639ec0', '高端奶酪生产加工项目', '哈尔滨', '双城区', '哈尔滨-双城区', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '6000', '一般', '10', '1200', '400', '筹划', '无', '北京', '', '哈尔滨市双城区企业发展和投资促进服务中心', '马洪喜', '13936110566', 'zsyz626@163.com', '哈尔滨市双城区企业发展和投资促进服务中心', '刘雪松', '13603664709', 'zsyz626@163.com', '40', '项目建设地点在哈尔滨市双城区，占地面积1.5万平方米，建筑面积7000平方米。双城奶牛存栏近30万头，原料充足。主要建设内容为生产主车间、清洗池、蓄水池、沉淀池、室泵房、洗箱间、成品库、包装间等；辅助工程有配电室、地泵房、仓库、门卫、综合办公楼等。拟建设处理鲜奶40吨生产线，占地面积约2000平方米，车间面积约1200平方米；冷藏库面积约200 平方米，为拼装冷库，锅炉房面积约120 平方米，变电室面积约60 平方料，废水处理池面积约60 平方米，其他辅助设施面积约200 平方米。', '农业及农副产品精深加工产业', '乳品', '黑龙江双城经济开发区', '212', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522123354264.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (668, 'aa1f1d9e-571c-11e8-a5b9-ac1f6b639ec0', '鹤岗煤化工项目', '鹤岗', '东山区', '鹤岗-东山区', '制造业', '第二产业', NULL, '合作', '105000万元（16206.75万美元）', '265000', '重点', '4', '30000', '20000', '建设', '有', '', '', '东山区人民政府', '杨永顺', '13945769291', 'dsqzsj@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '1248', '项目位于鹤岗市煤电化工业园区，占地25万平方米，依托鹤岗市丰富的煤炭资源，建设大型的焦炭企业，达产后年产100万吨焦炭、10万吨甲醇、5万吨粗苯加氢。由于钢铁和冶炼工业的发展，我国的焦炭消耗量也在不断增加，我国焦炭消费大户主要在冶金行业，其消费量占全国的70%—80%。目前，我国大中型钢铁企业平均外购焦炭约30%左右，今后将逐步下降至20%—10%左右。因此，国内建设大型焦炭行业空间良好。', '煤炭精深加工产业', '煤炭深加工', '黑龙江鹤岗经济开发区', '125', '2021-08-10 10:34:17', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (669, 'aa4cd7fd-6fad-11e8-a261-ac1f6b639ec0', '高档纸箱、包装盒生产项目', '哈尔滨', '宾县', '哈尔滨-宾县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '30000', '一般', '3', '4500', '1200', '筹划', '无', '', '', '宾西开发区招商局', '刘立巍', '13674509277', 'bxkfqzsj@163.com', '宾西开发区招商局', '孙悦', '13603612329', 'bxkfqzsj@163.com', '350', '主要建设2栋水印车间、1栋彩印车间，办公楼及附属设施。', '包装产业', '包装', '宾西经济技术开发区', '138', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524103926342.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (670, 'aa7ae048-63ec-11e8-aaec-ac1f6b639ec0', '龙凤山风景名胜区旅游综合开发项目', '哈尔滨', '五常市', '哈尔滨-五常市', '租赁和商务服务业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '20000', '重点', '10', '5000', '400', '筹划', '无', '', '', '五常市招商局', '王晓华', '19903611199', 'wuchangzsj@126.com', '五常市招商局', '王秀君', '15046037557', 'wuchangzsj@126.com', '500', '该项目建设地点在哈尔滨市五常市龙凤山风景区，该景区旅游资源极其丰富，自然景观独具特色。秀丽奇特的青山碧水和历史悠久的满族京旗文化及远近闻名的佛教圣地吸引着众多海内外游客。规划建设用地1000-2000亩地，主要建设水上乐园、栈道、停车场、游客接待中心等，修建空中缆车，购置游船等设备。', '旅游产业', '旅游', '其它', '111', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (671, 'aaa7921b-82d2-11eb-94a7-00ff338109dc', '黑河自贸片区中医药国际合作研发中心项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '合资', '25000万元（3858.75万美元）', '38000', '一般', '3', '11400', '5000', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '150', '黑河市地处高纬高寒地区，生态级别高，昼夜温差较大等特点、有利于优质绿色中药材生产。目前，黑河市列入《国家重点保护野生药材物种名录》的药用植物有11种。现境内种植中药材达18.4万亩，产量约2.1万吨。俄罗斯远东地区与我国边境接壤饶长，与小兴安岭植物区系相近，中药材资源较为丰富，质量上乘，预计2025年从俄进口的中药材约达到1000亿元贸易额。随着黑龙江公路大桥通车运行，依托黑河与俄罗斯毗邻的区位优势，拟建设中医药国际合作研发中心占地1.5万平方米，建设厂房、研发中心、办公室设施等。年加工中药3500吨，主要产品有中药饮片、切片等。\r\n', '中医药产业', '中医药', '黑河边境经济合作区', '0', '2021-08-10 09:57:37', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (672, 'aad1681e-790e-11e8-903f-ac1f6b639ec0', '阿木尔林业局“大北极旅游圈东部节点”——北极岛景区开发新建项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '租赁和商务服务业', '第三产业', NULL, '合作', '27000万元（4167.45万美元）', '11685', '重点', '8', '3016', '380', '建设', '有', '', '', '阿木尔林业局招商办', '刘忠来', '18845747099', 'geamezsb@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '100', '项目位于祖国版图最北端，北以黑龙江主航道为界，与俄罗斯隔江相望，是名副其实的中国最北界江半岛。以北极岛为核心的“一湾三岛”北极岛景区，总面积约2170公顷,借助找北游这一新兴热点，开发观光摄影类（修建观光塔1处、观景台4处等）、沙滩娱乐类（购置沙滩越野车、沙滩摩托、水上摩托艇等）、康养避暑类（建设治疗、康复、养生于一体的康养疗养中心8000㎡）、运动探险类(开发峭壁攀岩、飞越丛林、高空滑索等项目）、以生态体验、森林祈福、管理服务等七类景区景点设施。', '旅游产业', '旅游', '其它', '121', '2020-06-03 14:48:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525151011646.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (673, 'ab14f562-6f2b-11ea-b0bb-ac1f6b639ec0', '五大连池市苏打水生产基地项目', '黑河', '五大连池市', '黑河-五大连池市', '制造业', '第二产业', NULL, '独资', '54776万元（8454.68万美元）', '69642', '重点', '3.73', '14684', '2082', '可研', '有', '', '', '五大连池市经济合作中心', '李建松', '18645623498', 'wdlczsj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '80', '五大连池市境内出产的天然含汽矿泉水，是世界著名三大冷泉之一，富含硼、锌、硒、铬等离子矿物和微量元素。五大连池天然含汽苏打水在国内外享有极高的知名度，年产量5万吨，具备规模开发的条件。项目选址在黑龙江五大连池经济开发区内，项目占地3万平方米，建筑面积 2万平方米，打井2眼，购置设备20台套。\r\n\r\n', '农业及农副产品精深加工产业', '矿泉水', '黑龙江五大连池经济开发区', '3', '2021-08-10 10:12:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521205358036.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (674, 'ab33a8a7-9b34-11ea-8a5d-00ff338109dc', '大兴安岭地区松岭区绿色酱菜疏菜 开发项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '合资', '2000万元（308.7万美元）', '2500', '重点', '7', '300', '80', '建设', '有', '', '', '松岭区招商局', '宫玉文', '13604872200', 'songlingzsj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '30', '大兴安岭地区内的大气、水域、土壤、草原、森林和湿地等生态系统均保持着良好的无污染状态，生态条件适合发展卜留克、大头菜为主的腌制食品产业，符合黑龙江省的绿色食品战略规划，项目主要盘活松岭酱菜厂状态完好的贮存车间、酱油车间等资产，建设4000立方米蔬菜储存窖，新引进袋装、罐装两条生产线。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '21', '2020-06-03 15:19:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521152830093.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (675, 'abc03be6-8470-11ea-b0bb-ac1f6b639ec0', '大数据智慧交通项目', '大庆', '市辖区', '大庆-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '40000', '一般', '7', '3000', '1100', '筹划', '无', '', '', '大庆高新区管委会', '丁超', '18804593387', '418433790@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '在人工智能和大数据的发展前景影响下，智慧交通系统的应用范围也会随之扩大。通过交通运输系统信息化基础设施和信息资源的逐步整合，智慧化管理决策机制的逐步创建，为公众提供人性化、便捷化、综合化、智慧化的交通出行服务慧交通在人工智能和大数据支持下，其市场前景更加广阔。\r\n该项目将主要建设人性化交通出行的公众出行服务平合；实现交通运输行业应急指挥及日常监测的指挥监测平合；支撑交通运输智慧化的交通支撑平台；整合交通信息资源实现共亨服务的交通数据平台；提供智慧交通系统运行基础环境的交通基础云平台。\r\n\r\n', '新一代信息技术产业', '新一代信息技术', '大庆高新技术产业开发区', '18', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422161004058.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (676, 'aca522da-7250-11ea-b0bb-ac1f6b639ec0', '佳木斯市国际高端教育机构项目', '佳木斯', '市辖区', '佳木斯-市辖区', '教育', '第三产业', NULL, '独资', '90000万元（13891.5万美元）', '40000', '一般', '9', '10000', '240', '筹划', '无', '', '', '佳木斯市高新区管委会', '宫清霖', '13359763121', 'jmsgxqzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '400', '项目占地220亩，建筑面积约15万平米。在高新区建设国际高端教育机构项目。引进国际高端教育机构后，可以满足佳木斯市广大人民群众对多元精英教育的需求，解决教育发展不平衡，不充分的现实矛盾。（1 ）政策优势：《中华人民共和国民办教育促进法》、《黑龙江省人民政府关于鼓励社会力量兴办教育促进民办教育健康发展的实施意见》。（2）区位优势：佳木斯是黑龙江省东北部区域中心城市，总人口234.5万，现已发展为黑龙江省东部地区的政治、经济、科技、文化教育、医疗、商贸和交通物流中心。（3）资源优势：拥有5个综合性学校，16家专科院校，有曾连续5年培养出6个全省高考状元的佳木斯一中等一批基础教育品牌名校。', '农业及农副产品精深加工产业', '现代商贸', '佳木斯高新技术产业开发区', '18', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525143856929.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (677, 'acb600c0-5326-11e8-ba35-ac1f6b639ec0', '年产5万吨高功率石墨电极项目', '双鸭山', '市辖区', '双鸭山-市辖区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '130000', '一般', '2', '37700', '22100', '筹划', '无', '', '', '双鸭山经济技术开发区', '陈迎迎', '15145904789', 'systzcjj@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '120', '双鸭山市石墨矿藏丰富，品位较高，石墨主要呈细小麟片状，石墨晶体＜0.1mm占50%，0.1—0.5mm占40%，0.5-2mm占10%。该项目拟建设在双鸭山经济技术开发区，厂区总占地面积5万平方米，其中建筑面积3万平方米，拟购置生产与检测设备140余台套，配建相关辅助工程，依托当地丰富优质的石墨资源，设计年产高功率电极材料5万吨。', '新材料产业', '石墨烯', '双鸭山经济技术开发区', '16', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (678, 'ad501de3-725e-11ea-b0bb-ac1f6b639ec0', '肇东市新型农机装备制造项目', '绥化', '肇东市', '绥化-肇东市', '制造业', '第二产业', NULL, '独资', '70000万元（10804.5万美元）', '120000', '重点', '8', '9000', '1500', '筹划', '无', '', '', '肇东市招商引资服务中心', '王相涛', '04557782115', 'zd-zsyzj@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '400', '肇东是农业大市，交通便利资源丰富，此项目将发挥肇东的产业基础、市场潜力、科技支撑等优势，推动地方龙头企业不断提升规模水平，带动本地配套企业集群式发展。', '高端装备制造产业', '农机装备', '黑龙江肇东经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151924425.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (679, 'adc6a467-7311-11ea-b0bb-ac1f6b639ec0', '佳木斯市水世界项目', '佳木斯', '向阳区', '佳木斯-向阳区', '其他', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '30000', '一般', '10', '5000', '3000', '筹划', '无', '', '', '佳木斯市向阳区商务和经济合作局', '刘汉彬', '18904546633', 'jmsxyqjhj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '300', '项目拟选址滨江路西段，原松花江铁路大桥桥头堡东侧和北侧。项目计划占地10万平方米，建筑面积20万平方米。主要建设水上世界、冒险极限两大水上世界乐园。将重点引进水上冲关设备、大型互动水屋、彩虹滑梯、彩虹戏水门、大象滑梯、山坡组合滑梯、儿童梦幻水屋等一批强身健体、寓教于乐为一体的综合性游乐设施。依托松花江优美自然风光，引用处理松花江水，同沿江景观带融为一体，打造以游乐为主，集阳光、休闲、运动、健康、生态于一体的大型休闲娱乐空间。', '旅游产业', '旅游', '其它', '22', '2020-06-01 16:41:21', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523091819558.doc');
