INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (683, 'ae650645-7366-11e8-a795-ac1f6b639ec0', '皮影保护与开发中心建设项目', '绥化', '望奎县', '绥化-望奎县', '教育', '第三产业', NULL, '独资', '3000万元（463.05万美元）', '3000', '重点', '4', '800', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '50', '望奎县皮影历史悠久、文化底蕴深厚，在国内外享有盛誉。望奎县皮影分雕刻、演出、创作三个方面，雕刻作品主要用于演出、礼品、收藏、室内装饰、户外宣传等，年生产皮影制品1万余件，远销美、日、德、法、港、澳、台等国家和地区。为有效保护这一优秀传统民间艺术，现拟建一座占地80亩，融皮影研究与创作、雕刻与演出、展览与收藏、品牌与营销、培训与传承、教学与论坛为一体的望奎县皮影保护与开发中心。', '旅游产业', '旅游', '黑龙江望奎经济开发区', '46', '2020-05-26 11:02:14', '');
