INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (687, 'aeee8563-7285-11ea-b0bb-ac1f6b639ec0', '绥棱县四海店红色旅游小镇建设项目', '绥化', '绥棱县', '绥化-绥棱县', '其他', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '13000', '重点', '5', '3000', '150', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '200', '绥棱是国家革命二类老区，抗日联军英雄李兆麟、冯仲云、金策、于天放、陈雷等都曾在此战斗过，拥有北满省委老金沟等一批红色遗址，红色旅游优势十分明显。该项目在绥棱县四海店镇原有的抗联资源、森林河套风光、风土人情基础上开发建设，打造以红色旅游、乡村旅游、山水观光游、森林养生游为一体的现代旅游体验景区，重点推进红色主题营地、红色主题文化园建设。', '旅游产业', '旅游', '黑龙江绥棱经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521201017862.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (688, 'af007488-5282-11e8-ba35-ac1f6b639ec0', '年产1万吨大豆深加工产品项目', '双鸭山', '市辖区', '双鸭山-市辖区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '23000', '重点', '3', '4830', '3910', '可研', '有', '', '', '双鸭山经济技术开发区', '陈迎迎', '15145904789', '55064375@qq.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '180', '双鸭山2017年种植大豆面积228万亩，年产大豆26.6万吨，并且大豆种植比例逐年提升。该地区大豆为非转基因产品，品质优良，该项目以当地丰富的大豆为基本原料，占地10万平方米，拟建设年提取1万吨豆粕功能因子项目，主要是建设生产高纯度大豆低聚肽、大豆复合保健功效因子等产品生产线。大豆功能因子属于大豆蛋白，具有比大豆蛋白更高的生物活性，易吸收，可降低胆固醇、血压，促进新陈代谢，市场前景好。', '农业及农副产品精深加工产业', '大豆深加工', '双鸭山经济技术开发区', '196', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (689, 'af29113d-7674-11ea-b0bb-ac1f6b639ec0', '牡丹江市大数据产业园项目', '牡丹江', '市辖区', '牡丹江-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '合资', '50000万元（7717.5万美元）', '40000', '重点', '8', '6000', '2200', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '牡丹江市拥有独特的区位优势和资源优势，是国内最适宜发展大数据产业的地区之一。地理位置优越,处于世界公认的发展大数据产业的“黄金纬度”。\r\n项目规划占地面积10万平方米，主要建设数字牡丹江、旅游大数据中心、健康医疗大数据中心、绿色食品溯源大数据中心、云计算中心、遥感卫星数据备份中心等项目。', '金融产业', '数字金融', '牡丹江经济技术开发区', '18', '2020-05-29 15:40:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521162248098.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (690, 'af37ab4d-cf12-11eb-a12f-00ff338109dc', '禽类屠宰及深加工', '佳木斯', '同江市', '佳木斯-同江市', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '5500', '一般', '5', '1650', '300', '筹划', '无', '', '', '富锦市农业农村局', '李锦成', '04542926930', '2669106937@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '70', '项目一期建设屠宰车间、冷库、羽绒加工车间、污水处理车间、消防泵房、办公等附属设施；二期建设饲料加工厂、鹅血冻干粉厂、鹅肉食品厂、包装制品。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '0', '2021-08-10 09:47:13', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (691, 'b044e058-8538-11ea-b0bb-ac1f6b639ec0', '肇源县300吨/年葵花籽加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '50000', '一般', '7', '8000', '700', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '30', '近几年，肇源县种植葵花籽规模越来越大，逐渐成了远近闻名的葵花籽集散地，葵花籽产品远销到北京、天津、山西、河北等省市，该项目具有广阔的发展前景。\r\n肇源位于世界三大黑土带之一松嫩平原腹地，是黑龙江省第一积温带上限，年有效积温2900-3100℃，是世界著名黄金黑土带。肇源县葵花籽质量好，年产葵花籽400吨，产量居黑龙江省前列。\r\n项目选址在肇源县经济开发区，规划占地面积12万平方米，主要建设年加工葵花籽产品20万吨生产线及配套设施。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇源经济开发区', '4', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423160150984.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (692, 'b0594c8b-8476-11ea-b0bb-ac1f6b639ec0', '民族风情旅游度假村项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '其他', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '21000', '一般', '9', '6000', '120', '筹划', '无', '', '', '大庆市杜尔伯特蒙古族自治县经济贸易合作服务中心', '徐焱', '13115395234', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '300', '项目以历史、文化、餐饮、娱乐、度假为一体，建设占地面积约为3000亩，总建筑面积60万平方米。新建民族文化旅游广场；景区游路道路、民族特色一条街建设、温泉度假区、老年人休闲度假区；景区美化、亮化、水电管网改造等基础设施，特色民居保护开发、蒙古文化主题公园、湿地公园建设。杜尔伯特县建有景区景点14处，其中AAAA级景区4处、AAA级景区2处、AA级景区2处，开发养生度假、冬季捕鱼、雪地温泉等特色旅游项目20余个，开辟精品旅游路线14条。其中“龙江西部旅游线”入选全国十佳旅游线路，先后入选首批国家全域旅游示范区创建单位、第四批全国旅游标准化示范县创建单位。', '旅游产业', '旅游', '黑龙江杜尔伯特经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161036409.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (693, 'b06f8ad4-9b25-11ea-8a5d-00ff338109dc', '加格达奇区马铃薯淀粉精深加工项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '独资', '12000万元（1852.2万美元）', '17000', '重点', '5', '2546', '380', '可研', '有', '', '', '加格达奇区发改局', '刘涛', '18645719911', 'jqswj03@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '马铃薯淀粉广泛应用于纺织、石油开采、饲料及食品等行业，加之马铃薯淀粉有其它淀粉不可替代的自然属性，使其成为国内外淀粉深加工行业的首选产品，销路广阔、市场前景看好。大兴安岭是“中国马铃薯种薯之都”，世界公认的马铃薯最佳生产区域是N46°以北的高纬度地区，项目拟利用大兴安岭地区独特环境与资源优势，建设马铃薯深加工生产线一条，建成后年产马铃薯淀粉2万吨，植物蛋白2100吨，粉丝200吨，粉皮100吨。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江加格达奇经济开发区', '19', '2020-06-03 15:32:44', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134116414.doc');
