INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (698, 'b0e61703-9b2c-11ea-8a5d-00ff338109dc', '佳木斯市星级商务酒店建设项目', '佳木斯', '同江市', '佳木斯-同江市', '住宿和餐饮业', '第三产业', NULL, '独资', '5000万元（771.75万美元）', '1500', '一般', '5.5', '450', '300', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作促进局', '闫胜男', '18646462502', 'jmsgnlzk@163.com', '30', '项目选址在同江市市区内，占地面积3000平方米，建筑面积9000平方米。建成后的星级商务酒店是一座集高档客房、餐饮、会议、停车场等为一体的现代化、智能化的综合性旅游和商业服务设施。 ', '旅游产业', '旅游', '其它', '27', '2020-06-02 14:41:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143452616.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (699, 'b0f64f6d-9bc7-11ea-8a5d-00ff338109dc', '孙吴县汉麻花叶提取加工项目', '黑河', '孙吴县', '黑河-孙吴县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '14000', '重点', '4', '2500', '700', '筹划', '无', '', '', '孙吴县招商局', '赵义友', '13329466003', '8422728@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '70', '  汉麻花叶提取医药成份，汉麻花叶含有多种活性成分，包括大麻酚类化合物和非大麻酚类化合物。汉麻花叶的活性成分在医药等领域有极高的应用价值。可抗癌止吐、抗菌、抗炎、抗水肿，治疗神经性、心血管、大脑疾病。孙吴县地处小兴安岭山脉的特殊地理位置，形成了夜间湿气浓重、雨露丰沛，白天气温较高，适宜微生物生长。孙吴县仅第五、六积温带就有近百万亩耕地适于种植汉麻。本项目年提取汉麻CBD(大麻二酚)2000kg项目，年加工汉麻原麻2万吨，年产汉麻精干麻1万吨。\r\n\r\n', '生物医药产业', '生物医药', '黑龙江孙吴经济开发区', '61', '2020-06-04 14:37:17', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522090055769.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (700, 'b0fc85dc-b9de-11eb-a12f-00ff338109dc', '建国种业小镇项目', '佳木斯', '东风区', '佳木斯-东风区', '制造业', '第二产业', NULL, '独资', '80000万元（12348.0万美元）', '50000', '一般', '3', '15000', '5000', '筹划', '有', '', '', '佳木斯市东风区商务局和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '500', '\"中国国际黑龙江种业博览会展示馆。规划建设三层，面积5000平方米的展示馆作为种业博览会主会场，展示国际国内种子新品种、种子科技创新成果，以及我市种子发展的历史和成就，突出文化功能和会展功能。\r\n黑龙江种子研发中心。依托龙粳种业研发中心建立分子育种实验室，面积5000平方米，承担国家或省级种子实验项目和攻关课题。\r\n种子加工交易中心。改造升级森源北方寒地种子交易中心，占地12.5万平方米，建筑面积8万平方米，仓储能力30万吨，再配套公共种子加工生产区，面积5万平米，提供种子加工、拣选、分级、包装、交易等服务。建设电商服务站，打造种子品牌，通过招商引资，将种子小镇盘活、搞旺。\r\n种子品种转化展示中心。', '农业及农副产品精深加工产业', '水稻深加工', '其它', '1', '2021-08-10 09:52:49', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (701, 'b128dfa3-7d28-11ea-b0bb-ac1f6b639ec0', '年产2万吨天然石墨负极材料生产线项目', '鸡西', '滴道区', '鸡西-滴道区', '制造业', '第二产业', NULL, '其他', '22586万元（3486.15万美元）', '50677', '一般', '2', '12978', '3244', '筹划', '无', '', '', '滴道区发展和改革局', '刘丹祥', '13351177676', 'ddqfgj2455@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '40', '电动车与电力存储市场的快速增长意味着锂电池需求上升。按照国家提出的目标，2020年我国电动汽车可达400万辆，按每辆汽车配备3块电池，每块混合动力轿车电池负极材料20kg计算，将带动24万t负极材料的生产规模。建设年产2万吨天然石墨负极材料生产线。达产达效后可年产石墨负极材料2万吨', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525103424535.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (702, 'b14c6df8-9b29-11ea-8a5d-00ff338109dc', '加格达奇林业局百泉谷生态风景区建设项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '其他', '第三产业', NULL, '合资', '29000万元（4476.15万美元）', '12000', '重点', '9.5', '3000', '300', '建设', '有', '', '', '加格达奇林业局招商引资办公室', '蔺葳', '13845794556', 'cx-yx@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '百泉谷景区位于大兴安岭地区首府加格达奇区西北侧的翠峰林场，主要建设北药花海基地、氡温泉基地及道路等，包括天台山山门广场、森林瑜伽、森林音乐馆、生态观察镜、森林博物馆（茶室）、祈天台、祈福大道、天柞圣树（许愿树）、双龙泉、龙头泉等景点，总占地面积1.4万平方米。目前项目已初具规模，年接待游客100万人次，且在逐年增长。', '旅游产业', '旅游', '其它', '27', '2020-06-03 15:33:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140955848.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (703, 'b17d1832-6dac-11ea-b0bb-ac1f6b639ec0', '西客站商业综合体项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '150000万元（23152.5万美元）', '180000', '一般', '7', '22000', '3000', '筹划', '无', '', '', '道里区企业和投资服务局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区企业和投资服务局', '于鹏怡', '18686775832', 'daolizsj@163.com', '35', '项目背靠群力新区，东临哈西新区，处于哈西群力联络空间与老城区衔接处，属于城市上风、上水方向，踞守两大新区的核心位置。项目选址于哈西客站规划核心区，规划占地面积约3.90万平方米，建筑面积15.6万平方米，用地性质为商业用地，规划容积率为4.0，拟建设商场、公寓、写字楼、酒店、游乐场等，打造集大型商场、企业总部、高档公寓、高端酒店于一体的大型商业综合体。建成后可与周边的红星美凯龙等大型商场相互辉映。同时，又可完美融入哈尔滨西站北广场商圈，繁荣周边经济，方便市民生活。', '现代商贸产业', '现代商贸', '其它', '69', '2020-05-29 15:31:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144729660.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (704, 'b18f0d77-b7c7-11e8-b0d1-ac1f6b639ec0', '肇东市康复中心建设项目', '绥化', '肇东市', '绥化-肇东市', '其他', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '6000', '重点', '6', '1800', '600', '筹划', '无', '', '', '肇东市招商局', '付吉丽', '13845128005', 'zd-zsyzj@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '120', '肇东市人口近百万，目前还没有专业的康复医疗机构，本项目的主要功能是建立以养老、老年病医疗、康复、护理及残疾人矫形康复为一体的综合性健康养护中心。拟建设面积为2.5万平方米，总病床数500—600张。建设内容包括：老年病养护中心、残疾人肢体矫形康复中心、肿瘤康复治疗中心、临终关怀中心、老年康复训练中心、儿童康复训练中心、综合医疗楼、工作人员宿舍及办公楼等。', '康养产业', '康养', '黑龙江肇东经济开发区', '40', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (705, 'b194353a-82ae-11ea-b0bb-ac1f6b639ec0', '垃圾焚烧发电项目', '齐齐哈尔', '克山县', '齐齐哈尔-克山县', '其他', '第二产业', NULL, '独资', '35000万元（5402.25万美元）', '20000', '一般', '3.5', '5000', '1000', '筹划', '无', '', '', '克山县招商引资服务中心', '张立星', '15084525545', 'ksdb6006@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '拟用地面积约170亩，本项目占地面积约60亩。项目总规模为日处理生活垃圾400吨，配置1×400t/d垃圾焚烧线+1×9MW凝汽式汽轮发电机组，每条焚烧生产线配置1套烟气净化系统，用水取水管网，主厂房、烟囱、油库及油泵房、工业消防水池、综合水泵房、冷却塔、中水处理站、废水处理站、化水车间、地磅及地泵房、办公楼、综合楼等公用设施。', '节能环保产业', '秸秆综合利用', '黑龙江克山经济开发区', '25', '2020-06-04 14:01:06', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523221056813.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (706, 'b198ff69-8512-11ea-b0bb-ac1f6b639ec0', '大豆粕系列深加工项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '9889万元（1526.37万美元）', '14737', '一般', '4', '3000', '2000', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '大豆是植物蛋白之王，营养丰富，黑龙江省生产的大豆每100克中含蛋白37.3克，因此多吃大豆及其制品有利于身体健康。目前人们生活水平和消费观念逐渐提高，对食品的品质和营养层次要求也越来越高，对高蛋白、低脂肪、低热量的大豆深加工产品需求十分旺盛。国家相关部门统计，到2030年大豆及其制品消费需求达到4000万吨，大豆深加工产业具有广阔的发展空间。\r\n项目占地5万平方米，建设6条生产线，购买设备71套。拟建设规模为年处理6000吨大豆粕，连续提取异黄酮2.4吨、大豆低聚糖420吨、大豆核酸蛋白2.4吨、大豆浓缩蛋白3000吨及大豆纤维食品800吨。', '农业及农副产品精深加工产业', '大豆深加工', '大庆经济技术开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154210586.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (707, 'b1b0b51e-9c3a-11ea-8a5d-00ff338109dc', '佳木斯市朝鲜族风味绿色食品加工项目', '佳木斯', '桦川县', '佳木斯-桦川县', '制造业', '第二产业', NULL, '独资', '12150万元（1875.35万美元）', '30000', '一般', '4', '3400', '1500', '筹划', '无', '', '', '桦川县商务和经济合作局', '石建刚', '15046478536', 'hczsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '60', '项目规划占地面积4万平米，项目需要建设主生产车间、腌渍车间、大酱生产车间、发酵车间、综合仓库、动力车间、消防水池、污水处理站、办公楼、食堂宿舍等设施，总建筑面积达20000平方米。项目需要购置泡菜生产设备、酱菜生产设备、大酱生产设备、化验设备及公用工程设备。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江桦川经济开发区', '12', '2020-06-01 16:49:01', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522224409122.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (708, 'b1b7500b-725f-11ea-b0bb-ac1f6b639ec0', '肇东市飞机拆解与循环利用项目', '绥化', '肇东市', '绥化-肇东市', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '70000', '重点', '4', '21000', '10000', '筹划', '无', '', '', '肇东市招商引资服务中心', '王相涛', '04557782115', 'zd-zsyzj@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '300', '肇东市不仅拥有目前全国占地面积最大、设施最完备、运营效益最好的北大荒通用航空机场，而且毗邻哈尔滨太平国际机场和大庆萨尔图机场，具有发展航空配套产业的地缘优势和资源优势。该项目用地2000亩，建筑面积10万平方米，建设飞机拆解车间、仓储物流、检测场与拆解场、办公用房、生活用房及附属设施。', '高端装备制造产业', '航空装备', '黑龙江肇东经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145837353.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (709, 'b1d62a85-8440-11ea-b0bb-ac1f6b639ec0', '动物血浆、血球蛋白粉生产项目', '大庆', '肇州县', '大庆-肇州县', '其他', '第二产业', NULL, '独资', '11800万元（1821.33万美元）', '13400', '一般', '4', '3000', '1500', '筹划', '无', '', '', '肇州县招商服务中心', '张立江', '13604892456', 'jhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '本项目通过高新技术生产血浆血球蛋白粉，该产品是一种健康、环保的食品添加剂，可有效增强人体免疫力。在促进生猪产品增值的同时，也提高了资源的综合利用率，有效解决了环保问题。预计2021年食品血液蛋白质国内年使用量将突破40000吨，充分利用猪血生产食品级血液蛋白粉，具有广阔的市场前景。\r\n项目占地面积30000平方米，主要建设蛋白粉加工车间及配套设施。建成后，年可生产血浆蛋白粉800吨，血球蛋白粉2800吨。', '生物医药产业', '生物医药', '黑龙江肇州经济开发区', '5', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143736085.docx');
