INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (715, 'b3551ae2-72ee-11ea-b0bb-ac1f6b639ec0', '佳木斯市高端工业和民用铝型材产业园建设项目', '佳木斯', '东风区', '佳木斯-东风区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '70000', '一般', '3', '18000', '10000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '18545400563', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '铝型材广泛用于建筑、汽车轻量化、交通运输、自动化设备、消费电子、电信通讯等领域。目前黑龙江省家居铝型材市场规模为30亿元，而本省铝型材的产量无法满足市场所需，目前全省大多数铝型材都来自于辽宁营口，山东临沂，广东佛山等地。佳木斯是黑龙江省东部地区的中心城市和工业中心，公路、铁路四通八达，水、陆、空立体交通优势明显。通过中俄同江铁路大桥，可以从俄罗斯进口更加质优价廉的铝型材原料。该项目计划占地20万平方米，引进铝型材熔铸，挤压，喷涂、氧化、精深加工和交易中心等方向的企业，形成产业链闭环，打造东北最大的铝型材设计、生产、交易基地。', '有色金属精深加工产业', '金属精深加工', '黑龙江佳木斯经济开发区', '15', '2021-08-11 11:34:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200331160354109.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (716, 'b35d9de0-ba0d-11eb-a12f-00ff338109dc', '北药综合开发项目', '黑河', '爱辉区', '黑河-爱辉区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '70000', '一般', '3', '9000', '3420', '筹划', '无', '', '', '黑河市爱辉区商务局', '刘洋', '15145676764', 'wd873001706@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '1000', '这里所说的北药是指大小兴安岭山脉这一特殊区域的野生或种植的“北药”，即大小兴安岭地区生产的中药材和以中药材为基础的中成药、化学药品、生物制药和生化制药、保健滋补药及保健食品。俄罗斯远东地区与我国东北地区接壤，气候土壤等环境因素相似，因此该地区进口中草药也属于“北药”，北药产业是指，以大小兴安岭国有林区为生产基地，利用先进的种养殖技术，科学的生产方式，生产经营北药的产业。北药综合开发项目共分为两部分：一是北药活性物提取加工基地建设。北药活性物提取加工基地建设项目建设地点位于爱辉工业园区，占地面积200亩，建筑面积10000平方米。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:51:22', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (717, 'b36adf79-732c-11ea-b0bb-ac1f6b639ec0', '望奎县生物综合制药项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '10000', '重点', '6', '2000', '600', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '生物制药工程是采用先进的生物技术和生产工艺，利用动物内脏和其器官为原料，生产加工成纯生化原料药有胰岛素、肝素、胆红素等，这些生化原料药能加工制成肝注射剂、胰岛素注射剂、肝精片等药品。加工后的产品含有人体必须的胺基酸、微量元素、维生素等营养成分，市场前景广阔。\r\n1.2项目建设规模及主要建设内容\r\n', '生物医药产业', '生物医药', '黑龙江望奎经济开发区', '18', '2020-06-02 14:36:34', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112106332.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (718, 'b381d432-6eaf-11e8-afa3-ac1f6b639ec0', '肇东市大宗农副产品交易中心项目', '绥化', '肇东市', '绥化-肇东市', '批发和零售业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '500000', '重点', '10', '10000', '1600', '筹划', '无', '', '', '肇东市招商局', '王相涛', '04557782115', 'zd-zsyzj@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '2000', '肇东市南距省城哈尔滨53公里，北距油城大庆74公里，属哈大齐工业走廊上的节点城市，农副产品资源丰富，区位优势明显，交通便捷。该项目占地约20万平方米，以农副产品仓储和交易为主，配以管理、商务等设施，形成功能完善的市场交易体系，主要建设仓库、交易厅、市场服务中心，购置计量、检测、商务信息等配套设施。', '现代商贸产业', '现代商贸', '黑龙江肇东经济开发区', '105', '2020-05-31 22:35:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521164744228.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (719, 'b3f74007-8233-11ea-b0bb-ac1f6b639ec0', '新林区中兴矿业有限公司铜多金属矿项目', '大兴安岭', '塔河县', '大兴安岭-塔河县', '采矿业', '第二产业', NULL, '合作', '6100万元（941.53万美元）', '7234', '重点', '7.9', '826', '422', '建设', '有', '', '', '新林区自然资源局', '孙正军', '13039904488', 'xlqzsj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '大兴安岭中兴矿业有限公司铜多金属矿，采矿面积为0.64平方公里，经黑龙江省自然资源厅审核，矿石储量68.52万吨，金、银、铜金属储量分别为171公斤、136.67吨、2.72万吨，矿产资源价值62.5亿元。项目已建成年处理共伴生金银矿6万吨，铜尾矿4万吨，即年选矿10万吨的炭浆厂及冶炼系统。', '有色金属精深加工产业', '金属精深加工', '其它', '5', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522154822499.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (720, 'b420a112-73f2-11ea-b0bb-ac1f6b639ec0', '牡丹江市海林市平贝产品精深加工项目', '牡丹江', '海林市', '牡丹江-海林市', '制造业', '第二产业', NULL, '合资', '10000万元（1543.5万美元）', '4900', '重点', '10', '1000', '380', '筹划', '有', '', '', '牡丹江市经合局', '秦宇吉', '13836328270', 'hllyjdjk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '300', '平贝母性微寒、味苦、甘，有清肺，化痰，止咳功能，主要成分为生物碱。该项目以平贝母作为研究材料，通过中药炮制技术使平贝母味苦、甘、性微寒的药性发生改变，获得具有清肺、止咳、祛痰、平喘的平贝母产品，包括平贝母口服液和口含片两种产品。\r\n项目建成达到年设计产量：年产平贝母口服液可达100万瓶，平贝母口含片可达60万盒，预计年销售收入4900万元。', '中医药产业', '中医药', '海林经济技术开发区', '17', '2020-05-29 14:25:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401162802939.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (721, 'b4c55379-bb6a-11eb-a12f-00ff338109dc', '山林特产品加工项目', '哈尔滨', '阿城区', '哈尔滨-阿城区', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '38251', '一般', '5', '7298', '500', '筹划', '无', '', '', '哈尔滨市阿城区农业农村局', '肖志权', '13936368687', 'aclb2006@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '阿城位于黑龙江省会哈尔滨市中心东南23公里处，301国道穿境而过，滨绥铁路横贯东西，地理区位优势明显。阿城基本地貌为“七山一水二分田”，东部山区峰峦叠翠，西部平原坦荡开阔。阿城地处张广才岭与松嫩平原的缓冲地带，土壤有机质含量较高，盛产木耳、猴头、蕨菜等山野产品，人参、五味子、刺五加等药用植物。阿城区农林地域广阔，农业特色突出，山林特产品资源丰富。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '6', '2021-08-10 09:50:59', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (722, 'b5c4a7ff-8376-11ea-b0bb-ac1f6b639ec0', '康养旅游项目', '齐齐哈尔', '泰来县', '齐齐哈尔-泰来县', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '40000万元（6174.0万美元）', '9000', '一般', '10', '2500', '750', '筹划', '无', '', '', '泰来县经济合作促进局', '袁彦冰', '13803635039', 'tljhjyyb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '养生养老的核心是构建能够为老年人提供高标准连续性照料服务体系，此外还需建设针对于老年人无障碍设计的养老公寓、度假物业、餐饮配套、养生医疗配套、娱乐休闲配套以及公共设施配套。即构建以养生养老服务体系为核心，居住、养生、康体、休闲、度假等相关配套的“1+N”开发模式。', '康养产业', '康养', '黑龙江泰来经济开发区', '60', '2020-06-04 14:03:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523134610429.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (723, 'b63bfdab-74dc-11ea-b0bb-ac1f6b639ec0', '秸秆深加工项目', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '15000万元（2315.25万美元）', '35000', '一般', '3', '4500', '1500', '筹划', '无', '', '', '勃利县经济合作促进局', '贾利琦', '13846499855', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '勃利县是全国商品粮食基地县，全省可耕地面积172万亩，玉米、大豆、水稻等农作物秸秆十分丰富，我县年可收集秸秆约100万多吨。为贯彻落实国家绿色、生态、环保、可持续发展战略和理念，确保粮食生产安全，秸秆回收再利用前景广阔。且可利用领域广：造纸、生产秸秆丝纤维板、人造粘合剂、制作工艺品、生产活性炭，这些产品在建筑领域都有广泛的应用，特别是生产一次性餐具，生物降解性好，符合当前环保政策，如能充分利用，前景广阔。建设内容：建设一条年可加工3万吨秸秆丝生产线。', '节能环保产业', '秸秆综合利用', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174749834.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (724, 'b6434ccb-cf42-11eb-a12f-00ff338109dc', '汉麻纺纱项目', '黑河', '孙吴县', '黑河-孙吴县', '制造业', '第二产业', NULL, '独资', '16000万元（2469.6万美元）', '30000', '重点', '3', '5333', '906', '筹划', '无', '', '', '孙吴县经济合作发展中心', '赵义有', '13329466003', '8422728@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '本项目占地面积20000平方米，总建筑面积23250平方米，其中生产车间18500平方米，附属用房1100平方米，成品库900平方米，原料库1800平方米，办公用房950平方米，场地硬化3600平方米，绿化工程1350平方米，以及给排水、供电、消防工程等。引进纺纱生产线，加工汉麻制成的服装衣饰。', '农业及农副产品精深加工产业', '工业大麻', '黑龙江孙吴经济开发区', '1', '2021-08-06 16:07:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (725, 'b681e53e-7d29-11ea-b0bb-ac1f6b639ec0', '高级膨胀石墨及密封材料项目', '鸡西', '滴道区', '鸡西-滴道区', '制造业', '第二产业', NULL, '其他', '3000万元（463.05万美元）', '5000', '一般', '3', '1000', '450', '筹划', '无', '', '', '滴道区发展和改革局', '刘丹祥', '13351177676', 'ddqfgj2455@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '70', '高级膨胀石墨材料保持了天然石墨鳞片石墨原有的优良化学性能，又在其基础之上增加了许多独特的机械性能，是一种理想的密封材料。建设年产1000吨高级膨胀石墨生产线。主要建设生产车间、厂房、库房等其他辅助用房。', '新材料产业', '石墨', '黑龙江鸡西经济开发区', '5', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525103227456.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (726, 'b6a1f091-7268-11ea-b0bb-ac1f6b639ec0', '北林区绿色食品物流城建设项目', '绥化', '北林区', '绥化-北林区', '交通运输、仓储和邮政业', '第三产业', NULL, '其他', '80000万元（12348.0万美元）', '150000', '重点', '4.4', '18000', '2000', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '600', '北林区位于松嫩平原腹地，土壤有机质含量高、微量元素富集,水资源丰富、酸碱度适中。北林区绿色食品城项目的建立，可以起到优化我区农业产业资源，为绿色食品产业化提供发展平台，更有利于打造地域品牌。该项目规划占地面积10万平方米，建立大型仓储加工基地，计划实现年贸易交易额40亿元，主要建设物流仓储库房10万平方米，加工车间2万平方米，建设绿色物流联动平台、专业物流电子信息平台系统、金融服务平台、物流企业信用平台等。', '物流产业', '物流', '绥化经济技术开发区', '57', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111752471.doc');
