INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (730, 'b83e4bbe-6f05-11e9-88ef-ac1f6b639ec0', '10000吨/鲜食玉米及蔬菜加工项目', '大庆', '杜尔伯特蒙古族自治县', '大庆-杜尔伯特蒙古族自治县', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '6000', '一般', '4', '1800', '480', '筹划', '无', '', '', '杜蒙县经济贸易合作服务中心', '奚晓东', '13685495710', 'drbtzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '年加工速冻蔬菜10000吨，其中粘玉米7000吨，马铃薯1000吨，油豆角500吨，胡萝卜500吨，毛豆500吨、南瓜500吨。建设速冻粘玉米加工厂一处，总占地面积10000平方米；总建筑面积6000平方米。购置安装生产加工、制冷及生产辅助设备60台套。杜蒙县属温带大陆性季风气候，土壤肥沃，以砂土和黑钙土为主，气温年较差大，冬季漫长，积雪时间长。年平均气温4.6度，无霜期155天，光照资源丰富，年日照时数2738小时。气候非常适宜鲜食玉米的生长。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江杜尔伯特经济开发区', '33', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (731, 'b8725bff-8231-11ea-b0bb-ac1f6b639ec0', '呼中区地热能旅游开发项目', '大兴安岭', '塔河县', '大兴安岭-塔河县', '居民服务、修理和其他服务业', '第三产业', NULL, '合作', '12143万元（1874.27万美元）', '7868', '重点', '7', '1800', '600', '筹划', '无', '', '', '呼中区自然资源局', '王洪君', '13504565457', 'gw_hzqswj@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '150', '呼中区北西向卡玛兰河断裂带与北东向呼玛河断裂带交汇部位，花岗岩侵入岩中的放射性元素衰变能够放出大量热量，且构造带具有良好的储热空间、热流体补给和较厚的隔热保温盖层，具备地热资源形成、赋存的地质条件，同时也是天然温泉形成的重要条件。项目拟建设温泉度假山庄一处，包括具有康体养生功能的温泉区共2120m²，配套的休闲娱乐中心7100m²，停车场600m²，餐厅400 m²。', '旅游产业', '旅游', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522160649050.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (732, 'b873ca5c-7234-11ea-b0bb-ac1f6b639ec0', '佳木斯市农机综合体项目', '佳木斯', '市辖区', '佳木斯-市辖区', '批发和零售业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '50000', '一般', '10', '10000', '2000', '筹划', '无', '', '', '佳木斯市高新区管委会', '宫清霖', '13359763121', 'jmsgxqzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '200', '项目占地30公顷，建设农机四大中心，即交易中心、展览中心、检测中心和体验中心，汇聚农机产业金融、体验、文化、休闲等功能，形成农机产业全产业链条。政策优势：贯彻落实乡村振兴战略；区位优势：佳木斯市作为三江平原的主体，对周边农机市场的辐射带动潜力巨大，是全国最大的农机消费终端市场，地区年销售额超过40亿元，占全省市场份额的50%以上；资源优势：佳木斯是我国农机应用和农机装备制造业起步最早、基础最好的地区之一，形成了农业收获机、牵引机、播种机、整地配套机等四大门类齐全的农机装备产业集群，其中烘干设备总体水平长居全国第一位。', '高端装备制造产业', '农机装备', '佳木斯高新技术产业开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525150059184.docx');
