INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (734, 'b895f8bf-738f-11e8-a795-ac1f6b639ec0', '安达市医养综合体建设项目', '绥化', '安达市', '绥化-安达市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '7000', '重点', '5', '2000', '1000', '筹划', '无', '', '', '安达市招商办公室', '郑楠', '13946990006', 'adzsbgs@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '50', '初步统计，安达市周边60岁以上的老年人现有60余万人。目前安达市仅有社会福利院3所，无法满足需求。项目拟占地8万平方米，主要建设养老山庄、小型医院、保健浴池、心理治疗室、购物超市、游乐渔塘、室外运动场、多功能娱乐室及相关附属设施，具备照料2000余位老人的能力，形成集居家养老、住养照料、文娱疗养、医疗保健、健康养生等多种服务功能于一体的综合性医养服务中心。', '康养产业', '康养', '黑龙江安达经济开发区', '122', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (735, 'b8c995e9-72ef-11ea-b0bb-ac1f6b639ec0', '佳木斯市农机大市场项目', '佳木斯', '东风区', '佳木斯-东风区', '批发和零售业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '50000', '一般', '4', '15000', '12000', '筹划', '无', '', '', '佳木斯市东风区商务和经济合作局', '洪菊臣', '15804549499', 'dfqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '项目占地15万平方米，主要建设大型高科技农业展示场地、销售中心、大型售后维修中心、餐饮住宿服务区、农机物流中心等配套完善设施。没有农业机械化就没有农业现代化。当前，我国的经济建设已经进入了调整发展时期，农业机械化水平日益提高，在农业发展中发挥十分重要的作用。建设农机大市场正是现代农业发展的需要，国家粮食增产工程的需要，促进国家农业发展的一项重要举措。', '现代商贸产业', '现代商贸', '佳木斯高新技术产业开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525105104953.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (736, 'b8da4e9f-727b-11ea-b0bb-ac1f6b639ec0', '婴幼儿营养米粉生产项目', '绥化', '庆安县', '绥化-庆安县', '制造业', '第二产业', NULL, '独资', '3000万元（463.05万美元）', '6000', '重点', '2', '1500', '225', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '60', '庆安县是优质大米之乡，年生产优质大米60万吨，营养丰富，绿色健康。婴幼儿营养米粉采用优质大米为原料，经过粉碎、研磨、高温杀菌等十几道工序并强化铁、锌、钙、维生素A等多种营养素科学精制而成，以满足婴儿不同阶段的营养所需的补充食品。该项目年可加工3000吨婴幼儿米粉，新建生产车间、库房、办公楼等，厂房，新上两条生产线及附属设备。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江庆安经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521203856153.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (737, 'b8fa21d0-738b-11e8-a795-ac1f6b639ec0', '20万头肉牛养殖屠宰加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '21000万元（3241.35万美元）', '100000', '重点', '1', '25000', '8000', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '1500', '近年来在人们食品结构中，牛、羊肉的食用比例越来越大。毛皮、内脏、骨胶的精深加工等产业在目前为止还无大型龙头企业。育肥牛的饲养前景广阔，屠宰加工前途光明。本项目拟占地面积10万平方米，主要建设肉牛养殖育肥工程（其中2万头在基地饲养育肥，另发展饲养户形成18万头育肥规模），育肥牛舍、饲料加工厂、办公室及配套设施；引进相应设备，进行肉牛屠宰、牛肉精细分割与毛皮、内脏、骨胶的精深加工，形成产业链。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江望奎经济开发区', '106', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (738, 'b9382ff0-7223-11ea-b0bb-ac1f6b639ec0', '30万吨玉米深加工项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '200000万元（30870.0万美元）', '16000', '一般', '7.5', '4500', '230', '筹划', '无', '', '', '甘南县经济合作促进局', '赵文涛', '18045237733', 'gnxzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '100', '甘南县玉米产量大，品质好，淀粉含量高，玉米除食用，一部分作饲料用外，可供加工转化量大，玉米系列产品开发空间也非常大。新建玉米深加工生产车间，购置安装设备，年加工玉米30万吨，年产生物质玉米面粉、土壤改良剂、花青素10万吨。该产品今后在我国具有巨大的发展潜力，市场前景广阔。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江甘南经济开发区', '142', '2020-06-04 14:04:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522162257563.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (739, 'b97223f9-756f-11ea-b0bb-ac1f6b639ec0', '牡丹江市综合性蔬果深加工基地项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '111600万元（17225.46万美元）', '144800', '重点', '5', '22400', '8500', '筹划', '有', '', '', '牡丹江市经合局', '陆东旭', '18045361120', 'spjg123@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '项目占地800亩，其中：①建设罐头厂占地17万平方米，引进配套生产设备、环保设施，引进电脑全自动制罐、罐装设备等，生产果冻、水果罐头、蔬菜罐头等产品；②建设五万吨果汁厂项目，占地面积12.5万平方米，以各种果蔬为原料，生产瓶装或罐装天然果汁饮料；③建设规模为十万吨气调冷库，贮存温度为0°C～5°C，库内设计冷风机系统，由冷冻站利用液氨蒸发吸热的原理制冷；④建设十万吨红薯淀粉深加工项目，占地总面积6.5万平方米，以红薯、木薯为原料，项目总投资4600。', '农业及农副产品精深加工产业', '果蔬加工', '牡丹江经济技术开发区', '38', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403135530115.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (740, 'b974ec97-72f7-11ea-b0bb-ac1f6b639ec0', '佳木斯市脑专科医院项目', '佳木斯', '前进区', '佳木斯-前进区', '其他', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '7000', '一般', '10', '2100', '400', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '500', '建设脑专科医院将有利于完善我市医疗服务体系、提高整体医疗服务能力和医疗技术水平、合理布局优质医疗资源，进一步解决人民群众看病就医问题。前进区区域内有佳木斯市结核医院、传染病医院、精神疾病防治院、黑龙江农垦第二医院等，在前进区建设脑专科医院具有先天传统优势。项目占地5万平方米。建筑面积约3.6万平方米，初步设计500个床位，。设有四层约1.2万平方米医疗门诊、住院处等，另设有公寓四层约8000平方米，康复活动区两层约4000平方米，生活区两层约5000平方米。脑专科医院设有功能神经外科、癫痫外科、颅底神经外科、脑血管外科、神经内镜外科、神经介入科、小儿神经外科、幕上肿瘤外科、脊髓脊柱外科。', '生物医药产业', '生物医药', '其它', '13', '2020-06-01 16:21:40', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523100051375.doc');
