INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (742, 'b9c17ce9-ba09-11eb-a12f-00ff338109dc', '玉米淀粉及饲料加工项目', '伊春', '嘉荫县', '伊春-嘉荫县', '制造业', '第二产业', NULL, '独资', '14600万元（2253.51万美元）', '11200', '一般', '4', '1750', '1450', '筹划', '无', '', '', '\"嘉荫县发展和改革局', '高远', '13504573143', 'jyxfgj@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '70', '项目建设地点位于嘉荫县经济开发区内，紧临嘉荫口岸，距嘉荫县城6.5公里，交通便利，项目占地面积5万平方米，建筑面积2万平方米，包括生产车间5000平方米，输的生产车间200平方米、原料仓库1万平方米、成品仓库2000平方米、管理用房1000平方米，装玉米深加工生产线2条，购置浸泡罐、分离机、旋流器、干燥机、刮刀离心机、气流干煤号统等设备，实现玉米淀粉和饲料深加工。\r\n', '农业及农副产品精深加工产业', '玉米深加工', '其它', '7', '2021-08-10 09:51:57', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (743, 'ba281ae2-9d6a-11ea-8a5d-00ff338109dc', '5万头黑牛养殖加工项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '24000万元（3704.4万美元）', '12000', '一般', '7', '3500', '350', '筹划', '无', '', '', '甘南县经合局', '赵文涛', '18045237733', 'gnxzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '新建年出栏5万头养殖场，年加工5万头黑牛屠宰深加工厂。年加工冷鲜肉、深加工肉制品2万吨。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江甘南经济开发区', '26', '2020-06-04 14:00:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524110249768.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (744, 'ba652cfa-73f4-11ea-b0bb-ac1f6b639ec0', '牡丹江市熊胆粉深加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '50000', '重点', '10', '5000', '1000', '筹划', '有', '', '', '牡丹江市经合局', '勾志会', '18845763340', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '80', '熊胆作为中国四大动物药材之首，入药已有几千年历史，现代药理研究表明，熊胆具有清热解毒、抑菌抗炎、保肝护肝、利胆溶石、降脂降压、镇咳平喘、去翳明目、抗疲劳等多方面的药理功能，尤其是治疗胆囊炎、胆结石更是功效独特。\r\n牡丹江市是黑龙江省道地药材主要产地之一，野生药材蕴藏量近31万吨，资源总蕴藏量占全省的19%。有世界最大的黑熊养殖基地，养殖黑熊3400头，年产熊胆粉3000公斤。\r\n该项目以黑宝药业生产的熊胆粉为原料。寻求企业与黑宝药业合作，在园区择地拟建生产车间、研发基地、引进先进生产线、仓储设施等基础设施建设。', '生物医药产业', '生物医药', '牡丹江经济技术开发区', '5', '2020-05-29 14:25:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200401164232437.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (745, 'ba72fbba-7324-11ea-b0bb-ac1f6b639ec0', '生猪养殖项目', '鸡西', '密山市', '鸡西-密山市', '农、林、牧、渔业', '第一产业', NULL, '其他', '70000万元（10804.5万美元）', '210000', '一般', '3', '25000', '8300', '筹划', '无', '', '', '密山市区域经济发展服务中心', '刘娜', '13351670999', 'hljmszsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '200', '总建筑面积20万平方米，建设10个育肥猪基地，每个基地建设22栋舍，每栋猪舍存栏2400头，年存栏5000多头，10个基地存栏52万头，年出栏100万头。主要建设育猪基地、猪舍、饲料厂房等，配备排污、通风、供暖等设施。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '26', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521141932706.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (746, 'bb16cb59-9e70-11ea-8a5d-00ff338109dc', '小兴安岭户外运动谷建设项目', '伊春', '丰林县', '伊春-丰林县', '其他', '第三产业', NULL, '合资', '28400万元（4383.54万美元）', '3000', '一般', '15', '800', '108', '筹划', '无', '', '', '丰林县', '卢超', '13845820045', 'hxluchao@vip.qq.com', '伊春市经济合作局', '王丹', '13945876577', 'yczsb2011@163.com', '80', '丰林县新青镇具有白头鹤之乡的美称，境内新青国家湿地公园在2008年博鳌国际旅游论坛上被评为最具影响力的湿地景区之一。项目依托小兴安岭独特的森林、冰雪、河流、空气等生态资源优势，打造集森林游乐运动基地、中小学生研学基地、国防教育基地于一体的国内森林生态旅游与户外运动项目深度融合的新型体验景区。现已建成2万平方米的房车自驾车营地及木屋旅馆、帐篷酒店、森林树屋、猎人营地、青年旅舍、房车营位、野外露营营位等。规划面积2万公顷（包含林地），在现有设施基础上，新建初级滑雪场、林业生产体验园、开心农场、文化艺术创意村、松林户外人家、鹤仙湖水上运动基地。', '旅游产业', '旅游', '其它', '24', '2020-05-28 21:39:06', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525181600039.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (747, 'bb39bf3e-7d01-11e9-815b-ac1f6b639ec0', '北林区生物制药项目', '绥化', '北林区', '绥化-北林区', '制造业', '第二产业', NULL, '独资', '200000万元（30870.0万美元）', '100000', '重点', '7', '30000', '3500', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '200', '绥化市位于松嫩平原腹地寒地黑土核心区，拥有丰富的农牧资源，尤其是以玉米为主的生物制药原料极为丰富，适合发展生物制药项目。该项目拟选址在绥化市北林区，占地2万平方米，新建标准化制药生产车间、生物发酵车间、研发基地等内容，引进先进制药生产设备，采用生物发酵技术，充分发挥绥化生物资源优势，开展药物研发、生产。', '生物医药产业', '生物医药', '绥化经济技术开发区', '22', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (748, 'bbe26b9a-821a-11eb-94a7-00ff338109dc', '北安市万头奶牛一体化建设项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '180000万元（27783.0万美元）', '140000', '重点', '7', '26000', '3000', '可研', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安位于世界公认的北纬40-50度的黄金奶源带内，生态环境优良，畜牧资源丰富，奶源品质优越。为发展北安市奶牛产业，提高奶牛养殖技术和品质，充分利用北安市的资源优势，计划将北安市建设成为黑河市奶牛产业化开发的先进技术试验推广基地、优质产品生产基地、教育培训基地、科普基地、现代化生产示范基地和奶牛养殖基地。该项目主要建设奶牛繁育区建奶牛胚胎移植中心一座；奶牛养殖示范区建10000头奶牛养殖场两个；饲料牧草种植区10万亩；配套建设饲料加工区；青贮氨化区；管理中心等。建设奶粉加工企业一个，日加工鲜奶500吨。', '现代商贸产业', '现代商贸', '黑龙江北安经济开发区', '2', '2021-08-10 09:59:06', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (749, 'bc085cda-732e-11ea-b0bb-ac1f6b639ec0', '青冈县汉麻食品、保健品项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '70000万元（10804.5万美元）', '100000', '一般', '7', '10000', '3000', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '汉麻仁是植物汉麻成熟的果实，总蛋白含量达到25%左右，含有丰富的氨基酸、维生素和微量元素，含人体所需的必需氨基酸，迎合了大健康产业蓬勃发展以及人类健康对植物蛋白资源的需求。汉麻籽油含有合理比例的ω-3，6，9不饱和脂肪酸，通过改善机体的排泄(排毒)、改善心脑血管功能(防三高)、清除细胞自由基(延续衰老)、改善睡眠、防治癌症等作用，产品有机、绿色、效果好。利用汉麻仁发展汉麻休闲食品，健康、绿色、营养价值高，成为一种时尚。', '生物医药产业', '生物医药', '黑龙江青冈经济开发区', '11', '2020-05-31 22:42:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521133137118.doc');
