INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (751, 'bcb493f0-7257-11ea-b0bb-ac1f6b639ec0', '兰西县1000万只大鹅养殖屠宰加工项目', '绥化', '兰西县', '绥化-兰西县', '农、林、牧、渔业', '第一产业', NULL, '独资', '100000万元（15435.0万美元）', '150000', '重点', '4', '25000', '20000', '筹划', '无', '', '', '兰西县经济合作服务中心', '车德威', '18245599222', 'lxxzszj@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '3000', '目前鹅业加工是一项经济效益和社会效益很高的产业，养鹅具有投入少、产出快、效益显著的特点。鹅肥肝是高档食品，鹅肉脂肪含量较少，肉质细嫩，肉营养丰富、肉质好，蛋白质含量高，属绿色食品，越来越受到广大消费者欢迎。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江兰西经济开发区', '42', '2020-06-02 13:46:30', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200602110545002.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (752, 'bd13ac41-bd06-11ea-8a5d-00ff338109dc', '佳木斯市中药种植基地项目', '佳木斯', '汤原县', '佳木斯-汤原县', '农、林、牧、渔业', '第一产业', NULL, '独资', '40000万元（6174.0万美元）', '35000', '重点', '4', '10000', '6000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmssgntzk@163.com', '300', '汤原县全县林业经营地面积200万公顷，其中森林总蓄积量490万平方米，野生中草药有党参、刺五加、白术等，现有野生药材资源共计107个科200余种。土壤、气候非常适宜种植人参、五味子、黄芪、桔梗、板蓝根、防风、甘草、龙胆草、文冠果等植物，人工种植面积达2万亩。该项目占地1万亩，投资4亿元，建设中药种植科技培训、中药育苗和种植基地。其中,中药科技培训占地600亩，中药苗圃占地800亩，建设现代化的温室大棚，种植占地1500亩，建日光棚和钢架大棚各100个，带动就业人员300人。', '中医药产业', '其它', '黑龙江汤原经济开发区', '5', '2021-08-10 10:42:57', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707141020152.docx');
