INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (756, 'bf62bce6-82e1-11ea-b0bb-ac1f6b639ec0', '方便米饭生产加工项目', '齐齐哈尔', '泰来县', '齐齐哈尔-泰来县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '20000', '一般', '5', '5500', '1000', '筹划', '无', '', '', '泰来县经济合作促进局', '袁彦冰', '13803635039', 'tljhjyyb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '“创造大米制品知名品牌，开拓方便食品全新领域”。该项目投资额5亿元，厂区占地40000平方米。从方便米饭的生产进行研究，从改善产品品质、提高产品质量方面入手，进行方便米系列食品加工。解决了方便米饭的风味难题，保持大米的原粒原味，口感、味感，韧性优于蒸煮的米饭，产品经过高温加工，不生虫、不霉变，长期存放质量、风味、外观保持不变。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江泰来经济开发区', '30', '2020-06-04 14:04:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523132149597.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (757, 'bf8f467c-7d32-11ea-b0bb-ac1f6b639ec0', '玄武岩纤维项目', '鸡西', '滴道区', '鸡西-滴道区', '制造业', '第二产业', NULL, '其他', '6000万元（926.1万美元）', '4500', '一般', '5', '1344', '675', '筹划', '无', '', '', '滴道区发展和改革局', '刘丹祥', '13351177676', 'ddqfgj2455@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '100', '玄武岩纤维非磁性、电绝缘、强度高、弹性模量高、热膨胀系数与水泥混凝土相近。有极高的耐化学腐蚀性、耐酸、耐碱、耐盐。计划投资6000万元建设年产2000吨玄武岩纤维生产线；主要建设生产车间厂房、库房、仓库、等其他辅助用房。', '新材料产业', '复合材料', '黑龙江鸡西经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525104541185.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (758, 'bf934e03-846e-11ea-b0bb-ac1f6b639ec0', '数据中心监控运维系统项目', '大庆', '市辖区', '大庆-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '20000', '一般', '4', '3000', '800', '筹划', '无', '', '', '大庆高新区管委会', '丁超', '18804593387', '418433790@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', '此次疫情国内线下业务遭到重创，而游戏、视频等互联网流量大幅增加，在线办公、远程教育等需求相应激增，给现有的数据中心带来考验。部分应用服务器出现承载能力不足、网络传输速度和稳定性下降等问题，运营企业亟需扩容。\r\n项目为大庆大数据中心建立联网的监控运维系统，对各机房的UPS、配电屏、精密配电柜、高压直流、精密空调、列间空调、加湿器、温湿度、天窗控制、漏水、机柜温度检测实施监测，实现24×365的全面集中监控和管理，保障空调安全高效运行，以实现最髙的机房可用率，并不断提高运营维护管理水平。', '新一代信息技术产业', '新一代信息技术', '大庆高新技术产业开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422155618319.docx');
