INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (761, 'c0d5cf71-9b31-11ea-8a5d-00ff338109dc', '加格达奇林业局百泉谷自驾游营地项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '居民服务、修理和其他服务业', '第三产业', NULL, '合资', '7500万元（1157.63万美元）', '5000', '重点', '7.5', '1000', '80', '筹划', '无', '', '', '加格达奇林业局招商引资办公室', '蔺葳', '13845794556', 'cx-yx@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '自驾游属于自助旅游的一种类型，是有别于传统的集体参团旅游的一种新的旅游形态，在选择对象、参与程序和体验自由等方面给旅游者提供了伸缩空间，其本身具有自由化与个性化、灵活性与舒适性及选择性与季节性等内在特点，与传统的参团方式相比具有本身的特点和魅力，正日益成为国内旅客旅游新热点。项目拟借助加格达奇成为国内北部旅游集散地优势，利用丰富的森林旅游资源，规划百泉谷自驾游营地面积145亩，进行入口形象区、游客服务中心、自驾游停车场、车辆养护中心等设施建设。', '旅游产业', '旅游', '其它', '17', '2020-06-03 15:21:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521150737898.doc');
