INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (768, 'c2724835-72f6-11ea-b0bb-ac1f6b639ec0', '佳木斯市医疗养老中心项目', '佳木斯', '前进区', '佳木斯-前进区', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '30000万元（4630.5万美元）', '7000', '一般', '10', '1800', '300', '筹划', '无', '', '', '前进区商务和经济合作局', '杜新', '15765347593', 'qjqjhj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '300', '前进区医疗资源丰富，中西医各类科室部门齐全，特别是佳木斯市结核医院、传染病医院、精神疾病防治院、黑龙江农垦第二医院等专科医院具有先天传统优势。前进区区域内有水源山公园、农垦绿苑风景区，临近四丰山公园，周围环境优美、空气清新。该项目占地5万平方米，预计建设1500张床位，每床每月收费月4000-5000元，按照提升前进区家居生活环境、医疗服务质量的具体要求，将项目打造成集医疗保健、娱乐休闲、养生养老等配套设施齐全的医疗养老基地，建成后将成为我省东部地区最大的医疗、养老、养生于一体的综合性医疗养老中心项目。', '康养产业', '康养', '其它', '18', '2020-06-01 15:51:40', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523095123040.doc');
