INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (783, 'c6c82d3a-9e91-11ea-8a5d-00ff338109dc', '翔宇实业绿色家禽养殖屠宰加工项目', '伊春', '友好区', '伊春-友好区', '农、林、牧、渔业', '第一产业', NULL, '合作', '13000万元（2006.55万美元）', '73500', '一般', '5', '2904', '3675', '筹划', '无', '', '', '友好区人民政府', '李大庆', '13846690319', 'yhsw3298682@163.com', '伊春市经济合作局', '王丹', '13945876577', 'yuanlixin2005@126.com', '50', '充分利用原黑龙江翔宇实业集团闲置资产，引进养殖屠宰加工项目。黑龙江翔宇实业集团公司占地16万平方米，现有肉鸡养殖基地、屠宰车间及生产线、冷库。为满足国内及国际绿色畜禽养殖业产品市场消费需求为目的，以绿色生猪、肉鸡养殖、肉食品加工产业为先导，推动绿色农业结构调整，促进地区一二产融合发展，项目可填补区域空白。建设项目严格执行国家标准，产品质量安全可靠，具有很强的市场竞争优势。采取养殖基地+农户+公司产业模式，拟建设生猪、肉鸡饲养基地，改建综合服务楼一栋6000平方米，屠宰加工车间5000平方米、屠宰加工生产线4条，饲料库、冷藏库及相关附属设施建设。', '农业及农副产品精深加工产业', '肉制品加工', '其它', '21', '2020-05-27 23:09:44', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525221233049.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (784, 'c70093fd-ba0a-11eb-a12f-00ff338109dc', '大果沙棘制药及综合开发项目', '黑河', '孙吴县', '黑河-孙吴县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '65000', '一般', '3', '18000', '8000', '筹划', '无', '', '', '孙吴县农业农村局', '毕树理', '13394567234', 'bishuli@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '50', '年加工沙棘果1万吨。建设生产及辅助生产用房4万平方米；购置生产及辅助生产设备500多台（套）。\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江孙吴经济开发区', '3', '2021-08-10 09:51:29', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (785, 'c744d61d-757e-11ea-b0bb-ac1f6b639ec0', '牡丹江市国际商业广场项目', '牡丹江', '市辖区', '牡丹江-市辖区', '房地产业', '第三产业', NULL, '独资', '369000万元（56955.15万美元）', '500000', '重点', '5', '75000', '28500', '筹划', '有', '', '', '牡丹江市经合局', '孙佳新', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '300', '项目主要建成商贸综合体、高档望江住宅、住宅+公寓、餐饮会馆等。\r\n项目区域为牡丹江市沿江景观带上绝版区块，拥有较高的地产升值价值，人群消费热度集中，按照地方房屋基准价为7000元/㎡销售，市场人群购置率将达到开盘后的90%以上。\r\n项目占地面积45万平方米，部分用地已完成开发建设。', '现代商贸产业', '现代商贸', '其它', '20', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403154315753.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (786, 'c74c5203-83a9-11ea-b0bb-ac1f6b639ec0', '2000吨/年板蓝根提取物生产项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '16000', '一般', '5', '3200', '1000', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '35', '板蓝根提取物含有多种氨基酸、谷甾醇、靛玉蓝、靛玉红、靛青等成分，经过加工制成颗粒剂、片剂、糖浆、口服液、胶囊等系列产品。具有清热解毒凉血的功能，治疗流行性感冒、乙型脑炎等多种病症，药物价值很高。依托大同区板蓝根优势拟建设板蓝根提取物生产线，年可加工板蓝根8000吨，生产提取物2000吨。\r\n项目拟建设在大同经济开发区（食品园区），建设预处理车间、提取车间、动力车间、原辅料仓库、办公楼、综合楼、辅助用房、水泵房、污水机房、门房及总图工程，占地32572平方米。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江大同经济开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521132454318.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (787, 'c76226b2-8212-11eb-94a7-00ff338109dc', '北安市医养结合养老中心项目', '黑河', '北安市', '黑河-北安市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '4000', '一般', '13', '750', '250', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '北安市是黑龙江省北部的中心城市，是我国最北部的交通枢纽，距离世界地质公园五大连池风景名胜区仅50公里，北安市半径150公里辐射十余个县市400余万人口，人口众多，地理优势明显。北安市内医疗资源丰富，拥有黑龙江省第三医院、黑龙江省农垦北安管理局中心医院、北安市第一人民医院等众多医疗机构，成为周边地区群众就医首选，发展医养结合产业潜力巨大。本项目选址紧邻北安市滨水公园，交通便利，环境优美，城市基础设施和配套功能齐全，项目周边珍贵的生态资源构成了项目得天独厚的，纯天然的康疗、养生、宜居环境。项目占地面积4万平方米，建筑面积2万平方米。', '康养产业', '康养', '黑龙江北安经济开发区', '8', '2021-08-10 10:04:15', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (788, 'c7ee9aaa-7587-11ea-b0bb-ac1f6b639ec0', '牡丹江市阳明区华晟国运物流中心三期项目', '牡丹江', '阳明区', '牡丹江-阳明区', '交通运输、仓储和邮政业', '第三产业', NULL, '合资', '11000万元（1697.85万美元）', '6000', '重点', '11', '1000', '200', '筹划', '有', '', '', '牡丹江市经合局', '徐海鸥', '13009885897', 'huashengguoyun@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '牡丹江华晟国运物流中心项目，由牡丹江市政府主导，是黑龙江省、牡丹江市重点建设项目，项目总体规划占地总面积30万平方米，分三期建设，目前正在进行二期建设，三期建设从2021年5月开始，2025年12月完成。项目完成后，形成年40万个标准集装箱吞吐能力。\r\n新增建设一条500延米铁路专用线、新建两栋12000平方米农副产品和电子商务线下仓库、新建4000平方米内贸货物周转钢结构罩棚、新建200个集装箱冷藏充电设施、升级完善城市物流枢纽信息化平台、新建5万平方米堆存场地和场区道路、新增一台龙门吊、新增一台正面吊、购置集港、配送车辆和装卸设备、新建一座630KW箱式变电及消防、排水等配套设施。', '物流产业', '物流', '黑龙江阳明经济开发区', '18', '2020-05-29 15:39:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403164742332.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (789, 'c8274a52-8216-11eb-94a7-00ff338109dc', '北安市年产2万吨无氧铜杆项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '7000万元（1080.45万美元）', '100000', '一般', '1.5', '5000', '4000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '70', '北安市位于黑龙江省正北方区域中心，是黑龙江省北部地区的交通枢纽，周边辐射十余个县市，废旧特制铜100万吨以上，可利用的再生资源丰富。无氧铜杆具有纯度高、含氧量低、导电率高、加工性能好等优良特性，且外观光洁，表面圆整，无毛刺、裂纹、起皮及夹杂缺陷，相比其他铜杆具有明显的优势。目前，无氧铜杆是电线电缆生产的主要原材料，随着我国电线电缆行业的发展，带动对无氧铜杆的需求。该项目原料拟选为境外俄罗斯及北安周边县市收购，在俄罗斯加工成铜锭后运入国内在进行加工，成本会降低。该项目生产工艺为上引法，工艺流程短、成材率高、成本低、投资少。年产2万吨无氧铜杆项目，项目占地面积7000平方米，建筑面积4500平方米', '有色金属精深加工产业', '有色金属精深加工', '黑龙江北安经济开发区', '1', '2021-08-10 10:02:55', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (790, 'c86568a2-7fab-11ea-b0bb-ac1f6b639ec0', '300亩连栋智能温室项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '3990万元（615.86万美元）', '3000', '一般', '5', '800', '200', '筹划', '无', '', '', '甘南县经济合作促进局', '赵文涛', '18045237733', 'yw@yw-brg.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '60', '甘南县土地肥沃食欲农作物生长。项目拟占地总面积500亩，规划建设1栋智能连栋温室占地面积300亩及配套辅助设施，预计园区年生产各种果菜约500万公斤、年接待旅游人员100万人次。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江甘南经济开发区', '36', '2020-06-04 14:05:02', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522162137310.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (791, 'c8ecfffa-767c-11ea-b0bb-ac1f6b639ec0', '牡丹江市穆棱市连续玄武岩纤维项目', '牡丹江', '穆棱市', '牡丹江-穆棱市', '采矿业', '第二产业', NULL, '合作', '46000万元（7100.1万美元）', '40000', '重点', '8', '6000', '2200', '筹划', '有', '', '', '牡丹江市经合局', '孙树迎', '13804886661', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '50', '牡丹江市拥有丰富的天然玄武岩，原材料便利。拥有方便的交通和完善的物流体系，便于运输和销售。\r\n项目规划占地面积：5.6万平方米，建筑面积2.7万平方米，以玄武岩为原料，采用“燃气—电”结合的池窑拉丝生产工艺，建设规模为年产1万吨玄武岩连续纤维生产线，建设厂房、办公楼、库房等生产生活辅助设施。', '新材料产业', '复合材料', '黑龙江穆棱经济开发区', '21', '2020-05-29 16:13:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161708162.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (792, 'c8f36fb4-846d-11ea-b0bb-ac1f6b639ec0', '大庆云计算产业园二期项目', '大庆', '市辖区', '大庆-市辖区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '合资', '1800000万元（277830.0万美元）', '1302000', '一般', '9', '200000', '128700', '可研', '有', '', '', '大庆高新区管委会', '丁超', '18804593387', '418433790@qq.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '中国联通与大庆市政府合作于2019年12月20日签署了“战略合作框架协议”，政府高起点规划产业发展，政策支持积极推动，社会资本市场化参与国家级大型数据中心建设，形成云数据创新生态，大庆也必将抓住大数据产业难得的发展机遇。大庆市在地理位置、地质结构、气候条件、基础设施，电力供应等方面具有发展大数据产业多重优势，具备争取数据中心布局 “东部基地”的条件。 联通投资5000万元为园区提供国家骨干网接入（1000Gbps），解决了大数据产业发展瓶颈问题。二期用地800亩，规划32个数据中心计划2022年4月开工，5-8年完成园区建设并投入运营，建设30个以上数据中心单体、10万组机柜。', '新一代信息技术产业', '新一代信息技术', '大庆高新技术产业开发区', '25', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422154924551.docx');
