INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (802, 'caaa9d03-7259-11ea-b0bb-ac1f6b639ec0', '肇东市玉米生化及深加工项目', '绥化', '肇东市', '绥化-肇东市', '科学研究和技术服务业', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '100000', '重点', '2', '30000', '15000', '筹划', '无', '', '', '肇东市招商引资服务中心', '傅吉丽', '04557990608', 'zd-zsyzj@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '2000', '肇东是全国产粮大县，已形成了60亿斤优质粮食生产基地，原料资源丰富。围绕中国（肇东）国际农产品加工产业园规划，立足肇东本地玉米生化支柱产业，扩充增量，发挥中粮（肇东）生化能源有限公司、星湖等企业氨基酸、酒精基础优势，重点延伸小品种氨基酸、核苷、腺苷、腺嘌呤，精炼玉米油、变性淀粉、玉米淀粉、鲜食玉米饮品等项目。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江肇东经济开发区', '23', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145249942.doc');
