INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (804, 'cbca2e3a-5328-11e8-ba35-ac1f6b639ec0', '6000吨石墨电池负极材料生产加工项目', '双鸭山', '岭东区', '双鸭山-岭东区', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '42857', '重点', '4', '8500', '8600', '筹划', '无', '', '', '岭东区经济合作交流中心', '于婷婷', '18249427333', 'ldqjjhzjlzx@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '150', '该项目建设地点位于岭东区，依托已探明的5828万吨石墨储量，利用磷片石墨导电性好的特性通过高温或化学提纯的方法，建设6000吨电池负极材料生产加工项目。产出的材料可作为原料应用于新能源汽车电池及其它电池类产品，按照国家新能源汽车发展规划到2020年新能源汽车保有量将达到4000万辆，每年电池负极材料的市场需求量约为24万吨左右，前景极为可观。', '新材料产业', '石墨烯', '其它', '75', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (805, 'cc4f7d71-83a7-11ea-b0bb-ac1f6b639ec0', '猪副产品熟食加工项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '4000万元（617.4万美元）', '7500', '一般', '4', '1200', '600', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '大同区具有良好养殖基础，近年来发展养殖猪场30多个，年养殖规模3万多头猪，可为项目提供充足的畜产品供应加工。\r\n项目拟建在大同经济开发区（食品园区），规划总占地面积5000平方米，新建办公室、生产车间、原料接收库、污水处理站等。主要购置设备包括斩拌机、绞肉机、齿轮式濯肠机、巴士杀菌设备、真空封口机等熟食加工设备20台套，购置锅炉、制冷设备、污水处理设备3台套。达产后，年可生产各类熟食达3万吨。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江大同经济开发区', '5', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521114300053.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (806, 'cc70d786-9d82-11ea-8a5d-00ff338109dc', '商贸物流园项目', '齐齐哈尔', '建华区', '齐齐哈尔-建华区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '400000万元（61740.0万美元）', '250000', '一般', '6', '70000', '8000', '筹划', '无', '', '', '齐齐哈尔市建华区经济合作促进局', '刘德山', '18686901156', 'jjhqjhjgg@163.com', '齐齐哈尔市经济合作促进局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '70', '建设综合性商贸物流园，经营业态涵盖物流仓储区、农副产品区、五金机电、百货商品、家具家居建材区、餐饮休闲、娱乐电子、办公商务区、汽摩汽贸区、酒店公寓、银行金融等综合业态。主要建设物流中心、仓储中心、交易中心、商贸综合区及配套设施。', '物流产业', '物流', '其它', '55', '2020-06-04 13:58:34', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524135335859.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (807, 'cc812553-83aa-11ea-b0bb-ac1f6b639ec0', '100万只/年大鹅养殖和加工项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '20000', '一般', '8', '2000', '1000', '筹划', '无', '', '', '大庆市大同区经济和发展改革局', '林志力', '15776177776', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', '鹅肉具有高蛋白、低脂肪、低胆固醇等特点，鹅肉营养丰富、肉质好，蛋白质含量高，鹅肝是高档食品，鹅绒是高级衣被的填充料，本项目适应当前市场需求，发展前景广阔。大同区大鹅资源丰富，年出栏量达240万只，充分满足该项目需求。\r\n项目拟建在大同经济开发区（食品园区），建设种鹅场20个，每个种鹅场饲养优良种鹅2000只。建孵化车间300平方米，购置孵化器20台，建饲料加工厂2处，建设大鹅屠宰加工车间3万平方米，安装宰杀生产线2条，熟食生产线4条，可实现年屠宰加工100万只大鹅的生产能力。主要生产分割翅、鹅心、鹅肝、鹅肠和鹅火腿、鹅肉脯、烤鹅等系列产品，配套分离鹅毛、鹅绒等产品，提高大鹅产品附加值。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江大同经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153518309.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (808, 'cc9ac3c1-7df9-11ea-b0bb-ac1f6b639ec0', '城子河区康养中心建设项目', '鸡西', '城子河区', '鸡西-城子河区', '居民服务、修理和其他服务业', '第三产业', NULL, '合作', '8000万元（1234.8万美元）', '4000', '一般', '12', '600', '240', '筹划', '无', '', '', '城子河区发展和改革局', '张岩', '15561731621', '546713334@qq.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '150', '占地面积1万平方米，为疗养人提供一个集医疗、生活、保健、疗养、康复、健身运动、休闲的活动场所。拟建设康复理疗区、亚健康疗养区、居家养老区、运动健身区。突出区域文化，从康养、卫生、饮食、居住、绿化、景观、健身等多方面考虑，配套设施突出既能养病又能治病、既能养生又能养老、既能保健又能休闲娱乐。', '康养产业', '康养', '其它', '29', '2020-06-01 16:07:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525095858304.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (809, 'cc9d7c6d-843b-11ea-b0bb-ac1f6b639ec0', '可发性聚苯乙烯（EPS）项目', '大庆', '龙凤区', '大庆-龙凤区', '其他', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '120000', '一般', '3', '10000', '5000', '筹划', '无', '', '', '龙凤区投资促进服务中心', '王宏伟', '17804596555', 'lfqzsj@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '70', 'EPS制品由于独特的品质、低廉的价格，可广泛用于黑龙江及东北地区的建筑、船舶、冷藏、冷冻、化工设备的高温隔热材料和家用电气、仪器仪表、玻璃制品的包装材料等。本项目主要目标市场定位在黑龙江和东北地区，并可辐射内蒙古及远东等地区。大庆石化公司坐落于大庆市龙凤区，是中国重要的石化产品生产基地，具有丰富的原料、技术、人才等资源。\r\n该项目规划占地面积3万平方米，建筑面积2.5万平方米，总投资3亿元，主要建设年产10万吨EPS装置及配套设施，包括厂房、仓库、储存间等必要设施。', '石化产业', '石化', '黑龙江龙凤经济开发区', '22', '2020-05-30 16:36:44', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140243608.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (810, 'cd29ed2f-cf35-11eb-a12f-00ff338109dc', '秸秆产业园区项目', '双鸭山', '集贤县', '双鸭山-集贤县', '制造业', '第二产业', NULL, '独资', '132000万元（20374.2万美元）', '100000', '一般', '8', '17000', '3600', '筹划', '无', '', '', '集贤县经济合作交流中心', '胡晓强', '15545796181', 'jxkfqhxq@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '100', '建设秸秆产业园区，其中一期投资13.2亿元，建设生物质气化提氢项目。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:44:42', '');
