INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (812, 'cda3a17c-6e5e-11ea-b0bb-ac1f6b639ec0', '石墨烯科创城项目', '哈尔滨', '呼兰区', '哈尔滨-呼兰区', '科学研究和技术服务业', '第三产业', NULL, '合作', '700000万元（108045.0万美元）', '2100000', '一般', '5', '220000', '38000', '筹划', '无', '', '', '呼兰区企业和投资服务局', '高旭光', '13904663436', 'zhaoshangju2011@126.com', '呼兰区企业和投资服务局', '石海荣', '13351614077', 'zhaoshangju2011@126.com', '500', '该项目是集石墨烯研究院、项目孵化、众创空间、产业加速、产业转化、生产基地、产品展示及营销平台、综合管理服务平台、工业废弃物回收综合利用平台和投融资金融服务平台于一体的石墨烯全产业链主题产业园。石墨烯科创城通过政产学研用资紧密结合的跨界协同创新方式，开展石墨烯产业前沿技术、共性关键技术研发供给、转移扩散和首次商业化，实现创新链、产业链和投资链的“三链”融合，成为黑龙江石墨烯产业创新的重要支撑平台。该项目将按照国家级制造业创新中心要求与标准进行建设与运营，力争打造成国内一流的石墨烯创新及产业化基地。', '新材料产业', '石墨烯', '黑龙江呼兰经济开发区', '90', '2020-06-03 13:58:04', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200602162837847.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (813, 'ce6134de-7310-11ea-b0bb-ac1f6b639ec0', '望奎县秸秆综合处理项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '15000', '重点', '5', '3000', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '近年来，每年春季、秋冬季，总有大量农作物秸秆在田间被焚烧，产生大量浓重的烟雾，形成严重空气污染，农作物秸秆资源综合利用变废为宝被国家层面正式提上日程，通过综合处理对于促进农民增收、环境保护、资源节约以及农业经济可持续发展意义重大。秸秆用于生物柴油燃料、寡糖植宝素生物农药、秸秆有机肥、秸秆发电、秸秆生物饲料等都是秸秆转化的产物，有望形成比传统“石油农业”劳动生产率更高、可持续发展的新型农业，这种前景十分诱人，秸秆综合利用前景广阔。', '节能环保产业', '秸秆综合利用', '黑龙江望奎经济开发区', '27', '2020-06-02 14:34:58', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200331133100719.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (814, 'ce992c0c-7263-11ea-b0bb-ac1f6b639ec0', '佳木斯市年生产6000吨一次性全降解植物纤维餐具项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '24000', '一般', '5', '6000', '1800', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '50', '项目建设地点富锦市经开区，享受省级开发区优惠政策。项目占地面积5公顷。建设内容，建设标准化精深加工厂房6000平方米，购进先进的一次性可降解餐具生产线设备40台套，购进蒸汽锅炉1台，建设防火深水井1座，建设水泥场地6000平方米，安装3000kw电力设施。资源优势，富锦地势平坦，适合秋季秸杆机械大规模作业。由于本地气候特点，秸杆便于收储保管。富锦年际间产秸杆300多万吨，可为秸杆综合利用提供充足的原料。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享。', '节能环保产业', '秸秆综合利用', '黑龙江富锦经济开发区', '15', '2020-06-02 14:35:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521150732123.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (815, 'cf23865f-7265-11ea-b0bb-ac1f6b639ec0', '佳木斯市年深加工木材7万立方米生态板芯项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '30000', '一般', '8', '3000', '1100', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '130', '项目建设地点富锦市木材加工产业园区，具有物流运输、生产加工等优势条件。占地面积为4公顷，建设标准化精深加工厂房4000平方米，购进先进的木材深加工生产设备，购进蒸汽锅炉1台，建设防火深水井1座，垫整场地30000平方米。原料优势：中俄同江铁路大桥开通后，富锦市通过进口木材发展该项目具有原料保障。口岸优势：富锦是国家一类口岸，具有实现江海联运优势，辐射周边四个口岸，具有带动作用和承载功能力，已建立对外合作保税区，并出台了相关政策、奖励办法。', '节能环保产业', '秸秆综合利用', '黑龙江富锦经济开发区', '14', '2020-06-02 14:39:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144746392.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (816, 'cf917bb5-80de-11e8-bc9d-ac1f6b639ec0', '中俄跨境电子商务项目', '双鸭山', '饶河县', '双鸭山-饶河县', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '50000', '重点', '3', '5000', '1250', '筹划', '无', '', '', '饶河县经济合作交流中心', '宋树江', '13895860200', 'rhzsyzj@163.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '300', '饶河口岸是联结东北亚区域经济合作的纽带，饶河距俄罗斯哈巴罗夫斯克220公里。该项目依托饶河县的地缘优势和口岸优势，建设集仓储、物流配送、电商运营、培训、网货博览、体验、跨境监管、服务等要素为一体的跨境电子商务创业产业园，全面带动国际物流产业创新发展，构建海外营销体系，形成饶河电子商务模式下的外贸平台。', '电子商务产业', '电子商务', '其它', '106', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (817, 'cfd06ca4-cbe8-11ea-9952-00ff338109dc', '牡丹江市氧化石墨烯粉体 制备及应用开发项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '20000', '一般', '5', '2000', '500', '筹划', '无', '', '', '新材料专班', '苏振林', '18746336699', 'xclzb@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '我市石墨矿产资源充足，石墨产量大，可有效保证原材料的供给。石墨烯材料广泛应用在电池电极材料、半导体器件、透明显示屏、传感器、电容器、晶体管、发热材料、散热材料、防腐涂料、改性塑料等方面。鉴于石墨烯材料优异的性能及其潜在的应用价值，在化学、材料、物理、生物、环境、能源等众多学科领域已取得了一系列重要进展。规划占地面积1.5万平方米，建设生产500吨/年单层氧化石墨烯和3~5层石墨烯粉体生产线、厂房、办公楼等配套设施。牡丹江拥有石墨资源优势、对俄贸易优势，辐射市场份额优势，是建设高端石墨产业项目最佳生产基地。', '新材料产业', '石墨烯', '牡丹江经济技术开发区', '5', '2021-08-10 10:13:53', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200722145900356.docx');
