INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (821, 'd08ff2cb-725d-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产20万吨葡萄糖项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '30000', '一般', '6', '5000', '1500', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '项目建设地点富锦市经开区，享受省级开发区优惠政策。占地面积3公顷，总建筑面积2万平方米。建设内容，年产20万吨葡萄糖。资源优势，富锦象屿金谷生化科技有限公司年产75万吨优质玉米淀粉，可为配套企业提供原料保障。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富锦经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153354760.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (822, 'd0fcbffc-6f2a-11ea-b0bb-ac1f6b639ec0', '五大连池市国际康养城项目', '黑河', '五大连池市', '黑河-五大连池市', '房地产业', '第三产业', NULL, '独资', '75191万元（11605.73万美元）', '35060', '重点', '7.5', '10019', '641', '可研', '有', '', '', '五大连池市经济合作中心', '李建松', '18645623498', 'wdlczsj@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '五大连池市境内有享誉世界的世界地址公园-国家5A级风景名胜区-五大连池风景区，是一座有着富集的旅游资源和矿泉资源的美丽城市。五大连池矿泉水，具有强身健体、消除疲劳、预防疾病、辅助治疗的奇效。对消化器官胃肠疾病、神经系统疾病、心脑血管疾病、肝胆系统疾病有辅助疗效，特别是对亚健康人群恢复体质十分有益。五大连池得天独厚的环境因素和地质资源，造就了具有保健养生价值的6大天然理疗环境，这里是人类为细胞充水、充氧、充磁、充电、充钙理想的养生天堂，是重要的国际矿泉环境医学研究基地，十分适合康养产业发展。\r\n\r\n', '康养产业', '康养', '黑龙江五大连池风景区经济开发区', '36', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200326142826711.docx');
