INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (824, 'd133f684-c32d-11ea-8a5d-00ff338109dc', '年产10万吨SBCs项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '160000万元（24696.0万美元）', '220000', '重点', '7.3', '22300', '33100', '筹划', '无', '', '', '大庆高新区石化产业促进中心', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '苯乙烯-丁二烯-苯乙烯嵌段共聚物（SBS）是苯乙烯热塑性弹性体（SBCs）系列产品中产量和消费量最大的一种，以之为原料生产的橡胶制品、改性树脂等产品对支撑黑龙江省及东北地区制造业发展具有重要作用，SBS的加氢产物SEBS性能更优，有利于提升当地合成橡胶产品档次及产业竞争力。预计2020-2025年，我国SBS年均复合增长率约为4.5%，2025年国内SBS需求量将达到118万吨。BS生产所需的苯乙烯可由大庆石化供应，新增碳四原料经分离后得到正丁烯，正丁烯脱氢生产丁二烯，作为本项目配套装置，此外，SEBS生产所需的氢气也可来自大庆石化，因此，本项目具备一定原料优势。', '石化产业', '石化', '大庆高新技术产业开发区', '7', '2021-08-10 10:22:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200711122806042.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (825, 'd1b425cc-735e-11ea-b0bb-ac1f6b639ec0', '青冈县白鹅产业园项目', '绥化', '青冈县', '绥化-青冈县', '农、林、牧、渔业', '第一产业', NULL, '独资', '50000万元（7717.5万美元）', '80000', '重点', '2.5', '20000', '1000', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '800', '年繁育白鹅500万只，进行养殖饲料加工、鹅雏孵化、白鹅屠宰、肉食深加工和羽绒加工等，全产业链项目。大鹅产业具有投资少、周期短、风险低、效益高的特点，产业涉及育种、饲养、屠宰、加工等多个环节，连接龙头企业、养殖基地、农户多方利益，具有较高的辐射效应,易形成相关的产业群。我县白鹅繁育体系健全，有继东白鹅孵化基地。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江青冈经济开发区', '14', '2020-05-30 16:53:56', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200407110221790.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (826, 'd2829f4c-82d9-11ea-b0bb-ac1f6b639ec0', '绿色冷链发展中心项目', '齐齐哈尔', '泰来县', '齐齐哈尔-泰来县', '制造业', '第二产业', NULL, '独资', '76000万元（11730.6万美元）', '25000', '一般', '11', '7000', '700', '筹划', '无', '', '', '泰来县经济合作促进局', '袁彦冰', '13803635039', 'tljhjyyb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '项目占地20万平方米，建设电商平台、冷链物流、销售终端和消费端等，包括恒温库房、冷链运输车辆厂站、鲜米加工车间等设施。通过研发、培育优势特色产品，借助冷链物流和新型生态电商平台，销售区域绿色农副产品。', '电子商务产业', '电子商务', '黑龙江泰来经济开发区', '72', '2020-06-04 14:06:16', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521165918540.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (827, 'd34a0b03-735e-11e8-a795-ac1f6b639ec0', '北林区保税区B型试验区建设项目', '绥化', '北林区', '绥化-北林区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '300000', '重点', '4.5', '22000', '5500', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '240', '以营口港绥化陆港为依托，在东富工业园区建设北林区保税区B型试验区建设项目。规划占地面积20万平方米，主要建设物流仓储库房10万平方米，分拣加工车间5万平方米，建设保税试验区物流联动平台、专业物流电子信息平台系统、金融服务平台、物流企业信用平台等，计划实现年贸易交易额30亿元。提升绥化市区与营口港出海通道运作效率，畅通与黑河口岸的内陆出关通道，实现国际口岸、港口功能的内移，打造外向型产业培育集聚区。', '物流产业', '物流', '其它', '37', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115303875.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (828, 'd3926ca8-755c-11ea-b0bb-ac1f6b639ec0', '牡丹江市米酒生产加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '28000', '重点', '5', '4000', '1700', '筹划', '有', '', '', '牡丹江市食品加工产业加工专班', '吴思琪', '15604535477', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '80', '近年来，酒类行业收入总体保持稳定增长，利润总额有所增加。\r\n牡丹江市拥有水稻面积超4万公顷，适合发展米类精深加工项目。同时，牡丹江是全国第二大朝鲜族聚集地，而米酒正是朝鲜族特色美食之一。牡丹江市对于发展米酒加工生产项目不仅可提供优良的加工技术，还有广阔的市场前景。\r\n该项目预计占地面积4万平方米，主要建设米酒酿造标准化车间、发酵区、储罐区、包装区及相关配套附属设施。', '农业及农副产品精深加工产业', '水稻深加工', '牡丹江经济技术开发区', '14', '2020-05-29 15:17:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522095049711.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (829, 'd3c3c000-77d5-11ea-b0bb-ac1f6b639ec0', '牡丹江市秸秆气化发电供热项目', '牡丹江', '市辖区', '牡丹江-市辖区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '9000', '重点', '11', '1350', '500', '筹划', '有', '', '', '牡丹江市产业专班', '董  葳', '15724753463', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '50', '牡丹江市区和海林市农作物种植面积为141.21万亩，即项目所在地半径30公里秸秆总产量为150.35万吨（含玉米秸秆、大豆秸秆、水稻秸秆和木耳菌糠）。项目每年消耗农作物秸秆4万吨，项目地区能够满足项目燃料需求。\r\n主要建设两座生物质热解线路，占地约5万平方米。', '节能环保产业', '秸秆综合利用', '牡丹江经济技术开发区', '21', '2020-05-29 16:30:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521141705999.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (830, 'd3f17018-74d2-11ea-b0bb-ac1f6b639ec0', '食品杂粮饮料及红豆肽口服液', '七台河', '勃利县', '七台河-勃利县', '农、林、牧、渔业', '第一产业', NULL, '合资', '8000万元（1234.8万美元）', '15000', '一般', '3', '3500', '1000', '筹划', '无', '', '', '勃利县经济合作促进局', '高凤山', '13804877214', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '勃利县是全国商品粮基地县，原材料供应充足。勃利县劳务市场活跃，劳动力资源与周边地区和发达地区相比，资源比较富集，用工价格比较低廉，就业人员培训基础好，可为企业提供充足的技术工人。公司开发的新产品“活力餐”、“能量餐”、“智力餐”等即食食品满足了婴幼儿、中老年及学生用餐，公司年生产加工各类豆制食品2.1万吨，产值2.78亿元，公司生产的产品经各级检测部门检测全部达标，产品获得A级绿色食品认证并通过了国家质量管理体系认证，市场前景广阔。建设内容：年生产5000吨杂粮饮品、200吨红豆肽口服液。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江勃利经济开发区', '24', '2020-05-29 14:22:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174310970.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (831, 'd46ffdcd-730b-11ea-b0bb-ac1f6b639ec0', '望奎县马铃薯全粉加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '重点', '5', '3000', '500', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '马铃薯淀粉不仅是烹饪美食的好食材，而且更广泛应用于方便食品、香肠、火腿肠、膨化食品等生产中。目前我国对马铃薯淀粉的需求迅猛增长，为马铃薯淀粉项目发展创造更广阔市场前景。望奎县马铃薯种植面积近20万亩，总产40多万吨，且周边市县商品薯可达80万吨。1998年我县“黄麻子”土豆就注册了全国第一例薯类商标，2003年通过绿色食品标识认证，生长于寒地黑土具有薯形好、芽眼浅、口感好特点，为马铃薯全粉生产加工提供可靠原料保障。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江望奎经济开发区', '17', '2020-06-02 14:26:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521122058521.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (832, 'd47d2bf9-7d25-11ea-b0bb-ac1f6b639ec0', '恒山区石墨烯生产项目', '鸡西', '恒山区', '鸡西-恒山区', '制造业', '第二产业', NULL, '其他', '100000万元（15435.0万美元）', '60000', '一般', '7', '14000', '6600', '筹划', '无', '', '', '恒山区发展和改革局', '董勇霖', '04672457777', 'jxshsqfgj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '260', '石墨烯不仅是已知材料中最薄的一种，还非常牢固坚硬；作为单质，它在室温下传递电子的速度比已知导体都快。具有高导电、高强度、高韧度、高比表面等特性，广泛应用在电子、新材料、航天军工等领域，发挥重要的甚至是革命性的作用，市场应用前景非常广阔，未来发展空间巨大。建立石墨烯研发基地、规模化生产。', '新材料产业', '石墨烯', '黑龙江鸡西经济开发区', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525093609768.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (833, 'd5218884-7d05-11e9-815b-ac1f6b639ec0', '兴和现代农业生态公园项目', '绥化', '北林区', '绥化-北林区', '住宿和餐饮业', '第三产业', NULL, '独资', '28000万元（4321.8万美元）', '18000', '重点', '5.6', '5000', '1000', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '180', '北林区兴和朝鲜族乡是绥化市唯一的朝鲜族乡，具有独特的民族文化风情。兴和现代农业生态公园项目以民族特色文化为牵引，以绿色有机食品为特色，以生态农业为依托，以娱乐、餐饮、休闲、养生为载体，项目建成后将成为北林区首家集生态与文化、观光与休闲、旅游与度假、养生与养老深度整合的农业生态公园。项目以现有的朝鲜族特色乡为基础，拓展生态农业产业链条，打造综合性的旅游观光园。', '旅游产业', '旅游', '其它', '31', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521113944397.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (834, 'd5b99ea6-74d6-11ea-b0bb-ac1f6b639ec0', '明水县葵花籽综合深加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '重点', '3', '7000', '1190', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '150', '优质葵花籽油澄清透明、色泽浅淡，拌、炒、煎、炸均宜，葵香淡雅，自然爽口，色味诱人，不油腻，口感特佳。极少油烟经AOM质安性测试显示，葵花籽油在110摄氏度的高温下，油质可保持25小时不变，而一般的油类只能保持3至6小时。可见，葵花籽油是耐高温炒炸的理想食用油。该项目采用成熟可靠的工艺技术，先进合理的生产设备，使整个生产过程力求做到高起点、高标准，低消耗、高产出，具有国内同行业水平。项目总投资2亿元，固定资产投资1.2亿元，包括土建工程7000万元，设备投资5000万元。项目建成后，可安置150余人闲散待就业劳动力。\r\n', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江明水经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521114840474.doc');
