INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (839, 'd739fc8e-7fae-11ea-b0bb-ac1f6b639ec0', '脱水蔬菜加工项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '制造业', '第二产业', NULL, '独资', '8000万元（1234.8万美元）', '6000', '一般', '7.5', '1500', '300', '筹划', '无', '', '', '甘南县经济合作促进局', '赵文涛', '18045237733', 'yw@yw-brg.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '30', '新建年产脱水蔬菜： 脱水南瓜粒1000吨，2000吨南瓜粉，脱水土豆粒2000吨，脱水胡萝卜粒3000吨，脱水红辣椒500吨，脱水墨西哥辣椒500吨，脱水菠菜500吨；冷冻蔬菜：10000吨速冻南瓜，冷冻各类蔬菜3000-5000吨，以甘南县区域具有强势的农产品瓜类品种为发展导向，同时发展各类蔬菜产品的深加工开发与销售，带动农民土地种植种类的扩展，增加本地农产品走向世界市场的品种种类，为地方百姓谋福利，社会效益好。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江甘南经济开发区', '34', '2020-06-04 14:05:11', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522161629708.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (840, 'd75834a0-730c-11ea-b0bb-ac1f6b639ec0', '望奎县水稻综合加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '重点', '3.5', '6000', '360', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '大米含碱溶性谷蛋白80%，赖氨酸、氨基酸组成配比合理，蛋白质可消化性超过90%，均高于其它谷物。该项目采用先进的工艺技术，从大米中萃取大米蛋白、麦芽糖等系列产品。目前，美国等发达国家已把大米蛋白应用到医药、保健品、化妆品和蛋白质工程等高新领域，并普及到婴儿食品、低过敏性食品、高档代乳品和发泡剂等领域。望奎县水稻种植面积在15万亩以上，年产稻谷8万余吨。且大米品质好、绿色无公害。同时周边市县大米商品量达30万吨以上，原料保障充足。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江望奎经济开发区', '24', '2020-06-02 14:30:41', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200331130237767.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (841, 'd783f355-73ef-11ea-b0bb-ac1f6b639ec0', '牡丹江市中药保健品生产加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '合资', '40000万元（6174.0万美元）', '50000', '重点', '8', '5000', '1900', '筹划', '有', '', '', '市生物医药专班', '刘君文', '13836379955', 'jhjxmglk@163.com', '牡丹江市经济合作促进局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '依靠牡丹江市拥有的山参、细辛、刺五加、黄芪、杜鹃、五味子、桔梗、防风等500余种药用植物，年贮量20余万吨资源，加快北药开发。依托东北及俄罗斯中药材自然资源优势，发挥好中药材种、养殖基础和筛选本地特色的优势中药材品种，基地建设，打造中药行业上游产业，做强现代中药产业。\r\n项目预计占地400公顷，拟建产品技术研发实验室、生产车间、仓储库房及成品展示厅。建立适合大规模生产的自动化生产线。水、电、气、土地等配套设施，执行符合国家级经济园区政策。', '中医药产业', '中医药', '牡丹江经济技术开发区', '13', '2020-05-29 14:22:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522142832956.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (842, 'd809ff55-73c5-11ea-b0bb-ac1f6b639ec0', '佳木斯市蔓越莓种植扩建及深加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '制造业', '第二产业', NULL, '独资', '150000万元（23152.5万美元）', '80000', '一般', '7', '23000', '8000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '蔓越莓因其独特的口感、高花青素和维生素C，被誉为“超级水果”，广泛应用于食品及保健品中，深受国人喜爱。抚远与北美蔓越莓主产区处于同一纬度，具有相似的土壤、气候和水源等自然生态条件，十分适宜蔓越莓的种植。2019年抚远蔓越莓一期种植面积已达到4200亩，实现丰产500亩，结果量600吨。以蔓越莓果实为原料，生产嚼片、果汁、果醋、果干等食品和保健品，可构建蔓越莓生产、种植、仓储、深加工、销售的完整产业链，还能带动旅游、文化、休闲等相关产业发展。本项目位于抚远市东安村，规划种植面积3万亩，建设内容包括土壤改良、试验基地、种苗繁育基地、检测中心、冷库、仓储库及其它附属配套设施等。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521171804444.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (843, 'd92cb9ad-7346-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产10万吨米制主食项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '36000万元（5556.6万美元）', '75000', '一般', '4', '20000', '10000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '80', '随着生产生活节奏的加快，方便食品越来越受到出差旅游人员、上班族、学生、网虫一族等一系列人群的青睐，方便米粉、米饭以味道香、口感好、覆水后不会夹生及方便、快捷又富有营养等优势成为该群体的首选食品。据相关咨询公司的分析，方便米饭市场潜力巨大，仅在市场导入期就有30-50亿元的市场容量。拟新建年产4万吨快餐米粉生产线1条，6万吨高蛋白米饭生产线1条；建设稻谷原料仓储、原料预处理车间、生产车间、包装及后处理车间、成品库等。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江汤原经济开发区', '576', '2020-07-08 17:26:42', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707103841448.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (844, 'd94f58bc-58e0-11e8-a5b9-ac1f6b639ec0', '优质猪肉精深加工及出口项目', '绥化', '兰西县', '绥化-兰西县', '制造业', '第二产业', NULL, '独资', '26000万元（4013.1万美元）', '50000', '重点', '3', '9000', '3000', '筹划', '无', '', '', '绥化市经济合作局', '鲁怡彤', '13763750328', 'suihuazhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '该项目位于绥化市兰西县，占地5万平方米，厂房建筑4万平方米（生产车间、仓储、验检、办公等设施），购置罐头、特色猪肉加工生产线各2条，火腿肠等生产线4条，年产肉制品3万吨。绥化市农牧业资源优质丰富，生猪饲养有传统优势和集群优势，辖区内有“全国生猪调出大县”，“东北民猪之乡”。劳动力和土地供应充裕且成本低，能源充足、交通发达，适于发展优质猪肉加工项目，建设对外猪肉出口加工基地。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江兰西经济开发区', '195', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (845, 'd95e9bf3-cf41-11eb-a12f-00ff338109dc', '光伏+北药种植项目', '鹤岗', '兴山区', '鹤岗-兴山区', '制造业', '第二产业', NULL, '独资', '450万元（69.46万美元）', '1050', '一般', '2', '315', '40', '筹划', '无', '', '', '鹤岗市兴山区商务局', '李想', '13634689092', 'hgxsqswj@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '20', '该项目拟占地100公顷，采取“板上发电，板下药材”农光互补模式。光伏板下适宜种植铁皮石斛、覆盆子、白芍、白术、金线莲、三叶青等喜阴的中药材。2年成熟后可采收525吨，产生销售收入1050万元，利润600万元，提供就业岗位60个。随着人们对健康的重视，天然药物替代一些化学药物已成为医药市场发展的新趋势。', '农业及农副产品精深加工产业', '其它', '其它', '5', '2021-08-06 16:09:35', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (846, 'da15aeb0-8055-11ea-b0bb-ac1f6b639ec0', '阿木尔林业局萨布素军马场景区项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '居民服务、修理和其他服务业', '第三产业', NULL, '合作', '4015万元（619.72万美元）', '4800', '重点', '4', '960', '125', '可研', '无', '', '', '阿木尔林业局招商办', '刘忠来', '18845747099', 'gw_amezsb@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '60', '萨布素军马场地处阿木尔林业局，紧靠大兴安岭黄金旅游线路（G331），是黑龙江和大兴安岭重点打造“黄金之路”自驾旅游线路上的重要节点。该项目占地面积466.33公顷,拟建设综合服务区、萨布素军马场文化体验区、军马场湿地生态科普区，共包括生态停车场、集散广场、游客服务中心、房车营地、景区大门、交通换乘驿站、额木尔河游船码头、额木尔河吊桥、祈福栈道、北极莲花树广场等共计28子项目。', '旅游产业', '旅游', '其它', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525151500615.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (847, 'da15dcb5-732b-11ea-b0bb-ac1f6b639ec0', '望奎县黄肉牛屠宰加工项目', '绥化', '望奎县', '绥化-望奎县', '制造业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '30000', '重点', '6', '9000', '2700', '筹划', '无', '', '', '望奎县财源经济合作服务中心', '刘晓东', '18645542345', 'wkzhaoshang@126.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '500', '近年来在人们食品结构中，对牛、羊肉的食用比例越来越大。随着人们生活质量和生活水平的提高，牛肉已成为人们餐桌上不可缺少的一道佳肴，现在的牛肉市场供应日趋紧张，对肉牛屠宰水平提出了更高的要求。望奎县目前市场黄肉牛存栏15.5万头，对肉牛屠宰加工及毛皮、内脏、骨胶的精深加工等产业项目尚属空白。黄肉牛的饲养、繁育及屠宰加工项目具有广阔市场空间。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江望奎经济开发区', '23', '2020-06-02 14:35:57', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521112339792.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (848, 'da247d84-9b26-11ea-8a5d-00ff338109dc', '北药饮片及有机杂粮代餐粉混合加工项目', '大兴安岭', '呼玛县', '大兴安岭-呼玛县', '农、林、牧、渔业', '第一产业', NULL, '合作', '3000万元（463.05万美元）', '8000', '重点', '4', '800', '200', '可研', '有', '', '', '加格达奇区发改局', '刘涛', '18645719911', 'jqswj03@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '代餐粉集营养均衡、效果显著、食用方便等优点于一身，未来其将越来越受到消费者的欢迎。项目拟利用大兴安岭地区丰富的北药资源、高品质的杂粮资源，将可食用的北药饮片药材与代餐粉混合加工，生产面向发达地区人群的高端代餐食品。投资3000万元建设功能性代餐粉生产线及辅助工程，购置全自动隧道式微波熟化设备、配套北药饮片及杂粮前处理等设备，年产功能性代餐粉2000吨。 ', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江加格达奇经济开发区', '31', '2020-06-03 15:36:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521134935883.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (849, 'da68a6f8-6d50-11e8-96d9-ac1f6b639ec0', '通河县乌鸦泡特色小镇建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '其他', '12000万元（1852.2万美元）', '10000', '重点', '4', '3000', '2000', '筹划', '无', '', '', '乌鸦泡镇旅游局', '曲艳艳', '13796141345', 'jiangnan9582@qq.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '50', '项目建设地点在通河县东南部，位于哈尔滨市2小时经济圈内。乌鸦泡镇幅员面积132平方公里，山清水秀，鸟语花香，景色优美，旅游资源十分丰富。拟建设观赏韩乡蔬菜基地、小八家子的有机蔬菜园、柞树岗的稻作公园、乌鸦泡生态鱼村、五四民俗村、联合大湿地等旅游项目。乌鸦泡镇着重打造关东风情村和民俗特色村。该项目将满足周边市民旅游需要。', '旅游产业', '旅游', '黑龙江通河经济开发区', '112', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524214245756.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (850, 'dac05d80-843e-11ea-b0bb-ac1f6b639ec0', '温泉果蔬精深加工项目', '大庆', '林甸县', '大庆-林甸县', '农、林、牧、渔业', '第一产业', NULL, '独资', '45000万元（6945.75万美元）', '100000', '一般', '5', '10000', '6000', '筹划', '无', '', '', '林甸县项目推进管理办公室', '段福臣', '13351393013', 'ldzsyz@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '300', '随着我国果蔬质量水平的提高，采后处理设施和技术的改进，我国果蔬生产的气候资源和低成本的优势将得到进一步发挥，保鲜果蔬出口还有很大的发展空间。林甸县地热资源静态储量1810亿立方米，是国内特大型中低温地热田。水中富含硒、硅、碘、锌等20多种微量元素，水质世界一流，为县培育出优质果蔬提供保障。\r\n项目占地面积50亩，拟引进国内外先进的蔬菜清洗设备、蔬菜分选设备，新建冻鲜蔬菜生产示范园区，包括蔬菜加工包装车间、冷库、实验检测楼、综合办公楼、蔬菜储藏仓库等。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江林甸经济开发区', '5', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521142319592.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (851, 'dae68b52-725c-11ea-b0bb-ac1f6b639ec0', '乳品饮品精深加工项目', '绥化', '肇东市', '绥化-肇东市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '30000', '重点', '7', '3000', '390', '筹划', '无', '', '', '肇东市招商引资服务中心', '傅吉丽', '04557990608', 'zd-zsyzj@163.com', '绥化市经济合作局', '刘畅', '13555361177', 'suihuazhaoshangju@163.com', '200', '肇东市是著名的“中国乳业之乡”，年存栏奶牛47000头，奶牛泌乳牛22000头，日出奶量近600吨。该项目坐落于肇东经济开发区，预计总投资2亿元，全部由企业自筹。预计建成达产后年销售收入3亿元，利润3000万元，税收390万元。吸纳就业人数约200人。', '农业及农副产品精深加工产业', '乳品', '黑龙江肇东经济开发区', '16', '2020-05-31 22:40:09', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521154800261.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (852, 'dafdd11c-75a1-11ea-b0bb-ac1f6b639ec0', '年产2万吨锂电负极材料项目', '七台河', '市辖区', '七台河-市辖区', '采矿业', '第二产业', NULL, '独资', '15300万元（2361.55万美元）', '31500', '一般', '2', '9000', '2900', '筹划', '无', '', '', '七台河经济开发区投资合作促进局', '王显龙', '16604648525', '504218118@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '七台河市各类资源丰富,有煤炭、黄金、石墨、膨润土、花岗岩等十余种,尤以煤炭最为丰富。是国家保护性开采的三个稀有煤田之一。石墨烯因具有良好的抗拉性、透光性、导电性、导热性，被誉为新世纪的“材料之王”。目前七台河市辖区内已探明石墨储量4.78亿吨，矿物量3248万吨，具有储量丰富、品位高、鳞片大等特点，为产业发展提供了原料保障。建设内容：投资1.53亿元，建设年产2万吨天然石墨提纯生产线。', '新材料产业', '石墨烯', '黑龙江七台河经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522164129767.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (853, 'db5193e8-8081-11ea-b0bb-ac1f6b639ec0', '大豆制品项目', '齐齐哈尔', '依安县', '齐齐哈尔-依安县', '农、林、牧、渔业', '第一产业', NULL, '独资', '50000万元（7717.5万美元）', '20000', '一般', '5', '5000', '1000', '筹划', '无', '', '', '依安县农业农村局', '卞海', '13846254888', 'ya7022270@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '100', '投资生产线20条。其中一期计划投资2.2亿元，上马生产线6条及20条生产所需的附属配套工程，二期计划投资2.8元，上马生产线14条。项目达产后年可加工黄豆一万吨以上，生产腐竹、豆油皮等产品的产值实现两亿元以上。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江依安经济开发区', '136', '2020-06-04 14:06:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521151105166.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (854, 'db61ebb3-57e6-11e8-a5b9-ac1f6b639ec0', '等静压石墨生产项目', '鹤岗', '萝北县', '鹤岗-萝北县', '采矿业', '第二产业', NULL, '合资', '12000万元（1852.2万美元）', '15000', '一般', '4', '3000', '500', '筹划', '无', '', '', '萝北县园区办', '谢东伟', '15094537333', 'xdw2063@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '60', '本项目建设地点在萝北县石墨园区，计划占地5000平方米，规划建设主体工程：年产3000吨等静压石墨生产线及生产车间、宿舍楼、办公楼等，工艺技术：磨粉→配料→混合→二次磨粉→压制。主要设备有：等静压机、磨粉机、轧辊机、混合机、模压机等。\r\n\r\n', '新材料产业', '石墨', '黑龙江萝北经济开发区', '51', '2021-08-10 10:40:24', '');
