INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (858, 'dbe456e6-74d8-11ea-b0bb-ac1f6b639ec0', '年产10万吨1.4-丁二醇项目', '七台河', '勃利县', '七台河-勃利县', '制造业', '第二产业', NULL, '合资', '100000万元（15435.0万美元）', '13000', '一般', '15', '3900', '1100', '筹划', '无', '', '', '勃利县经济合作促进局', '贾利琦', '13846499855', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '建设内容：建设年产10万吨煤气产业链生产1.4-丁二醇（BDO），深度开发聚对苯二甲酸丁二醇脂（PBT）、Y-丁内脂（GBL）、聚氨酯（PU）、四氢呋喃、共聚多酯醚、聚四甲撑乙二醇醚、N-甲基吡咯烷酮（NMP）、聚乙烯吡咯烷酮、农药、除草剂、溶剂、增湿剂、医药中间体、胶粘剂等下游产品。', '新材料产业', '复合材料', '黑龙江勃利经济开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174650076.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (859, 'dc8fdc3d-734a-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产100万吨玉米汁加工项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '35000', '一般', '4', '10000', '2000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '玉米含有丰富的膳食纤维、卵磷脂、植物蛋白、胡萝卜素、VB1、VB2、VE以及钙、镁、硒等多种微量元素，为粗粮杂粮主要代表，已逐渐成为现代人平衡膳食，均衡营养，回归自然的潮流食品。以提升鲜玉米附加值为目标，采用现代工艺加工的鲜玉米汁系列饮料，满足了人们在不同季节对鲜玉米的需求。玉米汁饮料是以玉米为原料，采用淀粉酶、糖化酶酶解工艺，水解玉米中的淀粉，生产出澄清透明的饮料。以一个80万人口的中等城市的消费水平为例，估算一年的销售量大体在3000吨以上约合240万升，市场前景广阔。 建设生产车间、冷库、库房、办公室、门卫及车库。购置玉米生产线10条，最终形成年产100万吨玉米汁生产能力。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江汤原经济开发区', '7', '2021-08-11 11:33:56', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707110049697.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (860, 'dcc5ab7f-a17f-11ea-8a5d-00ff338109dc', '年产50台油气增产作业装备项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '25000万元（3858.75万美元）', '40000', '一般', '7', '3500', '2200', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '本项目拟用地3万平方米,建筑面积3.5万平方米。本项目分两期进行，一期以制造固井装备、水处理设备为主，厂房总面积2万平。二期在原有基础上进行新型处理设备研发。', '石化产业', '石化', '大庆经济技术开发区', '14', '2020-05-30 16:09:25', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529154152485.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (861, 'dd0a471e-73cd-11ea-b0bb-ac1f6b639ec0', '绥棱县数据小镇升级扩建项目', '绥化', '绥棱县', '绥化-绥棱县', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '30000', '重点', '5', '3000', '700', '筹划', '无', '', '', '绥棱县招商服务中心', '蒋立柱', '15636932939', 'suilingzhaoshangju@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '600', '该项目主要依托绥棱数据小镇项目进行建设，设计整体升级拓展百度数据审核等相关业务；建设“快手、火山、抖音、好看、西瓜”等微视频的主播托管、孵化、成长基地；承接其它互联网科技企业服务外包数据审核项目；同步建设绥棱电子商务运营中心以及动漫产业孵化工作室等业务。目前，入驻数据小镇电商30多家，入驻主播公会3家，网红60多人，并与广州神起、杭州顺网科技、北京热热网络科技共同开发建设手游开发、云PC基站、大数据机房等配套项目。', '新一代信息技术产业', '新一代信息技术', '黑龙江绥棱经济开发区', '21', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521201516134.doc');
