INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (864, 'dd29dd93-7553-11e9-815b-ac1f6b639ec0', '富锶含硼冷淡饮用水项目', '齐齐哈尔', '讷河市', '齐齐哈尔-讷河市', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '25000万元（3858.75万美元）', '100000', '一般', '10', '20000', '8000', '筹划', '无', '', '', '讷河市经济合作促进局', '杨扬', '15845230006', 'jhjzsb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjzsb@163.com', '50', '讷河市二克浅镇天然苏打水水源井井深72米，揭露地层为第三系依安组中砂岩、中细砂岩中，含水层顶板埋深40米，系孔隙层间承压水，周围区域补水条件好，水量稳定而丰富，出水量480立方米/日，从未出现枯竭现象。该苏打水化学类型为碳酸氢根—钠离子型水，溶解性固体564.95—587.43毫克/升，锶含量0.40983—0.46583毫克/升，酸碱度7.7—8.0（日本、俄罗斯、法国、德国的标准值为7.5—8.5），故被勘测单位定名为锶质饮用天然弱碱性苏打水。', '农业及农副产品精深加工产业', '矿泉水', '黑龙江讷河经济开发区', '32', '2020-06-04 14:04:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523111710258.doc');
