INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (869, 'df1d2e55-73dd-11ea-b0bb-ac1f6b639ec0', '佳木斯市鱼类休闲食品加工项目', '佳木斯', '抚远市', '佳木斯-抚远市', '其他', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '12000', '一般', '5', '3300', '800', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '45', '抚远地处黑龙江和乌苏里江两大界江交汇处，境内有江、河共27条，湖泊泡沼60多个，共有经济鱼类21科105种，水产资源十分丰富。抚远鱼品以其良好的品质深受广大消费者喜爱。多吃鱼类食品可延缓衰老，增加免疫力，改善胰岛素释放，降低血糖。利用我市丰富的鱼类资源加工鱼类休闲食品，不仅品种多、色泽好、风味独特、营养丰富，而且还方便携带，便于食用。本项目建设地点位于经济开发区，规划占地面积3万平方米，主要建设内容包括仓储配送中心、检测中心、食品加工中心、冷库及综合服务区等配套设施。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江抚远经济开发区', '17', '2020-06-02 14:30:34', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522140805183.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (870, 'df311f22-57dc-11e8-a5b9-ac1f6b639ec0', '大鹅生产基地开发项目', '鹤岗', '绥滨县', '鹤岗-绥滨县', '农、林、牧、渔业', '第一产业', NULL, '合作', '45000万元（6945.75万美元）', '82228', '一般', '3', '17804', '1324', '筹划', '无', '', '', '绥滨县商务局', '刘福林', '15145867636', 'sbxswj@126.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '200', '利用绥滨县资源及地域优势，发展大鹅的食品开发及羽绒制品的加工，形成饲养、屠宰、加工一条龙的绿色食品及副产品加工生产基地，拟建年饲养大鹅100万只的养殖基地和加工100万只的生产线。绥滨县有良好的水土及草原等自然资源，为大鹅的绿色养殖提供了保障。近几年，随着养鹅数量逐年上升，销售渠道、技术力量等十分雄厚。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江绥滨经济开发区', '164', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525140718746.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (871, 'dfe0cbc2-7365-11e8-a795-ac1f6b639ec0', '养生养老旅游度假区建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '居民服务、修理和其他服务业', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '42000', '一般', '3', '12600', '8400', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '120', '项目建设地点在哈尔滨市通河县，拟建设“氧洞”、“登山骑行”、温泉养疗、观光游览等项目。吸引周边县市人群到通河小假游，南方人群到北方避暑疗养，建设养老基地，开展养老服务，养生养老、消费和居住，建设老年人活动中心，设置50个床位。通河县生态环境优美，温泉蕴含极具保健作用的氟元素。旅游资源丰富，依托铧子山高负氧离子和二龙潭生态湿地优势。', '康养产业', '康养', '黑龙江通河经济开发区', '112', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524213553650.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (872, 'e02d5057-7304-11ea-b0bb-ac1f6b639ec0', '庆安县柳河参湖及五七小镇旅游项目', '绥化', '庆安县', '绥化-庆安县', '其他', '第三产业', NULL, '独资', '250000万元（38587.5万美元）', '66000', '重点', '13.9', '18000', '2500', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '500', '柳河水库是黑龙江百个最值得去的地方之一，柳河五七干校纪念馆是黑龙江红色旅游景区。柳河水库山清水秀，碧波荡漾，占地面积1.46万亩，其中水面积1万亩，水库总容量3980万立方米，属中型水库。本项目建设家庭旅游、文化探索、生态养生、商务会议。分七个功能区，综合游乐区、红色文化区、文化寺庙区、人参疗养区、酒店会议区、生态农业区、林木涵养区。打造红色文化和人参主题的生态旅游、养生度假的智慧型旅游度假区。', '旅游产业', '旅游', '黑龙江庆安经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521205436361.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (873, 'e0e4c948-a17d-11ea-8a5d-00ff338109dc', '年产8万片碳化硅单晶片项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '73363万元（11323.58万美元）', '99590', '重点', '6', '15480', '9527', '筹划', '无', '', '', '大庆经济技术开发区管委委员会', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '本项目规划占地面积3.5万平方米，计划建设生产车间、库房、配电室、办公用楼、宿舍楼等设施，将建成年产8万片碳化硅单晶片生产基地。本项目拟投入150台碳化硅单晶片生产、加工及配套设备，计划建成可实现年产年产8万片碳化硅单晶片的生产基地。', '新材料产业', '复合材料', '大庆高新技术产业开发区', '13', '2020-05-30 16:07:36', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200529152740407.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (874, 'e1718da3-759f-11ea-b0bb-ac1f6b639ec0', '清香型白酒项目', '七台河', '市辖区', '七台河-市辖区', '农、林、牧、渔业', '第一产业', NULL, '合资', '6000万元（926.1万美元）', '5000', '一般', '5', '1200', '1000', '筹划', '无', '', '', '七台河经济开发区投资合作促进局', '迟立成', '13339400670', 'kfqtzhzcj@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '200', '目前山东青岛琅琊台集团投资17亿元，建设年产10万吨葡萄糖酸钠项目、年处理玉米30万吨的淀粉加工项目、年产30万吨秸秆生物饲料项目和年产2万吨衣康酸项目已于2017年开工建设，总建设面积15万平方米，进行下游产业链延伸。建设内容：投资6000万元，建设清香型白酒生产线。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江七台河经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521125223984.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (875, 'e173e3b7-9cbc-11ea-8a5d-00ff338109dc', '玉米须颗粒冲剂生产加工项目', '齐齐哈尔', '泰来县', '齐齐哈尔-泰来县', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '5', '3000', '300', '筹划', '无', '', '', '泰来县经济合作促进局', '袁彦冰', '13803635039', 'tljhjyyb@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '拟日产20万袋玉米须颗粒冲剂生产线。每年需要消耗300吨玉米须。玉米须颗粒冲剂采用复合铝箔包装，具有服用剂量小、吸收较快、质量稳定、携带方便、易保存等特点，复合中高端人群需求。该生产线充分考虑和计算了整条生产线和各分系统的物料平衡关系，并考虑和计算了各分系统部分的正常运转、进出料输送、故障排除所需要的时间和各工序间的合理缓冲系数。所以该生产线投入生产后，能够连续、稳定地生产出统一品质的玉米须颗粒冲剂。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江泰来经济开发区', '24', '2020-06-04 14:03:49', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523142019822.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (876, 'e1e49d58-7305-11ea-b0bb-ac1f6b639ec0', '现代中成药研发生产基地项目', '绥化', '庆安县', '绥化-庆安县', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '120000', '重点', '4', '10000', '3000', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '50', '庆安县境内有人参、党参、刺五加、五味子等57科108种中药材。该项目主要以中药材为原料，生产中成药、饮片等产品。中药饮片在我国有庞大的消费群体，目前仍是中药临床用药的主要形式，是中药临床防病、治病的重要手段，也是中成药的中药原材料，行业需求呈现稳定增长态势，中药饮片产业拥有巨大的发展空间。该项目占地面积4万平方米，总建筑面积3.2万平方米，主要建设生产车间、灌装车间、办公室、职工宿舍等及购置生产线等。', '中医药产业', '中医药', '黑龙江庆安经济开发区', '4', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204822509.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (877, 'e3119b9d-6d7f-11ea-b0bb-ac1f6b639ec0', 'A2奶牛养殖及 A2有机婴幼儿配方乳粉生产项目', '齐齐哈尔', '甘南县', '齐齐哈尔-甘南县', '农、林、牧、渔业', '第一产业', NULL, '独资', '55000万元（8489.25万美元）', '10000', '一般', '7', '2900', '1000', '筹划', '无', '', '', '甘南县经济合作促进局', '赵文涛', '18045237733', 'gnxzsj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '50', '甘南县位于黑龙江省西部，饲草饲料资源丰富，地理环境、土地资源极适宜奶牛生产、乳制品生产。A2有机配方乳粉是高端婴幼儿配方奶粉，其β-酪蛋白与母乳中的β-酪蛋白相似，因而可能与母乳更接近，更有利于促进婴幼儿的生长发育。新建A2奶牛养殖场，占地约50万平方米；新建A2有机婴幼儿配方乳粉加工车间及附属设施，购置安装生产设备，占地约10万平方米，建筑面积约5万平方米。随着经济的持续增长，人们消费观念的变化，黑牛肉制品颇受高端消费者青睐，市场前景越来越好。', '农业及农副产品精深加工产业', '乳品', '黑龙江甘南经济开发区', '42', '2020-06-04 14:05:19', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522160936926.docx');
