INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (879, 'e43732c5-9c09-11ea-8a5d-00ff338109dc', '秸杆粪便综合利用项目', '鸡西', '鸡东县', '鸡西-鸡东县', '制造业', '第二产业', NULL, '其他', '15000万元（2315.25万美元）', '7500', '一般', '8', '2000', '1500', '筹划', '无', '', '', '鸡东县区域经济发展服务中心', '田军', '13904675001', 'jdxjhj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '100', '项目拟用地约100亩，建设厂房、库房等，购置天然气、有机肥生产设备。', '节能环保产业', '畜牧废弃物利用', '黑龙江鸡东经济开发区', '31', '2020-06-01 16:11:45', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165607760.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (880, 'e443503d-843b-11ea-b0bb-ac1f6b639ec0', '东方嘉禾物流项目', '大庆', '萨尔图区', '大庆-萨尔图区', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '6000', '一般', '7', '1500', '300', '筹划', '无', '', '', '萨尔图区商务局', '张鸿博', '13555507887', 'sqzsb2019@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '萨尔图区拥有全市规模最大、功能最全的物流园区，占地479万平方米。物流企业约80家、物流个体约180家，仓储企业约70家，全区铁路专用线10条，共计长度9519米，全区仓储面积达27万平方米，运力充足。\r\n东方嘉禾载体建筑面积30000㎡，二层框架式单体。一层长285米，宽40米，二层长285米，宽60米，层高均6.2米。水、电、暖设施已开通。载体南侧设有铁路专用线，货运十分便捷。配套建设有停车场，功能设施完善。该项目利用现有库房及运输设施，建设玉米、大豆及化肥仓储运输专业物流园。', '物流产业', '物流', '其它', '32', '2020-05-30 16:35:36', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521143254886.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (881, 'e49f0d74-7287-11ea-b0bb-ac1f6b639ec0', '生猪养殖、屠宰加工项目', '绥化', '海伦市', '绥化-海伦市', '农、林、牧、渔业', '第一产业', NULL, '独资', '40000万元（6174.0万美元）', '40000', '重点', '5.45', '8464.23', '1600', '筹划', '无', '', '', '海伦市经济合作服务中心', '姜大鹏', '04555725474', 'hlzhaoshang@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '180', '近年来，畜牧业由原来的家庭副业，转变为农业的一个主导产业，猪肉在人们的食物消费中占有很大比重。本项目主要生产原料直接面对农户，联接千家万户，对农民增产增收和农业发展有着直接的关系，对带动相关辅料、包装材料、运输服务等行业的发展起到一定的关联作用。项目拟建规模为产出栏10万头生猪养殖基地。项目计划占地面积100,000平方米，总建筑面积63,000平方米.', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江海伦经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521191056492.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (882, 'e4b208f0-736e-11e8-a795-ac1f6b639ec0', '肇东市高端稻米加工项目', '绥化', '肇东市', '绥化-肇东市', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '12000', '重点', '6', '3600', '900', '筹划', '无', '', '', '肇东市招商局', '王相涛', '04557782115', 'zd-zsyzj@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '200', '肇东市水稻种植面积40万亩，水稻总产量20万吨。以肇东为中心百公里半径内年产水稻168万吨。肇东全市城乡现有近40家小规模稻米加工企业，急需产能和品牌整合。项目建设规模为年加工30万吨水稻，占地面积10万平方米。主要建设制米车间、米糠预处理车间、浸出车间、米糠油精炼车间、稻壳燃料加工车间、成品油包装车间、大米库、稻谷储库、粮食烘干设施、储油罐等。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江肇东经济开发区', '191', '2020-05-27 11:21:54', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (883, 'e4bf98c0-7585-11ea-b0bb-ac1f6b639ec0', '牡丹江市城运城配仓储物流园项目', '牡丹江', '市辖区', '牡丹江-市辖区', '交通运输、仓储和邮政业', '第三产业', NULL, '合资', '30000万元（4630.5万美元）', '20000', '重点', '15', '2000', '200', '筹划', '有', '', '', '牡丹江市经合局', '徐海鸥', '13009885897', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '100', '仓储物流园是在物流作业集中的地区，在几种运输方式衔接地，将多种物流设施和不同类型的物流企业在空间上集中布局的场所，也是一个有一定规模的和具有多种服务功能的物流企业的集结点。\r\n项目利用裕民工业园区内5.3万平方米闲置厂房和厂地，改造现有厂房2.6万平米用于快消品分拨，新建厂房3栋12000平方米用于仓储物流，新建充电场站一座，设置充电桩40个，购置新能源配送汽车500台。', '物流产业', '物流', '牡丹江经济技术开发区', '14', '2020-05-29 15:37:31', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403163411689.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (884, 'e4c42320-ba03-11eb-a12f-00ff338109dc', '森之源休闲生态园项目', '鸡西', '虎林市', '鸡西-虎林市', '其他', '第三产业', NULL, '独资', '15000万元（2315.25万美元）', '12560', '一般', '5', '3768', '896', '筹划', '有', '', '', '黑龙江省森之源绿色食品有限责任公司', '高欣欣', '15636888251', '38073815@qq.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '45', '1.建设虎林森之源博物馆（分3层分别是黑蜂历史文化馆、虎林地区发展史、完达山室内景观科普教育基地）2.建设具有地域特色生态园（包括天鹅湖、熊乐园、温泉水疗等）3.打造有东北风情民宿。把森之源旅游品牌打造成集餐饮、休闲、旅游、度假、康养一体化经营，占地面积260亩建筑面积6000平方米。\r\n', '农业及农副产品精深加工产业', '其它', '其它', '3', '2021-08-10 09:52:23', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (885, 'e52224a1-9d86-11ea-8a5d-00ff338109dc', '海洋公园项目', '齐齐哈尔', '龙沙区', '齐齐哈尔-龙沙区', '其他', '第三产业', NULL, '独资', '50000万元（7717.5万美元）', '22000', '一般', '3', '4000', '300', '筹划', '无', '', '', '齐齐哈尔市龙沙区经济合作促进局', '张恒', '15845202234', 'lsqjhzx@163.com', '齐齐哈尔市经济合作促进局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '200', '这座集休闲、娱乐、科教、互动、体验为一体的综合性互动体验海洋馆，共有风情雨林区、梦幻水母区、海底奇观、动物剧场、儿童互动游乐、3D错觉艺术等六大特色区域， 让人们能够感受到最原生态的海洋世界，在与海洋生 物的“亲密接触”中，收获知识和快乐。集休闲、娱乐、科教、互动、体验为一体的综合性互动体验海洋馆，共有风情雨林区、梦幻水母区、海底奇观、动物剧场、儿童互动游乐、3D错觉艺术等六大特色区域。', '旅游产业', '旅游', '其它', '36', '2020-06-04 13:58:17', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524142241004.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (886, 'e598d1bb-74e9-11ea-b0bb-ac1f6b639ec0', '石墨烯下游应用项目', '七台河', '新兴区', '七台河-新兴区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '5000', '一般', '7', '1500', '500', '筹划', '无', '', '', '新兴区招商办', '冯帆', '13946575000', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '七台河市各类资源丰富,有煤炭、黄金、石墨、膨润土、花岗岩等十余种,尤以煤炭最为丰富。是国家保护性开采的三个稀有煤田之一。石墨烯因具有良好的抗拉性、透光性、导电性、导热性，被誉为新世纪的“材料之王”。目前七台河市辖区内已探明石墨储量4.78亿吨，矿物量3248万吨，具有储量丰富、品位高、鳞片大等特点，为产业发展提供了原料保障。建设内容：研发生产纯石墨烯导电剂、石墨烯纺织品。组建研发团队，建设纯石墨烯导电剂和石墨烯纺织品生产线。', '新材料产业', '石墨烯', '其它', '2', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522170206755.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (887, 'e5b112ce-73db-11ea-b0bb-ac1f6b639ec0', '佳木斯市农作物秸秆综合利用项目', '佳木斯', '抚远市', '佳木斯-抚远市', '其他', '第二产业', NULL, '独资', '25000万元（3858.75万美元）', '21000', '一般', '5', '6000', '2200', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '80', '秸秆是农作物成熟后所剩余的副产品，因其含有丰富的氮、磷、钾、钙、镁和有机质，被广泛应用于种植业、养殖业及农副产品加工业。抚远以农业种植为主，每年可生产稻草61万吨，大豆秸秆3.2万吨、玉米秸秆14.3万吨，在此基础上通过秸秆综合利用，可生产农用生物柴油燃料、秸秆有机肥、环保餐具、纸制品、秸秆生物饲料等，充分提高秸秆利用率，做到秸秆还田，减轻环境污染，保护生态环境，前景十分广阔。本项目建设地点位于抚远市浓桥镇，占地面积2万平方米，主要建设内容包括秸秆储草仓、农机具库房、生产车间、有机肥制作基地、办公楼、地坪、烘干塔及其它附属配套设施等。', '节能环保产业', '秸秆综合利用', '其它', '50', '2021-08-11 11:35:33', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102703829.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (888, 'e6961b1b-7af8-11ea-b0bb-ac1f6b639ec0', '健康养老建项目', '鸡西', '鸡冠区', '鸡西-鸡冠区', '居民服务、修理和其他服务业', '第三产业', NULL, '其他', '8000万元（1234.8万美元）', '8000', '一般', '8', '1000', '500', '筹划', '无', '', '', '鸡冠区投资合作促进局', '肖锋', '13504867678', 'jgqzsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '150', '项目建设鸡冠区域内，计划投资8000万元，占地面积2万平方米，建筑面积1.5万平方米，可入住500余人。主要建设老年福利院、后勤保障中心、照护中心、老年医疗卫生服务中心、综合性养老中心、适老卫浴、无障碍设施等配套辅助设施。', '康养产业', '康养', '其它', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525092107323.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (889, 'e6983324-73dc-11ea-b0bb-ac1f6b639ec0', '佳木斯市有机蔬菜种植项目', '佳木斯', '抚远市', '佳木斯-抚远市', '农、林、牧、渔业', '第一产业', NULL, '独资', '15000万元（2315.25万美元）', '12000', '一般', '5', '3000', '400', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '40', '随着经济的发展和人民生活水平的提高，人们对无公害农产品的需求愈来愈强烈，对蔬菜的喜爱和购买提出了高层次的需求，特别是“三无”绿色蔬菜更是得到消费者的青睐。推广绿色种植生产,促进规模经营,为发展农业产业化、规模化、合作化经营创造了条件。抚远市地处三江平原腹地，土壤肥沃,水源充足，交通便利，加之无工矿企业,空气清新,污染小，有利于有机蔬菜的生长。种植的优质有机绿色蔬菜将通过保鲜、包装、加工等方式，进入高端市场、各大餐饮机构，可大大提高商品附加值，经济效益明显。本项目建设地点位于通江乡，规划占地面积5万平方米，主要建设内容包括有机蔬菜种植区、生态农业度假区、仓储加工区、有机农业研发中心等。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '48', '2021-08-11 11:36:20', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707102550872.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (890, 'e6a90320-74ea-11ea-b0bb-ac1f6b639ec0', '新兴区风力发电机组生产组装项目', '七台河', '新兴区', '七台河-新兴区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '合资', '56000万元（8643.6万美元）', '50000', '一般', '3', '10000', '5000', '筹划', '无', '', '', '新兴区招商办', '夏士峰', '13029790055', '236998585@qq.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '按照火电煤耗每度电耗标准煤300g计算，投运后每年可节约标准煤约17万吨，减少灰渣排放12万吨，节约用水103万吨，节能减排效益显著，符合我国能源产业政策，经济效益和社会效益显著。建设内容：投资32亿元，用地面积26公顷，开发建设400MW风电场，架设128台风电机组。', '新能源产业', '风电', '其它', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522165608883.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (891, 'e6ab97b0-82d4-11eb-94a7-00ff338109dc', '黑河自贸片区徐工装载机俄罗斯建厂项目', '黑河', '市辖区', '黑河-市辖区', '制造业', '第二产业', NULL, '合资', '30000万元（4630.5万美元）', '55000', '一般', '6', '5000', '1500', '筹划', '无', '', '', '中国（黑龙江）自由贸易试验区黑河片区招商与项目服务中心', '李鹏亮', '18645645721', '18645645721@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '黑河和布拉戈维申斯克通过黑龙江公路大桥相连接，在黑龙江跨江空中隧道连接的中俄双方指定区域内，依托两国桥头区作为主要开发地带，构成跨境制造业集群的主体核心区。厂址设立于该区域，可依托黑龙江大桥的通道优势，以国际口岸为核心，配套布置旅检、货检等功能，重点发展保税加工和互市贸易等产业。俄方在其桥头区设立了“阿穆尔河沿岸超前发展区”，享有特殊税收优惠，平均税负在15%～20%；赋予入区企业大力产业扶持政策；出台多项规定，给予安全稳定的营商环境。依托地域及政策优势，在阿穆尔河沿岸超前发展区建设厂房60000平方米，办公楼5000平方米，职工宿舍及食堂3500平方米，购置组装工厂所需的生产设备，分销网点。', '现代商贸产业', '现代商贸', '黑河边境经济合作区', '1', '2021-08-10 09:54:45', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (892, 'e6cb7e8c-c0d9-11ea-8a5d-00ff338109dc', '年产600万平米汉麻石墨烯发热板材项目', '哈尔滨', '阿城区', '哈尔滨-阿城区', '制造业', '第二产业', NULL, '合作', '36000万元（5556.6万美元）', '70000', '重点', '3', '14000', '6000', '筹划', '无', '', '', '阿城区企业和投资服务局', '修立文', '13206755557', 'aczsyz@163.com', '阿城区企业和投资服务局', '郜效岩', '13936368827', 'aczsyz@163.com', '500', '汉麻新型建筑板材不含苯物质，零甲醛，防水、防臭、防虫.高防火性、能有效阻燃。防火等级达到B1-A2级，遇火自熄，不产生任何有毒气体。 轻量化高强，不龟裂，不膨胀，不变形，无需维修与养护。石墨烯发热模块是由电绝缘材料与封装其内的石墨烯发热电阻材料组成的平面发热元件。具有PTC效应的导电高分子编织层是实现电-热辐射转换的面状材料，具有理想的自限温功能，能产生远红外线，应用中有良好的节能性能，是一种高效安全的电热材料。\r\n汉麻健康板材和石墨烯发热模块结合一体化是理想的健康节能环保的电采暖新型建材，可广泛应用于南方改善型采暖需求和北方煤改电市场，具有广大的市场前景和空间。项目建设规划用地150亩。', '新材料产业', '其它', '黑龙江阿城经济开发区', '14', '2021-08-10 10:37:42', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (893, 'e6fa7dbc-8210-11eb-94a7-00ff338109dc', '北安市年产30万吨燃料乙醇项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '105000万元（16206.75万美元）', '197000', '重点', '6', '22000', '7000', '筹划', '有', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '400', '北安市位于哈尔滨、齐齐哈尔、伊春和黑河四座城市的中心地带，三条铁路干线在此交汇，四条高速公路和四条国家级公路再此互通，距五大连池机场30公里。市域内现有耕地516万亩，是国家级生态示范区和全国绿色食品玉米原料标准化生产基地,年产玉米500万吨，粮食仓储能力达400万吨。根据《黑龙江省玉米深加工产业发展指导意见》中指出，北安市位于玉米深加工7个布局片区内，目前北安市已通过“黑龙江省玉米燃料乙醇项目布局地点排序招标”，招标结果为北安市排序全省第三名。本项目主要产品为年产30万吨燃料乙醇，副产品为年产20万吨DDGS饲料等。项目年加工玉米90万吨。项目占地面积为30万平方米，总建筑面积15万平方米。', '新能源产业', '生物质能', '黑龙江北安经济开发区', '5', '2021-08-10 10:06:54', '');
