INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (895, 'e74f48fc-8465-11ea-b0bb-ac1f6b639ec0', '国际学校项目', '大庆', '市辖区', '大庆-市辖区', '教育', '第三产业', NULL, '合作', '30000万元（4630.5万美元）', '20000', '一般', '10', '3000', '90', '筹划', '无', '', '', '大庆高新区管委会', '大庆高新区新兴产业促进中心', '18645926543', '16645396016@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '500', '大庆市在读中小学生超过25万人，且大庆区位交通便利，可覆盖周边200公里内的哈尔滨、齐齐哈尔等生源。据了解，目前黑龙江省缺少有竞争力的知名的国际学校，很多教育消费升级需求，均选择在域外求学，大庆教育市场潜力较大。\r\n项目总投资3亿元，可由企业自筹或融资解决。项目谋划占地面积7万平方米，建筑面积10万平方米，建设教学楼、综合楼、宿舍楼和体育场馆等教育基础设施。项目建成并运营后，可优化大庆民办教育市场结构体系，提升大庆市整体教学实力，按照每人年收费8至10万元测算，年营业收入可实现2亿元,年利润3000万元。', '现代商贸产业', '现代商贸', '大庆高新技术产业开发区', '39', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422145259504.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (896, 'e86d35fe-8638-11e8-9218-ac1f6b639ec0', '年加工1万吨菇娘项目', '大庆', '肇州县', '大庆-肇州县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '15000', '一般', '5', '4000', '2000', '筹划', '无', '', '', '肇州县经济合作促进办公室', '孟令君', '13163554343', 'zzxjhb2013@163.com', '大庆市商务局', '裴风东', '13936948486', 'xmk6621216@163.com', '40', '项目建设地点在大庆市肇州经开区，占地面积4万平方米，建筑面积3万平方米。菇娘是肇州县特产，品质优良，产量高，原料充足。拟建设年加工菇娘1万吨生产线及相关配套设施。菇娘的浆果是一种食用与药用为一体的高级新型营养保健食品，产量和经济效益极高，市场前景广阔。项目达产后，可年产5000万罐罐头、5000吨果粉、10万瓶饮料等。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇州经济开发区', '193', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (897, 'e8b68550-7278-11ea-b0bb-ac1f6b639ec0', '玉米加工及仓储物流项目', '绥化', '庆安县', '绥化-庆安县', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '5000万元（771.75万美元）', '9200', '重点', '2', '2500', '375', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '04554341976', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '150', '庆安玉米种植面积约为70万亩，其土壤特殊、营养价值、规范管理、绿色标识等全国知名。庆安县以玉米产业加工为切入点，完善冷链物流、仓储等配套产业，在庆安县形成农业加工本地化的一产二产相配套的格局。形成集庆安旱地玉米种植、加工、仓储物流、销售为一体的产业经营联合体。年加工玉米肠50吨，玉米罐头100吨，玉米饮料100吨；建设玉米加工车间、仓储、新上4条生产线及仓储物流等。最终形成具有地方特色的品牌产业。', '物流产业', '物流', '黑龙江庆安经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521203658225.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (898, 'e8ce0dcd-6e5b-11ea-b0bb-ac1f6b639ec0', '年产3万吨桦树茸深加工项目', '黑河', '爱辉区', '黑河-爱辉区', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '69500', '一般', '3.1', '6845', '1711', '筹划', '无', '', '', '瑷珲对俄进出口加工基地', '刘洋', '17345605706', 'ahgyyq@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '30', '桦树茸是一种生长在白桦树上的野生珍贵药用真菌，具有广泛的药理作用和广阔的国际市场需求因桦树茸十分珍贵。桦树茸是饮料、调味品、饼干及面包类、香肠等加工类肉品、中药材的辅助品，是食用色素原料；将桦树茸提取液制成口服溶液，对预防病毒感染，抗肿瘤和提高免疫力都有很好的功效。在黑河市，桦树林分布极为广泛，我市有林地面积941168.4公顷，桦树林就占有40%的面积，约37.6万公顷，而很多桦树上生长着野生桦树茸，所以我市现在待开发的桦树茸资源非常丰富。项目占地面积6万平方米，设计产能年产3万吨桦树茸保健饮料、年产150吨桦树茸多糖提取物、年产2000吨桦树茸精粉胶囊。 ', '农业及农副产品精深加工产业', '果蔬加工', '其它', '475', '2020-06-04 14:37:42', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521200249654.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (899, 'e8d97e24-7d30-11ea-b0bb-ac1f6b639ec0', '炭黑综合加工项目', '鸡西', '滴道区', '鸡西-滴道区', '制造业', '第二产业', NULL, '其他', '7060万元（1089.71万美元）', '3700', '一般', '11', '630', '120', '筹划', '无', '', '', '滴道区发展和改革局', '刘丹祥', '13351177676', 'ddqfgj2455@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '35', '建设年产10000吨炭黑生产线，主要建设内容为原料油、焦炉煤气的供给；炭黑反应、空气/油预热和在线预热锅炉；炭黑收集与粉碎；湿法造粒与干燥；产品的贮存与包装；公用工程。主要建设生产车间厂房、库房、仓库、等其他辅助用房。', '煤炭精深加工产业', '煤炭深加工', '其它', '14', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200525104040937.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (900, 'e91e853d-7344-11ea-b0bb-ac1f6b639ec0', '佳木斯市玉米秸杆纤维浆粕及木糖醇生产项目', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '38000万元（5865.3万美元）', '35000', '重点', '5', '8000', '4000', '筹划', '无', '', '', '汤原县商务和经济合作局', '张壮', '15845410123', 'tyxyzj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '130', '主产品玉米秸杆纤维浆粕及副产品木糖醇，是以玉米秸杆为主要原料，通过高新技术生产工艺制作而成。主导产品玉米秸杆纤维浆粕可代替木浆和棉浆，是粘胶纤维、玻璃纸、无毒塑料、胶片、纤维素醚、喷漆、医药等行业的主要原料，在工业、农业、化工、环保上获得了越来越多的应用。本项目副产品木糖醇是一种白色晶体新型甜味剂，有较高的营养保健价值，广泛应用于化工、轻工、食品、医药等领域。该项目科技含量高，技术成熟，产品销路好，产品附加值高，应用领域广泛，发展前景广阔。汤原县是农业大县，玉米种植面积大，有丰富的原料资源优势。建设年产3.5万吨玉米秸杆纤维浆粕及年产4000吨木糖醇生产线及厂房。', '高端装备制造产业', '食品加工设备', '黑龙江汤原经济开发区', '7', '2021-08-10 10:44:08', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707140300232.docx');
