INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (903, 'e9b9d32f-8218-11eb-94a7-00ff338109dc', '北安市日无害化处理城市生活垃圾及农林垃圾300吨项目', '黑河', '北安市', '黑河-北安市', '水利、环境和公共设施管理业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '3600', '一般', '11', '900', '470', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '20', '北安市地处黑龙江省北部区域中心，是我国最北部铁路公路交通运输枢纽。其辖区100公里半径内包含多个城镇，辐射人口可达300万人。每日可产生生活垃圾约250吨，农林垃圾50吨。本次项目建设城市成活垃圾及农林垃圾无害化处理厂一座。预计日处理生活及农林垃圾300吨。厂区占地面积35000㎡，总建筑面积15000㎡，建设垃圾焚烧炉2台，配备2台1.5MW汽轮发电机组，塑料颗粒生产设备1套，有机质降解设备1套，污水处理设备1套。预计总投资10000万元。年可产出塑料颗粒1250吨，有机肥料1万吨。年焚烧发电量2500万度。', '节能环保产业', '畜牧废弃物利用', '黑龙江北安经济开发区', '3', '2021-08-10 10:00:21', '');
