INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (912, 'eb49d835-8442-11ea-b0bb-ac1f6b639ec0', '汽车排气系统生产项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '15000', '一般', '7', '1500', '1200', '筹划', '无', '', '', '大庆高新区管委会', '韩博强', '15164527375', 'hanboqiang@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '随着大庆沃尔沃整车制造增产上量，对其一级零部件供应商在周边建厂需求越来越迫切，为满足整车就近配套建厂，完善大庆汽车产业链条，计划引入汽车排气系统生产项目。市场前景方面，可以依托大庆沃尔沃整车产量，同时可辐射哈尔滨福特整车厂配套。项目建设的有利条件包括市场区位优势，大庆高新区已辟建汽车零部件产业园，可靠近整车厂就近建厂，实现集群化发展。\r\n项目规模为拟建设年产20万套汽车排气系统项目，建设内容包括投资建设汽车排气系统冲压、焊接、封装、总成生产线，主要产品为沃尔沃在庆投产车型汽车排气系统冷端及热端相关产品。项目建设地点为大庆汽车产业园内，目标企业要求需是沃尔沃供应商。', '汽车制造产业', '汽车服务', '大庆高新技术产业开发区', '21', '2020-05-30 16:35:10', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422104233804.doc');
