INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (915, 'ec483129-535a-11e8-ba35-ac1f6b639ec0', '兴安杜鹃种植项目', '双鸭山', '四方台区', '双鸭山-四方台区', '农、林、牧、渔业', '第一产业', NULL, '独资', '5100万元（787.18万美元）', '2700', '重点', '7', '810', '90', '筹划', '无', '', '', '四方台区发展改革局', '赵勇', '13555170808', 'bqxzsj@126.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '100', '该项目建设地点在紫云岭兴安杜鹃自然保护区，占地面积1.2万亩，现在野生兴安杜鹃已由保护工程实施前的110亩增加到现在的213.5亩。基础设施已经投入资金200万元。主要建设内容为：项目区土地覆土1.2万亩，规划项目区种植片区20片，新建育秧棚室8栋，硬化路面1.5公里，办公区1200平方米，水源井5眼，滴管管道2.5公里等。达到年产3600吨兴安杜鹃的能力。', '农业及农副产品精深加工产业', '果蔬加工', '其它', '203', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (916, 'ec4f6930-7267-11ea-b0bb-ac1f6b639ec0', '兰西县玉米深加工项目', '绥化', '兰西县', '绥化-兰西县', '制造业', '第二产业', NULL, '独资', '75000万元（11576.25万美元）', '80000', '一般', '5', '15000', '3000', '筹划', '无', '', '', '兰西县经济合作服务中心', '车德威', '18245599222', 'lxxzsj@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '1500', '玉米不仅是人们的口粮和“饲料之王”，也是重要工业原料，可加工成的工业产品达3000多种。来我国玉米工业加工迅速发展，消费的玉米大幅度增加，对我国乃至世界的玉米供求平衡和流通格局都产生了重大的影响。全面认识和深入研究玉米工业加工发展的重要作用及其所带来的影响，制定科学的发展对策，大力发展玉米精深加工产业，对于主动搞好粮食宏观调控，保持玉米供求平衡，促进我国经济健康发展都有着极为重要的意义。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江兰西经济开发区', '15', '2020-06-02 13:48:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521125343419.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (917, 'ec76dade-8517-11ea-b0bb-ac1f6b639ec0', '年产3万吨无纺布(SMS)系列产品项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '35000', '一般', '4', '3000', '2600', '筹划', '无', '', '', '大庆经济技术开发区', '张乐', '18746661957', 'dqetazl@126.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '100', '无纺布具有强力高、过滤性能好、不含粘合剂、无毒等优点。主要用于医疗卫生劳动防护产品如口罩、手术服、手术帽、防护服，洗手衣，手袋等。目前 SMS防粘无纺布产品在国内供不应求，部分产品出口，并且有相当大的应用领域尚未开发，市场前景较好。\r\n本项目规划占地面积3万平方米，拟投入50台（套）无纺布(SMS)生产及加工设备生产线，计划建成可实现年3万吨无纺布(SMS)生产、加工基地。', '新材料产业', '复合材料', '大庆经济技术开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521155059704.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (918, 'ec7dfd44-734d-11ea-b0bb-ac1f6b639ec0', '佳木斯市稻米综合利用项目', '佳木斯', '桦川县', '佳木斯-桦川县', '制造业', '第二产业', NULL, '独资', '40000万元（6174.0万美元）', '25000', '一般', '6', '7500', '2000', '筹划', '无', '', '', '桦川县商务和经济合作局', '石建刚', '15046478536', 'hczsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '120', '稻米综合利用项目拟在桦川县悦来镇选址，规划占地面积4.5万平方米。建设内容包括糖浆制品车间、大米蛋白车间、大米淀粉车间、成品仓库、低温冷库、锅炉房、围墙、硬化、绿化及亮化、办公楼、职工食堂及宿舍等土建工程。采购储浆罐、层流罐、高速洗渣机、糖化灭酶器、精密过滤器、冷却塔、料泵等设备。', '农业及农副产品精深加工产业', '水稻深加工', '黑龙江桦川经济开发区', '2', '2021-08-10 10:42:09', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707142344847.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (919, 'ec851c7f-74d4-11ea-b0bb-ac1f6b639ec0', '明水县年深加工1万吨腐竹项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '8000万元（1234.8万美元）', '14000', '重点', '6', '1512', '257', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '腐竹又称腐皮，是很受欢迎的一种江右传统食品，也是华人地区常见的食物原料，具有浓郁的豆香味，同时还有着其他豆制品所不具备的独特口感。年深加工1万吨腐竹项目总投资8000万元，其中固定资产投资7000万元（包括土建工程5000万元，设备投资1500万元，其它费用500万元），流动资金1000万元。本项目投入生产运营后，可安排就业100余人。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江明水经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521113916324.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (920, 'ecd002fb-8635-11e8-9218-ac1f6b639ec0', '年产1万吨多味营养蔬菜果酥脆片项目', '大庆', '大同区', '大庆-大同区', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '8000', '一般', '5', '2400', '2000', '筹划', '无', '', '', '大庆市大同区招商引资服务中心', '林志力', '13734586807', 'dtqzsb2004@163.com', '大庆市商务局', '裴丰东', '13936959927', 'xmk6621216@163.com', '100', '项目建设地点在大庆市大同工业园区，占地面积3万亩，建筑面积4000平方米。该区是大庆重要的果蔬种植基地，果蔬资源十分充裕，原料充足。拟建设4条蔬菜脆片加工流水线及相关配套设施。果蔬脆片保持了果蔬的本来品味并有口感松脆、无添加剂，携带方便等优点，倍受食品界瞩目，深受广大消费者欢迎，市场前景广阔。项目达产后，可年产1万吨多味营养蔬菜果酥脆片。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江大同经济开发区', '196', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (921, 'ecee7400-74d7-11ea-b0bb-ac1f6b639ec0', '明水县5万头肉牛养殖屠宰加工项目', '绥化', '明水县', '绥化-明水县', '农、林、牧、渔业', '第一产业', NULL, '独资', '45000万元（6945.75万美元）', '100000', '重点', '2', '30000', '5100', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '700', '项目总投资4.5亿元，项目占地面积25万平方米，建筑面积22.5万平方米，主要建设牛舍、库房、青贮塔、屠宰加工车间、冷冻厂、污水净化池、办公楼、化验室、配种室等。本项目采用节能环保无害化粪污处理措施，建立粪污四级净化室，循环利用还田增效。此外，该项目还可以开发沼气，建立有机肥厂等。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江明水经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521115112526.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (922, 'ed34aa06-9165-11e8-8e63-ac1f6b639ec0', '30万吨焦油深加工和8万吨针状焦项目', '鹤岗', '东山区', '鹤岗-东山区', '制造业', '第二产业', NULL, '合作', '135000万元（20837.25万美元）', '250000', '重点', '3', '60000', '15000', '筹划', '有', '', '', '东山区人民政府', '杨永顺', '13945769291', 'dsqjmj@163.com', '东山区商务局', '贾利娜', '15545861797', 'hgzsgz@163.com', '450', '项目位于鹤岗市煤化工循环经济园区，占地570亩，依托鹤岗市丰富的煤炭资源，建设大型的煤化工企业。项目分两期建设，一期20万吨焦油深加工和4万吨针状焦项目，二期10万吨焦油深加工和4万吨针状焦项目。主要产品：沥青、蒽油、洗油、萘、酚油、粗酚、轻油等及针状焦等。项目达产后，将打破我国针状焦高度依赖进口的局面，项目前景广阔。', '煤炭精深加工产业', '煤炭深加工', '其它', '1', '2021-08-10 10:07:47', 'http://111.40.46.10:8800/zsyz/file/xmfile/20201223100311521.docx');
