INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (926, 'ee308cb0-73e1-11ea-b0bb-ac1f6b639ec0', '佳木斯市现代农业冷链物流加工园区项目', '佳木斯', '抚远市', '佳木斯-抚远市', '交通运输、仓储和邮政业', '第三产业', NULL, '独资', '150000万元（23152.5万美元）', '70000', '重点', '8', '20000', '15000', '筹划', '无', '', '', '抚远市招商局', '朱志峰', '15764540789', 'fyxzsj@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '300', '抚远市粮食作物年产量达到百余吨，围绕商品粮生产基地，大力发展农产品深加工、流通及销售产业，同时完善农产品冷链物流建设，以提升我市发展水平。本项目以产品加工为主业、以现代仓储物流为配套，以多式联运为手段，充分挖掘项目的区域资源优势，立足精品农业项目，逐步将其建设成为功能完备，辐射带动力强，集贸易、加工、冷链物流为一体的现代农业国际物流园之一。项目建设地点位于经济开发区，占地面积80万平方米，主要建设内容包括筒仓、工作塔、包装平房仓、转运塔、综合服务楼等及其它附属配套设施。', '物流产业', '物流', '黑龙江抚远经济开发区', '30', '2020-06-02 14:27:48', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522142002545.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (927, 'ee4d6878-732f-11ea-b0bb-ac1f6b639ec0', '青冈县发酵产业园项目', '绥化', '青冈县', '绥化-青冈县', '制造业', '第二产业', NULL, '独资', '200000万元（30870.0万美元）', '500000', '重点', '4', '50000', '10000', '筹划', '无', '', '', '青冈县经济合作服务中心', '郭庆', '15184578881', '3223615@163.com', '绥化市经济合作局', '吴尧', '18324557333', 'shzsj@163.com', '800', '以淀粉为原料建设玉米发酵产业园，通过发酵生产市场需求旺盛的麦芽糖醇、山梨醇等醇类产品，发展乳酸、苹果酸、支链氨基酸等酸类产品，以及其他发酵产品。据中国玉米发酵产业协会分析，我国糖醇产品规模和技术已经达到世界领先水平，国际竞争力优势显著，发展糖醇类项目前景看好。一些酸类国内外需求量较大，发展迅速，乳酸2018年进口量同比增长91.2%，引起全行业关注，因此有选择发展前景较好酸类项目，是玉米发酵产业园的必然选择。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江青冈经济开发区', '21', '2020-05-31 22:43:04', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521132259110.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (928, 'ee5eb6a2-7264-11ea-b0bb-ac1f6b639ec0', '佳木斯市年生产出口6万吨圆葱毛葱产业项目', '佳木斯', '富锦市', '佳木斯-富锦市', '农、林、牧、渔业', '第一产业', NULL, '独资', '30000万元（4630.5万美元）', '12800', '一般', '8', '3800', '700', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '30', '项目拟建于黑龙江省富锦市各镇，享受《富锦市招商引资扶持奖励政策》。建设基地种植面积为1.5万亩，建设日光大棚70栋、冷棚500栋、保鲜储备库1万平方米，晒台及罩棚2万平方米。年产圆葱、毛葱9万吨，挑选出口6万吨，其余为国内销售。生态种植优势：富锦市是国家级无公害绿色农产品生产基地，也是有着丰富自然资源的农业大市，空气洁净，水质好，气候温暖，四季分明，光照充足，热量丰富，雨量充沛，植被保护良好。富锦是全国发展圆葱、毛葱产业的季节性主要产区，有地域环境优势。富锦市以发展圆葱、毛葱产业作为特色蔬菜出口重要产业来建设，已经在同江口岸、绥芬河、二连浩特、山东黄港、广西友谊关等港口建立圆葱、毛葱稳定的市场', '农业及农副产品精深加工产业', '果蔬加工', '其它', '18', '2020-06-02 14:37:07', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145754871.docx');
