INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (938, 'efe56ba0-7312-11ea-b0bb-ac1f6b639ec0', '佳木斯市原松花江铁路大桥遗址保护项目', '佳木斯', '向阳区', '佳木斯-向阳区', '其他', '第三产业', NULL, '独资', '20000万元（3087.0万美元）', '8000', '重点', '13', '1500', '500', '筹划', '无', '', '', '佳木斯市向阳区商务和经济合作局', '刘汉彬', '18904546633', 'jmsxyqjhj@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '150', '项目拟选址原松花江铁路大桥桥头堡位置。项目拟占地面积10万平方米，建筑面积5万平方米。项目由爱国主义、国防教育基地两部分组成。爱国主义教育基地建设主要内容包括对原铁路大桥桥头堡进行维修和修缮、履设铁轨1000延长米、摆设蒸汽火车头一个、恢复火车通行设施、修建日军侵华罪证和抗日战争纪念馆等。国防教育基地建设内容主要包括大型兵器陈列场、红蓝军阵地对抗、射击训练、军事体能拓展训练等设施。该地段与沿江景观带相连，环境优美，交通顺畅，方便游客游玩和观光活动。项目的给水、排水、供电、供热、通讯设施基本有保障。', '旅游产业', '旅游', '其它', '15', '2020-06-01 16:23:13', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523092224568.doc');
