INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (940, 'f0710f5e-c668-11ea-8088-00ff338109dc', '年产25万吨EVA树脂项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '合资', '237000万元（36580.95万美元）', '350000', '一般', '6.6', '48000', '66000', '筹划', '无', '', '', '石化产业促进中心', '张天宇', '13339392732', 'hwyq5619222@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', 'EVA树脂是聚乙烯中具有特殊性能的品种之一，国内市场缺口较大，且产品附加值高，创效能力较强。利用大庆乙烯原料建设EVA树脂装置，有利于优化本地区聚乙烯产品结构，提升化工产业层次，并满足电子信息、汽车制造及其他制造业、建筑业对高性能材料的需求，促进地区经济发展。项目建设25万吨/年釜式法EVA树脂装置总投资约23.7亿元，其中建设投资约20.7亿元。项目达产后，预计可实现年销售收入35亿元，利税6.6亿元，利润4.8亿元。', '石化产业', '石化', '大庆高新技术产业开发区', '2', '2021-08-10 10:12:41', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200715150104938.docx');
