INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (948, 'f2ae913a-738c-11e8-a795-ac1f6b639ec0', '2万吨马铃薯全产业链加工项目', '绥化', '北林区', '绥化-北林区', '制造业', '第二产业', NULL, '独资', '8000万元（1234.8万美元）', '10000', '重点', '4', '2000', '800', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '120', '马铃薯是北林区传统作物，更是优势和特色作物，原料充足，适合发展马铃薯加工产业。马铃薯全粉国内市场年需求量缺口在3万吨以上,市场前景较好。本项目以东北农业大学马铃薯研究所为技术依托,主要生产精制淀粉、变性淀粉、颗粒全粉、淀粉糖等产品，同时结合市场需求生产薯条、薯片、营养粉丝等主食品和方便食品，推进马铃薯全产业链开发。项目拟占地2万平方米，新建生产车间、库房、相关配套设施，引进国内先进生产工艺及生产设备。', '农业及农副产品精深加工产业', '果蔬加工', '绥化经济技术开发区', '186', '2020-05-26 11:02:14', '');
