INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (950, 'f31fa2be-7479-11ea-b0bb-ac1f6b639ec0', '牡丹江市中药饮片加工项目', '牡丹江', '市辖区', '牡丹江-市辖区', '制造业', '第二产业', NULL, '独资', '10000万元（1543.5万美元）', '10000', '重点', '7', '1500', '570', '筹划', '有', '', '', '牡丹江市生物医药专班', '赵鲲', '13945306605', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '200', '依靠牡丹江市丰富的北药资源，利用已完成先期建设的食品、医药产业园招引规模和规模以上药企入住园区，对原药材进行炮制加工，制成普通中药饮片、中医常用饮片、中药免煎饮片、中药颗粒饮片、中药精制饮片等产品，并对中药饮片炮制加工工艺、新品开发等方面的技术进行创新研究,使我市的中药饮片加工业尽快走上规模化、产业化的道路。\r\n项目拟建厂区总面积约9万平方米，包括一间生产车间，拟布置3条生产线，年加工中药3000吨；一栋办公楼；拥有检验检测与研发功能为一体的综合楼；仓库一间；药材露天晾晒车间；废水处理等环保设施和其它辅助配套设施。', '中医药产业', '中医药', '牡丹江经济技术开发区', '16', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522113704992.doc');
