INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (959, 'f608f996-7a33-11ea-b0bb-ac1f6b639ec0', '佳木斯市10万只肉羊产业化基地建设项目', '佳木斯', '同江市', '佳木斯-同江市', '农、林、牧、渔业', '第一产业', NULL, '独资', '14000万元（2160.9万美元）', '9800', '一般', '7', '2450', '610', '筹划', '无', '', '', '同江市发展和改革局', '贺简', '18845444111', 't2922499@163.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '60', '项目选址在同江市八岔乡，规划面积200亩，肉羊养殖10万头，饲料种植基地10万亩。本项目的实施，充分利用本地适宜的自然环境、丰富的饲草料资源，加强先进科学技术的推广应用，加大本地肉羊品种改良、秸秆养殖、塑料暖棚饲养快速育肥和防疫灭病等技术推广应用，提高肉羊养殖业的水平，把肉羊养殖列为农业发展的支柱产业之一有着重要意义。对提高农民的科学技术水平，拓宽就业渠道，增加农民收入，有着广阔的前景。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江同江经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521111738378.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (960, 'f65c532a-73c4-11ea-b0bb-ac1f6b639ec0', '畜禽养殖屠宰加工项目', '绥化', '庆安县', '绥化-庆安县', '农、林、牧、渔业', '第一产业', NULL, '独资', '12000万元（1852.2万美元）', '12000', '重点', '4', '3000', '450', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '80', '庆安县是国家商品粮生产基地，有八大国有林场，灌木资源丰富，畜禽产品，绿色健康。庆安实施生态发展战略，发展特色养殖，把畜禽养殖作为一项重要产业来发展。目前，牛存栏量8.6万头，猪存栏量38.7万头，羊存栏量7.8万头，鸡存栏量264.5万只，鹅存栏量74.9万只。利用自然生态资源发展绿色养殖。畜禽屠宰、食品加工、冷藏保鲜，有良好的发展空间。该项目年养殖、屠宰畜禽10万；建设畜禽舍、饲料加工厂、贮存及相关设施设备、技术服务及防疫体系、屠宰加工厂、冷冻厂等。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江庆安经济开发区', '7', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204449476.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (961, 'f6cd34d4-7262-11ea-b0bb-ac1f6b639ec0', '佳木斯市年加工5万吨DDGS饲料项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '50000', '重点', '3', '10000', '2000', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '100', '项目拟建于黑龙江省富锦市经开区，享受省级开发区优惠政策。占地面积3公顷。建设内容，建设标准化精深加工厂房2公顷、从山东地区购进先进的饲料加工成套设备、建设防火深水井1座。资源优势，富锦市现有象屿60万吨玉米淀粉生产厂及30万吨燃料乙醇生产厂，年可生产DDGS高蛋白饲料40万吨左右。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富锦经济开发区', '17', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153554794.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (962, 'f6e5451a-7a0c-11e8-9615-ac1f6b639ec0', '哈西客站北广场CBD建设项目', '哈尔滨', '道里区', '哈尔滨-道里区', '租赁和商务服务业', '第三产业', NULL, '独资', '900000万元（138915.0万美元）', '250000', '一般', '15', '60000', '2000', '筹划', '无', '', '', '道里区招商局', '于鹏菲', '15945186879', 'daolizsj@163.com', '道里区招商局', '于鹏怡', '18686775832', 'daolizsj@163.com', '25', '项目建设地点在哈尔滨西客站北侧，哈西客站规划区域的道里核心地段，东起和谐大道，西至发展大道，南起西客站，北至迎宾路，占地面积75.2万平方米，建筑面积392万平方米。其中，商业用地面积43.4万平方米，商住混合用地面积31.8万平方米市政设施用地0.4万平方米。拟建设商场、写字楼、住宅等。项目建成后拟引进世界500强、国内100强企业，打造集高端商业、休闲旅游、文化创意、餐饮住宿、企业总部于一体的大型城市综合体。', '现代商贸产业', '现代商贸', '其它', '108', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521161619684.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (963, 'f6f46053-7261-11ea-b0bb-ac1f6b639ec0', '北林区20万吨大豆深加工产业化项目', '绥化', '北林区', '绥化-北林区', '制造业', '第二产业', NULL, '其他', '50000万元（7717.5万美元）', '120000', '重点', '4.6', '12000', '2200', '筹划', '无', '', '', '北林区招商局', '孙乃龙', '15145517717', 'shsblqzsj@126.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '150', '北林区所在的绥化市全域是国家级现代农业示范区，是全国绿色食品标准化生产基地示范区和全国粮食生产先进县。建设20万吨大豆深加工产业化项目，占地面积15万平，主要建设内容为引导合作社或农户扩种大豆面积20万亩，新建厂房、加工生产线等，设计规模为年加工大豆20万吨，主要产品为大豆低聚糖、大豆异黄酮、酵母、大豆卵磷脂、大豆植物蛋白饮料、大豆素肉制品、大豆调味品、烘焙蛋白粉、组织蛋白加工等。', '农业及农副产品精深加工产业', '大豆深加工', '绥化经济技术开发区', '13', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521113209108.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (964, 'f765dd79-b9dd-11eb-a12f-00ff338109dc', '百万头生猪养殖屠宰加工项目', '佳木斯', '桦南县', '佳木斯-桦南县', '制造业', '第二产业', NULL, '独资', '200000万元（30870.0万美元）', '140000', '一般', '6', '42000', '3000', '筹划', '无', '', '', '桦南县农业农村局', '张本刚', '13846112399', 'nw141@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '1200', '占地4540亩，在我县行政区域内建设集36万吨生物饲料加工、100万头生猪养殖场、100万头屠宰加工为一体的现代化高效生态循环养殖产业链项目。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '5', '2021-08-10 09:53:00', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (965, 'f771d07e-6d48-11e8-96d9-ac1f6b639ec0', '自驾车房车营地建设项目', '哈尔滨', '通河县', '哈尔滨-通河县', '租赁和商务服务业', '第三产业', NULL, '其他', '16000万元（2469.6万美元）', '8000', '一般', '6.6', '2400', '1600', '筹划', '无', '', '', '通河县旅游局', '曲艳艳', '13796141345', 'thxlyj234@163.com', '通河县招商局', '王吉星', '15045499337', 'thzsj777@126.com', '100', '项目建设地点在铧子山南麓，水库西北岸。拟建设综合服务区+主题广场、星级房车营地、户外帐篷营地、创意建筑营地、观星别墅、开心菜园，具备房车营地停泊的接待能力，并能够提供房车供游客租赁使用，同时提供游乐场地和娱乐设施。项目拟建地符合山南水北位之阳的传统理论，适合建设房车营地。', '旅游产业', '旅游', '黑龙江通河经济开发区', '112', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524214904182.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (966, 'f7950549-74d8-11ea-b0bb-ac1f6b639ec0', '明水县年产15万吨生物有机肥厂建设项目', '绥化', '明水县', '绥化-明水县', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '45700', '重点', '3', '13710', '720', '筹划', '无', '', '', '绥化市明水县招商引资服务中心', '李艳军', '13804860069', '13804860069@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '150', '项目总投资3亿元，其中固定资产投资1.5亿元(土建工程投资12425.4万元，设备投资2574.6万元)，流动资金1.5亿元。项目建成投产后可安置就业岗位150个，并可解决众多企业的有机废弃物污染排放等问题。该项目应用国际高科技生物菌（酶制剂）——酵素技术，对畜禽粪便进行高温发酵在生产过程中攻克了三个全国独创的生物肥工厂化生产的难点。一是：最佳的发酵形成生物菌丝体和蛋白质的难题。二是：生物菌造粒难题。三是：生物菌与化肥混合的难题。在生物发酵过程中可利用畜禽废弃物，如鸡粪、草炭、锯沫和农作物的秸杆、稻壳等，变废为宝，采用该技术生产的肥料是二十一世纪农业的发展方向，它有利于人类的健康，是实现食品', '节能环保产业', '畜牧废弃物利用', '黑龙江明水经济开发区', '20', '2020-05-31 22:35:46', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521164322340.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (967, 'f7ba12b6-8441-11ea-b0bb-ac1f6b639ec0', '灵芝种植及深加工项目', '大庆', '肇州县', '大庆-肇州县', '农、林、牧、渔业', '第一产业', NULL, '独资', '11890万元（1835.22万美元）', '34000', '一般', '3', '4880', '2000', '筹划', '无', '', '', '肇州县招商服务中心', '张立江', '13604892456', 'jhb2013@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '200', '灵芝具有多种生理活性和药理作用，具有辅助抑制肿瘤、抗癌、增加机体免疫功能的作用。随着人们生活水平的提高，人们对“营养、保健、安全”的灵芝产品需求量必将越来越大，市场前景广阔。\r\n本项目灵芝种植拟占地面积1000亩，建筑面积建设灵芝种植大棚1000栋，灵芝菌棒培育场4500平方米、食用菌培育场3000平方米；灵芝加工拟占地面积20000平方米，建筑面积10400平方米，分别为：建设袍子粉加工车间1000㎡、灵芝切片加工车间2000㎡、库房5000㎡、冷库200㎡、办公生活用房1500㎡、门卫及秤房100㎡、锅炉房300㎡、配电室及消防泵房200㎡，购置各种生产设备42台（套）。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇州经济开发区', '10', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521144402330.docx');
