INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (970, 'f816d550-725f-11ea-b0bb-ac1f6b639ec0', '佳木斯市年产60万吨玉米精深加工系列食品项目', '佳木斯', '富锦市', '佳木斯-富锦市', '制造业', '第二产业', NULL, '独资', '100000万元（15435.0万美元）', '629200', '一般', '1', '135700', '43400', '筹划', '无', '', '', '富锦市经济合作促进服务中心', '王超', '13504691722', 'jhzx306@126.com', '佳木斯市商务和经济合作局', '闫胜男', '18646462502', 'jmsgntzk@163.com', '5000', '项目建设地点富锦市经开区，年生产玉米荞麦挂面、速冻窝头、速冻玉米汤圆等食品60万吨，享受省级开发区优惠政策。占地面积10公顷，总建筑面积3万平方米。建设内容，建设总体厂房、各类车间、冷库、动力、仓储、罩棚、物流、配送中心、场地、道路、绿化等场地设施。资源优势，富锦市玉米年际间产量稳定在140万吨以上，百公里半径内，年际间玉米产量约500多万吨，可为项目提供原料保障。区位优势，开发区内建设有自备热电厂、燃气管道，公共物料管廊、铁路专用线等生产成本、物流成本要素资源，可为园区企业延伸产业链提供充足的供电、供气、供水生产资源及污水排放，实现资源共享，降低上下游企业的固定资产投入及节约生产成本', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江富锦经济开发区', '7', '2021-08-11 11:33:45', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200707110309824.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (971, 'f81c7c77-8507-11ea-b0bb-ac1f6b639ec0', '漠河市前哨康养综合体开发项目', '大兴安岭', '漠河市', '大兴安岭-漠河市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '4000万元（617.4万美元）', '3000', '一般', '6.8', '600', '50', '建设', '无', '', '', '漠河市商务局', '张明亮', '15714678669', 'mhcxw1982@163.com', '大兴安岭地区行署商务局', '戴启荣', '13845799889', 'zgdqr@163.com', '50', '前哨林场地处中国最北-大兴安岭地区西林吉林业局北部，距离漠河市区17公里，漠河市机场21公里，漠河市火车站10公里，是通往北极村国家5A级旅游景区、观音山景区、采金小镇景区、中国最北点景区、黑龙江源头洛古河村等漠河市域核心景区景点的必经之地，开发建设了山特产品展览馆、采摘区、垂钓园、五花山等4处旅游景点。项目总规划面积91845公顷，总体发展结构分为公共功能区、产业功能区、森林体验区、生态保育区，为旅客提供良好的休闲养生度假体验。', '旅游产业', '旅游', '其它', '16', '2020-06-03 14:59:00', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522151732948.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (972, 'f89497a3-75a8-11ea-b0bb-ac1f6b639ec0', '开发区现代设施农业建设项目', '七台河', '市辖区', '七台河-市辖区', '农、林、牧、渔业', '第一产业', NULL, '合资', '5000万元（771.75万美元）', '1000', '一般', '15', '300', '100', '筹划', '无', '', '', '七台河开发区金沙实业公司发展战略部', '段红亮', '18346460010', 'kfqtzhzcj@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '100', '拥有全市最大的万亩农场，全场农机总装备26万千瓦，实现了田间作业翻、耙、播、种、收全程机械化，全场可在10天内迅速完成17万亩大田播种，年产粮豆7万吨。拥有单产全省领先的高产奶牛核心群，是全市最大的高产奶牛基地，建有两个标准化奶牛小区，存栏北美荷斯坦优质奶牛2100头，年产鲜奶4000吨，是完达山乳业的优质奶源供给地。蛋鸡存栏30万只，年产蛋6000吨，是周边闻名的蛋鸡基地。本项目拟定资金5000万元，占地76公顷。建设温室大棚、管理用房、仓库、农机库、机井房、门卫室、道路，棚室种植、观光采摘、休闲农业基础设施等。', '旅游产业', '旅游', '黑龙江七台河经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522163928883.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (973, 'f89561a9-8217-11eb-94a7-00ff338109dc', '北安市年成交1000辆二手车交易市场', '黑河', '北安市', '黑河-北安市', '批发和零售业', '第三产业', NULL, '独资', '6000万元（926.1万美元）', '4000', '一般', '7', '1000', '780', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '50', '北安市汽车销售服务园位于北安市区西部，毗邻202国道，区位交通优越。规划面积1平方公里，规划建设100个品牌的汽车经销、服务企业及相应配套附属设施，打造黑龙江省北部地区规模最大、服务最优的汽车销售及维修服务平台。现已入驻46个品牌企业，年成交量可达5000台。本次项目建设地点位于汽车销售服务园区内，计划与现有园区内企业共同打造北安市汽车销售服务综合体。北安市现有小型二手车交易商家20家，项目建设完成后可入驻园区。且北安市汽车销售服务园是黑河地区唯一的大型汽车销售基地，其销售市场及服务半径涵盖逊克等多个城镇。市场前景广阔。', '现代商贸产业', '现代商贸', '黑龙江北安经济开发区', '1', '2021-08-10 10:01:43', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (974, 'f8959d2a-74d6-11ea-b0bb-ac1f6b639ec0', '糠醛生产扩建项目', '七台河', '勃利县', '七台河-勃利县', '制造业', '第二产业', NULL, '合资', '6500万元（1003.27万美元）', '10500', '一般', '3', '1900', '800', '筹划', '无', '', '', '勃利县经济合作促进局', '贾利琦', '13846499855', 'zgzsblx@163.com', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '50', '糠醛是化工中介产品，广泛用于树脂、涂料、染料、医药、农药等行业，也是生产糠醇、四氢呋喃的重要原料。糠醛是玉米芯中提取物，原料市场在勃利县非常大。建设内容：年产1万吨糠醛生产线。', '生物医药产业', '生物医药', '黑龙江勃利经济开发区', '8', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522174218722.doc');
