INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (976, 'f8eec28e-58aa-11e8-a5b9-ac1f6b639ec0', '生物质能发电项目', '绥化', '北林区', '绥化-北林区', '电力、热力、燃气及水生产和供应业', '第二产业', NULL, '独资', '50000万元（7717.5万美元）', '18000', '重点', '8', '5000', '4000', '筹划', '无', '', '', '绥化市经济合作局', '曹鹏', '13091556111', 'suihuazhaoshangju@163.com', '绥化市经济合作局', '王俊飞', '13214555929', 'suihuazhaoshangju@163.com', '100', '项目位于绥化市北林区，拟建2×30MW生物质能发电项目，建设4×75吨/时机械炉排生物质焚烧炉，配2×30MW抽汽供热机组，2×30MW发电机。绥化市是全国著名的商品粮种植基地，全市各类秸秆产量约2200多万吨。按可利用系数测算，约有农作物秸秆1500多万吨，可为发展生物质秸秆发电项目提供充足原料。', '新能源产业', '生物质能', '绥化经济技术开发区', '88', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (977, 'f8ff984f-79f7-11e8-9615-ac1f6b639ec0', '肉牛加工项目', '哈尔滨', '双城区', '哈尔滨-双城区', '制造业', '第二产业', NULL, '独资', '12000万元（1852.2万美元）', '5000', '一般', '8', '1500', '500', '筹划', '无', '北京', '', '哈尔滨市双城区企业发展和投资促进服务中心', '马洪喜', '13936110566', 'zsyz626@163.com', '哈尔滨市双城区企业发展和投资促进服务中心', '刘雪松', '13603664709', 'zsyz626@163.com', '120', '项目建设地点在哈尔滨市双城区，占地面积10万平方米，建筑面积6万平方米，双城建成百头以上的规模养殖小区217个，肉牛年饲养量达到50万头，原料充足。拟建设屠宰车间、加工车间、办公楼，购置屠宰设备、预冷分割设备、血粉加工设备等生产设备600台（套）。牛肉及牛肉制品逐渐成为人们改善膳食结构的必需品，市场前景广阔。项目达产后，可年产优质牛肉4000吨，牛皮18000张，血粉20吨。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江双城经济开发区', '218', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200522121756414.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (978, 'f939432b-732a-11ea-b0bb-ac1f6b639ec0', '大豆分离蛋白项目', '鸡西', '虎林市', '鸡西-虎林市', '制造业', '第二产业', NULL, '独资', '30000万元（4630.5万美元）', '14400', '一般', '6', '3550', '1550', '筹划', '无', '', '', '虎林市投资合作促进局', '李晓磊', '04675891115', 'hlstcj@126.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '150', '拟利用虎林现有的大豆资源建设年处理大豆能力10万吨，大豆分离蛋白8000吨及其他副产品的精深加工项目。主要建设生产厂房、库房、办公楼、食堂、洗衣间、仓库等其他辅助用房。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江虎林经济开发区', '20', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521145213276.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (979, 'f94aa514-8441-11ea-b0bb-ac1f6b639ec0', '汽车顶棚生产项目', '大庆', '市辖区', '大庆-市辖区', '制造业', '第二产业', NULL, '独资', '15000万元（2315.25万美元）', '10000', '一般', '8', '2000', '800', '筹划', '无', '', '', '大庆高新区管委会', '韩博强', '15164527375', 'hanboqiang@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '50', '随着大庆沃尔沃整车制造增产上量，对其一级零部件供应商在周边建厂需求越来越迫切，为满足整车就近配套建厂，完善大庆汽车产业链条，计划引入汽车顶棚生产项目。市场前景方面，可以依托大庆沃尔沃整车产量，同时可辐射哈尔滨福特整车厂配套。项目建设的有利条件包括市场区位优势，大庆高新区已辟建汽车零部件产业园，可靠近整车厂就近建厂，实现集群化发展。\r\n项目规模为拟建设年产20万套汽车顶棚项目，建设内容包括投资建设汽车顶棚生产线，主要产品为沃尔沃在庆投产车型汽车顶棚相关产品。项目建设地点为大庆汽车产业园内，目标企业要求需是沃尔沃供应商。', '汽车制造产业', '汽车服务', '大庆高新技术产业开发区', '6', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200422103547801.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (980, 'f9933050-8216-11eb-94a7-00ff338109dc', '北安市非转基因玉米深加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '其他', '41000万元（6328.35万美元）', '65600', '重点', '2.5', '17000', '13000', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '100', '北安市位于黑龙江北部中心地带，距五大连池机场30公里。市域内现有耕地516万亩，是国家级生态示范区和全国绿色食品玉米原料标准化生产基地。年产玉米500万吨，市域内现有粮食仓储能力达400万吨。项目占地面积14.6万平方米，建设厂房、仓库、办公楼等基础设施，建筑面积共8万平方米，建设玉米汁饮料生产线一条、玉米胚芽油深加工生产线，购置生产胚芽油等设备。年加工玉米18万吨，年产大、中玉米糁2吨，食用玉米粉1.5万吨，玉米饲料粉1万吨，淀粉深加工6.75万吨，玉米蛋白粉5000吨，纤维饲料1.4万吨，玉米原油5250吨，玉米胚芽粕8500吨、玉米饮料6万吨。', '农业及农副产品精深加工产业', '玉米深加工', '黑龙江北安经济开发区', '4', '2021-08-10 10:02:45', '');
