INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (983, 'fa03f1c1-ba09-11eb-a12f-00ff338109dc', '养殖屠宰加工项目', '伊春', '友好区', '伊春-友好区', '制造业', '第二产业', NULL, '独资', '13000万元（2006.55万美元）', '14700', '一般', '4', '2904', '200', '筹划', '无', '', '', '友好区招商引资服务中心', '顾正刚', '13845845008', 'yhzsb2021@163.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '70', '采取养殖基地+农户+公司产业模式，拟建设生猪、肉鸡饲养基地，改建综合服务楼一栋6000平方米，屠宰加工车间5000平方米、屠宰加工生产线4条，饲料库、冷藏库及相关附属设施建设，项目年可养殖肉鸡30万只，肉食品加工2000吨。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '其它', '3', '2021-08-10 09:51:50', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (984, 'fa459c3c-6f2d-11ea-b0bb-ac1f6b639ec0', '嫩江市纳豆及纳豆激酶相关保健产品生产项目', '黑河', '嫩江县', '黑河-嫩江县', '制造业', '第二产业', NULL, '独资', '6500万元（1003.27万美元）', '7000', '一般', '4.1', '1584', '216', '筹划', '无', '', '', '嫩江市招商服务中心', '周茂波', '18724327888', 'njzhoumaobo@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '30', '嫩江市域内耕地面积1200万亩，粮食产量年均30亿斤，其中：大豆每年种植面积大约在650万亩左右，产量在100万吨。纳豆因其特殊的营养成分，在整个亚洲得到高度认可，食用者众多，而纳豆制成的保健产品、生物制剂被人们广泛接受。纳豆激酶(nattokinase 简称 NK)是一种枯草杆菌蛋白激酶，是在纳豆发酵过程中由纳豆枯草杆菌(Bacillus subtilisl natto)产生的一种丝氨酸蛋白酶。具有溶解血栓，降低血粘度，改善血液循环，软化和增加血管弹性等作用。项目占地 20 亩，年产鲜纳豆产品 3000 吨，纳豆激酶相关系列产品 20 万盒，年消耗大豆 1 万吨。\r\n\r\n\r\n', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江嫩江经济开发区', '661', '2020-06-04 14:39:28', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521195642644.doc');
