INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (990, 'fb97e531-51a8-11e8-ba35-ac1f6b639ec0', '地下煤气化项目', '双鸭山', '宝山区', '双鸭山-宝山区', '采矿业', '第二产业', NULL, '独资', '20590万元（3178.07万美元）', '25000', '重点', '3.5', '7000', '212', '可研', '有', '', '', '双鸭山东北煤炭地下气化技术有限公司', '于海军', '13904688619', 'bsqzsj101@126.com', '双鸭山市经济合作促进局', '王敬禹', '15246897517', 'jjhzcjj@126.com', '55', '该项目位于宝山区，利用宝山区七星煤矿去产能关闭矿井及遗弃、废弃矿井开展煤气化项目，拟建设气化炉、煤气净化系统、co变换制氢系统、污染物检测系统等，达到年产粗煤气3亿立方米的能力。根据煤种、气化工艺等的不同可作为工业燃气、化工合成原料气，用于发电、合成甲烷、汽柴油等。地下气化显著减少了对水资源的消耗，降低了灰渣，矸石排放量，并可作为co2封存的有利场所，项目具有明显的经济和环境优势。', '煤炭精深加工产业', '煤炭深加工', '其它', '152', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (991, 'fba782e2-9d77-11ea-8a5d-00ff338109dc', '生猪屠宰加工项目-2', '齐齐哈尔', '龙江县', '齐齐哈尔-龙江县', '农、林、牧、渔业', '第一产业', NULL, '独资', '35000万元（5402.25万美元）', '250000', '一般', '5', '18000', '1800', '筹划', '无', '', '', '龙江县经济局合作促进局', '李晓东', '15946466566', 'ljxjhj@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '150', '龙江县是全国商品猪生产基地县、国家生猪生产调出大县，生猪养殖量常年稳定在80万头左右，规模养殖场40家，位于全省前列，生猪资源丰富。引进国内外先进屠宰分割及加工生产线，年屠宰生猪200万头。主要产品：分割肉5万吨/年、白条肉9万吨/年；副产品：猪骨6500吨/年、板油7900吨/年、血浆蛋白粉400吨/年、血球蛋白粉2600吨/年、肠衣400万根/年以及猪皮、猪下货等。项目达产后，建设熟食加工生产线，生产各类风味肉类熟食产品。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江龙江经济开发区', '27', '2020-06-04 13:59:12', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200524123709613.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (992, 'fc3dea25-7002-11ea-b0bb-ac1f6b639ec0', '可口大豆食品加工项目', '鹤岗', '东山区', '鹤岗-东山区', '农、林、牧、渔业', '第一产业', NULL, '合作', '5158万元（796.14万美元）', '35277', '重点', '2', '3362', '2717', '建设', '有', '', '', '东山区人民政府', '谢泽民', '15145840488', 'dsqzsj@163.com', '鹤岗市商务局', '张雪松', '13694698881', 'hgzsgz@163.com', '120', '项目位于鹤岗市生物质园区，占地1300平方米，依托鹤岗市丰富大豆资源优势，拟建设大豆平房仓1座，大豆食品加工车间2座，配套扩建给水泵房、消防水池等设施，建成传统豆制品规模化、现代化生产基地，年可加工非转基因大豆3万吨，年产腐竹等传统豆制品2万吨。', '农业及农副产品精深加工产业', '大豆深加工', '其它', '8', '2021-08-10 10:33:21', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200327161431223.');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (993, 'fc5f88cc-7576-11ea-b0bb-ac1f6b639ec0', '牡丹江市绥芬河市木屋基地项目', '牡丹江', '绥芬河市', '牡丹江-绥芬河市', '房地产业', '第三产业', NULL, '合资', '60000万元（9261.0万美元）', '150000', '重点', '4', '15000', '3000', '筹划', '有', '', '', '绥芬河市经合促中心', '王殿玉', '15724753463', 'sfhbhq@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '300', '牡丹江市素有“中国雪城”之城，是黑龙江省主要的旅游中心之一，建设木屋基地可以让游客在游玩之时感受自然，给予游客不一样的观光体验。\r\n项目选址在边合区内十六街以北、中林西侧，占地9.38万平方米，建设木屋生产线及附属设施。\r\n项目主要建设木屋度假村，度假村内建设木屋别墅，建筑面积预计30万平方米。', '康养产业', '康养', '绥芬河边境经济合作区', '28', '2020-05-29 15:25:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200403144728868.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (994, 'fce4eec4-807c-11ea-b0bb-ac1f6b639ec0', '长链二元酸项目', '齐齐哈尔', '讷河市', '齐齐哈尔-讷河市', '制造业', '第二产业', NULL, '独资', '400000万元（61740.0万美元）', '300000', '一般', '4', '80000', '10000', '筹划', '无', '', '', '讷河市经济开发区', '于贵臣', '13514627376', 'ysmb6006@163.com', '齐齐哈尔市经合局', '宋照亮', '18604523993', 'jhjtzcj@163.com', '200', '本项目采用生物技术手段，利用石油化工副产品轻蜡油发酵法生产工程塑料、尼龙热熔胶、尼龙粉末涂料、高级油漆、香料、润滑油等材料的合成中间体一--长链二元酸，拉长了石化产业链条，增加了石化副产物的附加值。将生物技术与石油化学工程结合起来，形成生物化工技术产业，符合我国石化产业、高技术产业、生物产业的发展方向，符合国家及地区“十一五”规划的发展方向，是国家鼓励发展的技术产业。', '石化产业', '石化', '黑龙江讷河经济开发区', '46', '2020-06-04 14:04:38', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200523112352941.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (995, 'fd08d061-790c-11e8-903f-ac1f6b639ec0', '100万头生猪屠宰加工项目', '鸡西', '密山市', '鸡西-密山市', '制造业', '第二产业', NULL, '其他', '6000万元（926.1万美元）', '80000', '一般', '3', '2800', '7300', '筹划', '无', '', '', '密山市区域经济发展服务中心', '刘娜', '13351670999', 'hljmszsj@163.com', '鸡西市投资合作促进局', '李建成', '13054321245', 'zsk3123@163.com', '50', '项目计划用地7500平方米，规划总建筑面积6000平方米。主要建设屠宰分割车间、冷库、待宰圈、制冷机房、变配电室、机修间、水泵房、急宰化制间、办公大楼、食堂、洗衣间、仓库等其他辅助用房;拟购进生猪屠宰及肉制品加工主要设备约220台（套）。项目建成达产达效后，年屠宰生猪100万头。', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江密山经济开发区', '98', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521140405085.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (996, 'fd558031-7303-11ea-b0bb-ac1f6b639ec0', '有机食品营养豆奶（粉）生产项目', '绥化', '庆安县', '绥化-庆安县', '制造业', '第二产业', NULL, '独资', '6000万元（926.1万美元）', '10000', '重点', '2', '3000', '450', '筹划', '无', '', '', '庆安县项目招商中心', '吴相君', '18746531000', 'qazsjd@163.com', '绥化市经济合作局', '路俊德', '18704554444', 'suihuazhaoshangju@163.com', '100', '庆安县绿色有机大豆年产8万吨。庆安农产品加工业园区是国家级农产品加工业园区，园区内有东北最大的绿色食品大豆批发市场，年大豆交易量90万吨。本项目在庆安建设，原料供应十分充足，而且原料非转基因大豆质量好。本项目就是利用大豆丰富的营养，采用先进的配方和加工技术，开发生产多种口味的高营养豆奶（粉）制品，项目达产后可年产豆奶（粉）2500吨，产品市场十分广阔。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江庆安经济开发区', '11', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521204221164.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (997, 'fda86aef-853e-11ea-b0bb-ac1f6b639ec0', '肇源县果蔬、五谷杂粮饮品加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '60000万元（9261.0万美元）', '125000', '一般', '2', '30000', '4500', '筹划', '无', '', '', '大庆市肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '60', '近几年来，果蔬、谷物饮品在我国发展迅速，需求量逐年增长，在当代快节奏生活中，已成为生活不可或缺的一部分，具有广阔的发展空间。\r\n肇源县地处松嫩平原腹地，寒地黑土，土质肥沃，是黑龙江省第一积温带，是全国粮食生产先进县、黑龙江省绿色食品基地县。全县年产果蔬4.32亿斤，杂粮1.77亿斤，优质果蔬、杂粮产品为项目发展奠定了良好的原料基础。\r\n项目拟选址在肇源县经济开发区，规划占地面积18万平方米，其中年产10万吨果蔬饮品项目，设计建设三条生产线，主要加工花生、地瓜、胡萝卜等果蔬产品；10万吨五谷杂粮营养饮品加工项目，设计建设三条生产线，主要加工红小豆、绿豆、小米、甜玉米等农产品。', '农业及农副产品精深加工产业', '果蔬加工', '黑龙江肇源经济开发区', '9', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423164657801.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (998, 'fe5c5663-75af-11ea-b0bb-ac1f6b639ec0', '煤矸石生产A分子筛干燥剂项目', '七台河', '茄子河区', '七台河-茄子河区', '采矿业', '第二产业', NULL, '合资', '5000万元（771.75万美元）', '4000', '一般', '4', '1200', '500', '筹划', '无', '', '', '茄子河区招商局', '董广岩', '13946566656', 'qzhzsj2019@163.COM', '七台河市经济合作促进局', '郑宏图', '13846468119', 'zgzsqth@163.com', '75', '煤矸石生产A分子筛干燥剂是一种人工合成且对水分子有较强吸附性的干燥剂产品。分子筛的孔径大小可以通过加工工艺的不同来控制，除了吸附水汽，它还可以吸附其他气体，市场前景较好。建设内容：利用煤矸石所含铝硅为原料制造高品质A型分子筛干燥剂，年产20万吨以上。', '煤炭精深加工产业', '煤炭深加工', '其它', '15', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200521153246450.docx');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (999, 'ff211923-b719-11e8-b0d1-ac1f6b639ec0', '医养旅游文化小镇项目', '哈尔滨', '五常市', '哈尔滨-五常市', '居民服务、修理和其他服务业', '第三产业', NULL, '独资', '100000万元（15435.0万美元）', '25000', '重点', '14', '7500', '1000', '可研', '无', '', '', '哈尔滨五常市商务局', '王晓华', '19903611199', 'wuchangzsj@126.com', '哈尔滨五常市商务局', '王秀君', '15046037557', 'wuchangzsj@126.com', '50', '项目建设地点位于五常市向阳镇雪乡公路15公里处，国家5A级凤凰山地质公园旅游区50公里。地理位置属于小兴安岭山脉，自然条件优越，小镇总规划面积510亩，小镇重点突出康复医疗、健康养老、生态旅游、民族文化四大功能区域建设。根据地方自然资源优势，科学合理定位，小镇特色生态建设将满足周边人群更新更高的精神文化和物质文化需求。小镇建成后也将有力的提升五常市历史名城和旅游城市的知名度。', '康养产业', '康养', '黑龙江五常经济开发区', '60', '2020-05-26 11:02:14', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (1000, 'ff2bdbc4-cf11-11eb-a12f-00ff338109dc', '生猪屠宰及深加工', '佳木斯', '汤原县', '佳木斯-汤原县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '86000', '一般', '5', '4500', '1200', '筹划', '无', '', '', '汤原县农业农村局', '张学武', '15145472567', 'tynw2009@126.com', '省农业和农产品加工项目招商工作专班', '杨晓宇', '13644504097', 'nyzs2021@163.com', '100', '项目规划总占地面积200亩，主要建设屠宰车间、分割冷鲜肉车间、高温肉制品生产车间、副产品加工车间、冷库、冻结车间等。项目建成达产后，预计年可屠宰生猪80万头，年可生产鲜猪肉分割品1.2万吨，火腿、酱肉制品等高低温猪肉制品2.8万吨。\r\n', '农业及农副产品精深加工产业', '肉制品加工', '黑龙江汤原经济开发区', '2', '2021-08-10 09:47:25', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (1001, 'ff35011e-8212-11eb-94a7-00ff338109dc', '北安市中药加工项目', '黑河', '北安市', '黑河-北安市', '制造业', '第二产业', NULL, '独资', '18000万元（2778.3万美元）', '29700', '一般', '3', '7700', '5900', '筹划', '无', '', '', '北安市招商局', '韩国峰', '18645672251', 'bazsj4205@163.com', '黑河市经济合作促进局', '白宇涛', '18645616168', 'hhjhjbyt@163.com', '200', '北安市拥有丰富的林业资源，因地处寒温带，昼夜温差大，土壤、气候都很适宜种植水飞蓟、人参、五味子、黄芪、桔梗、板兰根、防风、甘草、龙胆草、文冠果等多种药材。据相关数据统计，预计2020年北安市种植药材面积将达到2万公顷。本项目种植中药材22000亩基地建设、项目分二期进行，一期做中药饮片、二期做提纯。项目年加工中药切片500吨、中药提纯800吨。项目占地面积5.5万平方米、建筑面积4万平方米。一期主要建设实验室、培训室、种植基地、仓储及粗加工厂、主要建设药材深加工生产线、包装车间、物流基地建设。二期为中药提纯、建设中药提纯生产线并购置生产设备。', '中医药产业', '中医药', '黑龙江北安经济开发区', '2', '2021-08-10 10:04:04', '');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (1002, 'ffb36db6-853a-11ea-b0bb-ac1f6b639ec0', '肇源县1万吨/年食醋加工项目', '大庆', '肇源县', '大庆-肇源县', '制造业', '第二产业', NULL, '独资', '20000万元（3087.0万美元）', '50000', '一般', '5', '4500', '850', '筹划', '无', '', '', '肇源县项目服务中心', '韩立伟', '13836790995', 'zyzsj8224442@163.com', '大庆市商务局', '裴丰东', '13936948486', 'xmk6621216@163.com', '30', '目前，醋的使用已不仅仅局限于传统的烹调中，醋作为营养饮品、保健饮品日益受到越来越多人的喜好，预计今后，饮料醋、保健醋的市场将发生格局性的变化，食醋市场前景广阔。\r\n肇源县寒地黑土，土质肥沃，是黑龙江省第一积温带，全县粮食总产量25亿斤以上，该项目年产食醋1万吨，年需各种粮食原料2万吨左右，只占全县粮食产量的很小一部分，所以就本县粮食产量可满足原料需求。\r\n项目规划占地面积8万平方米，引进4条生产线，1条包装线，项目建成后，年可生产食用香醋、醋酸饮料及保健醋等产品1万吨。', '农业及农副产品精深加工产业', '大豆深加工', '黑龙江肇源经济开发区', '12', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200423161823240.doc');
INSERT INTO `xmk_project` (`id`, `S_XM_ID`, `S_XM_NAME`, `S_XM_AREA`, `S_XM_ORGAN`, `S_XM_ORGAN_NAME`, `S_XM_HYDM`, `S_XM_CY`, `S_XM_ZYBK`, `S_XM_TZFS`, `S_XM_TZJE`, `S_XM_XSSR`, `S_XM_FLAG`, `S_XM_YQHSQ`, `S_XM_LR`, `S_XM_SS`, `S_XM_SCJD`, `S_XM_KYBG`, `S_XM_NZDGN`, `S_XM_NZDGW`, `S_XM_ZRDW_NAME`, `S_XM_ZRDW_LXR`, `S_XM_ZRDW_LXDH`, `S_XM_ZRDW_EMAIL`, `S_XM_TBDW_NAME`, `S_XM_TBDW_LXR`, `S_XM_TBDW_LXDH`, `S_XM_TBDW_EMAIL`, `S_XM_JYRS`, `S_XM_INFO`, `S_XM_ZDCY`, `S_XM_ZDCYL_NAME`, `S_XM_YQ`, `S_XM_LLL`, `S_PUBLISH_TIME`, `S_FILE_URL`) VALUES (1003, 'ffca8e59-77d8-11ea-b0bb-ac1f6b639ec0', '牡丹江市东安区有声书基地项目', '牡丹江', '东安区', '牡丹江-东安区', '信息传输、软件和信息技术服务业', '第三产业', NULL, '独资', '10000万元（1543.5万美元）', '10000', '重点', '5', '2000', '500', '筹划', '有', '', '', '牡丹江市招商专班', '江志刚', '18946377678', 'jhjxmglk@163.com', '牡丹江市经合局', '张智明', '18645358188', 'jhjxmglk@163.com', '300', '项目涵盖有声书制作、有声剧制作、动漫配音、网络游戏配音、影视网络剧制作及配音等。集版权引进、IP孕育及炒作、配音输出为一体的数字化泛娱乐及相关衍生品开发项目。深挖优质内容，推动有声文化及衍生产业的发展；打造全产业链有声版权分享体系，优化从内容生产到编辑加工到用户体验整个内容产销环节，创造最佳用户视听环境；创建泛娱乐生态圈，全面打造影视、听书、游戏等小说下游版权开发。最终目标为把牡丹江打造成“中国有声书之城”。', '旅游产业', '旅游', '牡丹江经济技术开发区', '35', '2020-05-26 11:02:14', 'http://111.40.46.10:8800/zsyz/file/xmfile/20200408163431345.doc');
